INSERT INTO "voyages" VALUES (99, '', 1, '', 'MIDDELBURG', 'Simon Lambrechtsz. Mau.', 600, NULL, NULL, NULL, NULL, NULL, 'A', '1605-05-12', 'Texel', NULL, NULL, true, '1606-05-01', 'Johore', 18, '-08-1606 burnt in action before Malacca.');
INSERT INTO "voyages" VALUES (100, '', 2, '', 'NASSAU', 'Abraham Mathijsz.', 320, NULL, NULL, NULL, NULL, NULL, 'A', '1605-05-12', 'Texel', NULL, NULL, true, '1606-05-01', 'Johore', 22, '-08-1606 burnt in action before Malacca. According to Commelin the master was Wouter Jakobsz.; according to Mac Leod Walter Karelsz. There were also 15 blacks on board.');
INSERT INTO "voyages" VALUES (101, '', 1, '', 'ORANJE', 'Dirk Klaasz. Mol', 700, NULL, NULL, NULL, NULL, NULL, 'A', '1605-05-12', 'Texel', NULL, NULL, true, '1606-05-01', 'Johore', 5078, 'fleet was before Johore where it started operations against the Portuguese. The ERASMUS, the PRO-VINCIEN and probably the EENDRACHT departed not before 30-05 from the Maas. The first 2 ships joined Matelieff on 14-07-1607 off Malacca, the EENDRACHT was sent for Mauritius to collect ebony. In August 1610 this ship was destroyed by fire on the coast of Coromandel. The ship probably never formed part of the fleet of Matelieff. The GROTE ZON and the KLEINE ZON stayed in the Indies and were broken up at Banda.');
INSERT INTO "voyages" VALUES (102, '', 1, '', 'GROTE ZON', 'Klaas Jansz. Melknap', 540, NULL, NULL, NULL, NULL, NULL, 'A', '1605-05-12', 'Texel', NULL, NULL, true, '1606-05-01', 'Johore', 5083, 'Purchased from the Admirality of Amsterdam, 1604.');
INSERT INTO "voyages" VALUES (103, '', 1, '', 'AMSTERDAM', 'Reinier Lambrechtsz.', 700, NULL, NULL, NULL, NULL, 'A', 'Z', '1605-05-24', 'Wielingen', NULL, NULL, true, '1606-05-01', 'Johore', 5072, NULL);
INSERT INTO "voyages" VALUES (104, '', 1, '', 'KLEINE ZON', 'Kornelis Jorisz.', 220, NULL, NULL, NULL, NULL, 'Z', 'Z', '1605-05-24', 'Wielingen', NULL, NULL, true, '1606-05-01', 'Johore', NULL, NULL);
INSERT INTO "voyages" VALUES (105, '', 2, '', 'ERASMUS', 'Olivier Kornelisz.', 540, NULL, NULL, NULL, NULL, NULL, 'R', '1605-05-30', 'Goeree', NULL, NULL, true, '1606-07-14', 'Johore', 5081, NULL);
INSERT INTO "voyages" VALUES (106, '', 1, '', 'GEUNIEERDE PROVINCIEN', 'Anthonis Anthonisz. (Zwarte Teun)', 400, NULL, NULL, NULL, NULL, 'D', 'D', '1605-05-30', 'Goeree', NULL, NULL, true, '1606-07-14', 'Johore', 5076, NULL);
INSERT INTO "voyages" VALUES (107, '', 1, '', 'BANDA', 'Jan Bruin', 600, NULL, NULL, NULL, NULL, NULL, 'A', '1606-04-20', 'Texel', NULL, NULL, true, '1607-10-02', 'Goa', 5088, 'number of those on board was 1060. From 23-05 till 03-06 on the roadstead of the isle of Wight, the 3 ships from Zeeland arrived here 25-05; 29-03 at Mozambique, where they started operations against the Portuguese. When leaving, 26-05, the ZIERIKZEE ran aground and was lost; the mainfleet was therefore unable to sail before June, 29th; from 08-06 till 17-07 at the Comoro I; from 04-08 till 26-08 again at Mozambique and 02-10 at Goa.');
INSERT INTO "voyages" VALUES (108, '', 1, '', 'BANTAM', 'Pieter Kornelisz. van Petten', 700, NULL, NULL, NULL, NULL, NULL, 'A', '1606-04-20', 'Texel', NULL, NULL, true, '1607-10-02', 'Goa', 5079, NULL);
INSERT INTO "voyages" VALUES (109, '', 1, '', 'CEYLON', 'Willem Dirksz.', 340, NULL, NULL, NULL, NULL, 'A', 'A', '1606-04-20', 'Texel', NULL, NULL, true, '1607-10-02', 'Goa', 5080, NULL);
INSERT INTO "voyages" VALUES (110, '', 1, '', 'CHINA', 'Kornelis Maartensz.', 420, NULL, NULL, NULL, NULL, 'H', 'H', '1606-04-20', 'Texel', NULL, NULL, true, '1607-10-02', 'Goa', NULL, 'Riding at anchor off Ternate in 1608, the ship was lost due to bad weather (July 1608).');
INSERT INTO "voyages" VALUES (111, '', 1, '', 'PATANIA', 'Dirk Albertsz. de Vries', 340, NULL, NULL, NULL, NULL, 'E', 'E', '1606-04-20', 'Texel', NULL, NULL, true, '1607-10-02', 'Goa', 5087, NULL);
INSERT INTO "voyages" VALUES (112, '', 1, '', 'TER VEERE', 'Adriaan Looy', 700, NULL, NULL, NULL, NULL, 'Z', 'Z', '1606-05-14', 'Wielingen', NULL, NULL, true, '1607-10-02', 'Goa', 5082, NULL);
INSERT INTO "voyages" VALUES (113, '', 1, '', 'WALCHEREN', 'Arend Maartensz.', 700, NULL, NULL, NULL, NULL, 'Z', 'Z', '1606-05-14', 'Wielingen', NULL, NULL, true, '1607-10-02', 'Goa', NULL, 'Riding at anchor off Ternate in 1608, the ship was lost due to bad weather.');
INSERT INTO "voyages" VALUES (114, '', 2, '', 'ZIERIKZEE', 'Adriaan Kornelisz.', 760, NULL, NULL, NULL, NULL, 'Z', 'Z', '1606-05-14', 'Wielingen', NULL, NULL, true, NULL, NULL, NULL, 'Foundered 1607 Cabacella (Moz.).');
INSERT INTO "voyages" VALUES (115, '', 2, '', 'GELDERLAND', NULL, 500, NULL, NULL, NULL, NULL, NULL, 'A', '1606-12-13', 'Texel', NULL, NULL, true, NULL, NULL, NULL, 'The ship was forced by bad weather to take refuge in the harbour of Vlissingen, July 19th and was lost, making its way out July 20th.');
INSERT INTO "voyages" VALUES (116, '', 2, '', 'GOUDA', 'Jakob Gerritsz.', 260, NULL, NULL, NULL, NULL, 'A', 'A', '1606-12-13', 'Texel', NULL, NULL, true, '1608-01-01', 'Atjeh', 5084, NULL);
INSERT INTO "voyages" VALUES (117, '', 1, '', 'GELDERLAND', 'Jan Jansz. Mol', 700, NULL, NULL, NULL, NULL, NULL, 'A', '1607-04-26', 'Zeeland', NULL, NULL, true, '1607-10-26', 'Malabar', 5085, NULL);
INSERT INTO "voyages" VALUES (118, '', 1, '', 'MIDDELBURG', 'Kornelis Leendertsz. Krakeel', 800, NULL, NULL, NULL, NULL, NULL, 'Z', '1607-12-21', 'Wielingen', NULL, NULL, true, '1608-09-18', 'Goa', 5096, NULL);
INSERT INTO "voyages" VALUES (119, '', 1, '', 'VALK', 'Kornelis Adriaansz. Hooiwagen', 140, 'jacht', NULL, NULL, NULL, 'Z', 'Z', '1607-12-21', 'Wielingen', NULL, NULL, true, '1608-09-18', 'Goa', NULL, 'Captured by the Spaniards off Manila, 25-04-1610.');
INSERT INTO "voyages" VALUES (120, '', 2, '', 'ZEELANDIA', 'Willem Jakobsz. van Arnemuiden', 500, NULL, NULL, NULL, NULL, 'Z', 'Z', '1607-12-21', 'Wielingen', NULL, NULL, true, '1608-09-18', 'Goa', 5086, NULL);
INSERT INTO "voyages" VALUES (121, '', 2, '', 'AMSTERDAM', 'Pieter Gerritsz.', 700, NULL, NULL, NULL, NULL, 'A', 'A', '1607-12-22', 'Texel', NULL, NULL, true, '1608-09-18', 'Goa', NULL, 'Captured by the Spaniards off Manilla, 25-04-1610.');
INSERT INTO "voyages" VALUES (122, '', 1, '', 'AREND', 'Rutger Thomasz.', 140, 'jacht', NULL, NULL, NULL, 'A', 'A', '1607-12-22', 'Texel', NULL, NULL, true, '1608-09-18', 'Goa', NULL, 'Captured and burnt by the Spaniards off Manilla 25-04-1610.');
INSERT INTO "voyages" VALUES (123, '', 1, '', 'DELFT', 'Simon Maartensz. (Zwarte Simon)', 800, NULL, NULL, NULL, NULL, 'D', 'D', '1607-12-22', 'Goeree', NULL, NULL, true, '1608-09-18', 'Goa', 5094, NULL);
INSERT INTO "voyages" VALUES (124, '', 1, '', 'GRIFFIOEN', 'Kornelis Kornelisz. ''t Hert', 140, 'jacht', NULL, NULL, NULL, 'R', 'R', '1607-12-22', 'Goeree', NULL, NULL, true, '1608-09-18', 'Goa', NULL, 'The ship stayed in the Indies.');
INSERT INTO "voyages" VALUES (125, '', 2, '', 'HOLLANDIA', 'Simon Jansz. Hoen', 800, NULL, NULL, NULL, NULL, 'A', 'A', '1607-12-22', 'Texel', NULL, NULL, true, '1608-09-18', 'Goa', 5097, 'illemsz. Verhoeff aboard the GEUNIEERDE PROVINCIEN and vice-adm. Frans Hendriksz. Wittert aboard the MIDDELBURG. The 3 Zeeland ships and the mainfleet met at Maio I. February 1608; from 15-05 till 02-06 at St. Helena; 28-06 somewhere in the regions off the Cape; from 28-06 till 23-08 the fleet started operations against the Portuguese at Mozambique; from 18-09 till 02-10 off Goa.');
INSERT INTO "voyages" VALUES (126, '', 2, '', 'HOORN', 'Maarten Jansz. Kloot', 700, NULL, NULL, NULL, NULL, 'H', 'H', '1607-12-22', 'Texel', NULL, NULL, true, '1608-09-18', 'Goa', 5091, NULL);
INSERT INTO "voyages" VALUES (127, '', 1, '', 'RODE LEEUW MET PIJLEN', 'Jan Walijchsz.', 400, NULL, NULL, NULL, NULL, 'A', 'A', '1607-12-22', 'Texel', NULL, NULL, true, '1608-09-18', 'Goa', 5089, NULL);
INSERT INTO "voyages" VALUES (128, '', 1, '', 'PAUW', 'Meeuwis Gijsbertsz.', 140, 'jacht', NULL, NULL, NULL, 'A', 'A', '1607-12-22', 'Texel', NULL, NULL, true, '1608-09-18', 'Goa', NULL, 'The ship stayed in the Indies.');
INSERT INTO "voyages" VALUES (129, '', 2, '', 'GEUNIEERDE PROVINCIEN', 'Frans Jakobsz. de Vries', 700, NULL, NULL, NULL, NULL, 'A', 'A', '1607-12-22', 'Texel', NULL, NULL, true, '1608-09-19', 'Goa', 5092, 'May 22th 1609 Frans 
INSERT INTO "voyages" VALUES (130, '', 2, '', 'ROTTERDAM', 'Jan Kornelisz. de Wit', 800, NULL, NULL, NULL, NULL, 'R', 'R', '1607-12-22', 'Goeree', NULL, NULL, true, '1608-09-19', 'Goa', 5090, NULL);
INSERT INTO "voyages" VALUES (131, '', 2, '', 'MEDEMBLIK', 'Jacques l''Hermite', 250, 'jacht', NULL, NULL, NULL, NULL, 'A', '1608-01-01', 'Texel', NULL, NULL, true, NULL, 'Bantam', NULL, 'The ship was despatched to bring news of the forthcoming Twelve Years'' Truce; stayed in the Indies and was wrecked near the Maledive Islands.');
INSERT INTO "voyages" VALUES (132, '', 1, '', 'HOOP', 'Pieter Heeresz.', 80, 'jacht', NULL, NULL, NULL, 'A', 'A', '1608-04-15', 'Texel', NULL, NULL, true, '1608-12-26', 'Bantam', NULL, 'Captured by the Spaniards near Manila, 15-07-1610.');
INSERT INTO "voyages" VALUES (133, '', 1, '', 'HALVE MAAN', 'Henry Hudson', 80, 'jacht', NULL, NULL, NULL, 'A', 'A', '1609-04-06', 'Texel', NULL, NULL, true, NULL, NULL, NULL, 'Destined to explore the North-East passage to the Indies; discovered Hudson Bay and returned 07-12 in Dartmouth. Further information see I''Honore Naber.');
INSERT INTO "voyages" VALUES (134, '', 1, '', 'HAZEWIND', 'Wemmer van Berchem', 120, 'jacht', NULL, NULL, NULL, 'E', 'E', '1609-08-01', 'Texel', NULL, NULL, true, '1610-10-01', 'Bantam', NULL, 'left Lissabon 05-02-1610, rounded the Cape 04-05, took on provisions from 25-06 till 06-07 at Madagascar. It stayed in the Indies.');
INSERT INTO "voyages" VALUES (135, '', 1, '', 'WAPEN VAN AMSTERDAM', 'Dirk Pietersz. Kalf', 800, NULL, NULL, NULL, NULL, 'A', 'A', '1610-01-30', 'Texel', '1610-06-28', '1610-08-10', true, '1610-12-19', 'Bantam', 5099, 'scattered the fleet; from 19-09 till 16-10 the WAPEN VAN AMSTERDAM took on provisions at Mauritius.');
INSERT INTO "voyages" VALUES (136, '', 1, '', 'BRAK', 'Jakob IJsbrandsz.', 100, 'jacht', NULL, NULL, NULL, NULL, 'E', '1610-01-30', 'Texel', NULL, NULL, true, NULL, 'Bantam', NULL, 'The BRAK lost sight of the fleet at 23-06; 03-08 at Mauritius. At 07-08-1613 the ship sailed aground near Macassar and was lost.');
INSERT INTO "voyages" VALUES (137, '', 2, '', 'CEYLON', 'Dirk Gerritsz. Smient', 340, NULL, NULL, NULL, NULL, 'A', 'A', '1610-01-30', 'Texel', NULL, NULL, true, '1610-08-08', 'Mauritius', 5093, 'The CEYLON lost sight of the fleet 03-07.');
INSERT INTO "voyages" VALUES (138, '', 2, '', 'TER GOES', 'Kornelis Reiniersz.', 240, NULL, NULL, NULL, NULL, 'Z', 'Z', '1610-01-30', 'Wielingen', NULL, NULL, true, '1610-12-10', 'Bantam', NULL, 'Lost sight of the fleet; from 30-07 till 02-08 at the Bay of Antipara; 02-08 in the St. Lucia Bay, where it took over the remaining cargo of the MAURITIUS (5077); 21-08 departure from Madagascar via the Bay of Antongil; from 27-10 till 08-12 at Mauritius.');
INSERT INTO "voyages" VALUES (139, '', 3, '', 'WITTE LEEUW', 'Klaas Rutgersz. Smit', 540, 'jacht', NULL, NULL, NULL, 'A', 'A', '1610-01-30', 'Texel', NULL, NULL, true, '1610-11-16', 'Bantam', 5100, 'Lost sight of the fleet; from 24-07 till 03-08 in the `Verhagensbaai''; from 29-08 till 27-09 at Mayotte.');
INSERT INTO "voyages" VALUES (140, '', 2, '', 'ZWARTE LEEUW', 'Kornelis Dirksz. Worst', 600, NULL, NULL, NULL, NULL, 'A', 'A', '1610-01-30', 'Texel', NULL, NULL, true, '1610-11-16', 'Bantam', 5102, 'See 0139.');
INSERT INTO "voyages" VALUES (141, '', 2, '', 'ORANJE', 'Kornelis Riemland', 700, NULL, NULL, NULL, NULL, 'A', 'Z', '1610-01-30', 'Wielingen', NULL, NULL, true, '1610-11-16', 'Bantam', 5095, 'See 0139.');
INSERT INTO "voyages" VALUES (142, '', 1, '', 'VLISSINGEN', 'Jan Kornelisz. ''t Hert', 600, NULL, NULL, NULL, NULL, 'Z', 'Z', '1610-01-30', 'Wielingen', NULL, NULL, true, '1610-11-16', 'Bantam', 5101, 'See 0139.');
INSERT INTO "voyages" VALUES (143, '', 3, '', 'GOUDA', 'Albert Hermansz.', 260, NULL, NULL, NULL, NULL, 'A', 'A', '1610-12-28', 'Texel', '1611-06-04', NULL, true, '1611-08-24', 'Bantam', NULL, 'Fleet (0143-0144) under the command of Hendrik Brouwer aboard the RODE LEEUW MET PIJLEN sailed the southern passage for the first time (latitude ca. 36'' south), which was made obligatory in 1616. The GOUDA was captured by the Spaniards near Tidore, 04-05-1612.');
INSERT INTO "voyages" VALUES (144, '', 2, '', 'RODE LEEUW MET PULEN', 'Kornelis Maartensz. ''t Kind', 400, NULL, NULL, NULL, NULL, 'A', 'A', '1610-12-28', 'Texel', '1611-06-04', NULL, true, '1611-08-18', 'Bantam', NULL, 'unseaworthiness, abandoned by its crew and set on fire, August 1615.');
INSERT INTO "voyages" VALUES (145, '', 2, '', 'TER VEERE', 'Willem Jakobsz. van Arnemuiden', 700, NULL, NULL, NULL, NULL, 'Z', 'Z', '1610-12-28', 'Wielingen', NULL, NULL, true, '1611-09-05', 'Bantam', 5103, NULL);
INSERT INTO "voyages" VALUES (146, '', 2, '', 'BANDA', 'Roelof Thijsz.', 800, NULL, NULL, NULL, NULL, NULL, 'A', '1611-03-16', 'Texel', NULL, NULL, true, '1612-02-02', 'Bantam', 5105, 'in St. Lucia Bay; from 15-12 till 23-12 at Mauritius. According to Commelin the master of the BANDA was Roelof Harmensz.');
INSERT INTO "voyages" VALUES (147, '', 2, '', 'BANTAM', 'Kornelis Arendse', 900, NULL, NULL, NULL, NULL, NULL, 'E', '1611-05-02', 'Texel', NULL, NULL, true, '1612-03-02', 'Bantam', 5098, NULL);
INSERT INTO "voyages" VALUES (148, '', 2, '', 'HALVE MAAN', 'Melis Andriesz.', 80, 'jacht', NULL, NULL, NULL, 'A', 'A', '1611-05-02', 'Texel', NULL, NULL, true, '1612-02-02', 'Bantam', NULL, NULL);
INSERT INTO "voyages" VALUES (149, '', 1, '', 'GROTE AEOLUS', 'Bouwe Bouwesz.', 300, NULL, NULL, NULL, NULL, 'A', 'A', '1611-12-29', 'Texel', NULL, NULL, true, '1612-11-28', 'Bantam', NULL, 'Capsized near Makian 31-01-1613; 15 survivors.');
INSERT INTO "voyages" VALUES (150, '', 3, '', 'CEYLON', 'Klaas Jansz.', 340, NULL, NULL, NULL, NULL, 'A', 'A', '1611-12-29', 'Texel', NULL, NULL, true, '1612-11-28', 'Bantam', NULL, NULL);
INSERT INTO "voyages" VALUES (151, '', 1, '', 'DUIFJE', 'Serpent', 50, 'jacht', NULL, NULL, NULL, 'A', 'A', '1611-12-29', 'Texel', NULL, NULL, true, '1612-10-24', 'Bantam', NULL, 'Ran aground near Surat and lost, 17-07-1617.');
INSERT INTO "voyages" VALUES (152, '', 2, '', 'GELDERLAND', 'Simon Lambrechtsz. Mau', 700, NULL, NULL, NULL, NULL, 'A', 'A', '1611-12-29', 'Texel', NULL, NULL, true, '1612-11-28', 'Bantam', 5107, 'command of Adriaan Martensz. Blok aboard the GELDERLAND. The total number of those on board was ca. 2000. From 17-01 till 09-02 at Maio I.; from 21-03 till 31-03 at Cape Lopez; from 19-04 till 01-05 at Annabon; 25-06 somewhere off the Cape; from 06-08 till 23-08 at Reunion; 03-05 the GROENE LEEUW and the STER were sent to Coromandel; 15-07 the DUIFJE was sent ahead of the fleet to Bantam.');
INSERT INTO "voyages" VALUES (153, '', 1, '', 'GROENE LEEUW', 'Klaas Warebouts', 140, 'jacht', NULL, NULL, NULL, 'A', 'A', '1611-12-29', 'Texel', NULL, NULL, true, '1612-09-08', 'Pulicat', 5110, NULL);
INSERT INTO "voyages" VALUES (154, '', 1, '', 'RODE ZEEUW', 'Volkert Thijsz.', 400, NULL, NULL, '1610', NULL, 'A', 'A', '1611-12-29', 'Texel', NULL, NULL, true, '1612-11-28', 'Bantam', NULL, 'Coming from Manila lost near Japan, 31-01-1613.');
INSERT INTO "voyages" VALUES (155, '', 1, '', 'GROTE MAAN', 'Jan Gerritsz.', 500, NULL, NULL, NULL, NULL, 'A', 'A', '1611-12-29', 'Texel', NULL, NULL, true, '1612-11-28', 'Bantam', NULL, 'Lost sight of the mainfleet after a heavy storm 05-07 but joined the fleet again at 22-10; in the meanwhile took on provisions in the Bay of Antongil.');
INSERT INTO "voyages" VALUES (156, '', 2, '', 'PATANIA', 'Sandersz.', 340, NULL, NULL, NULL, NULL, 'E', 'E', '1611-12-29', 'Texel', NULL, NULL, true, '1612-11-28', 'Bantam', NULL, 'Broken up in the Moluccas, June 1615.');
INSERT INTO "voyages" VALUES (157, '', 1, '', 'STER', 'Wouter Klaasz.', 160, NULL, NULL, NULL, NULL, 'A', 'A', '1611-12-29', 'Texel', NULL, NULL, true, '1612-09-08', 'Pulicat', NULL, NULL);
INSERT INTO "voyages" VALUES (158, '', 1, '', 'ZON', 'Pieter Kornelisz.', 500, NULL, NULL, NULL, NULL, 'A', 'A', '1611-12-29', 'Texel', NULL, NULL, true, '1612-11-28', 'Bantam', NULL, 'Broken up,10-1-1621.');
INSERT INTO "voyages" VALUES (159, '', 3, '', 'ORANJE', 'Willem Jansz.', 700, NULL, NULL, NULL, NULL, 'A', 'A', '1612-01-02', 'Wielingen', NULL, NULL, true, '1612-11-28', 'Bantam', NULL, 'Lost in the Indies 02-10-1614.');
INSERT INTO "voyages" VALUES (160, '', 3, '', 'ROTTERDAM', 'Elias Volkertsz.', 800, NULL, NULL, NULL, NULL, 'R', 'R', '1612-01-02', 'Goeree', NULL, NULL, true, '1612-10-19', 'Bantam', 5112, 'Sailed alone.');
INSERT INTO "voyages" VALUES (161, '', 3, '', 'ZEELANDIA', 'Abraham Klaasz.', 500, NULL, NULL, NULL, NULL, 'Z', 'Z', '1612-01-02', 'Wielingen', NULL, NULL, true, '1612-11-23', 'Bantam', NULL, 'Also mentioned as ZEELAND or OUD-ZEELAND.');
INSERT INTO "voyages" VALUES (162, '', 1, '', 'HOOP', 'Usbrand Jakobsz. de Gooier', 500, 'jacht', NULL, NULL, NULL, 'A', 'A', '1612-05-12', 'Texel', NULL, NULL, true, '1613-02-09', 'Bantam', NULL, 'at Brava I., where 13 man died in action. June 9th at the Gold Coast; September 8th somewhere off the Cape. From 04-11 till 24-11 at Mauritius.');
INSERT INTO "voyages" VALUES (163, '', 3, '', 'GEUNIEERDE PROVINCIEN', 'Rutger Antonisz.', 700, NULL, NULL, NULL, NULL, 'A', 'A', '1612-05-12', 'Texel', NULL, NULL, true, '1613-02-09', 'Bantam', 5108, NULL);
INSERT INTO "voyages" VALUES (164, '', 1, '', 'AREND', 'Gerard Albertsz. Lous', 300, NULL, NULL, NULL, NULL, NULL, 'A', '1613-01-31', 'Texel', NULL, NULL, true, '1614-01-04', 'Bantam', NULL, '23th at Brava I.; June 13th somewhere off the Cape; from 20-06 till 08-07 at Fermosa Bay; from 22-08 till 16-09 at Mauritius.');
INSERT INTO "voyages" VALUES (165, '', 1, '', 'HOORN', 'Olf Jansz.', 700, NULL, NULL, NULL, NULL, 'H', 'H', '1613-01-31', 'Texel', NULL, NULL, true, '1614-01-04', 'Bantam', NULL, NULL);
INSERT INTO "voyages" VALUES (166, '', 1, '', 'WITTE VALK', NULL, 360, NULL, NULL, NULL, NULL, NULL, 'A', '1613-01-31', 'Texel', NULL, NULL, true, '1614-01-04', 'Bantam', NULL, 'Stayed in the Indies.');
INSERT INTO "voyages" VALUES (167, '', 1, '', 'NEPTUNUS', 'Barend Pot', NULL, 'jacht', NULL, NULL, NULL, NULL, 'A', '1613-04-01', NULL, NULL, NULL, true, '1614-08-16', 'Bantam', NULL, 'Reprovisioned in St. Lucia Bay. The ship stayed in the Indies and was laid up ca. 1620-1621.');
INSERT INTO "voyages" VALUES (168, '', 1, '', 'KLEINE AEOLUS', 'Pieter Kornelisz.', 240, 'jacht', NULL, NULL, NULL, NULL, 'R', '1613-04-04', 'Maas', NULL, NULL, true, '1614-10-31', 'Bantam', NULL, 'Stayed in the Indies and was, coming from Coromandel, foundered on the rocks of Engano I. 25-08-1616.');
INSERT INTO "voyages" VALUES (169, '', 2, '', 'MIDDELBURG', 'Maarten Reiniersz.', 800, NULL, NULL, NULL, NULL, NULL, 'Z', '1613-04-04', 'Wielingen', NULL, NULL, true, '1614-05-02', 'Bantam', NULL, 'Fleet (0169-0170) under the command of Jasper van Surk aboard the MIDDELBURG. May 4th at Maio I.; August 10th the ZEELANDIA disappeared from sight and the MIDDELBURG reprovisioned in St. Lucia Bay. Later the MIDDELBURG was lost near Surat, 19-07-1617.');
INSERT INTO "voyages" VALUES (170, '', 1, '', 'ZEELANDIA', 'Kornelis Riemland', 800, NULL, NULL, NULL, NULL, 'Z', 'Z', '1613-04-04', 'Wielingen', '1613-08-21', '1613-09-03', true, '1613-12-12', 'Bantam', 5118, NULL);
INSERT INTO "voyages" VALUES (171, '', 2, '', 'DELFT', 'Jan Hillebrandsz.', 800, NULL, NULL, NULL, NULL, 'D', 'D', '1613-06-05', 'Goeree', NULL, NULL, true, '1614-05-05', 'Bantam', 5106, NULL);
INSERT INTO "voyages" VALUES (172, '', 1, '', 'WAPEN VAN AMSTERDAM', 'Jan Kornelisz. May', 1000, NULL, NULL, NULL, NULL, NULL, 'A', '1613-07-02', 'Texel', NULL, NULL, true, '1614-11-04', 'Bantam', 5117, NULL);
INSERT INTO "voyages" VALUES (173, '', 3, '', 'HOLLANDIA', 'Kornelis Hansz.', 800, NULL, NULL, NULL, NULL, 'A', 'A', '1613-07-02', 'Texel', NULL, NULL, true, '1614-11-05', 'Bantam', NULL, 'Gerard Reynst and admiraal Steven van der Hagen aboard the WAPEN VAN AMSTERDAM. From 29-09 till 05-10 at S. Vincente; January 
INSERT INTO "voyages" VALUES (174, '', 1, '', 'MAURITIUS', 'Leendert Jakobsz.', 800, NULL, '1612', NULL, NULL, 'A', 'A', '1613-07-02', 'Texel', NULL, NULL, true, '1614-11-04', 'Bantam', 5113, NULL);
INSERT INTO "voyages" VALUES (175, '', 1, '', 'NASSAU', 'Jan Pietersz.', 300, 'jacht', NULL, NULL, NULL, NULL, 'A', '1613-07-02', 'Texel', NULL, NULL, true, '1614-12-30', 'Bantam', NULL, 'According to Coolhaas the ship arrived at Bantam 16-01-1615. The ship stayed in the Indies and ran aground in the river Andragiri 19-09-1615.');
INSERT INTO "voyages" VALUES (176, '', 1, '', 'HERT', 'Kornelis Kornelisz.', 280, 'jacht', NULL, NULL, NULL, 'R', 'R', '1614-02-14', 'Maas', NULL, NULL, true, '1614-08-07', 'Bantam', 5104, 'Reprovisioned at the Cape and sailed, before arriving at Bantam, by mistake to Bali.');
INSERT INTO "voyages" VALUES (177, '', 2, '', 'VLISSINGEN', 'Joost Engels', 600, NULL, NULL, NULL, NULL, 'Z', 'Z', '1614-04-24', 'Wielingen', NULL, NULL, true, '1615-12-02', 'Bantam', NULL, 'Fleet (0177-0182) under command of Adriaan Woutersz. Stoop (+ 26-11-1615) aboard the VLISSINGEN. The VLISSINGEN had a difficult voyage; 19-12 rounding the Cape the ship sailed north too early; 18-11-1615 (!) it encountered the WALCHE-REN, the ENGEL and the AMSTERDAM.');
INSERT INTO "voyages" VALUES (178, '', 1, '', 'WALCHEREN', 'Hugo Pietersz.', 500, NULL, '1612', NULL, NULL, 'Z', 'Z', '1614-04-24', 'Wielingen', NULL, NULL, true, '1615-12-02', 'Bantam', 5124, '1615 till 01-05-1615 at Mauritius.');
INSERT INTO "voyages" VALUES (179, '', 1, '', 'ORANJEBOOM', 'Pieter Barendsz. van Hoorn', 360, 'jacht', NULL, NULL, NULL, 'H', 'H', '1614-04-26', 'Texel', '1614-11-01', NULL, true, '1615-04-01', 'Mauritius', 5109, 'From April 1615 till May 1615 at Mauritius to collect the cargo of the wrecked GELDERLAND (6007).');
INSERT INTO "voyages" VALUES (180, '', 2, '', 'WAPEN VAN AMSTERDAM', 'IJsbrand Kornelisz.', 800, NULL, NULL, NULL, NULL, 'A', 'A', '1614-05-11', 'Texel', NULL, NULL, true, '1615-12-02', 'Bantam', NULL, 'From 04-08 till 15-08 off Principe L; from 16-08 till 24-08 off Corisco; from 02-03 till 28-03 at St. Lucia Bay; from 15-04 till 01-05 at Mauritius.');
INSERT INTO "voyages" VALUES (181, '', 1, '', 'ENGEL', 'Jakob Kornelisz. Goedheid', 600, NULL, '1613', NULL, NULL, 'D', 'D', '1614-05-15', 'Maas', NULL, NULL, true, '1615-12-02', 'Bantam', NULL, 'Left Madagascar 15-02-1615; from April 1615 till 01-05-1615 at Mauritius.');
INSERT INTO "voyages" VALUES (182, '', 1, '', 'ENKHUIZEN', 'Dirk Albertsz. de Vries', 500, NULL, NULL, NULL, NULL, NULL, 'E', '1614-05-15', 'Texel', NULL, NULL, true, '1615-03-13', 'Bantam', 5123, NULL);
INSERT INTO "voyages" VALUES (183, '', 1, '', 'GROTE AEOLUS', 'Job Kornelisz.', 320, NULL, NULL, NULL, NULL, NULL, 'Z', '1614-08-08', 'Wielingen', NULL, NULL, true, '1616-03-30', 'Ternate', NULL, 'Burst in the battle of Manila, 16-04-1617.');
INSERT INTO "voyages" VALUES (184, '', 1, '', 'JAGER', 'Gerrit Jansz.', 140, 'jacht', NULL, NULL, NULL, 'A', NULL, '1614-08-08', 'Texel', NULL, NULL, true, '1616-03-30', 'Ternate', NULL, 'near the reef of Armigon.');
INSERT INTO "voyages" VALUES (185, '', 1, '', 'GROTE MAAN', 'Reinier Lambrechtsz.', 600, NULL, NULL, NULL, NULL, NULL, 'A', '1614-08-08', 'Texel', NULL, NULL, true, '1616-03-30', 'Ternate', NULL, NULL);
INSERT INTO "voyages" VALUES (186, '', 1, '', 'MEEUWTJE', 'Jan de Wit', 60, 'jacht', '1613', NULL, NULL, 'A', 'A', '1614-08-08', 'Texel', NULL, NULL, true, NULL, NULL, NULL, NULL);
INSERT INTO "voyages" VALUES (187, '', 1, '', 'MORGENSTER', 'Maarten Pietersz. Kruik', 300, NULL, '1613', NULL, NULL, 'R', 'R', '1614-08-08', 'Goeree', NULL, NULL, true, '1616-03-30', 'Ternate', NULL, NULL);
INSERT INTO "voyages" VALUES (188, '', 1, '', 'GROTE ZON', 'Reinier Jansz.', 600, NULL, NULL, NULL, NULL, NULL, 'A', '1614-08-08', 'Texel', NULL, NULL, true, '1616-03-30', 'Ternate', NULL, 'Maria; July 17th, sea battle of Canate against 8 Spanish ships (2 Spanish ships were sunk); from 08-08 till 21-08, capture of Payta; 11-10 till 18-10 at Acapulco; 24-01 till 27-01-1616 at the Ladrones; 28-02 till 10-03 at Manila Bay. The GROTE ZON was lost in the battle of Manila, 16-04-1617.');
INSERT INTO "voyages" VALUES (189, '', 1, '', 'WITTE BEER', 'Pieter Pietersz.', 300, 'jacht', '1614', NULL, NULL, 'A', 'A', '1614-12-17', 'Texel', '1615-04-14', '1615-04-29', true, '1615-12-02', 'Bantam', 5111, 'From 08-01 till 22-01-1615 at Maio Island.');
INSERT INTO "voyages" VALUES (190, '', 1, '', 'ZWARTE BEER', 'Adriaan Jansz. Pater', 320, 'jacht', NULL, NULL, NULL, 'A', 'A', '1614-12-17', 'Texel', '1615-04-14', '1615-04-29', true, '1615-08-17', 'Pulicat', 5115, 'From 08-01 till 22-01-1615 at Maio Island.');
INSERT INTO "voyages" VALUES (191, '', 1, '', 'DOLFIJN', 'David Willemsz. van Vlissingen', 280, 'jacht', NULL, NULL, NULL, 'Z', 'Z', '1615-04-05', 'Wielingen', NULL, NULL, true, '1616-03-01', 'Bantam', 5114, 'in the Bay of Antongil.');
INSERT INTO "voyages" VALUES (192, '', 3, '', 'TER VEERE', 'Willem Jakobsz. van Arnemuiden', 700, NULL, NULL, NULL, NULL, 'Z', 'Z', '1615-04-05', 'Wielingen', NULL, NULL, true, '1616-01-05', 'Bantam', NULL, 'Burnt in the battle of Manila 16-04-1617.');
INSERT INTO "voyages" VALUES (193, '', 1, '', 'BERGERBOOT', 'Floris Heeresz.', 280, 'jacht', NULL, NULL, NULL, NULL, 'A', '1615-05-18', 'Texel', NULL, NULL, true, '1616-04-30', 'Bantam', NULL, 'Reprovisioned at Cabo de Lopez Gonsalvez 20-09-1615; laid up in Batavia, 1621.');
INSERT INTO "voyages" VALUES (194, '', 1, '', 'GALIASSE', 'Theunis Florisz.', 280, NULL, NULL, NULL, NULL, 'H', 'H', '1615-05-18', 'Texel', NULL, NULL, true, '1616-04-30', 'Bantam', NULL, 'Stayed in the Indies.');
INSERT INTO "voyages" VALUES (195, '', 3, '', 'ZWARTE LEEUW', 'Kornelis Klaasz.', 600, NULL, NULL, NULL, NULL, NULL, 'A', '1615-05-18', 'Texel', NULL, NULL, true, '1616-04-30', 'Bantam', NULL, 'Captured by the English near Bantam, 15-12-1618.');
INSERT INTO "voyages" VALUES (196, '', 1, '', 'EENDRACHT', 'Willem Kornelisz. Schouten', 360, NULL, NULL, NULL, NULL, NULL, NULL, '1615-06-14', 'Texel', NULL, NULL, true, '1616-09-17', 'Ternate', NULL, 'was confiscated by the V.O.C.');
INSERT INTO "voyages" VALUES (197, '', 1, '', 'HOORN', 'Jan Kornelisz. Schouten', 110, 'jacht', NULL, NULL, NULL, NULL, NULL, '1615-06-14', 'Texel', NULL, NULL, true, NULL, NULL, NULL, 'Renamed ZUIDER EENDRACHT; capsized off Bantam, May 1620. The HOORN was destroyed by fire in Port Desire, 19-12-1615. Further information see Engelbrecht and Van Herwerden.');
INSERT INTO "voyages" VALUES (198, '', 1, '', 'GOUDEN LEEUW', 'Gheen Huigen Schapenham', 550, NULL, NULL, NULL, NULL, 'R', 'R', '1616-01-21', 'Maas', '1616-09-09', '1616-09-18', true, '1616-11-14', 'Bantam', 5134, 'Maio Island; 28-03 departure from Cabo de Lopez Gonsalvez; from 19-06 till 09-07 at Annabon.');
INSERT INTO "voyages" VALUES (199, '', 1, '', 'WESTFRIESLAND', 'Kornelis Fransz. van der Beets', 800, NULL, '1615', NULL, NULL, 'H', 'H', '1616-01-22', 'Texel', '1616-09-09', '1616-09-18', true, '1616-11-14', 'Bantam', 5119, 'From 21-02 till 04-03 Maio Island; 28-03-1616 departure from Cabo de Lopez Gonsalvez; from 19-06 till 09-07 at Annabon.');
INSERT INTO "voyages" VALUES (200, '', 1, '', 'BANTAM', 'Douwe Anthonisz.', 800, NULL, NULL, NULL, NULL, NULL, 'E', '1616-01-23', 'Texel', NULL, NULL, true, '1616-10-24', 'Bantam', NULL, 'Island; from 27-03 till 11-06 at Cabo de Lopez Gonsalvez; from 18-06 till 29-06 at Annabon. Burnt at Batavia 24-03-1627.');
INSERT INTO "voyages" VALUES (201, '', 1, '', 'EENDRACHT', 'Dirk Hartogs van Amsterdam', 700, NULL, NULL, NULL, NULL, 'A', 'A', '1616-01-23', 'Texel', '1616-08-05', '1616-08-27', true, '1616-12-14', 'Macassar', 5122, 'From 21-02 till 04-03 at Maio Island; from 27-03 till 11-05 at Cape Lopez; landed on the West Coast of Australia (27'' South), October 25th.');
INSERT INTO "voyages" VALUES (202, '', 1, '', 'TROUW', 'Gerrit Douwesz. van Medemblik', 500, NULL, NULL, NULL, NULL, 'A', 'A', '1616-01-23', 'Texel', NULL, NULL, true, '1616-10-19', 'Bantam', NULL, 'Like EENDRACHT at Maio Island and Cape Lopez; from 18-05 till 29-05 at Annabon; August 14th somewhere off the Cape, took Southern passage. The ship stayed in the Indies and was thrown on the beach near Kalongan, 31-12-1624.');
INSERT INTO "voyages" VALUES (203, '', 1, '', 'WAPEN VAN ZEELAND', 'Jakob Pankras van Vlissingen', 700, NULL, NULL, NULL, NULL, 'Z', 'Z', '1616-02-07', 'Wielingen', NULL, NULL, true, '1617-04-09', 'Bantam', 5126, 'Reprovisioned at Annabon; via `Verhagensbaai'' to the Primeira Islands, and back to the `Verhagensbaai.''');
INSERT INTO "voyages" VALUES (204, '', 2, '', 'HERT', 'Jan Kornelisz. Kunst', 280, 'jacht', NULL, NULL, NULL, 'R', 'D', '1616-03-19', 'Goeree', '1616-06-10', '1616-07-03', true, '1616-08-27', 'Bantam', 5116, 'Reprovisioned at the Cape.');
INSERT INTO "voyages" VALUES (205, '', 2, '', 'ORANJEBOOM', 'Pieter Barendsz. van Hoorn', 360, 'jacht', NULL, NULL, NULL, 'H', 'H', '1616-04-23', 'Texel', '1616-10-20', '1616-11-01', true, '1617-04-09', 'Bantam', 5120, 'Mauritius.');
INSERT INTO "voyages" VALUES (206, '', 1, '', 'EENHOORN', NULL, 300, 'jacht', NULL, NULL, NULL, 'A', 'A', '1617-02-26', 'Texel', '1617-07-05', '1617-07-18', true, '1617-10-23', 'Bantam', 5125, NULL);
INSERT INTO "voyages" VALUES (207, '', 1, '', 'GOEDE FORTUIN', 'Albert Kornelisz. Schagen +', 700, NULL, NULL, NULL, NULL, 'A', 'A', '1617-02-26', 'Texel', NULL, NULL, true, '1618-01-07', 'Bantam', 5127, 'Reprovisioned in the St. Lucia Bay.');
INSERT INTO "voyages" VALUES (208, '', 2, '', 'GROENE LEEUW', NULL, 140, 'jacht', NULL, NULL, NULL, 'A', 'A', '1617-02-26', 'Texel', NULL, NULL, true, '1617-10-26', 'Bantam', NULL, 'Stayed in the Indies.');
INSERT INTO "voyages" VALUES (209, '', 1, '', 'POSTPAARD', 'Enkhuizen', 300, 'jacht', NULL, NULL, NULL, 'E', 'E', '1617-02-26', 'Texel', '1617-07-09', NULL, true, '1617-10-07', 'Bantam', 5121, NULL);
