INSERT INTO "voyages" VALUES (211, '', 1, '', 'ZIERIKZEE', 'Laurens Simonsz.', 800, NULL, NULL, NULL, NULL, 'Z', 'Z', '1617-02-26', 'Wielingen', NULL, NULL, true, '1618-01-07', 'Bantam', 5130, 'in the St. Lucia Bay.');
INSERT INTO "voyages" VALUES (212, '', 2, '', 'WITTE BEER', 'Aris Jansz. Landsman', 300, 'jacht', '1614', NULL, NULL, 'A', 'A', '1617-04-22', 'Texel', '1617-08-10', '1617-08-25', true, '1617-10-22', 'Bantam', 5128, NULL);
INSERT INTO "voyages" VALUES (213, '', 1, '', 'TIJGER', 'Dirk Gerritsz. Krul', 140, 'jacht', NULL, NULL, NULL, 'A', 'A', '1617-04-22', 'Texel', '1617-08-10', '1617-08-25', true, '1617-10-22', 'Bantam', NULL, 'Stayed in the Indies and was wrecked on the shore of China, September 1622.');
INSERT INTO "voyages" VALUES (214, '', 2, '', 'ZWARTE BEER', 'Sijmen Joosten', 320, 'jacht', NULL, NULL, NULL, 'A', 'A', '1617-10-31', 'Texel', '1618-03-14', '1618-03-01', true, '1618-06-22', 'Pondicherry', 5135, NULL);
INSERT INTO "voyages" VALUES (215, '', 2, '', 'DOLFIJN', 'Bruin Anthonisz.', 260, 'jacht', NULL, NULL, NULL, 'Z', 'Z', '1617-11-07', 'Wielingen', NULL, NULL, true, '1618-09-20', 'Masulipatna', NULL, 'Stayed in the Indies and, laid up between 1620-1621.');
INSERT INTO "voyages" VALUES (216, '', 1, '', 'TER THOLEN', 'Adriaan de Walle', 400, 'jacht', NULL, NULL, NULL, 'Z', 'Z', '1617-11-07', 'Wielingen', NULL, NULL, true, '1618-04-30', 'Bantam', 5129, 'Amsterdam Isl. sighted by the Dutch for the first time.');
INSERT INTO "voyages" VALUES (217, '', 1, '', 'ZEEWOLF', 'Havik Klaasz. van Hillegom', 360, 'jacht', NULL, NULL, NULL, 'A', 'A', '1617-12-02', 'Texel', '1618-03-08', '1618-03-24', true, '1618-07-01', 'Jacatra', NULL, 'April 19th St. Paul sighted by the Dutch for the first time. May 11th on the west coast of Australia. The ship stayed in the Indies.');
INSERT INTO "voyages" VALUES (218, '', 2, '', 'MAURITIUS', 'Leendert Jakobsz.', 800, NULL, '1612', NULL, NULL, 'A', 'A', '1618-01-04', 'Texel', NULL, NULL, true, '1618-08-22', 'Bantam', 5131, 'July 1618 on the west coast of Australia (Eendrachtsland, 22'' South).');
INSERT INTO "voyages" VALUES (219, '', 3, '', 'DELFT', 'Jan Kornelisz. Kunst', 800, NULL, NULL, NULL, NULL, 'D', 'D', '1618-04-01', 'Goeree', NULL, NULL, true, '1618-10-13', 'Bantam', 5132, NULL);
INSERT INTO "voyages" VALUES (220, '', 1, '', 'WAPEN VAN HAARLEM', 'Willem Jansz. van Amersfoort', 360, 'jacht', NULL, NULL, NULL, NULL, 'A', '1618-05-04', 'Texel', NULL, NULL, true, NULL, 'Bantam', NULL, 'the KLEIN AMSTER-DAM. The ship stayed in the Indies and was laid up between 31-10-1627 and 31-10-1628.');
INSERT INTO "voyages" VALUES (221, '', 3, '', 'HERT', 'Quinten Pietersz. Wiltvank', 280, 'jacht', NULL, NULL, NULL, 'R', 'R', '1618-06-01', 'Goeree', NULL, NULL, true, '1619-01-16', 'Bantam', NULL, 'Stayed in the Indies; wrecked on the African coast 21-06-1622.');
INSERT INTO "voyages" VALUES (222, '', 2, '', 'WESTFRIESLAND', 'Abbe Willemsz.', 800, NULL, '1615', NULL, NULL, 'H', 'Z', '1618-12-05', 'Wielingen', NULL, NULL, true, '1619-09-13', 'Jacatra', 5138, 'it NASSAU.');
INSERT INTO "voyages" VALUES (223, '', 1, '', 'DORDRECHT', 'Reinier Jansz.', 800, NULL, NULL, NULL, NULL, NULL, 'A', '1618-12-28', 'Texel', '1619-05-17', '1619-06-08', true, '1619-09-03', 'Bantam', 5136, 'Fleet (0223-0232) under command of Frederik de Houtman aboard the DORDRECHT and Jakob Dedel. T otal number of those on board: seamen 1725; soldiers 675.');
INSERT INTO "voyages" VALUES (224, '', 2, '', 'EENHOORN', 'Klaas Egbertsz.', 300, 'jacht', NULL, NULL, NULL, 'A', 'A', '1618-12-28', 'Texel', '1619-04-01', '1619-04-30', true, '1619-07-06', 'Bantam', 5133, '19th, the DORDRECHT struck upon the west coast of Australia (32''20'' South).');
INSERT INTO "voyages" VALUES (225, '', 2, '', 'ENKHUIZEN', NULL, 500, NULL, NULL, NULL, NULL, NULL, 'E', '1618-12-28', 'Texel', NULL, NULL, false, NULL, 'Coromandel', NULL, 'From 25-02 till 02-03 at Brava Island. The ship stayed in the Indies.');
INSERT INTO "voyages" VALUES (226, '', 1, '', 'HOORN', 'Willem Usbrand Bontekoe', 700, NULL, NULL, NULL, NULL, 'H', 'H', '1618-12-28', 'Texel', NULL, NULL, false, NULL, NULL, NULL, 'west of Sumatra the ship caught fire and was blown up; on 14-12-1619 the sloop of the HOORN arrived with the survivors at Bantam.');
INSERT INTO "voyages" VALUES (227, '', 1, '', 'GOEDE HOOP', 'Jan van der Venne', 600, 'jacht', NULL, NULL, NULL, 'A', 'A', '1618-12-28', 'Texel', '1619-11-19', '1619-11-26', true, '1620-02-09', 'Jacatra', NULL, 'Forced by heavy weather in the Bay of Biscay the GOEDE HOOP returned to Zeeland and departed again 13-05-1619; from 14-08 till 21-08 at Cape Lopez.');
INSERT INTO "voyages" VALUES (228, '', 2, '', 'POSTPAARD', 'Jan Jansz. Rood', 300, 'jacht', NULL, NULL, NULL, 'E', 'A', '1618-12-28', 'Texel', NULL, NULL, true, '1619-09-19', 'Jacatra', NULL, 'Stayed in the Indies and laid up in 1623.');
INSERT INTO "voyages" VALUES (229, '', 2, '', 'ZEELANDIA', 'Jan van Meldert', 800, NULL, NULL, NULL, NULL, 'Z', 'A', '1618-12-28', 'Wielingen', NULL, NULL, false, '1619-09-16', 'Jacatra', NULL, 'From 07-01 till 26-01 at Plymouth, where 3 man deserted; from 25-02 till 02-03 at Bravo Island; from 03-07 till 17-07 near St. Maria (Madagascar). The ship stayed in the Indies and was wrecked on the Westcoast of Sumatra. Also mentioned as NIEUW ZEELAND.');
INSERT INTO "voyages" VALUES (230, '', 3, '', 'ORANJEBOOM', NULL, 360, 'jacht', NULL, NULL, NULL, 'H', 'R', '1619-01-25', 'Goeree', '1619-04-01', '1619-04-30', true, '1619-08-07', 'Jacatra', 5137, NULL);
INSERT INTO "voyages" VALUES (231, '', 1, '', 'AMSTERDAM', 'Maarten Kornelisz.', 800, NULL, NULL, NULL, NULL, 'A', 'A', '1619-01-27', 'Texel', '1619-05-20', '1619-06-08', true, '1619-09-03', 'Bantam', NULL, 'June 19th on the west coast of Australia (37''20'' South); the ship stayed in the Indies.');
INSERT INTO "voyages" VALUES (232, '', 2, '', 'WAPEN VAN ZEELAND', 'Pieter Barendsz.', 700, NULL, NULL, NULL, NULL, 'Z', 'Z', '1619-01-27', 'Wielingen', NULL, NULL, true, '1619-08-07', 'Bantam', NULL, 'Stayed in the Indies and laid up in Surat 1626/1627.');
INSERT INTO "voyages" VALUES (233, '', 3, '', 'WITTE BEER', 'Klaas Warebouts', 300, 'jacht', '1614', NULL, NULL, 'A', 'A', '1619-05-13', 'Texel', NULL, NULL, true, '1620-01-28', 'Bantam', 5139, 'From 20-08 till 01-09 at Cape Lopez; from 08-02 till 11-02 at Annabon.');
INSERT INTO "voyages" VALUES (234, '', 2, '', 'EENDRACHT', NULL, 700, NULL, NULL, NULL, NULL, 'A', 'A', '1619-05-13', 'Texel', '1619-11-19', '1619-11-26', true, '1620-03-22', 'Jacatra', NULL, 'From 14-08 till 21-08 at Cape Lopez. The ship stayed in the Indies and was wrecked on the west coast of Ambon, 13-05-1622.');
INSERT INTO "voyages" VALUES (235, '', 2, '', 'GOEDE FORTUIN', 'Jan Gijsbertsz. Booneter', 700, NULL, NULL, NULL, NULL, 'A', 'A', '1619-05-13', 'Texel', '1620-01-05', '1620-02-25', true, '1620-07-27', 'Jacatra', NULL, 'From 02-10 till 11-10 at Cape Lopez; February 5th with the GOUDEN LEEUW to the `Dasseneiland'' and St. Helena; from 15-02 till 25-02 at St. Helena. The ship stayed in the Indies and was lost near Sucatara; crew and cargo were saved.');
INSERT INTO "voyages" VALUES (236, '', 2, '', 'TER THOLEN', 'Adriaan de Walle', 400, 'jacht', NULL, NULL, NULL, 'Z', 'Z', '1619-05-16', 'Wielingen', NULL, NULL, true, '1619-11-20', 'Bantam', 5166, NULL);
INSERT INTO "voyages" VALUES (237, '', 2, '', 'WALCHEREN', 'Adriaan Boei', 500, NULL, '1612', NULL, NULL, 'Z', 'Z', '1619-05-16', 'Wielingen', NULL, NULL, true, '1619-12-01', 'Bantam', 5141, 'Forced to return to Zeeland, 11 -06-1619, but sailed again shortly afterwards.');
INSERT INTO "voyages" VALUES (238, '', 1, '', 'VREDE', NULL, 340, 'jacht', NULL, NULL, NULL, 'A', 'A', '1619-09-14', 'Texel', NULL, NULL, true, '1620-06-03', 'Bantam', 5140, NULL);
INSERT INTO "voyages" VALUES (239, '', 1, '', 'WAPEN VAN ENKHUIZEN', 'Jan Jansz.', 700, NULL, '1619', NULL, NULL, 'E', 'E', '1619-12-26', 'Texel', '1620-06-05', '1620-07-05', true, '1620-09-16', 'Jacatra', 5146, NULL);
INSERT INTO "voyages" VALUES (240, '', 1, '', 'HOLLANDIA', 'IJsbrand Kornelisz.', 700, NULL, NULL, NULL, NULL, 'A', 'A', '1619-12-26', 'Texel', '1620-05-06', '1620-07-05', true, '1620-12-08', 'Jacatra', 5147, 'Fleet (0237-0250) under command of Nikolaas van Baecum aboard the HOLLANDIA and vice-admiraal Kornelis Reiniersz. aboard the ZIERIKZEE.');
INSERT INTO "voyages" VALUES (241, '', 1, '', 'LEIDEN', 'Willem Kornelisz. Schouten', 700, NULL, NULL, NULL, NULL, NULL, 'A', '1619-12-26', 'Texel', '1620-06-01', '1620-07-05', true, '1620-12-15', 'Jacatra', 5144, NULL);
