INSERT INTO "voyages" VALUES (752, '', 9, '', 'ZEELANDIA', NULL, 600, NULL, '1631', NULL, NULL, 'Z', 'R', '1652-04-23', 'Goeree', NULL, NULL, false, '1652-10-18', 'Batavia', NULL, 'No ports of call. Decision to sell the ship, 10-04-1657. According to Uitloopboek laid up in 1659.');
