INSERT INTO "voyages" VALUES (754, '', 1, '', 'VLEERMUIS (GULDEN)', NULL, 150, 'galjoot', NULL, NULL, NULL, 'E', 'E', '1652-05-04', 'Texel', NULL, NULL, true, '1652-11-24', 'Batavia', NULL, 'Wrecked on the reefs of the Vuile Eiland in the Pescadores, 26-09-1655.');
INSERT INTO "voyages" VALUES (755, '', 5, '', 'WESTFRIESLAND', 'Pieter Konstant +', 1100, NULL, '1641', NULL, NULL, 'H', 'Z', '1652-05-20', 'Wielingen', NULL, NULL, true, NULL, NULL, NULL, 'From 15-06 till 25-06 at S. Vincente; from 09-11 till 15-11 in Sierra Leone with 82 deaths and 15 healthy men. December 29th. back in Sierra Leone; near Pernambuco an attempt to mutiny by the first mate Jakob Arentsz., 15-08. Hendrik Jansz. replaced Pieter Konstant (+). Returned to Wielingen 17-07-1654.');
INSERT INTO "voyages" VALUES (756, '', 1, '', 'ZWARTE VOS', 'Theunis Eissen', 60, 'galjoot', NULL, NULL, NULL, 'A', 'A', '1652-09-04', 'Texel', '1653-01-18', '1653-06-09', true, NULL, 'Gamron', NULL, 'under of Gerrit Abelsen went first to Gamron, then to Surat. Departure from Surat 11-11-1653. The ship was wrecked on the river of Cambodia (1-1-1657).');
INSERT INTO "voyages" VALUES (757, '', 1, '', 'RODE VOS', 'Joris Meindertsz + Elbert Kornelisz. Kes', 60, 'galjoot', NULL, NULL, NULL, 'H', 'H', '1652-09-19', 'Texel', NULL, NULL, true, '1653-06-02', 'The Cape', NULL, 'From 26-10 till 01-11-1652 at S. Tiago. The ship was tossed about for 3 1/2 month off the Cape. The ship stayed at the Cape for some time. Was sold 08-09-1664 at Batavia.');
INSERT INTO "voyages" VALUES (758, '', 1, '', 'HAAS', 'Joris Jansz. Zomer', 200, 'jacht', NULL, NULL, NULL, 'A', 'A', '1652-09-28', 'Texel', '1653-03-26', '1653-04-17', true, '1653-06-20', 'Batavia', NULL, 'Via Sierra Leone (01-01-1653). On 22-04-1661 wrecked on the reefs of the island Roti near Timor.');
INSERT INTO "voyages" VALUES (759, '', 3, '', 'DIAMANT', NULL, 1100, NULL, '1648', NULL, NULL, 'A', 'A', '1652-11-01', 'Texel', NULL, NULL, true, NULL, NULL, NULL, 'After departure from Texel the ship went to Goeree. Departure from there 09-12-1652. The ship was wrecked on the island Schouwen, crew and cargo were saved and the ship was left 21-12.');
INSERT INTO "voyages" VALUES (760, '', 3, '', 'LASTDRAGER', NULL, 640, 'fluit', NULL, '1648', NULL, 'A', 'A', '1652-11-01', NULL, NULL, NULL, true, NULL, NULL, NULL, 'After departure from Texel to Goeree. From there 09-12 back to Texel because of a lost rudder. Departure from Texel 09-02-1653. The ship was wrecked near the Shetland Islands on 02-03 (reefs of Bluemull Sound; 26 survivors; wreck recently discovered).');
INSERT INTO "voyages" VALUES (761, '', 1, '', 'WINDHOND', '(WITTE)', 360, 'jacht', NULL, NULL, NULL, 'A', 'A', '1652-11-01', 'Texel', '1653-04-14', '1653-04-17', true, '1653-06-14', 'Batavia', NULL, 'First call at Goeree till 01-12-1653 and from 08-12-1652 till 15-12-1652 again at Goeree because of adverse winds. Ship was wrecked near Batavia 30-05-1658 (Boompjes Islands).');
INSERT INTO "voyages" VALUES (762, '', 1, '', 'MUIDEN', 'Evert Theunisz. Harnay', 400, 'jacht', NULL, NULL, NULL, 'A', 'A', '1652-12-26', 'Texel', '1653-04-18', '1653-04-26', true, '1653-07-01', 'Batavia', 5418, NULL);
