INSERT INTO "voyages" VALUES (854, '', 1, '', 'ZEERIDDER', 'Jan Leendertsz. Roskam', 160, 'fluit? jacht?', NULL, NULL, NULL, 'Z', 'Z', '1656-05-15', 'Wielingen', '1656-09-14', '1656-10-01', true, '1656-12-06', 'Batavia', NULL, 'On 13-08-1669 laid up and sold at Batavia.');
INSERT INTO "voyages" VALUES (855, '', 5, '', 'PRINSES ROYAAL', 'Reinoud Engelbrechtsz.', 1100, NULL, NULL, NULL, NULL, 'A', 'A', '1656-05-31', 'Vlie', '1656-09-21', '1656-10-07', true, '1656-12-07', 'Batavia', 5458, 'Via S. Vincente and Sto. Antao. Three men were drowned at the Cape.');
