INSERT INTO "voyages" VALUES (858, '', 8, '', 'BREDA', 'Albert Jansz. Konijn', 1050, NULL, '1637', NULL, NULL, 'H', 'H', '1656-06-01', 'Vlie', '1656-10-17', '1656-11-01', true, '1657-01-20', 'Batavia', NULL, 'According to Daghregister 1656/7 it departed on 01-07-1656.');
INSERT INTO "voyages" VALUES (859, '', 1, '', 'MOLEN', 'Jakob Stevensz. Molenwerf', NULL, 'fluit', NULL, NULL, NULL, 'H', 'H', '1656-06-01', 'Vlie', '1656-11-09', '1656-11-21', true, '1657-02-11', 'Batavia', NULL, 'Via St. Helena. In March 1658 wrecked on a reef at Ceylon, crew and cargo were mainly saved.');
