INSERT INTO "voyages" VALUES (861, '', 1, '', 'HILVERSUM', 'Jakob Jansz.', 202, 'fluit', '1656', NULL, NULL, 'A', 'A', '1656-10-19', 'Texel', '1657-02-05', '1657-02-12', true, '1657-05-11', 'Batavia', 5480, NULL);
INSERT INTO "voyages" VALUES (862, '', 7, '', 'MALAKKA', NULL, 1100, NULL, NULL, NULL, NULL, 'A', 'A', '1656-11-22', 'Vlie', '1657-03-18', '1657-03-28', true, '1657-05-23', 'Batavia', 5454, 'The 27 soldiers who came on board at the Cape were from the ORANJE. Via S. Vincente, 23 till 28-12.');
INSERT INTO "voyages" VALUES (863, '', 7, '', 'ORANJE', NULL, 700, NULL, '1643', NULL, NULL, 'Z', NULL, '1656-11-22', NULL, '1657-03-17', '1657-04-19', true, '1657-07-01', 'Batavia', 5455, 'At the Cape 27 soldiers went from the ORANJE to the MAL-ACCA.');
INSERT INTO "voyages" VALUES (864, '', 2, '', 'GEKROONDE LEEUW', NULL, 1200, NULL, NULL, NULL, NULL, 'E', 'A', '1656-12-24', 'Vlie', '1657-05-05', '1657-05-29', true, '1657-08-10', 'Batavia', 5453, NULL);
INSERT INTO "voyages" VALUES (865, '', 1, '', 'OOIEVAAR', 'Jakob Doorn', 627, 'fluit', '1656', NULL, NULL, 'Z', 'Z', '1656-12-24', 'Wielingen', '1657-05-02', '1657-05-22', true, '1657-08-07', 'Batavia', 5499, '225, the ship departed with 227 men.');
INSERT INTO "voyages" VALUES (866, '', 1, '', 'VENENBURG', 'Hendrik Juriaansz.', 703, 'fluit', '1656', NULL, NULL, 'A', 'A', '1656-12-24', 'Vlie', '1657-04-22', '1657-05-02', true, '1657-06-29', 'Batavia', 5490, NULL);
INSERT INTO "voyages" VALUES (867, '', 1, '', 'VINK', 'Jan Bartelsz. +', 202, 'fluit', '1656', NULL, NULL, 'Z', 'Z', '1656-12-24', 'Wielingen', '1657-04-19', '1657-04-27', true, '1657-07-08', 'Batavia', NULL, 'Via the west coast of Australia (Suytlandt) for an inquiry concerning the VERGULDE DRAAK. In 1668/69 sold to a Portuguese citizen of Batavia. Master became Joost Jansz. van Serooskerke.');
INSERT INTO "voyages" VALUES (868, '', 3, '', 'PHOENIX', 'Kornelis Stamper', 900, NULL, NULL, NULL, NULL, 'A', 'D', '1656-12-25', 'Goeree', '1657-04-04', '1657-04-13', true, '1657-06-12', 'Batavia', 5464, NULL);
INSERT INTO "voyages" VALUES (869, '', 7, '', 'HOF VAN ZEELAND', 'Dirk Jansz. Knibbel', 1200, NULL, '1642', NULL, NULL, 'Z', 'Z', '1657-01-22', 'Wielingen', NULL, NULL, false, '1657-10-17', 'Batavia', 5460, 'back at the Wielingen. Missed the Cape because of a storm. Via Mauritius, departure: 20-08-1657.');
INSERT INTO "voyages" VALUES (870, '', 1, '', 'HASSELT', 'Jakob Hendriksz. Moker', 365, 'pinas', '1656', NULL, NULL, 'A', 'A', '1657-04-10', 'Vlie', '1657-08-16', NULL, true, NULL, NULL, NULL, 'Remained for service at the Cape, and probably sailed to Batavia later on. Sailing to Arakan in 1665/66 it was wrecked.');
INSERT INTO "voyages" VALUES (871, '', 1, '', 'MARIA', 'Klaas Fransz. Bording', 120, 'jacht', NULL, NULL, NULL, 'A', 'A', '1657-04-10', 'Vlie', '1657-07-13', '1658-07-18', true, NULL, NULL, NULL, 'departed from the Cape to Batavia with 35 men. It was laid up and sold at Batavia, 13-08-1669.');
INSERT INTO "voyages" VALUES (872, '', 8, '', 'WITTE OLIFANT', NULL, 1000, NULL, '1639', NULL, NULL, 'A', 'A', '1657-04-12', 'Vlie', NULL, NULL, false, '1658-01-19', 'Batavia', 5463, 'Via England, where 23 men deserted.');
INSERT INTO "voyages" VALUES (873, '', 8, '', 'VERENIGDE PROVINCIEN', 'Cape: Pieter van Dalen', 1100, NULL, '1643', NULL, NULL, 'Z', 'Z', '1657-04-13', 'Wielingen', '1657-08-07', '1657-08-27', true, '1657-10-25', 'Batavia', 5465, 'The men who embarked at the Cape came from the HASSELT and the MARIA. The master, Andries van Nesse, was dismissed because of adultery with the wife of the onderkoopman. According to Van Riebeek, 11, 153, the ship departed from the Wielingen with 263 men.');
INSERT INTO "voyages" VALUES (874, '', 8, '', 'ROTTERDAM', 'Jochem Klaasz.?', 1100, NULL, NULL, NULL, NULL, 'R', 'R', '1657-04-19', 'Goeree', '1657-08-25', '1657-09-30', true, '1657-12-13', 'Batavia', NULL, 'Laid up in 1661. At the Cape 31 seafarers and 45 soldiers were taken over by the ENKHUIZEN.');
INSERT INTO "voyages" VALUES (875, '', 9, '', 'ENKHUIZEN', 'Jan Kornelis Zwart', 700, NULL, NULL, NULL, NULL, NULL, 'E', '1657-04-30', 'Vlie', '1657-08-25', '1657-09-10', true, '1657-11-23', 'Batavia', 5457, 'See the ROTTERDAM (0874).');
INSERT INTO "voyages" VALUES (876, '', 8, '', 'WALVIS', 'Barend Barendsz. Lam van Bunschoten', 1000, NULL, '1639', NULL, NULL, 'A', 'D', '1657-06-27', 'Goeree', '1657-11-02', '1657-11-11', true, '1658-02-01', 'Batavia', 5467, NULL);
INSERT INTO "voyages" VALUES (877, '', 1, '', 'MEES', 'Maarten Bastink', 202, 'fluit', '1657', NULL, NULL, 'Z', 'Z', '1657-10-12', 'Wielingen', '1658-04-14', '1658-04-23', true, '1658-07-05', 'Batavia', NULL, 'one man deserted there. Until the Cape the voyage was severely delayed by calm and adverse winds. The ship was sold in 1673.');
INSERT INTO "voyages" VALUES (878, '', 1, '', 'SPREEUW', NULL, 374, 'fluit', '1657', NULL, NULL, 'Z', 'Z', '1657-10-12', 'Wielingen', '1658-03-27', '1658-04-08', true, NULL, NULL, 5500, 'there by the English. The seven `passengers'' who embarked at the Cape were slaves.');
INSERT INTO "voyages" VALUES (879, '', 2, '', 'VAN AMSTERDAM', 'Andries Wolf +', 920, NULL, '1653', NULL, NULL, 'A', 'A', '1657-10-13', 'Vlie', '1658-03-26', '1658-04-09', true, '1658-07-04', 'Batavia', 5462, 'succeeded him as master. The 16 `passengers'' who embarked at the Cape were slaves, 12 of them arrived at Batavia.');
INSERT INTO "voyages" VALUES (880, '', 2, '', 'WAPEN VAN HOLLAND', NULL, 920, NULL, '1653', NULL, NULL, 'A', 'A', '1657-10-13', 'Vlie', '1658-03-04', '1658-03-19', true, '1658-06-22', 'Batavia', 5473, NULL);
