INSERT INTO "voyages" VALUES (948, '', 1, '', 'JONGE PRINS', 'Kornelis Veldmuis +', 840, 'jacht', '1661', NULL, NULL, 'H', 'H', '1661-04-13', 'Texel', '1661-08-16', '1661-08-30', true, '1661-11-07', 'Batavia', 5506, 'At the Cape 23 soldiers went to the W ASSENDE MAAN, 4 soldiers and a carpenter to the RIJZENDE ZON, 48 soldiers and a carpenter to the HUTS TE ZWIETEN.');
INSERT INTO "voyages" VALUES (949, '', 1, '', 'NACHTEGAAL', 'Fijaart Meindertsz. Bakker', 80, 'galjoot', '1660', NULL, NULL, 'A', 'A', '1661-04-23', 'Vlie', '1662-01-17', '1662-01-31', true, '1662-06-02', 'Pulicat', NULL, 'On 15-06-1661 for the second time from the Vlie. Via Cape Verde (12 till 22-08) and Saldanha Bay (06-12-1661 till 10-01-1662). Wrecked off Ceram, 09-02-1665.');
INSERT INTO "voyages" VALUES (950, '', 5, '', 'PAREL', 'Robert Ram', 1100, NULL, '1651', NULL, NULL, 'A', 'A', '1661-04-23', 'Vlie', '1661-09-02', '1661-09-17', true, '1661-11-24', 'Batavia', 5505, 'During the voyage one child was born.');
