INSERT INTO "voyages" VALUES (961, '', 1, '', 'VELDHOEN', NULL, 180, 'fluit? galjoot?', '1661', NULL, NULL, 'A', 'A', '1662-01-09', 'Texel', '1662-08-01', '1662-09-26', true, NULL, NULL, NULL, 'Via the Wielingen. The ship stayed for some time for service at the Cape (Mozambique, St. Helena); see KENNEMERLAND (0968). Laid up and sold at Batavia in 1669.');
INSERT INTO "voyages" VALUES (962, '', 2, '', 'VENENBURG', NULL, 703, 'fluit', '1656', NULL, NULL, 'A', 'A', '1662-01-09', 'Texel', '1662-04-22', '1662-05-05', true, '1662-07-07', 'Batavia', 5537, 'Via the Wielingen, departure on 21-03-1662.');
