INSERT INTO "voyages" VALUES (967, '', 1, '', 'VLAARDINGEN', 'Bartholomeus Verwey van Rotterdam', 400, 'jacht? pinas?', '1661?', NULL, NULL, 'D', 'D', '1662-04-14', 'Goeree', '1662-08-28', '1662-09-26', true, '1663-03-30', 'Batavia', 5570, 'departure on 23-05-1662. See KENNE-MERLAND (0968).');
INSERT INTO "voyages" VALUES (968, '', 1, '', 'KENNERMERLAND', NULL, 950, NULL, NULL, '1661/2', NULL, 'A', 'A', '1662-04-17', 'Texel', '1662-09-03', '1662-09-26', true, '1663-03-30', 'Batavia', 5514, 'KENNEMERLAND, WAPEN VAN ZEELAND (0973), VLAARDINGEN (0967), RIJNLAND (0969), KOGGE (0971), VELDHOEN (0961), and ZEERIDDER (0854), and on 16-10-1662 the ORANJE (0972) departed from the Cape under command of Huibert de Laresse to attack Mozambique and to look for the missing ships of the return fleet under command of Arnold de Vlaming. The mission failed; the fleet sailed on for Batavia.');
INSERT INTO "voyages" VALUES (969, '', 1, '', 'RIJNLAND', NULL, 795, NULL, '1662', NULL, NULL, 'A', 'A', '1662-04-17', 'Texel', '1662-09-02', '1662-09-26', true, '1663-03-30', 'Batavia', 5518, 'See KENNEMERLAND (0968).');
INSERT INTO "voyages" VALUES (970, '', 1, '', 'WATERHOEN', 'Pieter Willemsz.', 193, 'galjoot? fluit?', '1661', NULL, NULL, 'A', 'A', '1662-04-17', 'Texel', '1662-10-22', '1664-12-11', true, '1665-02-14', 'Batavia', NULL, 'attack on Mozambique, but fell behind and left the fleet on 29-06-1662 at 5''N. Stayed at the Cape. Wrecked at Amboina in 1672.');
INSERT INTO "voyages" VALUES (971, '', 1, '', 'KOGGE', NULL, 400, 'jacht', NULL, '1662', NULL, 'H', 'H', '1662-04-23', 'Texel', '1662-08-29', '1662-09-26', true, '1663-03-30', 'Batavia', 5534, 'The ship lost its bowsprit, foremast and several topmasts. See also KENNEMERLAND (0968).');
INSERT INTO "voyages" VALUES (972, '', 9, '', 'ORANJE', 'Pieter Kaub', 700, NULL, '1643', NULL, NULL, 'Z', 'Z', '1662-04-23', 'Wielingen', '1662-10-03', '1662-10-16', true, '1663-03-30', 'Batavia', 5517, 'See also KENNEMERLAND (0968).');
INSERT INTO "voyages" VALUES (973, '', 1, '', 'WAPEN VAN ZEELAND', NULL, NULL, NULL, NULL, '1661', NULL, 'Z', 'Z', '1662-04-23', 'Wielingen', '1662-09-07', '1662-09-26', true, '1663-03-30', 'Batavia', NULL, 'KENNEMERLAND (0968). On board: Vice-admiraal Willem Volgers. The ship was wrecked on a voyage to China on 16-09-1663.');
