INSERT INTO "voyages" VALUES (980, '', 1, '', 'RAMMEKENS', NULL, 438, 'jacht', '1662', NULL, NULL, 'Z', 'Z', '1662-11-28', 'Wielingen', '1663-03-29', '1663-04-10', true, '1663-06-18', 'Batavia', NULL, 'On the return voyage the ship carried French prisoners-of-war. Departure from Ceylon on 24-09-1674; arrival in Holland on 21-04-1676, when it was restored to the Company, see 1327.');
