INSERT INTO "voyages" VALUES (1027, '', 2, '', 'KENNERMERLAND', NULL, 950, NULL, NULL, '1661', NULL, NULL, 'A', '1664-12-14', 'Texel', NULL, NULL, true, NULL, NULL, NULL, 'Wrecked on Stour a Stack in the Outer Skerries, Shetland 1. on 20-12-1664. All hands lost, also the cargo of fl.120,000.');
INSERT INTO "voyages" VALUES (1028, '', 3, '', 'ACHILLES', NULL, 550, 'jacht', '1655', NULL, NULL, 'A', 'A', '1664-12-20', 'Wielingen', '1665-12-22', '1666-01-04', true, '1666-05-04', 'Batavia', NULL, 'New departure from the Wielingen: 24-03-1665. Via Annabon and Cape Lopez, where 7 seafarers and 9 soldiers deserted. Wrecked on a voyage to Japan in 1669.');
INSERT INTO "voyages" VALUES (1029, '', 1, '', 'MIDDELBURG', 'Pieter Pietersz.', 846, NULL, '1664', NULL, NULL, 'Z', 'Z', '1664-12-21', 'Wielingen', '1665-08-18', '1665-09-01', true, '1665-11-09', 'Batavia', 5552, 'Via the Wielingen: 08-01 till 24-03-1665, S. Vincente: 19 till 20-05-1665, Bravo 1.: 22-05-1665 and Ascension: 14-07-1665. On board: commandeur Usbrand Godske.');
INSERT INTO "voyages" VALUES (1030, '', 1, '', 'GEKROONDE HARING', NULL, 80, 'hoeker', NULL, NULL, '1664', 'Z', 'Z', '1665-02-12', 'Wielingen', '1665-07-01', '1665-09-13', true, '1666-12-18', 'Batavia', NULL, 'service at the Cape. Destination Ceylon; because of adverse winds the ship sailed to Batavia.');
