INSERT INTO "voyages" VALUES (1067, '', 3, '', 'VENENBURG', NULL, 703, 'fluit', '1656', NULL, NULL, 'A', 'A', '1667-05-20', 'Texel', NULL, NULL, true, NULL, NULL, NULL, 'Taken by the English near Ireland in June 1667.');
INSERT INTO "voyages" VALUES (1068, '', 2, '', 'MEERMAN', 'Laurens Maartensz. Luiken', 440, 'jacht', '1663', NULL, NULL, 'D', 'D', '1667-05-23', 'Maas', '1667-11-28', '1667-12-05', true, '1668-02-11', 'Batavia', NULL, 'Via Texel, departure on 06-06-1667. Via Sierra Leone, 24-08 till 02-09-1667. At the Cape one seaman and five soldiers came on board as prisoners (counted as passengers). They were probably released at Batavia. The ship was sold in 1673.');
INSERT INTO "voyages" VALUES (1069, '', 2, '', 'BUIENSKERKE', 'Adriaan Schenkels+', 510, 'fluit', '1659', NULL, NULL, 'Z', 'Z', '1667-06-21', 'Wielingen', '1667-11-28', '1667-12-10', true, '1668-02-12', 'Batavia', NULL, 'some soldiers. Four soldiers were thrown overboard, one seaman and five soldiers went to the MEERMAN (1068). One child was born. The ship was wrecked near the isle of Galle (Bengal) on 08-08-1671.');
INSERT INTO "voyages" VALUES (1070, '', 1, '', 'DAMIATE', 'Kornelis Muts', 750, 'jacht', '1667', NULL, NULL, 'A', 'A', '1667-10-02', 'Texel', '1668-02-11', '1668-04-10', true, '1668-06-13', 'Batavia', 5600, 'Via Torbay, where 5 seafarers deserted.');
