INSERT INTO "voyages" VALUES (1225, '', 2, '', 'SAKSENBURG', 'Willem Albertsz. Graaf', 450, 'fluit', '1669', NULL, NULL, 'A', 'A', '1672-04-16', 'Texel', '1672-07-30', '1672-10-29', true, '1673-01-09', 'Batavia', NULL, 'The ship brought the news of the war with England and France to the Cape and also the Heren XVII''s order to do as much damage to the French and English as possible; the LUSTER (1191) went to Batavia with the same message.');
INSERT INTO "voyages" VALUES (1226, '', 4, '', 'ZUIDPOLSBROEK', 'Jakob Albertsz. Been', 960, NULL, '1664', NULL, NULL, 'A', 'A', '1672-04-30', 'Texel', '1672-10-07', '1673-05-19', true, '1673-08-14', 'Batavia', NULL, '12-01-1673. They left a garrison (+-100 men) and departed on 11-03-1673. The ZUIDPOLSBROEK arrived at the Cape with one soldier, taken prisoner at St. Helena. The ship was laid up at Batavia. The seafarers figures for III and IV refer to the Cape and St. Helena.');
INSERT INTO "voyages" VALUES (1227, '', 3, '', 'KATTENBURG', 'Jan Bartelsz. Tand', 637, 'fluit', '1663', NULL, NULL, 'A', 'Z', '1672-05-23', 'Veere', '1672-10-23', '1672-12-10', true, '1673-06-19', 'Batavia', NULL, 'See 1226. After departure from St. Helena no call at the Cape. The ship was laid up and sold at Batavia. on 16-07-1677. The seafarers figures for III and IV refer to the Cape and St. Helena.');
