INSERT INTO "voyages" VALUES (1234, '', 1, '', 'RHENEN', NULL, 580, 'pinas', '1672', NULL, NULL, 'A', 'A', '1672-10-21', 'Texel', '1673-03-28', '1673-04-13', true, '1673-06-24', 'Ceylon', NULL, 'The ship was wrecked off S. Tome in 1674.');
INSERT INTO "voyages" VALUES (1235, '', 2, '', 'ZOETENDAAL', 'Simon Kerseboom+', 448, 'fluit', '1669', NULL, NULL, 'Z', 'E', '1672-10-21', 'Texel', '1673-03-28', '1673-04-14', true, '1673-06-27', 'Batavia', NULL, 'by Willem van der Hop. The ship left the Cape on 21-04-1673, acc. to Daghregister 1673. It was wrecked 50 miles east of the Cape on 23-08-1673.');
INSERT INTO "voyages" VALUES (1236, '', 1, '', 'AZIE', 'Jan Sijbrandsz. Doen', 1140, NULL, '1671', NULL, NULL, 'A', 'A', '1672-12-18', 'Texel', '1673-04-15', '1673-05-19', true, '1673-08-14', 'Batavia', 5671, 'On 29-12-1672 there was a fight with an English frigate (I dead and 8 wounded), but the ship escaped on the third day. During this voyage the master and nearly all the officers died. Acc. to Daghregister 1673 the ship left the Cape on 26-05-1673.');
INSERT INTO "voyages" VALUES (1237, '', 1, '', 'BERGEEND', NULL, 90, 'hoeker', '1672', NULL, NULL, 'H', 'H', '1672-12-18', 'Texel', '1673-10-02', '1673-10-14', true, '1673-01-01', 'Ceylon', NULL, 'English, retaken by a Zeeland privateer, and restored in Zeeland. It finally left the Wielingen on 26-05-1673. Laid up at Ceylon in 1690.');
