INSERT INTO "voyages" VALUES (3085, '', 3, '', 'KERKWIJK', 'Marten Burgers', 850, NULL, '1733', NULL, NULL, 'A', 'A', '1737-10-17', 'Texel', '1738-02-04', '1738-02-18', true, '1738-06-18', 'Batavia', 7091, 'During the voyage one of the soldiers became a seafarer, another soldier became cook. The two `passengers'' were slaves.');
