INSERT INTO "voyages" VALUES (3087, '', 1, '', 'KASTEEL VAN TILBURG', 'Pieter Kronenburg', 850, NULL, '1737', NULL, NULL, 'A', 'A', '1737-10-17', 'Texel', '1738-02-04', '1738-02-27', true, '1738-06-06', 'Batavia', 7088, 'At least two, and probably even three soldiers became seafarers. The ship took over one seafarer from the BERKENRODE (see 3083), the BERKENRODE took over one seafarer from the KASTEEL VAN TILBURG. One of the passengers was a slave.');
INSERT INTO "voyages" VALUES (3088, '', 2, '', 'LANGEWIJK', 'Adriaan Katersveld+', 850, NULL, '1734', NULL, NULL, 'A', 'A', '1737-10-24', 'Texel', '1738-04-11', '1738-05-18', true, '1738-08-05', 'Batavia', 7102, 'died during the voyage, Wijnand van Nullerus succeeded him as master. During the voyage one of the soldiers became seafarer.');
