INSERT INTO "voyages" VALUES (3103, '', 2, '', 'HILVERBEEK', 'Jakob Verleng', 850, NULL, '1735', NULL, NULL, 'A', 'A', '1738-02-15', 'Texel', '1738-06-20', '1738-07-03', true, '1738-09-23', 'Batavia', 7115, 'The initial date of departure of the HILVERSBEEK was 01-01-1738, but 25 days later it returned to Texel, From 20 till 30-03-1738 the ship was at S, Tiago. During the voyage two soldiers became seafarers,');
