INSERT INTO "voyages" VALUES (3110, '', 3, '', 'NIEUWSTAD', 'Lukas Rozeboom', 650, NULL, '1733', NULL, NULL, 'H', 'H', '1738-04-20', 'Texel', '1738-10-01', '1738-10-27', true, '1739-02-13', 'Batavia', 7192, 'took place in 1737. During the last stay of the ship at Texel, 30-01 till 20-04, the crew was enlarged with 11 seafarers. From 03 till 14-06 the ship was at S. Tiago: 1 seafarer was taken over by the PROOSTWIJK (3107), one of the soldiers became a seafarer,');
