INSERT INTO "voyages" VALUES (3147, '', 2, '', 'SINT LAURENS', 'Hendrik Bossen', 850, NULL, '1734', NULL, NULL, 'Z', 'Z', '1739-04-02', 'Rammekens', '1739-07-28', '1739-08-15', true, '1739-11-01', 'Batavia', 7087, 'seafarer.');
INSERT INTO "voyages" VALUES (3148, '', 7, '', 'PATMOS', 'Jan de Jonge', 810, NULL, '1722', NULL, NULL, 'R', 'Z', '1739-04-02', 'Rammekens', '1739-07-28', '1739-08-26', true, '1739-11-07', 'Batavia', 7099, NULL);
INSERT INTO "voyages" VALUES (3149, '', 4, '', 'ZORGWIJK', 'Gozewijn de Vos', 650, NULL, '1732', NULL, NULL, 'A', 'R', '1739-04-06', 'Goeree', '1739-07-22', '1739-08-04', true, '1739-10-13', 'Batavia', 3149, 'the fourth voyage of the ZORGWIJK, which during its first voyage (see 2896/-) was called VOORDUIN. The ship was laid up in the Indies, 11-09-1744. One of the passengers was a female slave.');
INSERT INTO "voyages" VALUES (3150, '', 6, '', 'DELFLAND', 'Arie Verdoes', 600, NULL, '1717', NULL, NULL, 'D', 'Z', '1739-04-07', 'Goeree', '1739-08-18', '1739-09-07', true, '1739-11-26', 'Batavia', 7097, NULL);
INSERT INTO "voyages" VALUES (3151, '', 2, '', 'STREEFKERK', 'Hendrik Orsel', 650, NULL, '1736', NULL, NULL, 'A', 'E', '1739-05-19', 'Texel', '1739-12-09', '1740-01-01', true, '1740-04-28', 'Batavia', NULL, 'From 13 till 20-07-1739 the ship was at S. Tiago: one seafarer and three soldiers deserted. Since 22-09-1740 the STREEFKERK was missing at the island `Cureduvo at Calpetty''.');
INSERT INTO "voyages" VALUES (3152, '', 3, '', 'SIJBEKARSPEL', 'Gerrit Munt', 650, NULL, '1729', NULL, NULL, 'H', 'H', '1739-05-19', 'Texel', '1739-11-04', '1739-11-25', true, '1740-03-07', 'Batavia', 7114, 'From 13 till 21-07-1739 the ship was at S. Tiago. During the voyage one soldier became seafarer.');
INSERT INTO "voyages" VALUES (3153, '', 5, '', 'ADRICHEM', 'Bastiaan Mol', 850, NULL, '1726', NULL, NULL, 'A', 'A', '1739-05-21', 'Texel', '1739-10-25', '1739-11-15', true, '1740-02-23', 'Batavia', 7121, 'crew was enlarged with one soldier. The nine passengers included three female slaves and a slave-child.');
INSERT INTO "voyages" VALUES (3154, '', 3, '', 'BETHLEHEM', 'Jan van der Straten', 850, NULL, '1731', NULL, NULL, 'A', 'A', '1739-05-21', 'Texel', '1739-10-17', '1739-11-11', true, '1740-01-24', 'Batavia', 7117, 'From 16 till 23-07-1739 the ship was at S, Tiago. One soldier became seafarer, The six passengers included three slaves (one male and two females),');
INSERT INTO "voyages" VALUES (3155, '', 3, '', 'HUTS TE MARQUETTE', 'Joris Davidson +', 850, NULL, '1730', NULL, NULL, 'A', 'A', '1739-05-21', 'Texel', '1739-10-16', '1739-11-16', true, '1740-02-14', 'Batavia', 7119, 'Joris Davidson died on the way; Christiaan Duif succeeded him as master. One soldier became seafarer. One of the passengers was a female slave.');
INSERT INTO "voyages" VALUES (3156, '', 2, '', 'ABBEKERK', 'Dirk van der Poel', 850, NULL, '1734', NULL, NULL, 'Z', 'Z', '1739-05-25', 'Rammekens', '1739-09-22', '1739-10-11', true, '1739-12-22', 'Ceylon', 7139, NULL);
INSERT INTO "voyages" VALUES (3157, '', 5, '', 'LAGS POLDER', 'Jan Berkmans', 580, NULL, '1725', NULL, NULL, 'E', 'E', '1739-06-02', 'Texel', '1739-11-01', '1739-11-25', true, '1740-03-07', 'Batavia', NULL, 'The LAGEPOLDER was sold at Batavia, 28-03-1747.');
INSERT INTO "voyages" VALUES (3158, '', 1, '', 'HORSTENDAAL', 'Leendert Jongebroer', 850, NULL, '1739', NULL, NULL, 'A', 'A', '1739-10-02', 'Texel', '1740-03-07', '1740-03-25', true, '1740-06-16', 'Batavia', 7142, NULL);
INSERT INTO "voyages" VALUES (3159, '', 1, '', 'MAARSSEVEEN', 'Jan Almees', 850, NULL, '1739', NULL, NULL, 'A', 'A', '1739-10-02', 'Texel', '1740-03-07', '1740-03-25', true, '1740-06-15', 'Batavia', 7140, NULL);
INSERT INTO "voyages" VALUES (3160, '', 4, '', 'KNAPPENHOF', 'Kornelis de Zitter', 650, NULL, '1731', NULL, NULL, 'A', 'Z', '1739-10-07', 'Rammekens', '1740-02-11', '1740-02-27', true, '1740-06-05', 'Batavia', 7113, 'On its way to the Cape the ship called at Duins: from 09 till 11-10-1739.');
INSERT INTO "voyages" VALUES (3161, '', 2, '', 'LOVERENDAAL', 'Samuel Hendriksz.', 650, NULL, '1737', NULL, NULL, 'Z', 'Z', '1739-10-07', 'Rammekens', '1740-02-07', '1740-02-24', true, '1740-05-27', 'Batavia', 7118, '11-10-1739 the ship was at Duins.');
INSERT INTO "voyages" VALUES (3162, '', 1, '', 'OUWERKERK', 'Jan Bijland', 540, NULL, '1738', NULL, NULL, 'Z', 'Z', '1739-10-07', 'Rammekens', '1740-02-07', '1740-02-24', true, '1740-05-05', 'Batavia', 7107, 'The ship called at Duins from 09 till 10-10-1739,');
INSERT INTO "voyages" VALUES (3163, '', 5, '', 'BEEKVLIET', 'Pieter Kaayman', 850, NULL, '1724', NULL, NULL, 'A', 'A', '1739-10-09', 'Texel', '1740-03-03', '1740-03-27', true, '1740-06-16', 'Batavia', NULL, 'The BEEKVLIET was laid up in the Indies in 1744,');
INSERT INTO "voyages" VALUES (3164, '', 3, '', 'SCHEIJBEEK', 'Pieter Visser', 850, NULL, '1735', NULL, NULL, 'A', 'A', '1739-10-09', 'Texel', '1740-01-16', '1740-02-03', true, '1740-04-14', 'Batavia', 7120, 'On 14-01-1740 the SCHEIJBEEK arrived at Robben Island.');
INSERT INTO "voyages" VALUES (3165, '', 1, '', 'HORSSEN', 'Jan Luders', 650, NULL, '1739', NULL, NULL, 'A', 'A', '1739-10-12', 'Texel', '1740-02-10', '1740-02-27', true, '1740-06-06', 'Batavia', 7112, NULL);
INSERT INTO "voyages" VALUES (3166, '', 11, '', 'PHOENIX', 'Pieter Alkmaar', 650, NULL, '1739', NULL, NULL, 'A', 'A', '1739-10-12', 'Texel', '1740-01-15', '1740-02-03', true, '1740-04-27', 'Batavia', NULL, 'The PHOENIX was laid up at Batavia on 16-09-1746,');
INSERT INTO "voyages" VALUES (3167, '', 3, '', 'VREELAND', 'Jurriaan Zeeman', 650, NULL, '1735', NULL, NULL, 'A', 'A', '1739-10-12', 'Texel', '1740-01-20', '1740-02-08', true, '1740-04-09', 'Batavia', 7110, 'The VREELAND arrived at Robben Island on 17-01-1740.');
INSERT INTO "voyages" VALUES (3168, '', 8, '', 'MAGDALENA', 'Hendrik Westerbeek', 600, NULL, '1719', NULL, NULL, 'H', 'D', '1739-10-19', 'Goeree', '1740-02-23', '1740-03-16', true, '1740-06-15', 'Batavia', NULL, 'One soldier became seafarer; one of the seafarers was taken over by the WICKENBURG (see 3169). According to a letter from Bengal (31-12-1743) the MAG-DALENA was laid up there.');
INSERT INTO "voyages" VALUES (3169, '', 7, '', 'WICKENBURG', 'Gelijn Leynsen', 850, NULL, '1722', NULL, NULL, 'Z', 'Z', '1739-10-19', 'Rammekens', '1740-02-20', '1740-03-25', true, '1740-06-15', 'Batavia', 7127, 'During the voyage three seafarers deserted; the crew was enlarged by one seafarer, taken over from the MAGDALENA (see 3168), and a sailmaker.');
INSERT INTO "voyages" VALUES (3170, '', 4, '', 'HUIS TE SPIJK', 'Willem de Wijs', 650, NULL, '1732', NULL, NULL, 'D', 'R', '1739-10-31', 'Goeree', '1740-02-20', '1740-03-14', true, '1740-05-30', 'Batavia', 7133, 'During the voyage one soldier became seafarer.');
INSERT INTO "voyages" VALUES (3171, '', 8, '', 'BERKENRODE', 'Pieter Scherf', 1150, NULL, '1723', NULL, NULL, 'A', 'A', '1740-01-08', 'Texel', '1740-05-21', '1740-06-09', true, '1740-08-19', 'Ceylon', NULL, 'The BERKENRODE was laid up in the Indies in 1744.');
INSERT INTO "voyages" VALUES (3172, '', 3, '', 'BEUKESTIJN', 'Jan de Boer', 850, NULL, '1734', NULL, NULL, 'A', 'A', '1740-01-08', 'Texel', '1740-05-01', '1740-05-11', true, '1740-07-20', 'Batavia', 7103, NULL);
INSERT INTO "voyages" VALUES (3173, '', 2, '', 'ROOSWIJK', 'Daniel Ronzieres', 850, NULL, '1737', NULL, NULL, 'A', 'A', '1740-01-08', 'Texel', NULL, NULL, true, NULL, NULL, NULL, 'One day after its departure from Texel the ROOSWIJK was wrecked at Goodwin''s Sand on 09-01-1740.');
INSERT INTO "voyages" VALUES (3174, '', 4, '', 'VIS', 'Jan Sikkes', 650, NULL, '1732', NULL, NULL, 'E', 'A', '1740-01-08', 'Texel', '1740-05-06', NULL, true, NULL, NULL, NULL, 'wrecked `behind the Waterplaats'' at the Cape on 06-05-1740.');
INSERT INTO "voyages" VALUES (3175, '', 4, '', 'NIEUW WALCHEREN', 'Jan Reynders', 850, NULL, '1731', NULL, NULL, 'Z', 'Z', '1740-01-17', 'Rammekens', '1740-06-02', '1740-07-10', true, '1740-09-18', 'Batavia', 7116, NULL);
INSERT INTO "voyages" VALUES (3176, '', 7, '', 'EVERSWAART', 'Gerrit van der Tolle', 850, NULL, '1723', NULL, NULL, 'Z', 'Z', '1740-01-25', 'Rammekens', '1740-05-27', '1740-06-21', true, '1740-08-18', 'Batavia', 7104, 'The EVERSWAART did not call at the Cape, but at False Bay (27-05 till 21-06-1740),');
INSERT INTO "voyages" VALUES (3177, '', 1, '', 'HOF VAN DELFT', 'Jean Belleveau', 850, NULL, '1739', NULL, NULL, 'D', 'D', '1740-04-20', 'Goeree', '1740-09-04', '1740-09-21', true, '1740-12-08', 'Batavia', 7122, 'The two passengers on the HOF VAN DELFT were slaves.');
INSERT INTO "voyages" VALUES (3178, '', 2, '', 'SCHELLAG', 'Kornelis Mol +', 850, NULL, '1736', NULL, NULL, 'Z', 'Z', '1740-04-20', 'Rammekens', '1740-07-21', '1740-09-11', true, '1740-11-19', 'Batavia', 7124, 'During the voyage Kornelis Mol died, Willem Hendriksz. van Roffe succeeded him as master, One of the soldiers became seafarer.');
INSERT INTO "voyages" VALUES (3179, '', 7, '', 'BUVEGNIES', 'Jan Boelhouwer', 850, NULL, '1722', NULL, NULL, 'D', 'A', '1740-05-08', 'Texel', '1740-10-12', '1740-11-04', true, '1741-04-28', 'Batavia', 3179, '/- Is the seventh voyage of this ship, which during its preceding six voyages was called KASTEEL VAN WOERDEN (3114/1072). From 23-06 till 06-07-1740 the ship was at S. Tiago, where 6 seafarers deserted and one soldier probably became seafarer.');
INSERT INTO "voyages" VALUES (3180, '', 2, '', 'ENKHUIZEN', 'Dirk Zomerman', 850, NULL, '1735', NULL, NULL, 'E', 'A', '1740-05-08', 'Texel', '1740-10-12', '1740-11-15', true, '1741-02-16', 'Batavia', 7138, 'From 22-06 till 06-07-1740 the ship was at S, Tiago.');
INSERT INTO "voyages" VALUES (3181, '', 5, '', 'HOGERSMILDE', 'Willem Schul', 850, NULL, '1723', NULL, NULL, 'H', 'A', '1740-05-08', 'Texel', '1740-10-12', '1740-11-15', true, '1741-05-28', 'Batavia', 7143, 'The ship called at S, Tiago (23-06 till 06-07-1740), One soldier became seafarer. 3181/7143 Is the fifth voyage of this ship, which during its four preceding voyages was called WAPEN VAN HOORN (see 3109/7070).');
INSERT INTO "voyages" VALUES (3182, '', 4, '', 'HOF NIET ALTIJD WINTER', 'Koenraad van der Poel', 650, NULL, '1723', NULL, NULL, 'Z', 'R', '1740-05-15', 'Goeree', '1741-05-10', '1741-05-27', true, '1741-08-16', 'Batavia', NULL, '30-11-1740 till 02-01-1741 the ship was at Cape Lopez; it also called at Saldanha Bay (20-04 till 02-05-1741), The ship was sold at Batavia on 10-12-1747.');
INSERT INTO "voyages" VALUES (3183, '', 8, '', 'HILLEGONDA', 'Dirk de Vet', 850, NULL, '1720', NULL, NULL, 'H', 'H', '1740-05-18', 'Texel', '1740-11-02', '1740-12-10', true, '1741-05-27', 'Batavia', NULL, 'From 01 till 06-07-1740 the ship wat at S, Tiago. where one member of the crew deserted, probably a seafarer. In 1745 the HILLEGONDA was laid up at Batavia,');
INSERT INTO "voyages" VALUES (3184, '', 4, '', 'MARIA ADRIANA', 'Jan Elswout', 650, NULL, '1730', NULL, NULL, 'R', 'Z', '1740-05-23', 'Rammekens', '1740-11-03', '1740-11-21', true, '1741-03-03', 'Batavia', 7170, 'From 27-06 till 06-07-1740 the ship was at Porto Prayo and from 18-10 till 02-11 it called at Saldanha Bay.');
INSERT INTO "voyages" VALUES (3185, '', 6, '', 'WESTERBEEK', 'Dirk Pomp', 650, NULL, '1722', NULL, NULL, 'A', 'E', '1740-06-03', 'Texel', '1740-12-25', '1741-01-19', true, '1741-05-28', 'Batavia', 7145, 'Dirk Pomp died during the voyage; Christian Boelhouwer succeeded him as master. The ship called at S. Tiago from 29-08 till 03-09-1740.');
INSERT INTO "voyages" VALUES (3186, '', 3, '', 'BATAVIER', 'Jakob Verleng', 525, NULL, '1735', NULL, NULL, 'A', 'E', '1740-06-07', 'Texel', '1741-01-02', '1741-02-12', true, '1741-06-04', 'Batavia', 7131, 'On its way to the Cape the BATAVIER called at Ireland (08 till 20-07-1740) and at Saldanha Bay (19-12-1740 till 01-01-1741),');
INSERT INTO "voyages" VALUES (3187, '', 3, '', 'HUIS TE FOREEST', 'Christiaan Bakker', 850, NULL, '1731', NULL, NULL, 'H', 'A', '1740-06-29', 'Texel', '1741-01-02', '1741-01-19', true, '1741-04-25', 'Batavia', 7155, 'The 48 persons indicated in the fifth column include 12 seafarers and 8 soldiers who disembarked during a long stay at Pernambuco (13-09 till 13-11-1740); they all went to the hospital there. 2 Soldiers became seafarers.');
INSERT INTO "voyages" VALUES (3188, '', 2, '', 'KASTEEL VAN WOERDEN', 'Jan van Ingen', 850, NULL, '1736', NULL, NULL, 'A', 'A', '1740-06-29', 'Texel', '1740-11-23', '1740-11-26', true, '1741-04-24', 'Batavia', 7146, '3188/7146 Is the second voyage of the KASTEEL VAN WOERDEN; during the preceding voyage (3077/7057) it was called BUVEGNIES. From 29-07 till 11-08-1740 the ship was at S. Tiago.');
INSERT INTO "voyages" VALUES (3189, '', 1, '', 'OUDE ZIJPE', 'Joost Anker', 650, NULL, '1730', NULL, NULL, 'H', 'H', '1740-06-29', 'Texel', '1740-12-16', '1741-01-19', true, '1741-05-28', 'Batavia', 7136, 'probably became seafarers.');
INSERT INTO "voyages" VALUES (3190, '', 8, '', 'CORNELIA', 'Gerrit Scheepbouwer', 800, NULL, '1721', NULL, NULL, 'H', 'E', '1740-09-26', 'Texel', '1741-05-19', '1741-06-14', true, '1741-08-28', 'Batavia', 26, 'date of departure of the CORNELIA-. on 05-01-1740 it sailed out for the first time, but on 19-03 it returned to Texel, During the voyage one soldier became seafarer. The ship was laid up in the Indies on 11-09-1744.');
INSERT INTO "voyages" VALUES (3191, '', 4, '', 'RUST EN WERK', 'Willem van Eyk', 650, NULL, '1734', NULL, NULL, 'D', 'D', '1740-10-13', 'Goeree', '1741-02-24', '1741-03-16', true, '1741-06-08', 'Batavia', 7149, 'From 15 till 26-10-1740 the ship called at Portsmouth. One of the soldiers became corporal, another soldier probably became seafarer,');
INSERT INTO "voyages" VALUES (3192, '', 5, '', 'WESTKAPELLE', 'Michiel Keizer', 850, NULL, '1730', NULL, NULL, 'Z', 'Z', '1740-10-26', 'Rammekens', '1741-02-07', '1741-02-28', true, '1741-06-25', 'Batavia', 7191, 'One of the 17 seafarers who embarked at the Cape was taken over from the AMSTERDAM (see 3194); one soldier probably became seafarer, The five passengers included one former slave.');
INSERT INTO "voyages" VALUES (3193, '', 1, '', 'WOITKENSDORP', 'Adriaan van Maarsseveen', 800, NULL, '1739', NULL, NULL, 'Z', 'Z', '1740-10-26', 'Rammekens', '1741-02-08', '1741-02-28', true, '1741-06-29', 'Batavia', 7168, 'During the voyage one soldier became cook''s wain.');
INSERT INTO "voyages" VALUES (3194, '', 1, '', 'AMSTERDAM', 'Jan van Heemstede', 850, NULL, '1740', NULL, NULL, 'A', 'A', '1740-10-27', 'Texel', '1741-01-25', '1741-02-25', true, '1741-05-22', 'Batavia', 7130, 'One of the 20 seafarers who disembarked at the Cape was taken over by the WESTKAPELLE (3192), During the voyage one soldier probably became seafarer.');
INSERT INTO "voyages" VALUES (3195, '', 4, '', 'HOFVLIET', 'Kornelis van Velden', 1000, NULL, '1729', NULL, NULL, 'R', 'A', '1740-10-27', 'Texel', '1741-01-29', '1741-02-19', true, '1741-05-22', 'Batavia', 7132, NULL);
INSERT INTO "voyages" VALUES (3196, '', 7, '', 'WAPEN VAN HOORN', 'Jakob van Banken', 810, NULL, '1723', NULL, NULL, 'A', 'A', '1740-10-27', 'Texel', '1741-01-21', '1741-02-23', true, '1741-05-22', 'Batavia', 3196, '/- Is the seventh voyage of this ship, which during its six preceding voyages was called HOGERSMILDE (see 3078/7056), The ship was laid up in the Indies on 11-09-1744.');
INSERT INTO "voyages" VALUES (3197, '', 2, '', 'RUYVEN', 'Bernardus Heymans', 650, NULL, '1736', NULL, NULL, 'D', 'A', '1740-10-27', 'Texel', '1741-03-18', '1741-04-07', true, '1741-07-12', 'Batavia', 7141, NULL);
INSERT INTO "voyages" VALUES (3198, '', 1, '', 'THEEKOP', 'Jan Kelder', 600, NULL, '1740', NULL, NULL, 'A', 'A', '1740-10-27', 'Texel', '1741-03-10', '1741-05-04', true, '1741-07-29', 'Batavia', NULL, 'up and sold at Batavia on 1748,');
INSERT INTO "voyages" VALUES (3199, '', 1, '', 'WELTEVREDEN', 'Adolf van Westhoven', 850, NULL, '1740', NULL, NULL, 'A', 'A', '1740-10-27', 'Texel', '1741-01-31', '1741-02-19', true, '1741-05-22', 'Batavia', 7144, NULL);
INSERT INTO "voyages" VALUES (3200, '', 3, '', 'DIEMERMEER', 'Kornelis Kroon', 850, NULL, '1736', NULL, NULL, 'A', 'A', '1740-11-05', 'Texel', '1741-03-24', '1741-04-18', true, '1741-06-08', 'Batavia', 7151, 'The DIEMERMEER called at Duins (09 till 16-11-1740), One soldier probably became seafarer.');
INSERT INTO "voyages" VALUES (3201, '', 4, '', 'HAAMSTEDE', 'Maarten Kist', 650, NULL, '1730', NULL, NULL, 'D', 'H', '1740-12-26', 'Texel', '1741-05-24', '1741-06-14', true, '1741-08-28', 'Batavia', 7159, 'Two soldiers probably became seafarers.');
INSERT INTO "voyages" VALUES (3202, '', 1, '', 'HUIS TER DUINE', 'Mattheus Feris du Rietz', 550, NULL, '1739', NULL, NULL, 'Z', 'Z', '1740-12-31', 'Rammekens', '1741-05-21', '1741-06-14', true, '1741-08-16', 'Batavia', 7135, 'Adverse winds forced the ship to call at Duins (06 till 26-01-1741). One soldier probably became seafarer.');
INSERT INTO "voyages" VALUES (3203, '', 3, '', 'JONGE WILLEM', 'Daniel Udemans', 650, NULL, '1731', NULL, NULL, 'Z', 'Z', '1740-12-31', 'Rammekens', '1741-05-14', '1741-06-14', true, '1741-08-20', 'Batavia', 7150, 'From 02 till 26-01-1741 the ship was at Duins.');
INSERT INTO "voyages" VALUES (3204, '', 3, '', 'GUNTERSTUN', 'Pieter Korver', 850, NULL, '1736', NULL, NULL, 'A', 'A', '1741-01-20', 'Texel', '1741-05-18', '1741-06-14', true, '1741-09-08', 'Batavia', 7198, NULL);
INSERT INTO "voyages" VALUES (3205, '', 1, '', 'HEUVEL', 'Witto', 650, NULL, '1740', NULL, NULL, 'A', 'A', '1741-01-20', 'Texel', '1741-06-06', '1741-06-20', true, '1741-09-10', 'Batavia', 7147, 'One soldier became bottler'' s mate.');
INSERT INTO "voyages" VALUES (3206, '', 5, '', 'LEIDUIN', 'Dirk Quast', 650, NULL, '1730', NULL, NULL, 'A', 'E', '1741-01-20', 'Texel', '1741-06-12', '1741-06-27', true, '1741-09-02', 'Batavia', NULL, 'The LEIDUIN called at S. Tiago where one seafarer and one soldier deserted (05 till 30-03-1741). Some of the four seafarers who embarked at the Cape were taken over from the PATMOS (3207); at the Cape three soldiers became seafarers, The ship was laid up in the Indies on 11-09-1744.');
INSERT INTO "voyages" VALUES (3207, '', 8, '', 'PATMOS', 'David van Elteren', 810, NULL, '1722', NULL, NULL, 'R', 'A', '1741-01-20', 'Texel', '1741-06-12', '1741-06-27', true, '1741-09-09', 'Ceylon', 7200, NULL);
INSERT INTO "voyages" VALUES (3208, '', 5, '', 'VOORDUIN', 'Fredrik Schouten', 650, NULL, '1730', NULL, NULL, 'A', 'A', '1741-01-20', 'Texel', '1741-06-12', '1741-06-27', true, '1741-08-28', 'Batavia', NULL, 'Hs the fifth voyage of the VOORDUIN, which during its first voyage (2817/6844) was called ZORGWIJK. The ship was laid up in the Indies on 26-01-1745.');
INSERT INTO "voyages" VALUES (3209, '', 2, '', 'RUITER', 'Paulus Pieman', 650, NULL, '1736', NULL, NULL, 'E', 'A', '1741-01-23', 'Texel', '1741-11-10', '1741-12-06', true, '1742-02-13', 'Batavia', 7160, '08-03-1741 the RUITER was at Mountsbav where 4 seafarers and 1 soldier deserted. From 10 till 22-05-1741 the ship called at Plymouth where 17 seafarers and 3 soldiers died and 11 seafarers and 7 soldiers deserted, The diminished crew was enlarged by 37 seafarers from Amsterdam. The ship also called at S. Tiago (04 till 17-07-1741) where 1 seafarer and 1 soldier deserted and 2 soldiers became seafarers.');
INSERT INTO "voyages" VALUES (3210, '', 7, '', 'DELFLAND', 'Egbert Verduin', 600, NULL, '1717', NULL, NULL, 'D', 'D', '1741-03-29', 'Goeree', '1741-06-24', '1741-07-18', true, '1741-09-11', 'Batavia', NULL, 'After an accident on a voyage to Ambon the DELFLAND was laid up on 12-07-1746.');
INSERT INTO "voyages" VALUES (3211, '', 1, '', 'VRIJHEID', 'Jakob Pols', 650, NULL, '1740', NULL, NULL, 'R', 'R', '1741-05-06', 'Goeree', '1741-09-15', '1741-10-08', true, '1742-01-09', 'Batavia', 7163, 'One soldier probably became seafarer,');
INSERT INTO "voyages" VALUES (3212, '', 5, '', 'DUIFJE', 'Jakob van Duinen', 450, NULL, '1729', NULL, NULL, 'A', 'A', '1741-05-07', 'Texel', '1741-09-15', '1741-10-08', true, '1742-01-05', 'Batavia', NULL, 'The DUIFJE was sold at Batavia on 28-03-1747,');
INSERT INTO "voyages" VALUES (3213, '', 1, '', 'OOSTERHOUT', 'Willem Meyer', 600, NULL, '1740', NULL, NULL, 'A', 'A', '1741-05-07', 'Texel', '1742-02-09', '1742-03-11', true, '1742-06-14', 'Batavia', NULL, 'The OOSTERHOUT called at S. Tiago (16 till 26-06-1741) and at Saldanha Bay (.13-12-1741 till 08-02-1742). See also 3214. The ship was laid up at Batavia on 16-04-1748.');
INSERT INTO "voyages" VALUES (3214, '', 3, '', 'HUIS DEN EULT', 'Christiaan Boord', 850, NULL, '1731', NULL, NULL, 'A', 'A', '1741-05-18', 'Texel', '1741-11-04', '1741-12-03', true, '1742-02-25', 'Batavia', NULL, 'From 04 till 17-07-1741 the ship called at S. Tiago where one seafarer, deserted from the OOSTERHOUT (3213), embarked, One soldier probably became seafarer. The ship was laid up in the Indies on 25-02-1746,');
INSERT INTO "voyages" VALUES (3215, '', 3, '', 'HUIS TE RENSBURG', 'Jan Mijsters', 850, NULL, '1733', NULL, NULL, 'Z', 'Z', '1741-05-22', 'Rammekens', '1741-11-04', '1741-12-03', true, '1742-04-18', 'Ceylon', 7187, 'From 04 till 17-07-1741 the ship was at S. Tiago.');
INSERT INTO "voyages" VALUES (3216, '', 4, '', 'VLISSINGEN', 'Huibert Tiebout', 650, NULL, '1732', NULL, NULL, 'Z', 'Z', '1741-05-22', 'Rammekens', '1741-10-31', '1742-02-28', true, '1742-06-12', 'Batavia', 7222, 'till 30-10-1741),');
INSERT INTO "voyages" VALUES (3217, '', 3, '', 'WESTHOVEN', 'Jan de Jong', 650, NULL, '1734', NULL, NULL, 'Z', 'Z', '1741-05-22', 'Rammekens', '1741-11-03', '1741-12-13', true, '1742-03-17', 'Batavia', 7193, 'From 06 till 17-07-1741 the WESTHOVEN was at S. Tiago and from 27-10 till 02-11-1741 it was at Dassen Island.');
INSERT INTO "voyages" VALUES (3218, '', 5, '', 'MEERLUST', 'Gerrit Blauwpot', 600, NULL, '1725', NULL, NULL, 'A', 'H', '1741-05-24', 'Texel', '1741-12-08', '1741-12-22', true, '1742-04-07', 'Batavia', 7165, 'From 05-11 till 07-12-1741 the MEERLUST called at Saldanha Bay. One soldier probably became seafarer.');
INSERT INTO "voyages" VALUES (3219, '', 1, '', 'IDA', 'Roelof Blok', 650, NULL, '1740', NULL, NULL, 'E', 'E', '1741-06-01', 'Texel', '1741-11-15', '1741-12-06', true, '1742-02-26', 'Batavia', 7183, 'The IDA called at Robben Island (05 till 16-11-1741).');
INSERT INTO "voyages" VALUES (3220, '', 1, '', 'ROZENBEEK', 'Nanning Broeder', 200, 'galjoot', '1731', NULL, NULL, 'A', 'A', '1741-10-19', 'Texel', '1742-02-20', NULL, true, '1742-02-20', 'The Cape', 7148, 'orders''.');
INSERT INTO "voyages" VALUES (3221, '', 1, '', 'BOSBEEK', 'Jan Tobias Toon', 650, NULL, '1741', NULL, NULL, 'A', 'A', '1741-10-23', 'Texel', '1742-02-26', '1742-03-11', true, '1742-05-24', 'Batavia', 7158, 'During the voyage two soldiers probably became seafarers,');
INSERT INTO "voyages" VALUES (3222, '', 2, '', 'DRECHTERLAND', 'Pieter Krook', 650, NULL, '1736', NULL, NULL, 'H', 'A', '1741-10-23', 'Texel', '1742-02-22', '1742-03-23', true, '1742-06-12', 'Batavia', 7178, NULL);
INSERT INTO "voyages" VALUES (3223, '', 4, '', 'KERKWIJK', 'Pieter Sluis', 850, NULL, '1733', NULL, NULL, 'A', 'A', '1741-10-23', 'Texel', '1742-03-13', '1742-04-07', true, '1742-06-20', 'Batavia', 7216, NULL);
INSERT INTO "voyages" VALUES (3224, '', 3, '', 'NOORDWOLFSBERGEN', 'Wijnand Meurs', 650, NULL, '1733', NULL, NULL, 'A', 'A', '1741-10-23', 'Texel', '1742-03-14', '1742-04-07', true, '1742-06-12', 'Batavia', NULL, 'seafarer probably became soldier, The NOORDWOLFSBERGEN was sold at Batavia on 10-11-1747.');
INSERT INTO "voyages" VALUES (3225, '', 3, '', 'POPKENSBURG', 'Jan van Schutterop', 850, NULL, '1732', NULL, NULL, 'Z', 'A', '1741-10-23', 'Texel', '1742-02-20', '1742-03-13', true, '1742-06-12', 'Batavia', 7207, NULL);
INSERT INTO "voyages" VALUES (3226, '', 1, '', 'TOLSDUIN', 'Pieter Kouderk', 850, NULL, '1741', NULL, NULL, 'A', 'A', '1741-10-23', 'Texel', '1742-03-18', '1742-04-27', true, '1742-07-17', 'Batavia', 7157, 'The TOLSDUIN called at S. Tiago (14 till 26-12-1741).');
INSERT INTO "voyages" VALUES (3227, '', 4, '', 'SIJBEKARSPEL', 'Barend de Bruin', 650, NULL, '1729', NULL, NULL, 'H', 'A', '1741-10-23', 'Texel', '1742-03-14', '1742-04-07', true, '1742-06-20', 'Batavia', 7167, 'During the voyage one soldier probably became seafarer.');
INSERT INTO "voyages" VALUES (3228, '', 4, '', '''S HEER ARENDSKERKE', 'Kornelis Ariensz. Keet', 600, NULL, '1724', NULL, NULL, 'Z', 'R', '1741-10-24', 'Goeree', '1742-03-22', '1742-04-17', true, '1742-07-17', 'Batavia', NULL, 'Batavia on 01-11-1752,');
INSERT INTO "voyages" VALUES (3229, '', 1, '', 'DOMBURG', 'Dirk Tromp', 850, NULL, '1740', NULL, NULL, 'Z', 'Z', '1741-10-27', 'Rammekens', '1742-03-14', '1742-04-17', true, '1742-07-17', 'Batavia', 7177, 'During the voyage two soldiers probably became seafarers, One source mentions Hammen Noordrecht as master.');
INSERT INTO "voyages" VALUES (3230, '', 5, '', 'PALLAS', 'Bastiaan Koolmans', 650, NULL, '1723', NULL, NULL, 'A', 'Z', '1741-10-27', 'Rammekens', '1742-03-14', '1742-04-07', true, '1742-06-20', 'Batavia', NULL, 'Batavia on 25-04-1747.');
INSERT INTO "voyages" VALUES (3231, '', 5, '', 'KNAPPENHOF', 'Gozewijn de Vos', 650, NULL, '1731', NULL, NULL, 'A', 'R', '1741-12-14', 'Goeree', '1742-04-30', '1742-05-20', true, '1742-10-13', 'Batavia', 7169, 'The KNAPPENHOF called at Duins (21-12-1741 till 02-01-1742).');
INSERT INTO "voyages" VALUES (3232, '', 4, '', 'VREELAND', 'Arie Verdoes', 650, NULL, '1735', NULL, NULL, 'A', 'D', '1741-12-14', 'Goeree', '1742-04-30', '1742-05-20', true, '1742-08-08', 'Batavia', 7172, 'The VREELAND called at Portsmouth (19 till 23-12-1741). Three soldiers became seafarers.');
INSERT INTO "voyages" VALUES (3233, '', 4, '', 'BETHLEHEM', 'Usbrand Moens', 850, NULL, '1731', NULL, NULL, 'A', 'Z', '1741-12-26', 'Texel', NULL, NULL, true, NULL, NULL, NULL, 'The BETHLEHEM stranded at the Flemish sandbanks off Oostende on 29-12-1741. See also 3252. The ship was bound for Ceylon.');
INSERT INTO "voyages" VALUES (3234, '', 2, '', 'HORSSEN', 'Booy Kornelisz.', 650, NULL, '1739', NULL, NULL, 'A', 'A', '1741-12-26', 'Texel', '1742-04-12', '1742-05-04', true, '1742-06-22', 'Ceylon', NULL, 'The HORSSEN was laid up in the Indies on 15-08-1749. In one source Pieter Aas is mentioned as master.');
INSERT INTO "voyages" VALUES (3235, '', 1, '', 'LEEUWERIK', 'Dominikus Wormhout', 650, NULL, '1741', NULL, NULL, 'A', 'A', '1741-12-26', 'Texel', '1742-04-29', '1742-05-20', true, '1742-08-08', 'Batavia', 7175, NULL);
INSERT INTO "voyages" VALUES (3236, '', 4, '', 'HUIS TE MARQUETTE', 'Reinier Brugman', 850, NULL, '1730', NULL, NULL, 'A', 'A', '1741-12-26', 'Texel', '1742-04-12', '1742-05-11', true, '1742-07-02', 'Batavia', 7153, NULL);
INSERT INTO "voyages" VALUES (3237, '', 2, '', 'OUWERKERK', 'Meindert de Beer', 540, NULL, '1738', NULL, NULL, 'Z', 'E', '1741-12-26', 'Texel', '1742-04-12', '1742-05-11', true, '1742-07-17', 'Batavia', 7154, NULL);
INSERT INTO "voyages" VALUES (3238, '', 3, '', 'RIJNHUIZEN', 'Gerrit Reyndertsz. Vos', 650, NULL, '1736', NULL, NULL, 'R', 'H', '1741-12-26', 'Texel', '1742-04-30', '1742-05-20', true, '1742-10-14', 'Batavia', 7171, NULL);
INSERT INTO "voyages" VALUES (3239, '', 1, '', 'DUINENBURG', 'Hendrik Jansen', 650, NULL, '1740', NULL, NULL, 'Z', 'Z', '1742-01-03', 'Rammekens', '1742-05-10', '1742-06-23', true, '1742-11-08', 'Batavia', 7179, 'The DUINENBURG did not call at the Cape, but at False Bay.');
INSERT INTO "voyages" VALUES (3240, '', 8, '', 'NIEUWVLIET', 'Pieter Koor', 650, NULL, '1719', NULL, NULL, 'Z', 'Z', '1742-01-03', 'Rammekens', '1742-04-16', '1742-05-11', true, '1742-07-17', 'Batavia', NULL, 'During the voyage one soldier probably became seafarer. The NIEUWVLIET was laid up at Batavia on 23-07-1750.');
INSERT INTO "voyages" VALUES (3241, '', 2, '', 'SARA JACOBA', 'Jan Revnders', 1100, NULL, '1737', NULL, NULL, 'Z', 'Z', '1742-03-08', 'Rammekens', '1742-08-02', '1742-08-12', true, '1742-11-05', 'Batavia', 7196, 'The SARA JACOBA called at Saldanha Bay (25-06 till 01-08-1742) where 9 seafarers and 4 soldiers died. The six passengers who embarked at the Cape included ex-Governor-General Adriaan Valkenier, arrested at the Cape after his return from Batavia in January 1742 (see also 7130); he was accused by the future Governor-General Van Imhoff of being reponsible for the notorious ''Chinese murders'' in Batavia in 1740.');
INSERT INTO "voyages" VALUES (3242, '', 2, '', 'HOF VAN DELFT', 'Pieter van der Linden', 850, NULL, '1739', NULL, NULL, 'D', 'D', '1742-04-08', 'Goeree', '1742-08-10', '1742-09-15', true, '1742-11-25', 'Batavia', 7174, 'but at False Bay.');
INSERT INTO "voyages" VALUES (3243, '', 4, '', 'HOFWEGEN', 'Jan de Wit', 650, NULL, '1731', NULL, NULL, 'R', 'R', '1742-04-10', 'Goeree', NULL, NULL, false, '1742-10-07', 'Batavia', NULL, 'On 01-09-1746 the ship exploded on the roads of Batavia.');
INSERT INTO "voyages" VALUES (3244, '', 4, '', 'BEUKESTIJN', 'Jan de Boer', 850, NULL, '1734', NULL, NULL, 'A', 'A', '1742-05-03', 'Texel', '1742-08-23', '1742-09-09', true, '1742-12-22', 'Batavia', 7215, NULL);
INSERT INTO "voyages" VALUES (3245, '', 4, '', 'GOIDSCHALXOORD', 'Douwe Jansz. Mout', 850, 'fluit', '1734', NULL, NULL, 'A', 'A', '1742-05-03', 'Texel', '1742-08-22', '1742-10-29', true, '1743-01-06', 'Batavia', 7195, 'One soldier probably became seafarer.');
INSERT INTO "voyages" VALUES (3246, '', 3, '', 'NIEUWERKERK', 'Willem Houthuizen', 1135, NULL, '1735', NULL, NULL, 'Z', 'A', '1742-05-03', 'Texel', '1742-09-06', '1742-09-26', true, '1742-12-11', 'Batavia', 7184, 'One soldier became seafarer.');
INSERT INTO "voyages" VALUES (3247, '', 5, '', 'NIEUW WALCHEREN', 'Nikolaas van Ewijk', 850, NULL, '1731', NULL, NULL, 'Z', 'A', '1742-05-03', 'Texel', '1742-08-22', '1742-09-09', true, '1742-12-20', 'Batavia', 7218, 'One seafarer became soldier.');
INSERT INTO "voyages" VALUES (3248, '', 3, '', 'WATERVLIET', 'Gerbrand Swaag', 650, NULL, '1736', NULL, NULL, 'A', 'E', '1742-05-03', 'Texel', NULL, NULL, true, NULL, NULL, NULL, 'The WATERVLIET ran ashore off Calais on 05-05-1742. See also 3261.');
INSERT INTO "voyages" VALUES (3249, '', 2, '', 'POLANEN', 'Herman Quinje', 650, NULL, '1737', NULL, NULL, 'A', 'H', '1742-05-05', 'Texel', '1742-09-11', '1742-10-09', true, '1743-01-12', 'Batavia', 7194, 'at Robben Island. At the Cape two soldiers became cook and cook''s wain; another soldier probably became seafarer.');
INSERT INTO "voyages" VALUES (3250, '', 8, '', 'EVERSWAART', 'Kornelis de Zitter', 850, NULL, '1723', NULL, NULL, 'Z', 'Z', '1742-05-15', 'Rammekens', '1742-09-11', '1742-10-03', true, '1743-01-08', 'Batavia', NULL, 'one soldier became cook, The ship was laid up at Batavia on 03-12-1748.');
INSERT INTO "voyages" VALUES (3251, '', 4, '', 'SCHEIJBEEK', 'Jan Bijland', 850, NULL, '1735', NULL, NULL, 'A', 'Z', '1742-05-15', 'Rammekens', '1742-08-25', '1742-09-18', true, '1743-11-22', 'Batavia', 7197, NULL);
INSERT INTO "voyages" VALUES (3252, '', 5, '', 'PAPENBURG', 'Pieter Elsvliet', 800, NULL, '1729', NULL, NULL, 'A', 'A', '1742-06-20', 'Texel', '1742-10-04', '1742-11-09', true, '1743-02-02', 'Ceylon', NULL, 'The PAPENBURG replaced the wrecked BETHLEHEM (see 3233). The ship was sold at Batavia on 05-05-1747.');
INSERT INTO "voyages" VALUES (3253, '', 1, '', 'ANNA', 'Christoffel Blom', 600, NULL, '1741', NULL, NULL, 'A', 'A', '1742-10-27', 'Texel', '1743-01-24', '1743-02-18', true, '1743-05-28', 'Batavia', 7176, 'The ANNA called at Madeira (12 till 14-11-1742) and at S. Tiago (25/6-11-1742). During the voyage, probably at the Cape, one seafarer was taken over by the EENDRACHT (3254); five soldiers became seafarers.');
INSERT INTO "voyages" VALUES (3254, '', 1, '', 'EENDRACHT', 'Jakob Verleng', 1150, NULL, '1742', NULL, NULL, 'A', 'A', '1742-10-27', 'Texel', '1743-02-02', '1743-02-28', true, '1743-05-28', 'Batavia', 7180, 'The EENDRACHT called at Madeira (12 till 14-11-1742) and at S. Tiago (25/6-11-1742). See also 3253.');
INSERT INTO "voyages" VALUES (3255, '', 1, '', 'FORTUIN', 'Kornelis Booys', 600, NULL, '1741', NULL, NULL, 'A', 'A', '1742-10-27', 'Texel', '1743-01-21', '1743-02-18', true, '1743-05-28', 'Batavia', 7201, 'The FORTUIN called at Madeira (12 till 14-11-1742) and at S. Tiago (25/6-11-1742), At the Cape 2 seafarers disembarked, another deserted; the 14 passengers who embarked at the Cape included 4 slaves.');
INSERT INTO "voyages" VALUES (3256, '', 1, '', 'HERSTELDER', 'Jean Belleveau', 1150, NULL, NULL, '1741', NULL, 'A', 'A', '1742-10-27', 'Texel', '1743-01-21', '1743-02-28', true, '1743-05-28', 'Batavia', 7181, 'previously called EDAM, had been bought by the VOC from the Admiralty of Amsterdam, The 9 passengers included Governor-General Van Imhoff and 7 servants. From 12 till 14-11-1742 the ship called at Madeira where 2 seafarers embarked. The ship also called at S. Tiago (25/6-11-1742) where 1 seafarer died, At the Cape 3 seafarers and 1 servant of the GG became soldiers.');
INSERT INTO "voyages" VALUES (3257, '', 8, '', 'WICKENBURG', 'Jan Licent', 850, NULL, '1722', NULL, NULL, 'Z', 'A', '1742-10-28', 'Texel', '1743-01-24', '1743-02-06', true, '1743-05-10', 'Ceylon', NULL, 'The WICKENBURG called at Madeira (12 till 14-11-1742) and at S. Tiago (25/6-11-1742). The ship was laid up in the Indies on 07-05-1748.');
INSERT INTO "voyages" VALUES (3258, '', 3, '', 'SCHELLAG', 'Anthonie Uiterschouw', 850, NULL, '1736', NULL, NULL, 'Z', 'Z', '1742-11-01', 'Rammekens', '1743-03-01', '1743-03-16', true, '1743-05-28', 'Batavia', 7185, 'From 05 till 21-11-1742 the SCHELLAG was at Portsmouth.');
INSERT INTO "voyages" VALUES (3259, '', 1, '', 'ZAAMSLAG', 'Nanning Broeder', 900, NULL, '1741', NULL, NULL, 'Z', 'Z', '1742-11-01', 'Rammekens', '1743-02-28', '1743-03-16', true, '1743-05-28', 'Batavia', 7186, 'The ZAAMSLAG called at Portsmouth (05 till 21-11-1742) and at S. Tiago (15 till 20-12-1742) where 11 persons died and 13 soldiers deserted.');
INSERT INTO "voyages" VALUES (3260, '', 6, '', 'ADRICHEM', 'Kornelis van Velden', 850, NULL, '1726', NULL, NULL, 'A', 'A', '1742-11-22', 'Texel', '1743-03-28', '1743-04-24', true, '1743-07-21', 'Batavia', NULL, 'as master.');
INSERT INTO "voyages" VALUES (3261, '', 5, '', 'HOFVLIET', 'Pieter Lakeman', 1000, NULL, '1729', NULL, NULL, 'R', 'E', '1742-11-22', 'Texel', '1743-03-22', '1743-04-11', true, '1743-10-15', 'Batavia', 7182, 'During the voyage one seafarer became soldier. The HOF-VLIET replaced the W ATERVLIET, wrecked in May 1742 (see 3248).');
INSERT INTO "voyages" VALUES (3262, '', 1, '', 'KLEVERSKERKE', 'Anthonie Marijnissen +', 850, NULL, '1742', NULL, NULL, 'Z', 'Z', '1742-12-12', 'Rammekens', '1743-03-19', '1743-04-09', true, '1743-10-15', 'Batavia', 7244, 'Two seafarers were taken over by an English man-of-war. Anthonie Marijnissen died during the voyage.');
INSERT INTO "voyages" VALUES (3263, '', 3, '', 'ARNESTUN', 'Bastiaan Verdoes', 575, NULL, '1736', NULL, NULL, 'Z', 'A', '1743-03-07', 'Texel', '1743-08-03', '1743-08-23', true, '1743-11-05', 'Batavia', 7188, 'From 30-04 till 13-05-1743 the ship was at S. Tiago. At the Cape one soldier became seafarer,');
INSERT INTO "voyages" VALUES (3264, '', 4, '', 'BATAVIER', 'Marten den Breems', 525, NULL, '1735', NULL, NULL, 'A', 'A', '1743-03-07', 'Texel', '1743-08-02', '1743-08-08', true, '1743-10-22', 'Batavia', 7219, 'the ship called at S. Tiago, where 2 soldiers died.');
INSERT INTO "voyages" VALUES (3265, '', 1, '', 'LEIDERDORP', 'Hendrik Weiland', 600, NULL, '1741', NULL, NULL, 'A', 'A', '1743-03-07', 'Texel', '1743-08-11', '1743-09-28', true, '1743-12-15', 'Batavia', NULL, 'On its way to the Cape the ship called at S. Tiago (30-04 till 13-05-1743). At the Cape 8 seafarers were taken over by the HOOP (see 3272) and 2 seafarers deserted. The LEIDERDORP was laid up in the Indies on 20-08-1748.');
INSERT INTO "voyages" VALUES (3266, '', 2, '', 'WELTEVREDEN', 'Harke Zeres', 850, NULL, '1740', NULL, NULL, 'A', 'A', '1743-03-07', 'Texel', '1743-08-06', '1743-08-23', true, '1743-11-12', 'Batavia', 7199, 'One source mentions Pieter Schildman as master.');
INSERT INTO "voyages" VALUES (3267, '', 3, '', 'KASTEEL VAN WOERDEN', 'Willem Vroom', 850, NULL, '1736', NULL, NULL, 'A', 'A', '1743-03-19', 'Texel', '1743-07-23', '1743-08-18', true, '1743-11-13', 'Ceylon', 3267, 'its first voyage(3077/7057) was called BUVEGNIES. The KASTEEL VAN WOERDEN was laid up in the Indies on 08-10-1744.');
INSERT INTO "voyages" VALUES (3268, '', 3, '', 'HARTENLUST', 'Gijsbert Bonekamp', 650, NULL, '1734', NULL, NULL, 'A', 'R', '1743-03-29', 'Goeree', '1743-08-06', '1743-08-23', true, '1743-11-14', 'Batavia', 7190, NULL);
INSERT INTO "voyages" VALUES (3269, '', 3, '', 'LOVERENDAAL', 'Kornelis Mangelaar', 650, NULL, '1737', NULL, NULL, 'Z', 'Z', '1743-03-30', 'Rammekens', '1743-08-12', '1743-09-21', true, '1743-12-20', 'Batavia', NULL, 'The LOVERENDAAL called at Duins from 11 till 27-04-1743 where at Duins 10 seafarers deserted, one soldier died and the crew was enlarged by one seafarer; 2 soldiers became seafarers. The ship was laid up at Batavia on 13-12-1751.');
INSERT INTO "voyages" VALUES (3270, '', 2, '', 'HUIS TER DUINE', 'Pieter Adriaansz.', 550, NULL, '1739', NULL, NULL, 'Z', 'Z', '1743-04-25', 'Rammekens', '1743-08-06', '1743-09-05', true, '1743-11-12', 'Batavia', 7189, 'The 16 seafarers who disembarked at the Cape included 3 deserters.');
INSERT INTO "voyages" VALUES (3271, '', 3, '', 'STRIJEN', 'Gijsbert van der Blok', 650, NULL, '1735', NULL, NULL, 'D', 'D', '1743-04-25', 'Goeree', '1743-09-14', '1744-10-20', true, '1744-01-03', 'Batavia', 7203, NULL);
INSERT INTO "voyages" VALUES (3272, '', 1, '', 'HOOP', 'Pieter Zwanendrecht', 850, NULL, '1742', NULL, NULL, 'D', 'D', '1743-05-10', 'Goeree', '1743-09-21', '1743-10-12', true, '1744-02-12', 'Batavia', 7220, 'From 15 till 20-06-1743 the ship was at S. Tiago. See also 3265.');
INSERT INTO "voyages" VALUES (3273, '', 3, '', 'RUYVEN', 'Christiaan de Jong', 650, NULL, '1736', NULL, NULL, 'D', 'R', '1743-06-24', 'Goeree', '1743-12-10', '1744-01-11', true, '1744-05-14', 'Batavia', NULL, 'The RUYVEN called at Duins from 28-06 till 01-07-1743. On 11-09-1745 the ship was wrecked on the Ganges.');
INSERT INTO "voyages" VALUES (3274, '', 2, '', 'HEUVEL', 'Daniel ten Velde', 650, NULL, '1740', NULL, NULL, 'A', 'A', '1743-07-03', 'Texel', '1743-12-18', '1744-01-09', true, '1744-05-10', 'Batavia', 7225, 'From 20 till 29-08-1743 the HEUVEL was at S. Tiago. The ship replaced the ENKHUIZEN, lost in 1742 (see 7138).');
INSERT INTO "voyages" VALUES (3275, '', 1, '', 'HOLLANDIA', 'Jan Kelder', 1150, NULL, '1742', NULL, NULL, 'A', 'A', '1743-07-03', 'Texel', NULL, NULL, true, NULL, NULL, NULL, 'HOLLANDIA was wrecked at the Sorlings on 13-07-1743. The wreck was found in 1971; coins from the HOLLANDIA were put up for auction in 1972.');
INSERT INTO "voyages" VALUES (3276, '', 1, '', 'OVERNES', 'Hendrik de Ruyter', 1150, NULL, '1742', NULL, NULL, 'A', 'A', '1743-07-03', 'Texel', '1743-12-08', '1744-01-02', true, '1744-04-11', 'Batavia', 7224, 'From 19 till 29-08-1743 the ship was at S. Tiago where the crew was enlarged by 2 seafarers. During the voyage 2 soldiers became seafarers.');
INSERT INTO "voyages" VALUES (3277, '', 2, '', 'MAARSSEVEEN', 'Koenraad van der Poel', 850, NULL, '1739', NULL, NULL, 'A', 'Z', '1743-07-26', 'Rammekens', '1744-01-15', '1744-02-28', true, '1744-06-27', 'Batavia', 7206, NULL);
INSERT INTO "voyages" VALUES (3278, '', 6, '', 'HOGERSMILDE', 'Otto van Dam', 850, NULL, '1723', NULL, NULL, 'H', 'Z', '1743-08-29', 'Rammekens', '1744-01-18', '1744-02-28', true, '1745-02-25', 'Ceylon', 7228, '3278/7228 Is the sixth voyage of the HOGERSMILDE, which during its first four voyages was called WAPEN VAN HOORN.');
INSERT INTO "voyages" VALUES (3279, '', 1, '', 'VERWACHTING', 'Gerrit van der Tolle', 850, NULL, '1742', NULL, NULL, 'Z', 'Z', '1743-08-29', 'Rammekens', '1744-01-01', '1744-02-05', true, '1744-05-13', 'Batavia', NULL, 'to Surat.');
INSERT INTO "voyages" VALUES (3280, '', 1, '', 'HUIGENWAARD', 'Adam Roos', 850, NULL, '1742', NULL, NULL, 'H', 'H', '1743-09-25', 'Texel', '1744-01-29', '1744-02-12', true, '1744-08-22', 'Batavia', 7247, 'The HUIGENWAARD called at Saldanha Bay, where one craftsmen died.');
INSERT INTO "voyages" VALUES (3281, '', 1, '', 'AKERENDAM', 'Paulus Pieman', 1150, NULL, '1743', NULL, NULL, 'A', 'A', '1743-10-27', 'Texel', '1744-02-24', '1744-03-14', true, '1744-05-27', 'Batavia', 7213, 'and at S. Tiago (29-12-1743 till 05-01-1744). At S. Tiago one soldier deserted.');
INSERT INTO "voyages" VALUES (3282, '', 1, '', 'DUINHOF', 'Kornelis Bommer', 850, NULL, '1743', NULL, NULL, 'A', 'A', '1743-10-27', 'Texel', '1744-03-26', '1744-04-18', true, '1744-06-11', 'Batavia', 7233, 'From 18 till 19-11-1743 the DUINHOF was at Duins.');
INSERT INTO "voyages" VALUES (3283, '', 5, '', 'RUST EN WERK', 'Pieter Jellesz.', 650, NULL, '1734', NULL, NULL, 'D', 'A', '1743-10-27', 'Texel', '1744-04-05', '1744-04-23', true, NULL, 'Batavia', 7209, '22-01-1744).');
INSERT INTO "voyages" VALUES (3284, '', 2, '', 'BOSBEEK', 'Laurens Siewertsz.', 650, NULL, '1741', NULL, NULL, 'A', 'A', '1743-11-27', 'Texel', '1744-03-30', '1744-04-20', true, '1744-06-26', 'Batavia', 7223, '31-12-1743) where 8 seafarers deserted. During the voyage one soldier probably became seafarer.');
INSERT INTO "voyages" VALUES (3285, '', 1, '', 'GERECHTIGHEID', 'Meindert de Beer', 850, NULL, '1742', NULL, NULL, 'E', 'E', '1743-11-27', 'Texel', '1744-04-01', '1744-04-18', true, '1744-07-07', 'Batavia', 7212, 'At the Cape 6 soldiers probably became seafarers.');
INSERT INTO "voyages" VALUES (3286, '', 2, '', 'HECTOR', 'Jan Raay', NULL, 'hoeker', '1738', NULL, NULL, 'Z', 'A', '1743-11-27', 'Texel', '1744-05-26', NULL, true, '1744-05-26', 'The Cape', 7360, 'During the voyage Jan Bop succeeded Jan Raay as master, one source mentions Gerrit Bot. From 26-12-1743 till 06-02-1744 the ship was at Morlaix.');
INSERT INTO "voyages" VALUES (3287, '', 5, '', 'HUTS TE MARQUETTE', 'Paulus Lindenberg', 850, NULL, '1730', NULL, NULL, 'A', 'A', '1743-11-27', 'Texel', '1744-03-27', '1744-04-18', true, '1744-08-06', 'Batavia', NULL, 'One week after its departure from Texel the ship returned (04-12-1743); on 27-12 it sailed out again. The HUTS TE MAR-QUETTE was sold at Batavia on 10-11-1747.');
INSERT INTO "voyages" VALUES (3288, '', 1, '', 'STANDVASTIGHEID', 'Willem de Wijs', 850, NULL, '1743', NULL, NULL, 'R', 'R', '1743-11-27', 'Goeree', '1744-03-17', '1744-04-06', true, '1744-06-22', 'Batavia', 7221, 'On its way to the Cape the ship called at Duins (08-till 13-12-1743) where 2 seafarers deserted, at Dassen Island (17-02 till 06-03-1744), and at Saldanha Bay. During the voyage one soldier probably became seafarer.');
INSERT INTO "voyages" VALUES (3289, '', 2, '', 'TOLSDUIN', 'Maarten van der Meer', 850, NULL, '1741', NULL, NULL, 'A', 'D', '1743-11-27', 'Goeree', '1744-04-12', '1744-05-01', true, NULL, 'Batavia', 7208, '(17-12-1743 till 06-01-1744) where 11 seafarers and 4 soldiers were pressed by the English. During the voyage one soldier became seafarer.');
INSERT INTO "voyages" VALUES (3290, '', 2, '', 'WOITKENSDORP', 'Jurriaan Koperslager', 800, NULL, '1739', NULL, NULL, 'Z', 'A', '1743-11-27', 'Texel', '1744-03-02', '1744-03-21', true, '1744-06-11', 'Batavia', 7211, NULL);
INSERT INTO "voyages" VALUES (3291, '', 2, '', 'KRABBENDIJKE', 'Frans Gassels', 830, NULL, '1738', NULL, NULL, 'Z', 'A', '1743-12-27', 'Texel', '1744-04-15', '1744-05-08', true, '1744-08-07', 'Batavia', 7205, 'At the Cape one stowaway, not registered in the columns, disembarked; one soldier became third meester (counted as seafarer).');
INSERT INTO "voyages" VALUES (3292, '', 2, '', 'DISHOEK', 'Jan Hugo Captijn', 665, NULL, '1735', NULL, NULL, 'Z', 'Z', '1743-12-31', 'Rammekens', '1744-04-14', '1744-05-01', true, '1744-08-22', 'Batavia', 7204, 'From 02 till 04-02-1744 the DISHOEK called at S. Tiago where one seafarer died, another seafarer and one soldier deserted.');
INSERT INTO "voyages" VALUES (3293, '', 3, '', 'OUWERKERK', 'Kornelis Stevens', 540, NULL, '1738', NULL, NULL, 'Z', 'Z', '1743-12-31', 'Rammekens', '1744-05-13', '1744-06-02', true, '1744-09-07', 'Batavia', 7214, 'embarked, two of them died on the way to Batavia.');
INSERT INTO "voyages" VALUES (3294, '', 4, '', 'JONGE WILLEM', 'Jan Akkerveld', 650, NULL, '1731', NULL, NULL, 'Z', 'Z', '1743-12-31', 'Rammekens', '1744-05-04', '1744-05-15', true, '1744-08-17', 'Batavia', NULL, 'S. Tiago where two seafarers died and six soldiers deserted. The ship was laid up in the Indies on 03-06-1749.');
INSERT INTO "voyages" VALUES (3295, '', 5, '', 'SIJBEKARSPEL', 'Hendrik Volkers', 650, NULL, '1729', NULL, NULL, 'H', 'A', '1744-01-09', 'Texel', '1744-04-06', '1744-04-18', true, '1744-07-03', 'Batavia', 7210, '09-01-1744 Was the final date of departure of the SIJBEKAR-SPEL; on 01-01-1744 the ship set out for the first time. but four days later it returned to Texel.');
INSERT INTO "voyages" VALUES (3296, '', 3, '', 'RUITER', 'Bastiaan Mol', 650, NULL, '1736', NULL, NULL, 'E', 'E', '1744-01-09', 'Texel', '1744-06-02', '1744-07-06', true, '1744-09-20', 'Batavia', NULL, 'From 07 till 18-02-1744 the RUITER called at S. Tiago where one seafarer and five soldiers died; the crew was enlarged by one seafarer, taken over from the OUWERKERK (see 3293), and one soldier. At the Cape ten seafarers deserted. The ship was laid up in the Indies on 03-06-1749.');
INSERT INTO "voyages" VALUES (3297, '', 6, '', 'KNAPPENHOF', 'Herman Schutte', 650, NULL, '1731', NULL, NULL, 'A', 'A', '1744-01-11', 'Texel', '1744-05-22', '1744-07-06', true, '1744-09-22', 'Ceylon', 7217, 'The KNAPENHOF called at Duins (16-01 till 03-02-1744). It did not call at the Cape, but at False Bay.');
INSERT INTO "voyages" VALUES (3298, '', 2, '', 'VRIJHEID', 'Adriaan van Dorp+', 650, NULL, '1740', NULL, NULL, 'R', 'D', '1744-05-12', 'Goeree', '1744-11-01', '1744-11-30', true, '1745-04-12', 'Batavia', 7275, NULL);
INSERT INTO "voyages" VALUES (3299, '', 1, '', 'NIEUW VIJVERVREUGD', 'Hendrik Bossen', 1150, NULL, '1742', NULL, NULL, 'Z', 'Z', '1744-05-13', 'Rammekens', '1744-09-14', '1744-10-01', true, '1744-12-06', 'Batavia', NULL, 'During the voyage one soldier became seafarer. The seven passengers were criminals. The NIEUW VIJVERVREUGD exploded in 1746 on the roads of Batavia.');
INSERT INTO "voyages" VALUES (3300, '', 2, '', 'LEEUWERIK', 'Adriaan Laurens', 650, NULL, '1741', NULL, NULL, 'A', 'A', '1744-05-17', 'Texel', '1744-10-11', '1744-11-03', true, '1745-01-25', 'Ceylon', NULL, 'The LEEUWERIK called at S. Tiago (10 till 17-07-1744). In 1748 the ship was wrecked near Macassar.');
INSERT INTO "voyages" VALUES (3301, '', 4, '', 'HUIS TE FOREEST', 'Gerrit Blauwpot', 850, NULL, '1731', NULL, NULL, 'H', 'A', '1744-05-27', 'Texel', '1744-10-12', '1744-11-03', true, '1745-01-11', 'Batavia', NULL, 'Tiago. One of the soldiers became cook''s wain. The 2 seafarers who embarked at the Cape included a master, Kornelis Booys.');
INSERT INTO "voyages" VALUES (3302, '', 4, '', 'NIEUWLAND', 'Jan de Zee', 850, NULL, '1733', NULL, NULL, 'Z', 'H', '1744-06-06', 'Texel', '1744-12-16', '1744-12-28', true, '1745-04-28', 'Batavia', 7238, NULL);
INSERT INTO "voyages" VALUES (3303, '', 4, '', 'DIEMERMEER', 'Christiaan Boord', 850, NULL, '1736', NULL, NULL, 'A', 'A', '1744-07-19', 'Texel', '1745-01-11', '1745-02-09', true, '1745-08-14', 'Ceylon', 7257, 'From 04 till 15-10-1744 the DIEMERMEER was at S. Tiago.');
INSERT INTO "voyages" VALUES (3304, '', 7, '', 'KETEL', 'Kornelis Quack', 810, NULL, '1721', NULL, NULL, 'R', 'R', '1744-07-31', 'Goeree', '1745-04-02', '1745-04-27', true, '1745-07-14', 'Batavia', NULL, 'The KETEL called at Portsmouth from 06-08 till 09-12-1744. See also 3313. According to a Resolution of Gouverneur-Generaal en Raden the ship was sold to Spanish merchants at Manila in 1748.');
INSERT INTO "voyages" VALUES (3305, '', 1, '', 'VOORZICHTIGHEID', 'der Schilde', 850, NULL, '1744', NULL, NULL, 'D', 'D', '1744-10-04', 'Goeree', '1745-05-05', '1745-06-29', true, '1745-09-11', 'Batavia', 7235, 'The VOORZICHTIGHEID did not call at the Cape but at Saldanha Bay.');
INSERT INTO "voyages" VALUES (3306, '', 1, '', 'HUTS TE PERSIJN', 'Jan Koning', 850, NULL, '1743', NULL, NULL, 'R', 'R', '1744-11-06', 'Goeree', '1745-05-25', '1745-06-11', true, '1745-08-17', 'Batavia', 7234, 'One day after its departure the ship returned to Goeree (07-11-1744); it finally set out on 08-12-1744. From 29-12-1744 till 26-01-1745 the ship called at Duins. The HUIS TE PERSIJN did not call at the Cape, but at False Bay (25-05 till 11-06-1745). During the voyage 4 soldiers became seafarers.');
INSERT INTO "voyages" VALUES (3307, '', 3, '', 'HOF VAN DELFT', 'Jan Bloem', 850, NULL, '1739', NULL, NULL, 'D', 'A', '1744-11-06', 'Texel', '1745-03-27', '1745-04-12', true, '1745-06-30', 'Batavia', NULL, 'after its departure the ship returned to Texel (10-11-1744); it finally sailed out on 09-12. The eight passengers included one female slave. The HOF VAN DELFT was sold in the Indies on 17-02-1750.');
INSERT INTO "voyages" VALUES (3308, '', 1, '', 'DIEMEN', 'Barend de Bruin', 850, NULL, '1743', NULL, NULL, 'A', 'A', '1744-11-06', 'Texel', '1745-03-29', '1745-04-16', true, '1745-07-02', 'Batavia', 7239, 'Four days after its departure the DIEMEN returned to Texel (10-11-1744); it finally set out on 09-12-1744. The ship carried f 250,000 in cash.');
INSERT INTO "voyages" VALUES (3309, '', 2, '', 'EENDRACHT', 'Nanning Broeder+', 1150, NULL, '1742', NULL, NULL, 'A', 'A', '1744-11-06', 'Texel', '1745-03-07', '1745-03-22', true, '1745-06-08', 'Batavia', 7251, '7208). Nanning Broeder died, his successor is unknown.');
INSERT INTO "voyages" VALUES (3310, '', 2, '', 'ZAAMSLAG', 'Johannes Band', 900, NULL, '1741', NULL, NULL, 'Z', 'A', '1744-11-06', 'Texel', '1745-03-26', '1745-04-12', true, '1745-06-13', 'Batavia', 7236, 'to Texel on 10-11 ; it finally departed on 09-12-1744. The ship carried f 200,000 in cash.');
INSERT INTO "voyages" VALUES (3311, '', 1, '', 'ZUIDERBURG', 'Christoffel Blom', 1150, NULL, '1743', NULL, NULL, 'A', 'A', '1744-11-06', 'Texel', '1745-03-21', '1745-04-19', true, '1745-07-02', 'Batavia', 7237, 'The ZUIDERBURG returned to Texel on 10-11, its final date of departure was 09-12-1744. The ship carried f 250,000 in cash.');
INSERT INTO "voyages" VALUES (3312, '', 2, '', 'ANNA', 'Hendrik Taal', 600, NULL, '1741', NULL, NULL, 'A', 'A', '1744-12-09', 'Texel', '1745-04-02', '1745-05-02', true, '1745-07-15', 'Batavia', 7294, NULL);
INSERT INTO "voyages" VALUES (3313, '', 1, '', 'BROUWER', 'Gerrit Revndertsz. Vos', 850, NULL, '1743', NULL, NULL, 'H', 'H', '1744-12-09', 'Texel', '1745-04-24', '1745-05-19', true, '1745-08-18', 'Batavia', 7232, 'Some of the 29 persons who disembarked at the Cape went to the KETEL (see 3304); the 16 embarking persons partially came from the KETEL and the LEIDEN (see 3321). One soldier became cook''s wain. The BROUWER replaced the ABBEKERK, wrecked on a return voyage in 1742 (see 7139).');
INSERT INTO "voyages" VALUES (3314, '', 2, '', 'DOMBURG', 'Jan Verhagen', 850, NULL, '1740', NULL, NULL, 'Z', 'A', '1744-12-09', 'Texel', '1745-04-09', '1745-04-27', true, '1745-07-05', 'Batavia', 7241, 'At the Cape one seafarer turned out to be a woman, she continued the voyage as passenger. One soldier became cook''s wain. The DOMBURG carried f 250,000 in cash.');
INSERT INTO "voyages" VALUES (3315, '', 2, '', 'REIGERSDAAL', 'Kornelis van Zwanenburg', 850, NULL, '1738', NULL, NULL, 'A', 'Z', '1744-12-09', 'Rammekens', '1745-04-07', '1745-05-02', true, '1745-07-07', 'Batavia', 7230, NULL);
INSERT INTO "voyages" VALUES (3316, '', 1, '', 'SPANDERSWOUD', 'Hendrik Gerritsz.', 850, NULL, '1744', NULL, NULL, 'A', 'A', '1744-12-09', 'Texel', '1745-03-29', '1745-05-02', true, '1745-07-04', 'Batavia', 7231, 'the ship was at S. Tiago. One of the craftsmen became bottler''s mate. The SPANDERSWOUD carried f 100,000 in cash.');
INSERT INTO "voyages" VALUES (3317, '', 5, '', 'H UIS TE SPIJK', 'Kornelis Vis', 650, NULL, '1732', NULL, NULL, 'D', 'Z', '1744-12-09', 'Rammekens', '1745-04-20', '1745-05-10', true, '1745-07-20', 'Batavia', NULL, 'The HUIS TE SPIJK was laid up and sold at Batavia on 18-07-1752.');
INSERT INTO "voyages" VALUES (3318, '', 4, '', 'SCHELLAG', 'Willem ''t Hoen', 850, NULL, '1736', NULL, NULL, 'Z', 'A', '1745-01-14', 'Texel', '1745-06-01', '1745-06-18', true, '1745-08-17', 'Batavia', 7242, 'From 02 till 13-03-1745 the SCHELLAG was at S. Tiago: at Porto Prayo the crew was enlarged with 16 seafarers and 27 soldiers. These 43 persons came from the SCHONAUWEN (see 3320). The ship carried f 100,000 in cash. It did not call at the Cape but at False Bay.');
INSERT INTO "voyages" VALUES (3319, '', 5, '', 'VREELAND', 'Evert de Haas', 650, NULL, '1735', NULL, NULL, 'A', 'E', '1745-01-14', 'Texel', '1745-07-03', '1745-08-06', true, '1745-10-18', 'Batavia', 14, '-01-1745 Was the final date of departure of the VREELAND: on 06-12-1744 the ship sailed out for the first time, it returned to Texel the same day however. The ship called at Torbay (24 till 29-01-1745) and at Plymouth (05 till 26-02-1745). It did not call at the Cape but at False Bay: the two passengers who embarked there included one slave. The VREELAND was laid up at Batavia on 10-11-1750.');
INSERT INTO "voyages" VALUES (3320, '', 4, '', 'SCHONAUWEN', 'Evert Blinkebijle', 600, NULL, '1729', NULL, NULL, 'A', 'Z', '1745-01-20', 'Rammekens', '1745-06-15', '1745-07-08', true, NULL, 'Batavia', NULL, 'SCHELLAG (see 3318). The SCHONAUWEN did not call at the Cape but at False Bay. The ship was sold at Batavia on 29-01-1754.');
INSERT INTO "voyages" VALUES (3321, '', 1, '', 'LEIDEN', 'Jakob Verleng', 1150, NULL, '1744', NULL, NULL, 'A', 'A', '1745-01-21', 'Texel', '1745-05-11', '1745-05-19', true, '1745-07-24', 'Batavia', 7229, 'At the Cape one seafarer was taken over by the BROUWER (see 3313), another disembarked.');
INSERT INTO "voyages" VALUES (3322, '', 3, '', 'WELTEVREDEN', 'Willem Vrucht', 850, NULL, '1740', NULL, NULL, 'A', 'A', '1745-01-21', 'Texel', '1745-06-15', '1745-07-08', true, '1745-10-05', 'Ceylon', 7243, NULL);
INSERT INTO "voyages" VALUES (3323, '', 3, '', 'HUIS TER DUINE', 'Dirk Quast', 550, NULL, '1739', NULL, NULL, 'Z', 'E', '1745-01-23', 'Texel', '1745-05-03', '1745-05-19', true, '1745-07-21', 'Batavia', 7240, NULL);
INSERT INTO "voyages" VALUES (3324, '', 4, '', 'HARTENLUST', 'Bastiaan Verdoes', 650, NULL, '1734', NULL, NULL, 'A', 'A', '1745-02-26', 'Texel', '1745-06-15', '1745-07-08', true, '1745-09-13', 'Batavia', NULL, 'The HARTENLUST did not call at the Cape but at False Bay. The ship was laid up and sold at Batavia on 11-05-1753.');
INSERT INTO "voyages" VALUES (3325, '', 2, '', 'IDA', 'Simon de Boer', 650, NULL, '1740', NULL, NULL, 'E', 'D', '1745-04-21', 'Goeree', '1745-12-31', '1746-01-24', true, '1746-05-19', 'Batavia', NULL, 'before the IDA reached the Cape 20 seaferers and 11 soldiers were taken over from the DUINENBURG (see 3331). The ship was laid up in the Indies on 11-05-1751. Klaas van den Hoed and Jakob van der Meer are also mentioned in sources as master of the IDA.');
INSERT INTO "voyages" VALUES (3326, '', 4, '', 'NIEUWSTAD', 'Abraham Zwart', 650, NULL, '1733', NULL, NULL, 'H', 'A', '1745-04-21', 'Texel', '1745-09-16', '1745-10-03', true, '1745-12-13', 'Batavia', 7322, 'From 21-05 till 09-06-1745 the NIEUWSTAD called at S. Tiago where 4 seafarers and 1 soldier deserted. At the Cape one seafarer turned out to be a woman; she continued the voyage as a passenger.');
INSERT INTO "voyages" VALUES (3327, '', 3, '', 'POLANEN', 'Gijsbert Bonekamp', 650, NULL, '1737', NULL, NULL, 'A', 'R', '1745-04-21', 'Goeree', '1745-09-01', '1745-09-22', true, '1745-12-13', 'Batavia', 7266, NULL);
INSERT INTO "voyages" VALUES (3328, '', 5, '', 'GOIDSCHALXOORD', 'Gerrit Bot', 850, 'fluit', '1734', NULL, NULL, 'A', 'A', '1745-05-12', 'Texel', '1745-10-15', '1745-11-30', true, '1746-05-07', 'Batavia', NULL, 'soldiers became seafarers. The GOID-SCHALXOORD was laid up at Batavia in 1750.');
INSERT INTO "voyages" VALUES (3329, '', 4, '', 'RIJNHUIZEN', 'Adriaan de Graaf', 650, NULL, '1736', NULL, NULL, 'R', 'H', '1745-05-20', 'Texel', '1745-09-29', '1745-10-20', true, '1746-01-25', 'Batavia', NULL, 'RIJNHUIZEN was laid up at Batavia on 31-12-1751.');
INSERT INTO "voyages" VALUES (3330, '', 1, '', 'SPION', '. Jan Thorn', 150, NULL, '1745', NULL, NULL, 'A', 'A', '1745-06-11', 'Texel', '1745-12-19', '1745-12-29', true, '1746-03-23', 'Batavia', NULL, 'The SPION called at S. Tiago (25 till 30-07-1745), and at the island Annabon (19 till 22-09); from 29 till 31-10 the ship was off Angola.');
INSERT INTO "voyages" VALUES (3331, '', 2, '', 'DUINENBURG', 'Willem van Mensburg', 650, NULL, '1740', NULL, NULL, 'Z', 'E', '1745-06-30', 'Texel', '1745-12-28', '1746-01-15', true, '1746-06-07', 'Batavia', 7258, 'at Saldanha Bay. See also the IDA (3325).');
INSERT INTO "voyages" VALUES (3332, '', 2, '', 'HERSTELDER', 'Jan Mijsters', 1150, NULL, NULL, '1741', NULL, 'A', 'Z', '1745-07-03', 'Rammekens', '1745-11-25', '1745-12-14', true, '1746-03-05', 'Batavia', 7346, 'The HERSTELDER called at Saldanha Bay from 06 till 25-11-1745.');
INSERT INTO "voyages" VALUES (3333, '', 2, '', 'LIS', 'Kornelis Salomonsz.', 600, NULL, '1738', NULL, NULL, 'A', 'H', '1745-08-01', 'Texel', '1745-12-31', '1746-01-16', true, '1746-05-15', 'Batavia', 7263, '29-09-1745): at Porto Prayo 3 seafarers and 3 soldiers deserted. The ship also called at Robben Island (29 till 31-12-1745).');
INSERT INTO "voyages" VALUES (3334, '', 1, '', 'HOF D''UNO', 'Gilles Dabijn', 1150, NULL, '1743', NULL, NULL, 'Z', 'Z', '1745-08-12', 'Rammekens', '1745-12-25', '1746-01-14', true, '1746-05-18', 'Batavia', 7262, 'Tiago where one seafarer and four soldiers deserted.');
INSERT INTO "voyages" VALUES (3335, '', 1, '', 'HERCULES', 'Jan Bijland', 850, NULL, '1743', NULL, NULL, 'Z', 'Z', '1745-09-06', 'Rammekens', '1746-02-03', '1746-03-04', true, '1746-06-21', 'Batavia', 7264, NULL);
INSERT INTO "voyages" VALUES (3336, '', 4, '', 'WESTHOVEN', 'Jan de Jong', 650, NULL, '1734', NULL, NULL, 'Z', 'Z', '1745-09-11', 'Rammekens', '1746-01-19', '1746-02-11', true, '1746-05-15', 'Batavia', 7260, '14 till 22-09 the WESTHOVEN was at Portsmouth where 6 seafarers and 4 soldiers were pressed by the English. The ship also called at Dassen Island from 06 till 18-01-1746. The passenger who embarked at the Cape was a stowaway, found on the REIGERSDAAL (see 7230).');
INSERT INTO "voyages" VALUES (3337, '', 4, '', 'NIEUWERKERK', 'Jan Akkermans', 1135, NULL, '1735', NULL, NULL, 'Z', 'Z', '1745-10-09', 'Rammekens', '1746-03-20', '1746-04-10', true, '1746-07-01', 'Batavia', NULL, 'from Batavia to Banda. Francois Pennink and Reinier van der Luchten also are mentioned in sources as master of the NIEUWERKERK.');
INSERT INTO "voyages" VALUES (3338, '', 4, '', 'ARNESTIJN', 'Jan Hugo Captijn', 575, NULL, '1736', NULL, NULL, 'Z', 'R', '1745-11-11', 'Goeree', '1746-03-02', '1746-03-20', true, '1746-06-20', 'Batavia', 7265, NULL);
INSERT INTO "voyages" VALUES (3339, '', 1, '', 'PASGELD', 'Hendrik Westerbeek', 850, NULL, '1744', NULL, NULL, 'D', 'D', '1745-11-11', 'Goeree', '1746-02-28', '1746-03-25', true, '1746-06-11', 'Batavia', 7281, NULL);
INSERT INTO "voyages" VALUES (3340, '', 2, '', 'FORTUIN', 'Dirk Took', 600, NULL, '1741', NULL, NULL, 'A', 'A', '1745-11-14', 'Texel', '1746-03-14', '1746-04-20', true, '1746-07-01', 'Batavia', 7245, 'The FORTUIN carried f 150,000 in cash.');
INSERT INTO "voyages" VALUES (3341, '', 1, '', 'LEKKERLAND', 'Jan de Boer', 1150, NULL, '1744', NULL, NULL, 'A', 'A', '1745-11-14', 'Texel', '1746-02-04', '1746-02-26', true, '1746-05-15', 'Batavia', 7261, 'The LEKKERLAND carried f 250,000 in cash.');
INSERT INTO "voyages" VALUES (3342, '', 5, '', 'SCHEIJBEEK', 'Martin Grambergen', 850, NULL, '1735', NULL, NULL, 'A', 'A', '1745-11-14', 'Texel', '1746-02-19', '1746-04-03', true, '1746-06-20', 'Batavia', 7259, 'During the voyage, probably in November, 43 soldiers were taken over from the WILDRIJK (see 3343) and other ships. The SCHEIJBEEK carried f 200,000 in cash.');
INSERT INTO "voyages" VALUES (3343, '', 1, '', 'WILDRIJK', 'Kornelis de Nijs', 850, NULL, '1744', NULL, NULL, 'A', 'A', '1745-11-14', 'Texel', '1746-02-14', '1746-04-20', true, NULL, NULL, 7292, 'November, many soldiers, presumably about 40, were taken over by the SCHEIJBEEK (see 3342). The WILDRIJK carried f 145,000 in cash.');
INSERT INTO "voyages" VALUES (3344, '', 3, '', 'SARA JACOBA', 'Jan Reynders', 1100, NULL, '1737', NULL, NULL, 'Z', 'Z', '1745-11-20', 'Rammekens', '1746-03-03', '1746-04-19', true, '1746-07-23', 'Ceylon', NULL, 'The SARA JACOBA was laid up and sold at Batavia on 02-02-1753.');
INSERT INTO "voyages" VALUES (3345, '', 1, '', 'WAAKZAAMHEID', 'Roelof Blok', 850, NULL, '1744', NULL, NULL, 'E', 'E', '1745-12-14', 'Texel', '1746-04-17', '1746-05-03', true, '1746-07-07', 'Batavia', 7332, 'The WAAKZAAAMHEID called at S. Tiago from 21 tilt 26-01-1746.');
INSERT INTO "voyages" VALUES (3346, '', 1, '', 'EINDHOEF', 'Willem Klump', 850, NULL, '1745', NULL, NULL, 'A', 'A', '1745-12-15', 'Texel', '1746-04-01', '1746-05-07', true, '1746-08-19', 'Batavia', 7246, '15-12-1745 Was the final date of departure of the EINDHOEF; on 24-11-1745 the ship set out for the first time but four days later it returned: 20 soldiers disembarked and 30 seafarers were taken over from the HUIS TE RENSBURG (see 3353); the original crew consequently was altered into 83 seafarers and 21 soldiers.');
INSERT INTO "voyages" VALUES (3347, '', 1, '', 'ZEELANDIA', 'Boudewijn Immers', 1150, NULL, '1744', NULL, NULL, 'Z', 'Z', '1746-01-10', 'Rammekens', '1746-06-09', '1746-07-09', true, '1746-10-30', 'Batavia', 7252, 'turned out to be a woman; she continued the voyage as a passenger.');
INSERT INTO "voyages" VALUES (3348, '', 1, '', 'GETROUWIGHEID', 'Herman Zoet', 850, NULL, '1744', NULL, NULL, 'H', 'H', '1746-02-15', 'Texel', '1746-06-22', '1746-07-04', true, '1746-11-08', 'Batavia', 7254, 'Five days after its departure the ship returned to Texel (20-02-1746); it finally set out on 10-03-1746. From 05 till 09-04-1746 the GETROUWIGHEID called at S. Tiago. It did not call at the Cape but at False Bay.');
INSERT INTO "voyages" VALUES (3349, '', 9, '', 'PATMOS', 'Kornelis Arduin', 810, NULL, '1722', NULL, NULL, 'R', 'Z', '1746-03-22', 'Rammekens', '1746-08-31', '1746-10-15', true, '1747-01-09', 'Batavia', NULL, 'Smalle Baei''.');
INSERT INTO "voyages" VALUES (3350, '', 1, '', 'SPARENRIJK', 'Herman Schutte', 850, NULL, '1745', NULL, NULL, 'A', 'A', '1746-03-23', 'Texel', '1746-07-18', '1746-08-08', true, '1746-09-26', 'Ceylon', 7284, '23-03-1746 Was the final date of departure of the SPAREN-RIJK; on 15-02-1746 the ship sailed out for the first time, but five days later it returned. The SPARENRIJK did not call at the Cape but at False Bay.');
INSERT INTO "voyages" VALUES (3351, '', 3, '', 'DISHOEK', 'Nikolaas van Eek', 665, NULL, '1735', NULL, NULL, 'Z', 'R', '1746-03-29', 'Goeree', '1746-07-12', '1746-08-28', true, '1746-11-22', 'Batavia', 7253, 'False Bay.');
INSERT INTO "voyages" VALUES (3352, '', 7, '', 'KNAPPENHOF', 'Jakob Kornelis Warmenhoven', 650, NULL, '1731', NULL, NULL, 'A', 'A', '1746-04-09', 'Texel', '1746-07-12', '1746-07-28', true, '1746-09-30', 'Batavia', NULL, '02-07-1754.');
INSERT INTO "voyages" VALUES (3353, '', 4, '', 'HUIS TE RENSBURG', 'Willem van Westrenen', 850, NULL, '1733', NULL, NULL, 'Z', 'A', '1746-04-09', 'Texel', '1746-07-18', '1746-08-11', true, '1746-11-10', 'Batavia', 7255, '09-04-1746 Was the final date of departure of the HUIS TE RENSBURG; on 24-11-1745 it set out for the first time, but on 27-01-1746 it returned. Thirty seafarers had been taken over by the EINDHOEF (see 3346); the first column indicates the final composition of the crew. The ship did not call at the Cape but at False Bay.');
INSERT INTO "voyages" VALUES (3354, '', 6, '', 'RUST EN WERK', 'Dirk Verduin', 650, NULL, '1734', NULL, NULL, 'D', 'D', '1746-04-09', 'Goeree', '1746-07-24', '1746-08-08', true, '1746-10-11', 'Batavia', 7248, 'The RUST EN W ERK did not call at the Cape but at False Bay.');
INSERT INTO "voyages" VALUES (3355, '', 2, '', 'STANDVASTIGHEID', 'Floris Smit', 850, NULL, '1743', NULL, NULL, 'R', 'A', '1746-04-09', 'Texel', '1746-08-05', '1746-08-28', true, '1746-10-10', 'Batavia', 7256, 'Pieter Schildman was master and that he died before reaching the Cape. From 08 till 15-05-1746 the STANDVASTIGHEID was at Porto Prayo (S. Tiago). The ship did not call at the Cape but at False Bay.');
INSERT INTO "voyages" VALUES (3356, '', 3, '', 'TOLSDUIN', 'Kornelis Booys', 850, NULL, '1741', NULL, NULL, 'A', 'A', '1746-04-09', 'Texel', '1746-07-16', '1746-07-27', true, '1746-10-10', 'Batavia', 7250, 'The four passengers included one slave. The TOLSDUIN called at S. Tiago (03 till 06-05-1746) and at False Bay.');
INSERT INTO "voyages" VALUES (3357, '', 1, '', 'SLOT VAN KAPELLE', 'Pieter Jellesz.', 1150, NULL, '1744', NULL, NULL, 'A', 'A', '1746-04-22', 'Texel', '1746-07-26', '1746-08-08', true, '1746-10-05', 'Batavia', 7249, 'The SLOT VAN KAPELLE did not call at the Cape but at False Bay. The ship carried f 225,000 in cash.');
INSERT INTO "voyages" VALUES (3358, '', 2, '', 'AKERENDAM', 'Hendrik Volkers', 1150, NULL, '1743', NULL, NULL, 'A', 'A', '1746-05-07', 'Texel', '1746-08-31', '1746-09-22', true, '1746-11-13', 'Batavia', 7279, 'was at Duins.');
INSERT INTO "voyages" VALUES (3359, '', 5, '', 'BATAVIER', 'Arnold de la Forcade', 525, NULL, '1735', NULL, NULL, 'A', 'A', '1746-05-07', 'Texel', '1746-10-24', '1746-11-16', true, '1747-01-30', 'Batavia', 7293, '23-05-1746 the BATAVIER was at Duins.');
INSERT INTO "voyages" VALUES (3360, '', 3, '', 'MAARSSEVEEN', 'Herman Quinje', 850, NULL, '1739', NULL, NULL, 'A', 'A', '1746-05-07', 'Texel', '1746-10-20', '1746-11-16', true, '1747-01-30', 'Batavia', NULL, 'The MAARSSEVEEN called at Duins (09 till 23-05-1746) and at S. Tiago (10-06 till 12-07-1746). where the crew was enlarged by 9 French seafarers. In 1748 the ship exploded on a voyage from Banda to Batavia.');
INSERT INTO "voyages" VALUES (3361, '', 6, '', 'WESTKAPELLE', 'Herman van Hoest', 850, NULL, '1730', NULL, NULL, 'Z', 'Z', '1746-05-26', 'Rammekens', '1746-10-26', '1746-11-22', true, '1747-03-02', 'Batavia', NULL, 'See also 3364. In 1751 the WESTKAPELLE was laid up at Bengal.');
INSERT INTO "voyages" VALUES (3362, '', 3, '', 'BOSBEEK', 'Leendert de Bruin', 650, NULL, '1741', NULL, NULL, 'A', 'D', '1746-05-29', 'Goeree', '1746-10-20', '1746-11-17', true, '1747-03-02', 'Batavia', 7267, 'From 07 till 22-07-1746 the BOSBEEK called at S. Tiago, where four soldiers `disembarked'' (they probably died); the crew was enlarged by five French seafarers.');
INSERT INTO "voyages" VALUES (3363, '', 4, '', 'OUWERKERK', 'Bernard Heymans', 540, NULL, '1738', NULL, NULL, 'Z', 'A', '1746-06-01', 'Texel', '1746-10-26', '1746-11-22', true, '1747-03-05', 'Batavia', 7335, 'See also 3364.');
INSERT INTO "voyages" VALUES (3364, '', 1, '', 'DONK', 'Govert van Welle', 875, NULL, '1745', NULL, NULL, 'R', 'R', '1746-06-24', 'Goeree', '1746-11-08', '1746-11-23', true, '1747-02-14', 'Batavia', 7333, '21-08-1746). Some of the 17 persons who disembarked at the Cape were taken over by the WESTKA-PELLE (3361) and the OUWERKERK (3363).');
INSERT INTO "voyages" VALUES (3365, '', 2, '', 'GERECHTIGHEID', 'Kornelis Trappel', 850, NULL, '1742', NULL, NULL, 'E', 'E', '1746-06-25', 'Texel', '1746-12-12', '1747-01-17', true, '1747-05-21', 'Batavia', 7286, 'From 28-06 till 06-07-1746 the ship was at Duins.');
INSERT INTO "voyages" VALUES (3366, '', 6, '', 'SUBEKARSPEL', 'Erasmus Mulder', 650, NULL, '1729', NULL, NULL, 'H', 'H', '1746-07-05', 'Texel', '1746-12-12', '1747-01-17', true, '1747-05-19', 'Batavia', NULL, 'The SIJBEKARSPEL called at S. Tiago from 27-08 till 03-09-1746 where 3 French seafarers embarked. The ship was laid up and sold at Batavia on 11-05-1753.');
INSERT INTO "voyages" VALUES (3367, '', 3, '', 'WOITKENSDORP', 'Kornelis Stevens', 800, NULL, '1739', NULL, NULL, 'Z', 'Z', '1746-07-05', 'Rammekens', '1746-12-24', '1747-02-03', true, '1747-06-02', 'Batavia', 7285, NULL);
INSERT INTO "voyages" VALUES (3368, '', 3, '', 'KRABBENDIJKE', 'Jan Tuman', 830, NULL, '1738', NULL, NULL, 'Z', 'A', '1746-07-24', 'Texel', '1746-12-12', '1747-01-18', true, '1747-08-17', 'Ceylon', 7282, 'The KRABBENDUKE called at Portsmouth from 05 till 21-08-1746.');
INSERT INTO "voyages" VALUES (3369, '', 2, '', 'OVERNES', 'Nikolaas de Beer', 1150, NULL, '1742', NULL, NULL, 'A', 'A', '1746-07-24', 'Texel', '1746-12-12', '1747-01-17', true, '1747-05-07', 'Batavia', 7291, 'The OVERNES called at Portsmouth (05-08 till 21-08-1746 (?)) and at S. Tiago (08 till 14-09-1746).');
INSERT INTO "voyages" VALUES (3370, '', 1, '', 'GUSTAAF WILLEM', 'Huibert Tiebout', 1150, NULL, '1744', NULL, NULL, 'Z', 'Z', '1746-07-31', 'Rammekens', '1747-01-09', '1747-02-03', true, '1747-04-30', 'Batavia', 7280, 'From 13 till 26-10-1746 the GUSTAAF WILLEM called at S. Tiago. After the departure from the Cape two stowaways were found.');
INSERT INTO "voyages" VALUES (3371, '', 5, '', 'BEUKESTIJN', 'Frederik Schouten', 850, NULL, '1734', NULL, NULL, 'A', 'A', '1746-10-19', 'Texel', '1747-02-17', '1747-03-23', true, '1747-06-15', 'Batavia', NULL, 'The BEUKESTIJN carried_f 150,000 in cash. The ship was laid up and sold at Batavia on 11-05-1753.');
INSERT INTO "voyages" VALUES (3372, '', 1, '', 'HAARLEM', 'Hendrik de Ruyter', 1150, NULL, '1745', NULL, NULL, 'A', 'A', '1746-10-19', 'Texel', '1746-11-18', '1747-02-12', true, '1747-04-30', 'Batavia', 7270, 'During the voyage two soldiers became seafarers. The HAAR-LEM carried _/''300,000 in cash.');
INSERT INTO "voyages" VALUES (3373, '', 5, '', 'HUIS TE RENSBURG', 'Jakob Wiebe', 850, NULL, '1733', NULL, NULL, 'A', 'A', '1746-10-19', 'Texel', '1747-01-18', '1747-02-16', true, '1747-08-17', 'Ceylon', 7283, '3373/7283 Is the fifth voyage of this ship, which during its four preceding voyages was called KERKWIJK (3223/7216). The HUTS TE RENSBURG carried f 200,000 in cash.');
INSERT INTO "voyages" VALUES (3374, '', 1, '', 'HUIS TE MANPAD', 'Willem ''t Hoen', 850, NULL, '1745', NULL, NULL, 'A', 'A', '1746-10-19', 'Texel', '1747-02-26', '1747-03-31', true, '1747-06-15', 'Batavia', 7287, 'From 20 till 26-02-1747 the HUIS TE MANPAD called at Robben Island. The ship carried f 250,000 in cash.');
INSERT INTO "voyages" VALUES (3375, '', 1, '', 'OOSTKAPELLE', 'Jan Kakelaar', 850, NULL, '1745', NULL, NULL, 'Z', 'Z', '1746-10-20', 'Rammekens', '1747-02-13', '1747-03-10', true, '1747-05-27', 'Batavia', 7310, 'The OOSTKAPELLE called Robben Island from 03 till 13-02-1747.');
INSERT INTO "voyages" VALUES (3376, '', 6, '', 'NIEUW WALCHEREN', 'Jakob Hogermolen', 850, NULL, '1731', NULL, NULL, 'Z', 'Z', '1746-10-20', 'Rammekens', '1747-02-13', '1747-03-10', true, '1747-05-27', 'Batavia', NULL, 'From 03 till 13-02-1747 the NIEUW WALCHEREN called at Robben Island. The ship was wrecked on the roads of Surat on 24-05-1748.');
INSERT INTO "voyages" VALUES (3377, '', 2, '', 'HOOP', 'Gerrit Reyndertsz. Vos', 850, NULL, '1742', NULL, NULL, 'D', 'H', '1746-11-10', 'Texel', '1747-03-05', '1747-03-31', true, '1747-07-18', 'Batavia', 7271, 'Some of the 16 persons who disembarked at the Cape were taken over by the LEIDEN (see 3382).');
INSERT INTO "voyages" VALUES (3378, '', 1, '', 'ROOSWIJK', 'Jan van Ingen', 1150, NULL, '1746', NULL, NULL, 'A', 'A', '1746-11-10', 'Texel', '1747-02-17', '1747-03-23', true, '1747-08-28', 'Batavia', 7277, NULL);
INSERT INTO "voyages" VALUES (3379, '', 1, '', 'OVERSCHIE', 'Maarten van der Meer', 850, NULL, '1745', NULL, NULL, 'D', 'D', '1746-11-11', 'Goeree', '1747-03-08', '1747-03-31', true, '1747-06-28', 'Batavia', 7272, 'out to be a woman, she continued the voyage as a passenger.');
INSERT INTO "voyages" VALUES (3380, '', 1, '', 'LANGEWIJK', 'Meindert de Beer', 850, NULL, '1745', NULL, NULL, 'E', 'E', '1746-11-15', 'Texel', '1747-03-11', '1747-03-31', true, '1747-06-21', 'Batavia', 7309, NULL);
INSERT INTO "voyages" VALUES (3381, '', 2, '', 'DIEMEN', 'Michiel van Son', 850, NULL, '1743', NULL, NULL, 'A', 'A', '1746-11-22', 'Texel', '1747-03-08', '1747-04-15', true, '1747-07-07', 'Batavia', 7268, 'The four passengers included two female slaves. The DIEMEN carried f 130,000 in cash.');
INSERT INTO "voyages" VALUES (3382, '', 2, '', 'LEIDEN', 'Dirk Wolter van Nimwegen', 1150, NULL, '1744', NULL, NULL, 'A', 'A', '1746-11-22', 'Texel', '1747-03-08', '1747-03-31', true, '1747-06-27', 'Batavia', 7301, 'Sea''. From 30-12-1746 till 05-01-1747 the LEIDEN was at S. Tiago. The ship carried f 150,000 in cash.');
INSERT INTO "voyages" VALUES (3383, '', 2, '', 'ZUIDERBURG', 'Martin den Breems+', 1150, NULL, '1743', NULL, NULL, 'A', 'A', '1746-11-22', 'Texel', '1747-03-19', '1747-04-17', true, '1747-06-27', 'Batavia', 7289, 'Martin den Breems 
INSERT INTO "voyages" VALUES (3384, '', 2, '', 'SPANDERSWOUD', 'Jan du Riets', 850, NULL, '1744', NULL, NULL, 'A', 'Z', '1746-11-25', 'Rammekens', '1747-03-24', '1747-04-19', true, '1747-06-15', 'Batavia', 7288, NULL);
INSERT INTO "voyages" VALUES (3385, '', 1, '', 'OUD BERKENRODE', 'Jan van Thiel', 850, NULL, '1746', NULL, NULL, 'A', 'A', '1747-01-07', 'Texel', '1747-05-21', '1747-06-23', true, '1747-09-21', 'Batavia', NULL, 'The OUD BERKENRODE did not call at the Cape but at False Bay. On 04-12-1747 the ship was wrecked ''in the Bight of Anjer''; most of the cargo and crew was saved.');
INSERT INTO "voyages" VALUES (3386, '', 7, '', 'HOGERSMILDE', 'Herman Laurier', 850, NULL, '1723', NULL, NULL, 'H', 'A', '1747-01-07', 'Texel', '1747-06-18', '1747-07-21', true, '1747-11-02', 'Ceylon', 3386, '/- Is the seventh voyage of this ship, which during its first four voyages was called WAPEN VAN HOORN. The ship was wrecked on a return voyage from Surat to Batavia on 08-06-1751.');
INSERT INTO "voyages" VALUES (3387, '', 2, '', 'VOORZICHTIGHEID', 'Willem de Wijs', 850, NULL, '1743', NULL, NULL, 'D', 'R', '1747-01-07', 'Goeree', '1747-05-10', '1747-06-01', true, '1747-08-03', 'Batavia', 7273, NULL);
INSERT INTO "voyages" VALUES (3388, '', 4, '', 'WELTEVREDEN', 'Jochem Outjes', 850, NULL, '1740', NULL, NULL, 'A', 'A', '1747-01-07', 'Texel', '1747-06-21', '1747-07-21', true, '1747-10-12', 'Batavia', 7276, 'The WELTEVREDEN did not call at the Cape but at False Bay.');
INSERT INTO "voyages" VALUES (3389, '', 5, '', 'VLISSINGEN', 'Adriaan Kakelaar', 650, NULL, '1732', NULL, NULL, 'Z', 'Z', '1747-01-09', 'Rammekens', NULL, NULL, true, NULL, NULL, NULL, 'The VLISSINGEN was lost between patria and the Cape.');
INSERT INTO "voyages" VALUES (3390, '', 3, '', 'DOMBURG', 'Leendert Bonekamp', 850, NULL, '1740', NULL, NULL, 'Z', 'A', '1747-03-03', 'Texel', '1747-06-10', '1747-07-04', true, '1747-09-17', 'Batavia', 7274, 'The DOMBURG did not call at the Cape but at False Bay.');
INSERT INTO "voyages" VALUES (3391, '', 2, '', 'DUINHOF', 'Hendrik Taal', 850, NULL, '1743', NULL, NULL, 'A', 'A', '1747-03-03', 'Texel', '1747-06-17', '1747-07-04', true, '1747-10-14', 'Batavia', 7269, 'the Cape but at False Bay.');
INSERT INTO "voyages" VALUES (3392, '', 1, '', 'HAGEDIS', 'Gerrit de Leeuw', 600, NULL, '1746', NULL, NULL, 'A', 'A', '1747-03-03', 'Texel', '1747-06-17', '1747-07-04', true, '1747-09-13', 'Batavia', NULL, 'did not call at the Cape but at False Bay and Simon''s Bay (17-06 till 04-07-1747). The ship was sold at Batavia on 19-03-1748.');
INSERT INTO "voyages" VALUES (3393, '', 1, '', 'BAARZANDE', 'Martin Haringman', 850, NULL, '1745', NULL, NULL, 'Z', 'Z', '1747-03-22', 'Rammekens', '1747-07-18', '1747-08-08', true, '1747-10-30', 'Batavia', 7278, 'but at False Bay.');
INSERT INTO "voyages" VALUES (3394, '', 4, '', 'HUIS TER DUINE', 'Pieter van Onkhuizen', 550, NULL, '1739', NULL, NULL, 'Z', 'D', '1747-03-23', 'Goeree', '1747-07-09', '1747-07-29', true, '1747-11-09', 'Batavia', 7290, 'The HUIS TER DUINE did not call at the Cape but at False Bay.');
INSERT INTO "voyages" VALUES (3395, '', 1, '', 'JAGER', 'Pieter Tijm', 850, NULL, '1745', NULL, NULL, 'H', 'H', '1747-04-02', 'Texel', '1747-09-19', '1747-10-11', true, '1748-05-17', 'Batavia', 7343, '25-01-1748), and at Lombok (28/9-01-1748).');
INSERT INTO "voyages" VALUES (3396, '', 1, '', 'KASTEEL VAN TILBURG', 'Abraham Zwart', 850, NULL, '1746', NULL, NULL, 'A', 'A', '1747-05-02', 'Texel', '1747-08-22', '1747-09-12', true, '1747-12-02', 'Batavia', 7295, NULL);
INSERT INTO "voyages" VALUES (3397, '', 2, '', 'HUIS TE PERSUN', 'Dirk Bolk', 850, NULL, '1743', NULL, NULL, 'R', 'E', '1747-05-14', 'Texel', '1747-09-23', '1747-11-07', true, '1748-03-06', 'Batavia', NULL, 'In 1748 the HUIS TE PERSIJN was wrecked on a return voyage from Japan.');
INSERT INTO "voyages" VALUES (3398, '', 1, '', 'SCHAKENBOS', 'Jan Joel', 850, NULL, '1746', NULL, NULL, 'R', 'R', '1747-05-19', 'Goeree', '1747-10-16', '1747-11-05', true, '1748-03-07', 'Batavia', 7324, 'From 28-06 till 03-07-1747 the SCHAKENBOS was at S. Tiago.');
INSERT INTO "voyages" VALUES (3399, '', 3, '', 'REIGERSDAAL', 'Johannes Band', 850, NULL, '1738', NULL, NULL, 'A', 'A', '1747-05-31', 'Texel', NULL, NULL, true, NULL, NULL, NULL, 'On 25-10-1747 the REIGERSDAAL was wrecked off the Cape. Wreck discovered.');
INSERT INTO "voyages" VALUES (3400, '', 2, '', 'KLEVERSKERKE', 'Simon de Groot', 850, NULL, '1742', NULL, NULL, 'Z', 'A', '1747-06-17', 'Texel', '1747-11-20', '1747-12-11', true, '1748-03-06', 'Batavia', 7308, 'The KLEVERSKERKE called at S. Tiago, where one seafarer disembarked, another one and one soldier deserted.');
INSERT INTO "voyages" VALUES (3401, '', 2, '', 'BROUWER', 'Jan Tuinman', 850, NULL, '1743', NULL, NULL, 'H', 'H', '1747-06-26', 'Texel', '1747-12-15', '1748-02-07', true, '1748-05-15', 'Batavia', 7307, 'From 17-11 till 07-12-1747 the BROUWER called at Saldanha Bay.');
INSERT INTO "voyages" VALUES (3402, '', 3, '', 'ZAAMSLAG', 'Kornelis Zwanenburg', 900, NULL, '1741', NULL, NULL, 'Z', 'Z', '1747-07-25', 'Rammekens', '1747-12-15', '1748-01-25', true, '1748-06-01', 'Batavia', 7306, 'From 05 till 13-09-1747 the ZAAMSLAG was at `Goeree near Cape Verde''.');
INSERT INTO "voyages" VALUES (3403, '', 1, '', 'NAARSTIGHEID', 'Dirk van der Schilde', 850, NULL, '1746', NULL, NULL, 'D', 'D', '1747-07-28', 'Goeree', '1747-11-14', '1747-12-02', true, '1748-02-29', 'Batavia', 7305, NULL);
INSERT INTO "voyages" VALUES (3404, '', 1, '', 'IMMAGONDA', 'Lambert Toussaint', 850, NULL, '1746', NULL, NULL, 'E', 'E', '1747-08-18', 'Texel', '1748-01-10', '1748-02-07', true, '1748-06-04', 'Batavia', 7304, 'From 27-09 till 01-10-1747 the IMMAGONDA called at S. Tiago where 2 seafarers and 2 soldiers deserted.');
INSERT INTO "voyages" VALUES (3405, '', 5, '', 'SCHELLAG', 'Adriaan Laurens', 850, NULL, '1736', NULL, NULL, 'Z', 'Z', '1747-08-20', 'Rammekens', '1747-12-18', '1748-01-16', true, '1748-05-18', 'Batavia', NULL, 'The SCHELLAG called at S. Tiago from 22-09 till 01-10-1747 where one sailmaker was taken over by the IMMAGONDA (see 3404), another seafarer and 16 soldiers deserted. In 1748, during a return voyage from Japan, the ship was captured by the French.');
INSERT INTO "voyages" VALUES (3406, '', 1, '', 'AMISTELVEEN', 'Molen', 1150, NULL, '1746', NULL, NULL, 'A', 'A', '1747-10-27', 'Texel', '1748-05-09', '1748-05-30', true, '1748-09-18', 'Batavia', 7302, 'From 25-12-1747 till 05-01-1748 the AMSTELVEEN called at S. Tiago. The ship carried f 150,000 in cash.');
INSERT INTO "voyages" VALUES (3407, '', 2, '', 'SLOT VAN KAPELLE', 'Jakob Buis', 1150, NULL, '1745', NULL, NULL, 'A', 'A', '1747-10-27', 'Texel', '1748-05-06', '1748-05-30', true, '1748-10-15', 'Batavia', 7311, 'deserted. The ship carried f 150,000 in cash.');
INSERT INTO "voyages" VALUES (3408, '', 2, '', 'EINDHOEF', 'Jan Otto', 850, NULL, '1745', NULL, NULL, 'A', 'A', '1747-10-27', 'Texel', '1748-04-12', '1748-05-19', true, '1748-09-08', 'Batavia', NULL, 'carried f 100,000 in cash. The EINDHOEF was laid up and sold at Batavia on 31-12-1755.');
INSERT INTO "voyages" VALUES (3409, '', 3, '', 'FORTUIN', 'Jochem Beek', 600, NULL, '1741', NULL, NULL, 'A', 'A', '1747-10-27', 'Texel', '1748-04-06', '1748-05-02', true, '1748-07-07', 'Batavia', 7303, 'and one seafarer embarked. The ship carried f 100.000 in cash.');
INSERT INTO "voyages" VALUES (3410, '', 1, '', 'OSDORP', 'Willem Vrucht', 850, NULL, '1746', NULL, NULL, 'A', 'A', '1747-10-27', 'Texel', '1748-04-27', '1748-05-30', true, '1748-10-12', 'Batavia', 7300, 'OSDORP called at S. Tiago from 23-12-1747 till 03-01-1748 where 5 seafarers and 13 soldiers died or deserted. The ship carried f 100,000 in cash.');
INSERT INTO "voyages" VALUES (3411, '', 1, '', 'VOSMAAR', 'Willem van der Heyden', 850, NULL, '1746', NULL, NULL, 'Z', 'Z', '1748-10-29', 'Rammekens', '1748-04-25', '1748-05-19', true, '1748-10-15', 'Batavia', 7299, 'From 23 till 28-12-1747 the VOSMAAR called at S. Tiago where one seafarer died and two soldiers embarked.');
INSERT INTO "voyages" VALUES (3412, '', 1, '', 'BEVALLIGHEID', 'Arie van der Meer', 850, NULL, '1746', NULL, NULL, 'R', 'R', '1748-01-05', 'Goeree', '1748-04-12', '1748-05-19', true, '1748-09-08', 'Batavia', 7297, 'The BEVALLIGHEID called at Portsmouth (08 till 15-01-1748) where 11 seafarers and 4 soldiers deserted or were pressed by the English.');
INSERT INTO "voyages" VALUES (3413, '', 1, '', 'SLOTEN', 'Arneus Lodewijk Berting', 1150, NULL, '1746', NULL, NULL, 'A', 'A', '1748-01-05', 'Texel', '1748-04-07', '1748-05-19', true, '1748-09-17', 'Batavia', 7329, 'The SLOTEN carried f 150,000 in cash.');
INSERT INTO "voyages" VALUES (3414, '', 1, '', 'SLOTERDIJK', 'David van Elteren', 1150, NULL, '1747', NULL, NULL, 'A', 'A', '1748-01-05', 'Texel', '1748-04-12', '1748-05-19', true, '1748-10-12', 'Batavia', 7298, 'The SLOTERDIJK carried f 150,000 in cash.');
INSERT INTO "voyages" VALUES (3415, '', 4, '', 'TOLSDUIN', 'Bastiaan Verdoes', 850, NULL, '1741', NULL, NULL, 'A', 'A', '1748-01-05', 'Texel', '1748-03-31', '1748-05-19', true, '1748-09-05', 'Batavia', 7296, '130,000 in cash.');
INSERT INTO "voyages" VALUES (3416, '', 3, '', 'EENDRACHT', 'Abraham Haring', 1150, NULL, '1742', NULL, NULL, 'A', 'A', '1748-05-06', 'Texel', '1748-09-06', '1748-10-08', true, '1749-01-22', 'Ceylon', 7330, NULL);
INSERT INTO "voyages" VALUES (3417, '', 2, '', 'HUIGENWAARD', 'Huibert van der Linde', 850, NULL, '1742', NULL, NULL, 'H', 'A', '1748-05-06', 'Texel', '1748-09-06', '1748-09-28', true, '1748-12-26', 'Batavia', 7334, NULL);
INSERT INTO "voyages" VALUES (3418, '', 2, '', 'LEKKERLAND', 'Willem van Westrenen', 1150, NULL, '1744', NULL, NULL, 'A', 'A', '1748-05-06', 'Texel', '1748-09-06', '1748-10-02', true, '1748-12-26', 'Batavia', 7312, 'On the way four seafarers and nine soldiers deserted.');
INSERT INTO "voyages" VALUES (3419, '', 1, '', 'BREDENHOF', 'Frederik Jansz. van Winsum', 850, NULL, '1746', NULL, NULL, 'H', 'H', '1748-05-26', 'Texel', '1748-09-30', '1748-10-20', true, '1749-02-24', 'Batavia', 7313, 'to Texel on 10-05. The two passengers were stowaways found after the departure from the Cape; one of them was the wife of a sergeant.');
INSERT INTO "voyages" VALUES (3420, '', 3, '', 'LIS', 'Willem Hoogland', 600, NULL, '1738', NULL, NULL, 'A', 'A', '1748-05-26', 'Texel', '1748-11-22', '1748-12-28', true, '1749-04-14', 'Batavia', NULL, 'out on 06-05-1748; four days later it returned to Texel after having run aground ''at the Haaks''. The ship was laid up and sold at Batavia on 01-05-1752.');
INSERT INTO "voyages" VALUES (3421, '', 2, '', 'ZEELANDIA', 'Otto van Dam', 1150, NULL, '1744', NULL, NULL, 'Z', 'Z', '1748-05-27', 'Rammekens', '1748-10-15', '1748-11-30', true, '1749-03-26', 'Ceylon', NULL, 'One source mentions Thomas Hardy as master. The ZEELANDIA was wrecked in the Indies.');
INSERT INTO "voyages" VALUES (3422, '', 4, '', 'DISHOEK', 'Leendert van Dijk', 665, NULL, '1735', NULL, NULL, 'Z', 'E', '1748-06-10', 'Texel', '1748-11-20', '1749-01-01', true, '1749-05-30', 'Batavia', NULL, 'The DISHOEK was laid up in the Indies on 31-12-1756.');
INSERT INTO "voyages" VALUES (3423, '', 2, '', 'HERCULES', 'Thijl Jansz. Thijling', 850, NULL, '1743', NULL, NULL, 'Z', 'A', '1748-06-10', 'Texel', '1748-01-16', '1749-01-10', true, '1749-05-01', 'Ceylon', 7327, 'As the BREDENHOF and the LIS (see 3419 and 3420) the HERCULES initially set out on 06-05-1748; four days later the ship returned to Texel after having run aground ''at the Haaks''.');
INSERT INTO "voyages" VALUES (3424, '', 6, '', 'DUINENBURG', 'Jan Frederik Woesthof', 850, NULL, '1733', NULL, NULL, 'A', 'A', '1748-07-04', 'Texel', '1748-11-20', '1748-12-16', true, '1749-04-06', 'Batavia', 3424, '/- Is the sixth voyage of this ship, which during its first four voyages was called KERKWIJK (3223/7216) and during its fifth voyage HUIS TE RENSBURG (3373/7283). The ship was sold at Batavia on 29-01-1754.');
INSERT INTO "voyages" VALUES (3425, '', 1, '', 'WITSBURG', 'Willem van Mensburg', 850, NULL, '1746', NULL, NULL, 'E', 'E', '1748-07-29', 'Texel', '1748-12-23', '1749-02-01', true, '1749-05-18', 'Batavia', 7361, NULL);
INSERT INTO "voyages" VALUES (3426, '', 3, '', 'STANDVASTIGHEID', 'Pieter Lichthart', 850, NULL, '1742', NULL, NULL, 'R', 'R', '1748-08-10', 'Goeree', '1748-11-20', '1748-12-13', true, '1749-03-28', 'Batavia', 7314, NULL);
INSERT INTO "voyages" VALUES (3427, '', 1, '', 'GELDERMALSEN', 'Willem Marreeuw', 1150, NULL, '1746', NULL, NULL, 'Z', 'Z', '1748-08-16', 'Rammekens', '1748-12-18', '1749-01-10', true, '1749-03-31', 'Batavia', 7371, 'The GELDERMALSEN called at S. Tiago from 15 till 30-09-1748.');
INSERT INTO "voyages" VALUES (3428, '', 5, '', 'WESTHOVEN', 'Dirk Verduin', 650, NULL, '1734', NULL, NULL, 'Z', 'D', '1748-08-18', 'Goeree', '1748-12-23', '1749-02-01', true, '1749-06-09', 'Batavia', NULL, 'From 08 till 18-12-1748 the WESTHOVEN was at Robben Island. The ship was sold at Malacca.');
INSERT INTO "voyages" VALUES (3429, '', 2, '', 'GETROUWIGHEID', 'Huibert Vijs', 850, NULL, '1744', NULL, NULL, 'H', 'Z', '1748-09-20', 'Rammekens', '1749-03-05', '1749-04-07', true, '1749-06-27', 'Batavia', 7363, NULL);
INSERT INTO "voyages" VALUES (3430, '', 1, '', 'PRINSES VAN ORANJE', 'Pieter Tornboom', 250, NULL, NULL, '1747', NULL, 'E', 'A', '1748-10-17', 'Texel', '1749-02-18', '1749-03-07', true, '1749-06-17', 'Batavia', 7315, 'The PRINSES VAN ORANJE was bought in England where it had been built by Wells and Stanton, a shipyard on the Thames; the ship arrived at Texel in January 1748.');
INSERT INTO "voyages" VALUES (3431, '', 1, '', 'OUDKARSPEL', 'Ficco Eybo van Rheede', 1150, NULL, '1747', NULL, NULL, 'A', 'A', '1748-11-04', 'Texel', '1749-03-01', '1749-03-20', true, '1749-05-24', 'Batavia', 7392, 'The OUDKARSPEL called at Duins from 10 till 15-11-1748.');
INSERT INTO "voyages" VALUES (3432, '', 3, '', 'HUIS TE RENSBURG', 'Jacob van Wieler', 650, NULL, '1740', NULL, NULL, 'Z', 'A', '1748-11-04', 'Texel', '1749-03-11', NULL, true, '1749-06-13', NULL, 7336, 'was called DUINENBURG (3331/7258). 04-11-1748 Was the final date of departure of the HUIS TE RENS-BURG; the ship initially sailed out on 06-05-1748, but it returned four days later after having run aground `at the Haaks'' (at that moment its name still was DUINENBURG). On 15-11-1748 the ship was at Duins.');
INSERT INTO "voyages" VALUES (3433, '', 1, '', 'SCHUILENBURG', 'Jan Tobias Toon', 300, NULL, '1747', NULL, NULL, 'A', 'A', '1748-11-04', 'Texel', '1749-03-18', NULL, true, '1749-03-18', 'The Cape', NULL, '15-11-1748. For seven years the ship was on service at the Cape: in 1756 it was wrecked on a voyage from the Cape to False Bay.');
INSERT INTO "voyages" VALUES (3434, '', 4, '', 'POLANEN', 'Adriaan Waag +', 650, NULL, '1737', NULL, NULL, 'A', 'A', '1748-11-21', 'Texel', '1749-06-29', '1749-07-26', true, '1749-09-25', 'Batavia', 7325, 'Initially the POLANEN departed on 15-11, but four days later it returned to Texel. The ship called at Duins twice: 11-12-1748 till 09-01-1749 and 22-01 till 22-02-1749. Adriaan Waag did not survive the voyage, Hilde Hendriksz. Hoek succeeded him as master. The ship did not call at the Cape but at False Bay.');
INSERT INTO "voyages" VALUES (3435, '', 2, '', 'OVERSCHIE', 'Leendert de Bruin', 850, NULL, '1745', NULL, NULL, 'D', 'D', '1749-01-07', 'Goeree', '1749-08-18', '1749-09-07', true, '1749-11-22', 'Batavia', 7352, 'of its course by a heavy storm, the ship stranded near Portsmouth; before it got afloat 137 seafarers, 83 soldiers and 12 craftsmen deserted. From 17-02, the day the ship got afloat, till 10-05-1749 the OVER-SCHIE remained at Portsmouth; the diminished crew was enlarged by 113 seafarers, 74 soldiers, 3 craftsmen and 12 passengers, all sent from Delft. During the voyage at least 5 soldiers probably became seafarers.');
INSERT INTO "voyages" VALUES (3436, '', 2, '', 'PASGELD', 'Hendrik van Oudheusden', 850, NULL, '1745', NULL, NULL, 'D', 'R', '1749-01-07', 'Goeree', '1749-07-16', '1749-08-04', true, '1749-09-29', 'Batavia', 7319, 'stranded near Portsmouth; after getting afloat it sailed to Spithead. The PASGELD remained there till 09-02 and, after a vain attempt to depart, from 12-02 till 10-04-1749. The ship did not call at the Cape but at False Bay.');
INSERT INTO "voyages" VALUES (3437, '', 1, '', 'AMSTERDAM', 'Willem Klump', 1150, NULL, '1748', NULL, NULL, 'A', 'A', '1749-01-08', 'Texel', NULL, NULL, true, NULL, NULL, NULL, '15-11-1748 (return to Texel: 19-11) and 21-11 (return: 06-12). On 26-01-1749 the ship ran ashore between Hastings and Beachy Head. The value of silver in coins and bars was f 300,104; most of it was recovered within a few days after the loss.');
INSERT INTO "voyages" VALUES (3438, '', 1, '', 'ELSWOUD', 'Dirk Took', 1150, NULL, '1748', NULL, NULL, 'A', 'A', '1749-01-08', 'Texel', '1649-06-02', '1749-07-03', true, '1749-09-12', 'Batavia', 7317, 'The ELSWOUD called at Duins. 24-01 till 22-02-1749. It did not call at the Cape but at False Bay, 02-06 till 03-07-1749 During the voyage 2 soldiers probably became seafarers.');
INSERT INTO "voyages" VALUES (3439, '', 2, '', 'HAARLEM', 'Herman Schutte', 1150, NULL, '1745', NULL, NULL, 'A', 'A', '1749-01-08', 'Texel', '1749-06-02', '1749-07-03', true, '1749-09-19', 'Ceylon', 7373, 'From 20-01 till 22-02-1749 the HAARLEM called at Duins.');
INSERT INTO "voyages" VALUES (3440, '', 1, '', 'HARTEKAMP', 'Jan Diederik Morel', 650, NULL, '1748', NULL, NULL, 'A', 'A', '1749-01-08', 'Texel', '1749-06-15', '1749-07-03', true, '1749-09-20', 'Batavia', 7318, 'The HARTEKAMP did not call at the Cape but at False Bay; the 8 seafarers who disembarked there included one drummer, 2 seafarers went over to the HUIS TE MANPAD (see 3441).');
INSERT INTO "voyages" VALUES (3441, '', 2, '', 'HUIS TE MANPAD', 'Hendrik de Ruyter', 850, NULL, '1745', NULL, NULL, 'A', 'A', '1749-01-08', 'Texel', '1749-06-02', '1749-07-03', true, '1749-09-05', 'Batavia', 7366, 'From 23-01 till 22-02 the HUIS TE MANPAD was at Duins. It did not call at the Cape but at False Bay; the 2 seafarers who embarked there came from the HARTEKAMP (see 3440).');
INSERT INTO "voyages" VALUES (3442, '', 2, '', 'SPARENDIJK', 'Jan Willemsz. van den Briel', 850, NULL, '1745', NULL, NULL, 'A', 'A', '1749-01-08', 'Texel', '1749-06-16', '1749-07-08', true, '1749-09-09', 'Batavia', 7316, 'The SPARENRIJK called at Spithead twice: 20-01 till 09-02 and 12 till 22-02-1749. The ship did not call at the Cape but at False Bay, 16-06 till 08-07-1749.');
INSERT INTO "voyages" VALUES (3443, '', 2, '', 'HOF D''UNO', 'Gerrit Reyndertsz. Vos', 1150, NULL, '1743', NULL, NULL, 'Z', 'H', '1749-01-08', 'Texel', '1749-07-12', '1749-08-25', true, '1749-11-14', 'Batavia', 7331, 'From 23-01 till 22-02-1749 the HOF D''UNO was at Duins. The ship did not call at the Cape but at False Bay, 12-07 till 25-08-1749.');
INSERT INTO "voyages" VALUES (3444, '', 3, '', 'DIEMEN', 'Jakob Wiebe', 850, NULL, '1743', NULL, NULL, 'A', 'A', '1749-02-07', 'Texel', '1749-06-08', '1749-07-03', true, '1749-09-12', 'Batavia', 7326, 'From 13 till 22-02 the DIEMEN was at Duins. The ship did not call at the Cape but at False Bay from 08-06 till 03-07-1749.');
INSERT INTO "voyages" VALUES (3445, '', 3, '', 'SPANDERSWOUD', 'Jean de la Voie', 850, NULL, '1744', NULL, NULL, 'A', 'A', '1749-02-07', 'Texel', '1749-06-02', '1749-07-03', true, '1749-09-09', 'Batavia', 7328, 'The SPANDERSWOUD called at Duins, 13 till 22-02-1749. It did not call at the Cape but at False Bay from 02-06 till 03-07-1749.');
INSERT INTO "voyages" VALUES (3446, '', 5, '', 'ARNESTUN', 'Jochem Aldertsz. Tarnike', 575, NULL, '1736', NULL, NULL, 'Z', 'E', '1749-02-23', 'Texel', '1749-07-13', '1749-07-26', true, '1749-10-01', 'Batavia', 7321, '26-07-1749. During the voyage one soldier probably became seafarer.');
INSERT INTO "voyages" VALUES (3447, '', 4, '', 'BOSBEEK', 'Jan Sluiskens', 650, NULL, '1741', NULL, NULL, 'A', 'Z', '1749-03-02', 'Rammekens', '1749-07-26', '1749-09-18', true, '1749-11-23', 'Batavia', NULL, 'the BOSBEEK was at S. Tiago. It did not call at the Cape but at Saldanha Bay, 26-07 till 18-09-1749. The ship was laid up and sold at Batavia, 05-01-1754.');
INSERT INTO "voyages" VALUES (3448, '', 6, '', 'SCHEIJBEEK', 'Pieter Perduin', 850, NULL, '1735', NULL, NULL, 'A', 'Z', '1749-03-02', 'Rammekens', '1749-07-15', '1749-08-04', true, '1749-10-05', 'Batavia', NULL, 'The SCHEIJBEEK made two earlier attempts to depart: 21-11-1748 and 10-01-1749 (return to Rammekens: 31-01). From 18-04 till 01-05-1749 the ship was at S. Tiago: 9 soldiers deserted. The SCHEIJBEEK was laid up in India, 09-08-1755.');
INSERT INTO "voyages" VALUES (3449, '', 1, '', 'VREDE', 'Gillis Dabijn', 850, NULL, '1746', NULL, NULL, 'Z', 'Z', '1749-03-02', 'Rammekens', '1749-07-14', '1749-08-04', true, '1749-10-05', 'Batavia', 7365, 'The VREDE made one earlier attempt to depart: 10-01; three weeks later it returned to Rammekens (31-01-1749). From 18-04 till 01-05-1749 the ship called at S. Tiago.');
INSERT INTO "voyages" VALUES (3450, '', 2, '', 'GUSTAAF WILLEM', 'Kornelis Jurriaansz.', 1150, NULL, '1744', NULL, NULL, 'Z', 'Z', '1749-03-11', 'Rammekens', '1749-06-25', '1749-07-26', true, '1749-09-24', 'Batavia', 7320, 'The GUSTAAF WILLEM called at S. Tiago. 23-04 till 01-05-1749. The two passengers were slaves.');
INSERT INTO "voyages" VALUES (3451, '', 2, '', 'WILDRIJK', 'Jan Pakmor', 850, NULL, '1744', NULL, NULL, 'A', 'D', '1749-03-25', 'Goeree', '1749-08-20', '1749-09-19', true, '1749-11-22', 'Batavia', 7393, 'From 07 till 15-05-1749 the WILDRIJK called at S. Tiago. The ship did not call at the Cape but at False Bay from 20-08 till 19-09-1749.');
INSERT INTO "voyages" VALUES (3452, '', 3, '', 'VOORZICHTIGHEID', 'Kornelis Quack', 850, NULL, '1743', NULL, NULL, 'D', 'R', '1749-04-21', 'Goeree', '1749-08-18', '1749-09-02', true, '1749-11-22', 'Batavia', 7372, 'The VOORZICHTIGHEID called at Portsmouth from 24-04 till 07-05-1749.');
INSERT INTO "voyages" VALUES (3453, '', 2, '', 'BAARZANDE', 'Maarten Haringman', 850, NULL, '1745', NULL, NULL, 'Z', 'Z', '1749-02-01', 'Rammekens', '1749-09-18', '1749-09-21', true, '1749-12-11', 'Batavia', 7323, 'Duins (24-04 till 07-05-1749) and at S. Tiago (02 till 07-06-1749).');
INSERT INTO "voyages" VALUES (3454, '', 1, '', 'PRINSES CAROLINA', 'Josias Ruts', 300, NULL, '1748', NULL, NULL, 'Z', 'Z', '1749-05-07', 'Rammekens', '1749-08-30', '1749-09-18', true, '1749-12-11', 'Batavia', 7383, 'From 03 till 07-06-1749 the PRINSES CAROLINA called at S. Tiago.');
INSERT INTO "voyages" VALUES (3455, '', 3, '', 'HOOP', 'Gerrit Munt', 850, NULL, '1742', NULL, NULL, 'D', 'H', '1749-05-07', 'Texel', '1749-10-08', '1749-10-31', true, '1750-01-22', 'Batavia', 7337, 'called at S. Tiago from 05 till 11-06-1749.');
INSERT INTO "voyages" VALUES (3456, '', 4, '', 'KRABBENDIJKE', 'Otto Freudenfeld', 830, NULL, '1738', NULL, NULL, 'Z', 'A', '1749-06-19', 'Texel', '1749-11-10', '1749-12-03', true, '1750-03-07', 'Batavia', 7351, 'KRABBENDIJKE called at S. Tiago. The ship replaced the DIEMERMEER, wrecked in 1747 (see 7257).');
INSERT INTO "voyages" VALUES (3457, '', 1, '', 'WAPEN VAN HOORN', 'Jakob Greef', 850, NULL, '1747', NULL, NULL, 'H', 'H', '1749-06-20', 'Texel', '1749-11-28', '1749-12-15', true, '1750-03-22', 'Batavia', 7350, 'On its way to the Cape the WAPEN VAN HOORN called at Duins (24-06 till 08-07-1749) and at S. Tiago (17 till 24-08-1749).');
INSERT INTO "voyages" VALUES (3458, '', 1, '', 'DEUNISVELD', 'Marten van der Meer', 850, NULL, '1747', NULL, NULL, 'D', 'D', '1749-07-09', 'Goeree', '1749-12-02', '1749-12-15', true, '1750-04-28', 'Batavia', 7411, 'The DEUNISVELD called at S. Tiago from 25-08 till 09-09-1749.');
INSERT INTO "voyages" VALUES (3459, '', 5, '', 'HUIS TER DUINE', 'Arnoldus de Ruyter', 550, NULL, '1739', NULL, NULL, 'Z', 'E', '1749-07-09', 'Texel', '1749-11-01', '1749-11-25', true, '1750-01-24', 'Batavia', 7347, 'From 11 till 17-07-1749 the HUIS TER DUINE was at S. Tiago.');
INSERT INTO "voyages" VALUES (3460, '', 4, '', 'WOITKENSDORP', 'Pieter de Waayer de la Rue', 800, NULL, '1739', NULL, NULL, 'Z', 'Z', '1749-07-09', 'Rammekens', '1749-12-02', '1750-01-25', true, '1750-05-11', 'Batavia', 7357, '11-09-1749.');
INSERT INTO "voyages" VALUES (3461, '', 3, '', 'AKERENDAM', 'Klaas Andersen', 1150, NULL, '1743', NULL, NULL, 'A', 'A', '1749-07-12', 'Texel', '1749-11-29', '1749-12-15', true, '1750-03-13', 'Batavia', 7342, 'probably became soldiers.');
INSERT INTO "voyages" VALUES (3462, '', 5, '', 'HUIS TE RENSBURG', 'Kornelis Leempoel', 850, NULL, '1733', NULL, NULL, 'Z', 'A', '1749-07-12', 'Texel', '1749-12-11', '1750-01-02', true, '1750-04-26', 'Batavia', NULL, 'The HUIS TE RENSBURG called at Duins (15 till 20-07-1749) and at Portsmouth (02 till 25-08-1749). The ship was sold in the Indies, 29-06-1753.');
INSERT INTO "voyages" VALUES (3463, '', 3, '', 'OVERNES', 'Michiel van Son', 1150, NULL, '1742', NULL, NULL, 'A', 'A', '1749-07-12', 'Texel', '1749-12-01', '1749-12-17', true, '1750-03-14', 'Batavia', 7348, 'OVERNES called at Duins (15 till 20-07-1749) and at S. Tiago (01-09 till 13-09-1749).');
INSERT INTO "voyages" VALUES (3464, '', 3, '', 'ZUIDERBURG', 'Gerrit Kadoele', 1150, NULL, '1743', NULL, NULL, 'A', 'A', '1749-07-12', 'Texel', '1749-12-02', '1749-12-17', true, '1750-04-25', 'Batavia', 7368, 'The ZUIDERBURG called at Duins (15 till 20-07-1749) and at S. Tiago (01 till 13-09-1749). During the voyage one soldier probably became seafarer.');
INSERT INTO "voyages" VALUES (3465, '', 3, '', 'ANNA', 'Jakob Regnault', 600, NULL, '1741', NULL, NULL, 'A', 'Z', '1749-08-31', 'Rammekens', '1750-01-12', '1750-01-17', true, '1750-04-23', 'Batavia', NULL, 'From 10 till 17-10-1749 the ANNA was at Porto Prayo on S. Tiago. The ship was sold at Batavia, 30-12-1758.');
INSERT INTO "voyages" VALUES (3466, '', 1, '', 'NIEUWVIJVERVREUGD', 'Jan du Riets', 1150, NULL, '1748', NULL, NULL, 'Z', 'Z', '1749-08-31', 'Rammekens', '1750-01-11', '1750-02-13', true, '1750-05-25', 'Batavia', 7349, 'The NIEUWVIJVERVREUGD called at S. Tiago from 10 till 18-10-1749.');
INSERT INTO "voyages" VALUES (3467, '', 6, '', 'BATAVIER', 'Pieter Pietersz.', 525, NULL, '1735', NULL, NULL, 'A', 'A', '1749-09-08', 'Texel', '1750-01-13', '1750-02-16', true, '1750-05-07', 'Batavia', 7362, 'voyage two soldiers probably became seafarers.');
INSERT INTO "voyages" VALUES (3468, '', 2, '', 'KASTEEL VAN TILBURG', 'Kornelis de Nijs', 850, NULL, '1746', NULL, NULL, 'A', 'A', '1749-09-08', 'Texel', '1750-01-13', '1750-02-07', true, '1750-05-05', 'Batavia', 7366, 'probably became soldier.');
INSERT INTO "voyages" VALUES (3469, '', 1, '', 'BLOEMENDAAL', 'Hendrik Taal', 1150, NULL, '1748', NULL, NULL, 'A', 'A', '1749-09-30', 'Texel', '1750-01-13', '1750-02-07', true, '1750-05-02', 'Batavia', 7374, '08-11-1749. During the voyage one soldier probably became seafarer.');
INSERT INTO "voyages" VALUES (3470, '', 1, '', 'LIEFDE', 'Jochem Outjes', 1150, NULL, '1748', NULL, NULL, 'A', 'A', '1749-09-30', 'Texel', '1750-01-04', '1750-01-21', true, '1750-04-03', 'Batavia', 7341, 'From 02 till 08-11-1749 the LIEFDE was at S. Tiago.');
INSERT INTO "voyages" VALUES (3471, '', 7, '', 'RUST EN WERK', 'Paulus Verschur', 650, NULL, '1734', NULL, NULL, 'D', 'D', '1749-09-30', 'Goeree', '1750-01-11', '1750-01-25', true, '1750-05-05', 'Batavia', NULL, 'Strait Buton, retaken and laid up there. Taken by a ''Maccassaersen vrijman'' called Frans Fransz.');
INSERT INTO "voyages" VALUES (3472, '', 2, '', 'SLOTERDIJK', 'Herman Zoet', 1150, NULL, '1747', NULL, NULL, 'A', 'A', '1749-09-30', 'Texel', '1750-01-14', '1750-02-07', true, '1750-05-04', 'Batavia', 7345, 'During the voyage one soldier probably became seafarer.');
INSERT INTO "voyages" VALUES (3473, '', 1, '', 'SPREEUW', 'Jan de Wit', 150, NULL, '1749', NULL, NULL, 'A', 'A', '1749-10-03', 'Texel', '1750-01-13', '1750-01-28', true, '1750-05-02', 'Batavia', NULL, 'From 01 till 08-11-1749 the SPREEUW called at S. Tiago. The ship was destined to remain on service between Batavia and the Cape.');
INSERT INTO "voyages" VALUES (3474, '', 5, '', 'TOLSDUIN', 'Gerrit de Leeuw', 850, NULL, '1741', NULL, NULL, 'A', 'A', '1749-10-07', 'Texel', '1750-01-04', '1750-01-21', true, '1750-04-22', 'Batavia', NULL, 'The TOLSDUIN was laid up at the Cape, 15-06-1752.');
INSERT INTO "voyages" VALUES (3475, '', 3, '', 'GERECHTIGHEID', 'Martin Lop', 850, NULL, '1742', NULL, NULL, 'E', 'Z', '1749-10-09', 'Rammekens', '1750-02-08', '1750-03-06', true, '1750-07-09', 'Ceylon', 7356, 'The GERECHTIGHEID called at Duins from 15 till 21-10-1749.');
INSERT INTO "voyages" VALUES (3476, '', 1, '', 'ROTTERDAM', 'Jan Martens', 850, NULL, '1748', NULL, NULL, 'R', 'R', '1749-10-13', 'Goeree', '1750-02-05', '1750-02-18', true, '1750-05-12', 'Batavia', 7377, 'The ROTTERDAM called at Duins from 14 till 21-10-1749. and at S. Tiago from 13 till 16-11-1749.');
INSERT INTO "voyages" VALUES (3477, '', 2, '', 'BEVALLIGHEID', 'Maarten de Vos', 850, NULL, '1746', NULL, NULL, 'R', 'D', '1749-11-23', 'Goeree', '1750-03-31', '1750-04-16', true, '1750-06-20', 'Batavia', 7338, 'Some of the 20 persons who disembarked at the Cape went over to the STRALEN (see 3484). During the voyage 3 soldiers probably became seafarers.');
INSERT INTO "voyages" VALUES (3478, '', 2, '', 'VOSMAAR', 'Willem van der Heyden', 850, NULL, '1746', NULL, NULL, 'Z', 'Z', '1749-11-23', 'Rammekens', '1750-04-01', '1750-04-16', true, '1750-06-25', 'Batavia', 7339, NULL);
INSERT INTO "voyages" VALUES (3479, '', 2, '', 'AMSTELVEEN', 'Herman Laurier', 1150, NULL, '1746', NULL, NULL, 'A', 'A', '1749-12-31', 'Texel', '1750-04-16', '1750-05-02', true, '1750-07-03', 'Ceylon', 7370, NULL);
INSERT INTO "voyages" VALUES (3480, '', 4, '', 'FORTUIN', 'Marten Wout', 600, NULL, '1741', NULL, NULL, 'A', 'A', '1749-12-31', 'Texel', '1750-05-06', '1750-06-09', true, '1750-08-18', 'Batavia', NULL, 'The FORTUIN called at S. Tiago from 01 till 08-02-1750. The ship was laid up and sold at Batavia, 31-12-1755.');
INSERT INTO "voyages" VALUES (3481, '', 2, '', 'IMMAGONDA', 'Hendrik Visser', 850, NULL, '1746', NULL, NULL, 'E', 'A', '1749-12-31', 'Texel', '1750-04-22', '1750-05-02', true, '1750-07-18', 'Batavia', 7340, 'The IMMAGONDA called at S. Tiago from 01 till 07-02-1750.');
INSERT INTO "voyages" VALUES (3482, '', 1, '', 'KIEVITSHEUVEL', 'Jochem Beek', 1150, NULL, '1749', NULL, NULL, 'A', 'A', '1749-12-31', 'Texel', '1750-04-01', '1750-04-16', true, '1750-06-21', 'Batavia', 7344, 'The 6 passengers included one female slave. The KIEVIETS-HEUVEL called at S. Tiago from 01 till 07-02-1750.');
INSERT INTO "voyages" VALUES (3483, '', 1, '', 'ADMIRAAL DE RUYTER', 'Bastiaan Verdoes', 1150, NULL, '1749', NULL, NULL, 'A', 'A', '1749-12-31', 'Texel', '1750-04-22', '1750-05-02', true, '1750-07-06', 'Batavia', 7355, NULL);
INSERT INTO "voyages" VALUES (3484, '', 1, '', 'STRALEN', 'Kornelis Trappel', 850, NULL, '1748', NULL, NULL, 'E', 'E', '1749-12-31', 'Texel', '1750-04-01', '1750-04-16', true, '1750-07-06', 'Batavia', 7359, 'During the voyage one soldier probably became seafarer. See also 3477.');
INSERT INTO "voyages" VALUES (3485, '', 1, '', 'HAZE', 'Kornelis de Jonge', 150, NULL, '1749', NULL, NULL, 'A', 'Z', '1750-01-02', 'Rammekens', NULL, NULL, false, '1750-10-29', 'Batavia', NULL, 'Storm and thunder drove the HAZE beyond the Cape; it called at Delagoa from 11-07 till 08-08-1750. The ship was laid up in the Indies on 31-12-1756.');
INSERT INTO "voyages" VALUES (3486, '', 2, '', 'NAARSTIGHEID', 'Kornelis Vis', 850, NULL, '1746', NULL, NULL, 'D', 'Z', '1750-03-26', 'Rammekens', '1750-09-17', '1750-10-12', true, '1750-12-24', 'Batavia', 7387, 'The NAARSTIGHEID called at Duins (twice: from 10 till 21-04 and 26 till 28-04-1750) and at Portsmouth (03 till 17-05-1750).');
INSERT INTO "voyages" VALUES (3487, '', 1, '', 'GOUVERNEUR-GENERAAL', 'Dirk van der Schilde', 850, NULL, '1749', NULL, NULL, 'D', 'D', '1750-04-18', 'Goeree', '1750-08-07', '1750-08-24', true, '1750-11-28', 'Batavia', 7354, 'Prayo on S. Tiago (19 till 23-05-1750). It did not call at the Cape but at False Bay from 07 till 24-08-1750.');
INSERT INTO "voyages" VALUES (3488, '', 2, '', 'OOSTKAPELLE', 'Gijsbert Bonekamp', 850, NULL, '1745', NULL, NULL, 'Z', 'R', '1750-04-18', 'Goeree', '1750-08-10', '1750-08-25', true, '1750-12-20', 'Batavia', 7358, 'The OOSTKAPELLE called at S. Tiago from 16 till 21-05-1750. During the voyage one soldier probably became seafarer.');
INSERT INTO "voyages" VALUES (3489, '', 3, '', 'BROUWER', 'Adriaan de Graaf', 850, NULL, '1743', NULL, NULL, 'H', 'H', '1750-04-19', 'Texel', NULL, NULL, false, '1750-10-10', 'Batavia', 7353, 'From 19 till 27-05-1750 the BROUWER was at S. Tiago.');
INSERT INTO "voyages" VALUES (3490, '', 3, '', 'KLEVERSKERKE', 'Willem ''t Hoen', 850, NULL, '1742', NULL, NULL, 'Z', 'A', '1750-04-21', 'Texel', '1750-07-31', '1750-08-24', true, '1750-11-08', 'Batavia', NULL, 'disembarked at Batavia. As appears from a resolution of gouverneur-generaal en raden the KLEVERSKERKE was wrecked during a voyage to Macassar in 1761.');
INSERT INTO "voyages" VALUES (3491, '', 2, '', 'LANGEWIJK', 'Wouter Abraham Brake', 850, NULL, '1745', NULL, NULL, 'E', 'A', '1750-04-21', 'Texel', '1750-08-03', '1750-09-04', true, '1750-12-23', 'Batavia', 7395, 'The LANGEWIJK called at Duins (26 till 29-04) and at S. Tiago (25 till 28-05-1750). It did not call at the Cape but at False Bay The 52 soldiers who disembarked at Batavia included 7 gunners');
INSERT INTO "voyages" VALUES (3492, '', 3, '', 'LEIDEN', 'Frederik Schouten', 1150, NULL, '1744', NULL, NULL, 'A', 'A', '1750-04-21', 'Texel', '1750-08-03', '1750-08-24', true, '1750-10-31', 'Batavia', 738, '28-04-1750) and at S. Tiago (22 till 27-05-1750). It did no call at the Cape but at False Bay. During the voyage one soldier probably became seafarer.');
INSERT INTO "voyages" VALUES (3493, '', 1, '', 'MEERVLIET', 'Pieter Frederik van Heyne', 850, 'fluit', '1749', NULL, NULL, 'A', 'A', '1750-04-21', 'Texel', '1750-08-05', '1750-09-12', true, '1751-01-08', 'Batavia', 737, 'called at Duins from 26 till 29-04-1750.');
INSERT INTO "voyages" VALUES (3494, '', 1, '', 'ADMIRAAL TROMP', 'Jakob Klaasz.', 250, NULL, '1749', NULL, NULL, 'R', 'R', '1750-04-21', 'Goeree', '1750-07-31', '1750-08-09', true, '1750-10-19', 'Batavia', NULL, 'From 18 till 20-05-1750 the ADMIRAAL TROMP was at S. Tia go. It did not call at the Cape but at False Bay, 31-07 till 09-08 1750. The ship was sold in the Indies on 25-08-1763.');
INSERT INTO "voyages" VALUES (3495, '', 4, '', 'ZAAMSLAG', 'Ilogermoien +', 900, NULL, '1741', NULL, NULL, 'Z', 'Z', '1750-04-21', 'Rammekens', '1751-01-05', '1751-02-03', true, '1751-05-24', 'Batavia', 7375, 'The 92 soldiers who embarked at the Rammekens included 10 gunners; they disembarked at Batavia. The ZAAMSLAG called at S. Tiago (from 22 till 27-05-1750) and, after a vain attempt to round Cape Augustin, at S. Angra on Terceira (from 26-08 till 24-09-1750). Jakob Hogermolen died before reaching the Cape: Leendert Fruit van Hertog succeeded him as master. The ship also called at Bantam, where 64 soldiers disembarked.');
INSERT INTO "voyages" VALUES (3496, '', 2, '', 'OSDORP', 'Joost Meeuwsz.', 850, NULL, '1746', NULL, NULL, 'A', 'E', '1750-05-09', 'Texel', '1750-12-09', '1751-01-12', true, '1751-05-18', 'Batavia', 7419, 'After having lost its rudder on the Flemish Banks, 10-05. the OS-DORP called at Duins (from 13-05 till 21-07-1750). This delay was due to a mutiny. 19 Mutineers were taken over by a man-of-war. The OSDORP also called at Bantam, where 52 soldiers disembarked.');
INSERT INTO "voyages" VALUES (3497, '', 1, '', 'VRIJBURG', 'Huibert Tiebout', 1150, NULL, '1748', NULL, NULL, 'Z', 'Z', '1750-05-18', 'Rammekens', '1750-09-19', '1750-10-26', true, '1751-01-03', 'Batavia', 7422, 'The 119 soldiers who embarked at Rammekens included 11 gunners; they all disembarked at Batavia.');
INSERT INTO "voyages" VALUES (3498, '', 1, '', 'OOSTHUIZEN', 'Jan Tuinman', 850, NULL, '1749', NULL, NULL, 'H', 'H', '1750-05-22', 'Texel', '1751-11-18', '1751-12-11', true, '1752-03-03', 'Batavia', 7400, 'till 04-12-1750): 21 seafarers, 3 soldiers and 2 craftsmen disembarked or deserted. The ship also called at Surinam (from 21-02 till 10-05-1751): 28 seafarers and 13 soldiers deserted, one chief mate and 4 soldiers embarked. From 18-07 till 13-08-1751 the OOSTHUIZEN was at S. Tiago: 2 seafarers and 3 soldiers went ashore, 4 seafarers were taken over from the LUCHTENBURG (see 3525) and the TULPENBURG (see 3526). Some of the 4 seafarers who disembarked at the Cape went to the LUCHTENBURG.');
INSERT INTO "voyages" VALUES (3499, '', 4, '', 'STANDVASTIGHEID', 'Jakob Buis', 850, NULL, '1742', NULL, NULL, 'R', 'D', '1750-09-02', 'Goeree', '1750-12-29', '1751-01-24', true, '1751-05-18', 'Batavia', 7401, 'The 6 passengers who embarked at the Cape were bandits. The STANDVASTIGHEID called at Bantam, where 62 soldiers went ashore.');
INSERT INTO "voyages" VALUES (3500, '', 3, '', 'LEKKERLAND', 'Jan Kakelaar', 1150, NULL, '1744', NULL, NULL, 'A', 'Z', '1750-09-10', 'Rammekens', '1751-01-08', '1751-02-03', true, '1751-05-18', 'Batavia', 7426, 'From 24-10 till 4-11-1750 the LEKKERLAND called at S. Tiago. At Bantam 71 soldiers disembarked.');
INSERT INTO "voyages" VALUES (3501, '', 2, '', 'HARTEKAMP', 'Pieter Tijm', 650, NULL, '1748', NULL, NULL, 'A', 'H', '1750-09-21', 'Texel', '1751-02-08', '1751-02-22', true, '1751-06-20', 'Batavia', 7429, 'The HARTEKAMP called at Duins (25-09 till 04-10), and at S. Tiago (11 till 18-11-1750).');
INSERT INTO "voyages" VALUES (3502, '', 2, '', 'BREDENHOF', 'Simon Rood', 850, NULL, '1746', NULL, NULL, 'H', 'E', '1750-10-06', 'Texel', '1751-01-31', '1751-02-16', true, '1751-06-26', 'Batavia', 7363, 'In two sources Frederik 
INSERT INTO "voyages" VALUES (3503, '', 2, '', 'ELSWOUD', 'Jan Willemsz, van den Briel', 1150, NULL, '1748', NULL, NULL, 'A', 'A', '1750-10-06', 'Texel', '1751-01-29', '1751-02-16', true, '1751-05-18', 'Batavia', 7398, 'Bantam.');
INSERT INTO "voyages" VALUES (3504, '', 2, '', 'SLOTEN', 'Jan Diederik Morel', 1150, NULL, '1746', NULL, NULL, 'A', 'A', '1750-10-06', 'Texel', '1751-01-21', '1751-02-09', true, '1751-05-18', 'Batavia', 7386, 'SLOTEN called at Bantam, where 93 soldiers went ashore.');
INSERT INTO "voyages" VALUES (3505, '', 3, '', 'SPARENRIJK', 'Jan Tobias Toon', 850, NULL, '1745', NULL, NULL, 'A', 'A', '1750-10-06', 'Texel', '1751-01-28', '1751-02-09', true, '1751-05-25', 'Batavia', 7417, 'From 11 till 17-11-1750 the SPARENRIJK called at S. Tiago.');
INSERT INTO "voyages" VALUES (3506, '', 3, '', 'SLOT VAN KAPELLE', 'Jakob van Wieler', 1150, NULL, '1745', NULL, NULL, 'A', 'A', '1750-10-18', 'Texel', '1751-01-23', '1751-02-09', true, '1751-06-04', 'Batavia', 7428, NULL);
INSERT INTO "voyages" VALUES (3507, '', 1, '', 'MIDDELBURG', 'Kornelis van Zwanenburg', 1150, NULL, '1749', NULL, NULL, 'Z', 'Z', '1750-10-18', 'Rammekens', '1751-02-10', '1751-03-23', true, '1751-07-10', 'Batavia', 7414, 'The MIDDELBURG called at S. Tiago from 28-11 till 08-12-1750.');
INSERT INTO "voyages" VALUES (3508, '', 1, '', 'ROZENBURG', 'Molen', 1150, NULL, '1749', NULL, NULL, 'A', 'A', '1750-10-18', 'Texel', '1751-01-23', '1751-02-09', true, '1751-07-10', 'Batavia', 7420, NULL);
INSERT INTO "voyages" VALUES (3509, '', 1, '', 'GIESSENBURG', 'David van Elteren', 1150, NULL, '1749', NULL, NULL, 'A', 'A', '1750-11-18', 'Texel', '1751-03-21', '1751-04-13', true, '1751-07-10', 'Batavia', 7394, 'The 6 passengers included 3 female slaves. The GIESSEN-BURG called at Duins (20 till 28-11-1750) and at S. Tiago (25-12-1750 till 02-01-1751).');
INSERT INTO "voyages" VALUES (3510, '', 3, '', 'GUSTAAF WILLEM', 'Abraham Zwart', 1150, NULL, '1744', NULL, NULL, 'Z', 'A', '1750-11-18', 'Texel', '1751-04-01', '1751-04-21', true, '1751-07-26', 'Batavia', 7424, 'The GUSTAAF WILLEM called at Duins (20 till 28-11-1750) and at S. Tiago (25-12-1750 till 02-01-1751). At Bantam 122 seafarers and 85 soldiers disembarked. During the voyage one soldier probably became a seafarer.');
INSERT INTO "voyages" VALUES (3511, '', 3, '', 'PASGELD', 'Klaas van den Hoed', 850, NULL, '1745', NULL, NULL, 'D', 'D', '1750-11-18', 'Goeree', '1751-01-28', '1751-02-09', true, '1751-05-18', 'Batavia', 7382, '75 soldiers went ashore.');
INSERT INTO "voyages" VALUES (3512, '', 1, '', 'NOORD NIEUWLAND', 'Hendrik van Oudheusden', 880, NULL, '1749', NULL, NULL, 'R', 'R', '1750-11-19', 'Goeree', '1751-01-29', '1751-02-15', true, '1751-05-26', 'Batavia', 7381, 'seafarer.');
INSERT INTO "voyages" VALUES (3513, '', 4, '', 'DIEMEN', 'Simon de Groot', 850, NULL, '1743', NULL, NULL, 'A', 'A', '1750-12-04', 'Texel', '1751-04-27', '1751-05-08', true, '1751-09-12', 'Bengal', 7368, 'transported to Bengal.');
INSERT INTO "voyages" VALUES (3514, '', 1, '', 'RUYSKESTEIN', 'Willem Klump', 850, NULL, '1749', NULL, NULL, 'A', 'A', '1750-12-04', 'Texel', '1751-04-30', '1751-05-13', true, '1751-08-12', 'Batavia', 7444, 'From 10 till 26-12-1750 the RUYSKESTEIN called at Duins.');
INSERT INTO "voyages" VALUES (3515, '', 1, '', 'LUXEMBURG', 'Jakob Wiebe', 1150, NULL, '1750', NULL, NULL, 'A', 'A', '1750-12-26', 'Texel', '1751-04-27', '1751-05-08', true, '1751-07-08', 'Ceylon', 7390, 'The LUXEMBURG carried 20 cases tilled with silver, destined for Bengal (see also 3513).');
INSERT INTO "voyages" VALUES (3516, '', 1, '', 'LYCOCHTON', 'Jochem Albertsz. Tarnike', 880, NULL, '1749', NULL, NULL, 'E', 'E', '1750-12-26', 'Texel', '1751-04-27', '1751-05-13', true, '1751-07-20', 'Batavia', 7408, 'The LYCOCHTON called at Duins (06 till 14-02-1751) and at Bantam, where 58 soldiers disembarked.');
INSERT INTO "voyages" VALUES (3517, '', 5, '', 'NIEUWSTAD', 'Jan Dekker', 650, NULL, '1733', NULL, NULL, 'H', 'H', '1750-12-26', 'Texel', '1751-05-02', '1751-05-14', true, '1751-07-26', 'Batavia', NULL, 'During the voyage two soldiers probably became seafarers. The NIEUWSTAD was sold in the Indies on 28-06-1754.');
INSERT INTO "voyages" VALUES (3518, '', 4, '', 'SPANDERSWOUD', 'Pieter Tornboom', 850, NULL, '1744', NULL, NULL, 'A', 'A', '1750-12-26', 'Texel', '1751-04-19', '1751-05-05', true, '1751-07-12', 'Ceylon', NULL, 'The SPANDERSWOUD carried 20 cases filled with silver, destined for Bengal (see also 3513).');
INSERT INTO "voyages" VALUES (3519, '', 6, '', 'ARNESTUN', 'Adriaan van den Boer', 650, NULL, '1736', NULL, NULL, 'Z', 'Z', '1751-01-03', 'Rammekens', '1751-04-25', '1751-05-08', true, '1751-07-14', 'Ceylon', NULL, 'In 1757 the ARNESTIJN was laid up and sold at Batavia.');
INSERT INTO "voyages" VALUES (3520, '', 3, '', 'HOF D''UNO', 'Samuel Wanjon', 1150, NULL, '1743', NULL, NULL, 'H', 'Z', '1751-02-01', 'Rammekens', '1751-05-24', '1751-06-18', true, '1751-10-08', 'Batavia', 7409, 'From 09 till 17-03-1751 the HOF D''UNO was at S. Tiago. The ship did not call at the Cape but at False Bay');
INSERT INTO "voyages" VALUES (3521, '', 2, '', 'SCHAKENBOS', 'Dirk Klein', 850, NULL, '1746', NULL, NULL, 'R', 'R', '1751-04-12', 'Goeree', '1751-07-31', '1751-08-14', true, '1751-10-18', 'Batavia', NULL, 'The SCHAKENBOS did not call at the Cape, but at False Bay. During the voyage one soldier probably became a seafarer. On 17-02-1752 the SCHAKENBOS was wrecked in Manipa Strait.');
INSERT INTO "voyages" VALUES (3522, '', 3, '', 'BAARZANDE', 'Gerrit Bot', 850, NULL, '1745', NULL, NULL, 'Z', 'A', '1751-04-28', 'Texel', '1751-08-16', '1751-09-06', true, '1751-11-11', 'Batavia', 7379, 'The BAARZANDE called at S. Tiago from 05 till 08-07-1751.');
