INSERT INTO "voyages" VALUES (3525, '', 1, '', 'LUCHTENBURG', 'Gerrit Reyndertsz. Vos', 880, NULL, '1750', NULL, NULL, 'H', 'H', '1751-05-11', 'Texel', '1751-11-12', '1751-12-17', true, '1752-07-02', 'Batavia', 7412, 'The LUCHTENBURG called at S. Tiago from 20-07 till 12-08-1751.');
