INSERT INTO "voyages" VALUES (3528, '', 1, '', 'NIEUW NIEUWERKERK', 'Jan de Wever', 1150, NULL, '1749', NULL, NULL, 'Z', 'Z', '1751-07-04', 'Rammekens', '1751-12-16', '1752-01-26', true, '1752-05-01', 'Batavia', 7391, 'From 30-08 till 09-09-1751 the ship called at S. Tiago.');
INSERT INTO "voyages" VALUES (3529, '', 2, '', 'WAAKZAAMHEID', 'Christoffel Alwel', 850, NULL, '1744', NULL, NULL, 'E', 'E', '1751-08-27', 'Texel', '1752-01-09', '1752-01-26', true, '1752-04-15', 'Batavia', 7395, 'The WAAKZAAMHEID called at S. Tiago from 07 till 14-10-1751.');
INSERT INTO "voyages" VALUES (3530, '', 1, '', 'AMSTELLAND', 'Hilde Hendriksz. Hoek', 850, NULL, '1750', NULL, NULL, 'A', 'A', '1751-09-07', 'Texel', NULL, NULL, true, NULL, NULL, NULL, 'AMSTELLAND ran ashore at the island Sylt.');
INSERT INTO "voyages" VALUES (3531, '', 3, '', 'VOSMAAR', 'Klaas Droogsteen', 850, NULL, '1746', NULL, NULL, 'Z', 'R', '1751-09-27', 'Goeree', '1752-02-08', '1752-02-20', true, '1752-06-07', 'Batavia', 7402, 'Before reaching Batavia the VOSMAAR called at Bantam. where 66 soldiers disembarked.');
INSERT INTO "voyages" VALUES (3532, '', 3, '', 'HUIGENWAARD', 'Kornelis Eike', 850, NULL, '1742', NULL, NULL, 'H', 'A', '1751-10-05', 'Texel', '1752-02-08', '1752-03-01', true, '1752-06-16', 'Batavia', 7385, 'On 07-09 the HUIGENWAARD set out for the first time, but three days later it returned to Texel. The ship called at S. Tiago from 29-11 till 04-12-1751.');
INSERT INTO "voyages" VALUES (3533, '', 2, '', 'KIEVIETSHEUVEL', 'Beek', 1150, NULL, '1749', NULL, NULL, 'A', 'A', '1751-10-05', 'Texel', '1752-02-11', '1752-03-04', true, '1752-08-12', 'Ceylon', 7405, NULL);
INSERT INTO "voyages" VALUES (3534, '', 2, '', 'LIEFDE', 'Jochem Outjes', 1150, NULL, '1748', NULL, NULL, 'A', 'A', '1751-10-05', 'Texel', '1752-01-23', '1752-02-12', true, '1752-05-22', 'Batavia', 7476, 'seafarer.');
INSERT INTO "voyages" VALUES (3535, '', 4, '', 'HUIS TE RENSBURG', 'Jan Hover', 650, NULL, '1740', NULL, NULL, 'Z', 'A', '1751-10-05', 'Texel', '1752-02-11', '1752-03-04', true, '1752-07-01', 'Batavia', NULL, 'Texel. It called at Duins (19-10 till 21-10) and at S. Tiago (27 till 30-11-1751). At Bantam 54 soldiers disembarked. During the voyage one soldier probably became a seafarer. 3535/- Is the fourth voyage of this ship. which during its first two voyages was called DUINENBURG (see 3331/7258); it was laid up and sold at Batavia on 11-05-1753.');
INSERT INTO "voyages" VALUES (3536, '', 3, '', 'BEVALLIGHEID', 'Gabriel Keizer', 850, NULL, '1746', NULL, NULL, 'R', 'D', '1751-10-21', 'Goeree', '1752-01-22', '1752-02-16', true, '1752-05-25', 'Batavia', 7396, NULL);
INSERT INTO "voyages" VALUES (3537, '', 1, '', 'BOSSCHENHOVE', 'Dirk Took', 1150, NULL, '1750', NULL, NULL, 'A', 'A', '1751-10-23', 'Texel', '1752-01-25', '1752-02-24', true, '1752-06-06', 'Batavia', 7427, 'soldiers disembarked.');
INSERT INTO "voyages" VALUES (3538, '', 2, '', 'JAGER', 'Jakob Leertouwer', 850, NULL, '1745', NULL, NULL, 'H', 'H', '1751-10-23', 'Texel', '1752-01-22', '1752-02-12', true, '1752-05-05', 'Batavia', 7388, 'were handed over to the law.');
INSERT INTO "voyages" VALUES (3539, '', 1, '', 'SNOEK', 'Kornelis Jurriaansz.', 880, NULL, '1750', NULL, NULL, 'Z', 'Z', '1751-10-23', 'Rammekens', '1752-01-26', '1752-03-14', true, '1752-05-29', 'Batavia', 7446, 'The 5 passengers who embarked at Rammekens included 2 slaves. During the voyage one soldier probably became a seafarer.');
INSERT INTO "voyages" VALUES (3540, '', 1, '', 'SPAARZAAMHEID', 'Willem Vrucht', 1150, NULL, '1750', NULL, NULL, 'A', 'A', '1751-10-23', 'Texel', '1752-01-24', '1752-02-18', true, '1752-06-07', 'Batavia', 7462, 'The SPAARZAAMHEID called at Bantam, where 75 soldiers went ashore.');
INSERT INTO "voyages" VALUES (3541, '', 1, '', 'VOORLAND', 'Herman Zoet', 1150, NULL, '1750', NULL, NULL, 'A', 'A', '1751-10-23', 'Texel', '1752-01-22', '1752-02-16', true, '1752-05-22', 'Batavia', 7407, 'During the voyage 17 soldiers probably became seafarers.');
INSERT INTO "voyages" VALUES (3542, '', 2, '', 'NIEUWVIJVERVREUGD', 'Martin Haringman', 1150, NULL, '1748', NULL, NULL, 'Z', 'Z', '1751-10-23', 'Rammekens', '1752-02-03', '1752-04-03', true, '1752-07-13', 'Batavia', 7389, NULL);
INSERT INTO "voyages" VALUES (3543, '', 4, '', 'AKERENDAM', 'Klaas Andersen', 1150, NULL, '1743', NULL, NULL, 'A', 'A', '1751-11-07', 'Texel', '1752-03-29', '1752-04-22', true, '1752-07-25', 'Batavia', 7416, 'The AKERENDAM called at S. Tiago from 31-12-1751 till 06-01-1752.');
