INSERT INTO "voyages" VALUES (3545, '', 3, '', 'IMMAGONDA', 'Hendrik Visser', 850, NULL, '1746', NULL, NULL, 'E', 'A', '1751-12-19', 'Texel', '1752-04-01', '1752-04-29', true, NULL, 'Bengal', 7425, NULL);
INSERT INTO "voyages" VALUES (3546, '', 3, '', 'SLOTERDIJK', 'Gillis Dabijn', 1150, NULL, '1747', NULL, NULL, 'A', 'Z', '1751-12-19', 'Rammekens', '1752-04-15', '1752-05-21', true, '1752-07-26', 'Batavia', 7437, NULL);
INSERT INTO "voyages" VALUES (3547, '', 6, '', 'HUIS TER DUINE', 'Jan Statema', 650, NULL, '1739', NULL, NULL, 'Z', 'A', '1752-01-12', 'Texel', '1752-05-05', '1752-06-04', true, '1752-08-06', 'Batavia', NULL, 'On 30-12-1751 the HUIS TER DUINE set out for the first time, but three days later it returned to Texel. In 1757 the ship was laid up in the Indies.');
INSERT INTO "voyages" VALUES (3548, '', 4, '', 'HOOP', 'Godfried Wargijn', 850, NULL, '1742', NULL, NULL, 'D', 'A', '1752-01-12', 'Texel', '1752-04-24', '1752-05-22', true, '1752-07-17', 'Batavia', 7432, 'the law.');
INSERT INTO "voyages" VALUES (3549, '', 5, '', 'KRABBENDIJKE', 'Christiaan Hansen', 830, NULL, '1738', NULL, NULL, 'Z', 'A', '1752-01-12', 'Texel', '1752-04-25', '1752-05-17', true, '1752-08-14', 'Ceylon', 7406, NULL);
INSERT INTO "voyages" VALUES (3550, '', 2, '', 'ADMIRAAL DE RUYTER', 'Christiaan Boelhouwer', 1150, NULL, '1749', NULL, NULL, 'A', 'A', '1752-01-12', 'Texel', '1752-04-25', '1752-05-17', true, '1752-07-23', 'Batavia', 7445, 'On 30-12-1751 the ADMIRAAL DE RUYTER set out for the first time, but three days later the ship returned to Texel. From 17 till 22-02-1752 the ship called at S. Tiago.');
INSERT INTO "voyages" VALUES (3551, '', 2, '', 'HUIS TEN DONK', 'Huibert Vijs', 875, NULL, '1745', NULL, NULL, 'R', 'Z', '1752-01-29', 'Rammekens', '1752-05-07', '1752-05-21', true, '1752-07-26', 'Batavia', 7410, 'The HUIS TEN DONK called at S. Tiago from 25-02 till 01-03-1752.');
INSERT INTO "voyages" VALUES (3552, '', 3, '', 'HERSTELDER', 'Jan van Tuil', 1150, NULL, NULL, '1741', NULL, 'A', 'A', '1752-01-31', 'Texel', '1752-04-27', '1752-05-17', true, '1752-08-12', 'Ceylon', 7404, NULL);
INSERT INTO "voyages" VALUES (3553, '', 4, '', 'OVERNES', 'Michiel van Son', 1150, NULL, '1742', NULL, NULL, 'A', 'A', '1752-01-31', 'Texel', '1752-06-10', '1752-07-03', true, '1752-09-08', 'Batavia', 7415, 'till 07-03-1752). It did not call at the Cape but at False Bay. During the voyage a number of soldiers probably became seafarers.');
INSERT INTO "voyages" VALUES (3554, '', 4, '', 'GERECHTIGHEID', 'Martin Lop', 850, NULL, '1742', NULL, NULL, 'E', 'Z', '1752-02-15', 'Rammekens', '1752-05-30', '1752-06-20', true, '1752-08-21', 'Batavia', 7423, 'The GERECHTIGHEID did not call at the Cape but at False Bay.');
INSERT INTO "voyages" VALUES (3555, '', 3, '', 'OOSTKAPELLE', 'Boudewijn Immers', 850, NULL, '1745', NULL, NULL, 'Z', 'Z', '1752-04-08', 'Rammekens', '1752-07-20', '1752-08-06', true, '1752-10-28', 'Batavia', 7413, NULL);
INSERT INTO "voyages" VALUES (3556, '', 3, '', 'OVERSCHIE', 'Maarten de Vos', 850, NULL, '1745', NULL, NULL, 'D', 'D', '1752-04-09', 'Goeree', '1752-07-21', '1752-08-15', true, '1752-11-01', 'Batavia', 7443, 'The OVERSCHIE did not call at the Cape but at False Bay from 21-07 till 15-08-1752.');
INSERT INTO "voyages" VALUES (3557, '', 3, '', 'HECTOR', 'Kornelis de Leeuw', NULL, 'hoeker', '1738', NULL, NULL, 'Z', 'A', '1752-05-15', 'Texel', '1752-10-11', NULL, true, '1752-10-11', 'The Cape', NULL, 'See also the SCHOLTENBURG (3743) and the NAARSTIGHEID (7502). Laid up at the Cape in 1762.');
INSERT INTO "voyages" VALUES (3558, '', 2, '', 'STRALEN', 'Adriaan de Graaf', 850, NULL, '1748', NULL, NULL, 'E', 'H', '1752-05-17', 'Texel', '1752-09-16', '1752-10-04', true, '1752-12-10', 'Batavia', 7431, 'The STRALEN called at S. Tiago from 28-06 till 06-07-1752.');
INSERT INTO "voyages" VALUES (3559, '', 1, '', 'VREDESTEIN', 'Pieter Lichthart', 880, NULL, '1750', NULL, NULL, 'R', 'R', '1752-05-22', 'Goeree', '1752-09-17', '1752-10-04', true, '1752-12-13', 'Batavia', 7421, 'From 02 till 06-07-1752 the VREDESTEIN called at S. Tiago. The ''passenger'' who embarked at the Cape was a bandit.');
INSERT INTO "voyages" VALUES (3560, '', 5, '', 'WOITKENSDORP', 'Martin van den Hoed', 800, NULL, '1739', NULL, NULL, 'Z', 'A', '1752-05-22', 'Texel', '1752-10-11', '1752-11-05', true, '1753-01-30', 'Batavia', NULL, 'WOITKENSDORP called at S. Tiago from 06 till 13-07-1752. The ship was sold in the Indies on 31-12-1758.');
INSERT INTO "voyages" VALUES (3561, '', 1, '', 'ORANJEZAAL', 'Willem van Mensburg', 880, NULL, '1750', NULL, NULL, 'E', 'E', '1752-06-05', 'Texel', '1752-10-15', '1752-11-05', true, '1753-01-23', 'Batavia', 7448, NULL);
INSERT INTO "voyages" VALUES (3562, '', 2, '', 'GOUVERNEUR-GENERAAL', 'Kornelis Leempoel', 850, NULL, '1749', NULL, NULL, 'D', 'A', '1752-06-10', 'Goeree', '1752-10-18', '1752-11-09', true, '1753-01-17', 'Batavia', 7473, 'GOUVERNEUR-GENERAAL called at S. Tiago.');
INSERT INTO "voyages" VALUES (3563, '', 1, '', 'TORENVLIET', 'Jakob la Mote', 1150, NULL, '1750', NULL, NULL, 'Z', 'Z', '1752-06-24', 'Rammekens', '1752-11-14', '1752-12-06', true, '1753-03-31', 'Batavia', 7459, 'The TORENVLIET called at S. Tiago (10 till 16-08-1752), where 11 seafarers, 8 soldiers and 2 craftsmen deserted. During the voyage one soldier probably became a seafarer.');
INSERT INTO "voyages" VALUES (3564, '', 2, '', 'WITSBURG', 'Arie van der Pot', 850, NULL, '1746', NULL, NULL, 'E', 'R', '1752-07-24', 'Goeree', '1752-12-05', '1753-01-01', true, '1753-04-07', 'Batavia', 7430, 'From 26 till 31-08-1752 the WITSBURG called at S. Tiago, where 2 seafarers deserted.');
INSERT INTO "voyages" VALUES (3565, '', 7, '', 'BATAVIER', 'Jakob Regnault', 525, NULL, '1735', NULL, NULL, 'A', 'Z', '1752-08-04', 'Rammekens', '1752-12-10', '1753-01-01', true, '1753-03-11', 'Batavia', 7478, 'Tiago from 21 till 26-09-1752. where 5 seafarers and 8 soldiers deserted.');
INSERT INTO "voyages" VALUES (3566, '', 1, '', 'HAGEVELD', 'Pieter Jongedijk', 600, NULL, '1752', NULL, NULL, 'A', 'A', '1752-10-03', 'Texel', '1753-03-21', '1753-05-08', true, '1753-09-20', 'Batavia', NULL, 'The cargo of the HAGEVELD consisted among other things of f 179.972 in cash. From 09 till 21-10-1752 the ship called at Portsmouth. The HAGEVELD was laid up in the Indies on 31-12-1756.');
INSERT INTO "voyages" VALUES (3567, '', 1, '', 'DE DRIE HEUVELEN', 'Gotlieb Silo', 850, 'fluit', '1752', NULL, NULL, 'A', 'A', '1752-10-03', 'Texel', '1753-03-07', '1754-02-04', true, '1754-05-20', 'Batavia', NULL, 'In 1758 the DRIE HEUVELEN, sailing from Banda, was wrecked on a reef.');
INSERT INTO "voyages" VALUES (3568, '', 5, '', 'OUWERKERK', 'Marinus de Jong', 540, NULL, '1738', NULL, NULL, 'Z', 'Z', '1752-10-03', 'Rammekens', '1753-03-06', '1753-04-01', true, '1753-07-08', 'Batavia', NULL, 'The OUWERKERK called at Plymouth from 09 till 21-10-1752, where 4 seafarers and 1 soldier deserted. In 1758 the ship was wrecked in the Indies.');
INSERT INTO "voyages" VALUES (3569, '', 1, '', 'DE DRIE PAPEGAAIEN', 'Bastiaan Verdoes', 1150, NULL, '1752', NULL, NULL, 'A', 'A', '1752-10-03', 'Texel', '1753-03-06', '1753-03-25', true, '1753-06-14', 'Batavia', 7496, 'The DRIE PAPEGAAIEN called at Portsmouth (08 till 20-10-1752) and at S. Tiago (16 till 27-11-1752), where one soldier deserted, and one craftsmen died.');
INSERT INTO "voyages" VALUES (3570, '', 1, '', 'VLIETLUST', 'Otto Freudenfeld', 1150, NULL, '1752', NULL, NULL, 'A', 'A', '1752-10-03', 'Texel', '1753-02-22', '1753-03-15', true, '1753-06-07', 'Batavia', 7484, 'ship carried among other things f 299,290 in cash.');
INSERT INTO "voyages" VALUES (3571, '', 1, '', 'WIMMENUM', 'Johan Louis Philippi', 1150, NULL, '1752', NULL, NULL, 'A', 'A', '1752-10-03', 'Texel', '1753-03-06', '1753-03-27', true, '1753-07-18', 'Batavia', NULL, 'One of the passengers was a female slave. From 09 till 21-10 the WIMMENUM called at Portsmouth. from 16 till 27-11-1752 at S. Tiago, where 3 soldiers deserted. The cargo consisted of among other things f 299,698 in cash. In January 1754 the ship was attacked by `Angrians'' of the Malabar Coast, it caught fire and exploded, see also the VREDE (3575).');
INSERT INTO "voyages" VALUES (3572, '', 1, '', 'DELFT', 'Jan van Heemskerk', 850, NULL, '1752', NULL, NULL, 'D', 'D', '1752-10-05', 'Goeree', '1753-03-16', '1753-03-27', true, '1753-06-16', 'Batavia', 7455, '249,851 in cash.');
INSERT INTO "voyages" VALUES (3573, '', 1, '', 'PIJLSWAART', 'Reinier Jongemaas', 880, NULL, '1752', NULL, NULL, 'H', 'H', '1752-10-21', 'Texel', '1753-03-07', '1753-03-27', true, '1753-07-20', 'Batavia', 7435, 'On 06-10-1752 the PIJLSWAART set out for the first time, but on 12-10 it returned to Texel. The ship called at S. Tiago (08 till 15-12-1752), where one seafarer deserted. During the voyage one soldier probably became a seafarer. The cargo consisted among other things of f 250,004 in cash.');
INSERT INTO "voyages" VALUES (3574, '', 1, '', 'KATTENDIJKE', 'Willem van der Heyden', 880, NULL, '1750', NULL, NULL, 'Z', 'Z', '1752-10-24', 'Rammekens', '1753-03-21', '1753-04-14', true, '1753-07-08', 'Batavia', 7433, 'During the voyage one soldier probably became a seafarer.');
INSERT INTO "voyages" VALUES (3575, '', 2, '', 'VREDE', 'Simon Rood', 850, NULL, '1746', NULL, NULL, 'Z', 'E', '1752-11-17', 'Texel', '1753-03-11', '1753-04-01', true, '1753-07-02', 'Batavia', NULL, 'During the voyage one soldier probably became seafarer. The VREDE carried among other things f 98,109 in cash. See the WIMMENUM (3571).');
INSERT INTO "voyages" VALUES (3576, '', 2, '', 'BLOEMENDAAL', 'Hilde Hendriksz. Hoek', 1150, NULL, '1748', NULL, NULL, 'A', 'A', '1752-12-28', 'Texel', '1753-03-17', '1753-04-01', true, '1753-06-14', 'Batavia', NULL, 'The cargo of the BLOEMENDAAL consisted among other things of f 215,629 in cash. In 1756 the ship was wrecked off Surat.');
INSERT INTO "voyages" VALUES (3577, '', 3, '', 'DIEMEN', 'Tobias Sielkens', 850, NULL, '1746', NULL, NULL, 'A', 'A', '1752-12-28', 'Texel', '1753-03-17', '1753-04-14', true, '1753-07-06', 'Batavia', NULL, 'The DIEMEN carried among other things f 103,542 in cash. 3577/- Is the third voyage of this ship, which during its previous two voyages was called KASTEEL VAN TILBURG (see 3468/7366). In 1756 it was wrecked in the Indies.');
INSERT INTO "voyages" VALUES (3578, '', 3, '', 'GETROUWIGHEID', 'Petrus Engelaar', 850, NULL, '1744', NULL, NULL, 'H', 'A', '1752-12-28', 'Texel', '1753-03-16', '1753-04-01', true, '1753-06-21', 'Batavia', 7465, 'One of the passengers was a female slave. The cargo of the GE-TROUWIGHEID consisted among other things of f 115,342 in cash.');
INSERT INTO "voyages" VALUES (3579, '', 3, '', 'HUIS TE MANPAD', 'Jan Roelofsz.', 850, NULL, '1745', NULL, NULL, 'A', 'H', '1752-12-28', 'Texel', '1753-03-23', '1753-04-14', true, '1753-07-06', 'Batavia', 7457, 'The cargo of the HUIS TE MANPAD consisted among other things of f 62,772 in cash.');
INSERT INTO "voyages" VALUES (3580, '', 5, '', 'KASTEEL VAN TILBURG', 'Willem ''t Hoen', 850, NULL, '1743', NULL, NULL, 'A', 'A', '1752-12-28', 'Texel', '1753-03-16', '1753-04-17', true, NULL, 'Bengal', 7475, '3513/7369).');
INSERT INTO "voyages" VALUES (3581, '', 4, '', 'ZUIDERBURG', 'Christiaan Hagerop', 1150, NULL, '1743', NULL, NULL, 'A', 'A', '1752-12-28', 'Texel', '1753-03-17', '1753-04-05', true, NULL, 'Ceylon', 7452, 'The cargo of the ZUIDERBURG consisted of f 375,270 in cash.');
INSERT INTO "voyages" VALUES (3582, '', 3, '', 'BREDENHOF', 'Jan Nielson', 850, NULL, '1746', NULL, NULL, 'H', 'Z', '1752-12-31', 'Rammekens', '1753-04-11', '1753-04-26', true, NULL, NULL, NULL, 'the ship ran aground on a small island and was wrecked. Foundered 06-0601753 on a reef off the coast of Mozambique; wreck discovered.');
INSERT INTO "voyages" VALUES (3583, '', 2, '', 'ROTTERDAM', 'Govert van Welle', 850, NULL, '1748', NULL, NULL, 'R', 'R', '1753-01-01', 'Goeree', '1753-03-27', '1753-04-14', true, '1753-07-06', 'Batavia', 7436, 'On 19-11-1752 the ROTTERDAM set out for the first time, but it was forced by adverse wind to return to Goeree three days later. The ship carried among other things f 250,006 in cash.');
INSERT INTO "voyages" VALUES (3584, '', 5, '', 'ZAAMSLAG', 'Jakob Kolom', 900, NULL, '1741', NULL, NULL, 'Z', 'Z', '1753-02-28', 'Rammekens', '1753-07-03', '1753-07-25', true, '1753-09-25', 'Batavia', NULL, 'ZAAMSLAG was laid up at Batavia.');
INSERT INTO "voyages" VALUES (3585, '', 3, '', 'AMSTELVEEN', 'Jan Willemsz. van den Briel', 1150, NULL, '1746', NULL, NULL, 'A', 'A', '1753-03-09', 'Texel', '1753-06-30', '1753-07-18', true, '1753-12-15', 'Batavia', 7442, 'Bay.');
INSERT INTO "voyages" VALUES (3586, '', 3, '', 'HAARLEM', 'Markus Tetting', 1150, NULL, '1745', NULL, NULL, 'A', 'A', '1763-03-09', 'Texel', '1753-06-29', '1753-07-18', true, '1753-11-14', 'Batavia', 7463, 'From 12-03 till 05-04-1753 the HAARLEM called at Duins, where 2 seafarers died. The ship did not call at the Cape but at False Bay. At Bantam 51 soldiers went ashore. During the voyage 2 soldiers probably became seafarers. The ship carried among other things f 27,580 in cash.');
INSERT INTO "voyages" VALUES (3587, '', 2, '', 'NOORD NIEUWLAND', 'Eduard Koning', 880, NULL, '1749', NULL, NULL, 'R', 'A', '1753-03-09', 'Texel', '1753-06-30', '1753-07-18', true, '1753-09-18', 'Batavia', 7449, 'The cargo consisted among other things of f 104,950 in cash.');
INSERT INTO "voyages" VALUES (3588, '', 1, '', 'RHOON', 'Kornelis de Jonge', 1150, NULL, '1752', NULL, NULL, 'Z', 'Z', '1753-04-09', 'Rammekens', '1753-08-31', '1753-09-19', true, '1753-11-12', 'Batavia', 7440, 'The 8 passengers included 4 female slaves. The RHOON called at Duins twice: from 14 till 15-04 and from 16-04 till 03-05-1753, where one seafarer died. It did not call at the Cape but at False Bay. The ship carried among other things f 171,894 in cash. During the voyage one soldier probably became a seafarer.');
INSERT INTO "voyages" VALUES (3589, '', 4, '', 'BAARZANDE', 'Hans Coenraads', 850, NULL, '1745', NULL, NULL, 'Z', 'D', '1753-04-20', 'Goeree', '1753-08-22', '1753-09-08', true, '1753-11-12', 'Batavia', 7439, 'The BAARZANDE carried among other things f 149,721 in cash.');
INSERT INTO "voyages" VALUES (3590, '', 1, '', 'PERSIJNENBURG', 'Pieter Arendse', 880, NULL, '1752', NULL, NULL, 'E', 'E', '1753-05-05', 'Texel', '1753-08-29', '1753-09-27', true, '1753-12-05', 'Batavia', 7472, 'in cash.');
INSERT INTO "voyages" VALUES (3591, '', 5, '', 'SPANDERSWOUD', 'Nikolaas Pietersz.', 850, NULL, '1744', NULL, NULL, 'A', 'A', '1753-05-05', 'Texel', '1753-09-06', '1753-09-27', true, '1754-04-26', 'Batavia', 7447, 'Louis, the delay there cost 1100 French pounds, the equivalent of 550 Dutch guilders. The ship carried among other things f 354,027 in cash.');
INSERT INTO "voyages" VALUES (3592, '', 2, '', 'MEERVLIET', 'Dirk Dirksz. Klein', 850, NULL, '1749', NULL, NULL, 'A', 'H', '1753-05-30', 'Texel', '1754-03-30', '1754-04-23', true, '1754-07-25', 'Batavia', NULL, 'The MEERVLIET called at Bahia de Todos os Santos (All Saints'' Bay) from 03-12-1753 till 20-01-1754, where 20 seafarers deserted or died. The 6 seafarers who disembarked at the Cape included one condemned person, he was sent back to patria on the OSDORP (see 7419). The ship carried among other things f 74,550 in cash. It was laid up at Malacca on 31-12-1758.');
INSERT INTO "voyages" VALUES (3593, '', 4, '', 'VOORZICHTIGHEID', 'Arend van der Deuren', 850, NULL, '1743', NULL, NULL, 'D', 'E', '1753-05-30', 'Texel', '1753-08-28', '1753-09-27', true, '1753-12-05', 'Batavia', NULL, 'The cargo of the VOORZICHTIGHEID consisted among other things of f 60,005 in cash. On 08-06-1757 the VOORZICHTIGHEID, loaded with rice, ran aground at the Cape and was wrecked.');
INSERT INTO "voyages" VALUES (3594, '', 4, '', 'LEIDEN', 'Jan Sluiskens', 1150, NULL, '1744', NULL, NULL, 'A', 'Z', '1753-06-12', 'Rammekens', '1753-10-16', '1753-11-03', true, '1754-01-19', 'Batavia', 7481, 'seafarers, one soldier and 2 craftsmen deserted. The ship carried among other things .f 82,117 in cash.');
INSERT INTO "voyages" VALUES (3595, '', 1, '', 'JERUSALEM', 'Jan van der Vlucht', 880, NULL, '1752', NULL, NULL, 'R', 'R', '1753-07-07', 'Goeree', '1753-11-08', '1753-11-28', true, '1754-01-26', 'Batavia', 7469, 'From 19 till 25-08-1753 the JERUSALEM called at S. Tiago.');
INSERT INTO "voyages" VALUES (3596, '', 1, '', 'VISVLIET', 'Hertog', 880, NULL, '1752', NULL, NULL, 'Z', 'Z', '1753-07-25', 'Rammekens', '1754-01-14', '1754-02-07', true, '1754-05-20', 'Batavia', 7499, 'The VISVLIET called at Portsmouth (07-08 till 06-09) and at S. Tiago (13 till 18-10-1753), where 8 seafarers and one soldier deserted. The ship carried among other things f 325,000 in cash.');
INSERT INTO "voyages" VALUES (3597, '', 4, '', 'PASGELD', 'Josias Ruts+', 850, NULL, '1745', NULL, NULL, 'D', 'Z', '1753-09-14', 'Rammekens', '1754-01-10', '1754-02-03', true, '1754-05-15', 'Batavia', NULL, 'died; Jakob van Dam succeeded him as master. At Bantam 41 soldiers went ashore. The PASGELD carried among other things f 112,927 in cash. The ship was sold in the Indies on 06-08-1762.');
INSERT INTO "voyages" VALUES (3598, '', 1, '', 'VOORBURG', 'Klaas van den Hoed', 880, NULL, '1753', NULL, NULL, 'D', 'D', '1753-09-19', 'Goeree', '1754-01-22', '1754-02-10', true, '1754-05-18', 'Batavia', NULL, 'From 16 till 17-09-1753 the VOORBURG called at Duins, where one seaferer disembarked. In 1756 the ship was wrecked off Bengal.');
INSERT INTO "voyages" VALUES (3599, '', 4, '', 'HERCULES', 'Johannes Nicolaij', 850, NULL, '1743', NULL, NULL, 'Z', 'Z', '1753-10-22', 'Rammekens', '1754-01-18', '1754-02-10', true, '1754-05-04', 'Batavia', 7474, NULL);
INSERT INTO "voyages" VALUES (3600, '', 1, '', 'BUITENZORG', 'Abraham Zwart', 880, NULL, '1753', NULL, NULL, 'A', 'A', '1753-10-23', 'Texel', '1754-01-22', '1754-02-21', true, '1754-06-08', 'Batavia', 7500, 'On 08-10 the BUITENZORG set out for the first time, but three days later it returned to Texel.');
INSERT INTO "voyages" VALUES (3601, '', 2, '', 'PRINSES CAROLINA', 'Willem Kramer', 300, NULL, '1748', NULL, NULL, 'Z', 'A', '1753-10-23', 'Texel', '1754-02-07', '1754-03-12', true, '1754-08-12', 'Batavia', NULL, 'return to Texel. The ship called at S. Tiago from 19 till 24-11-1753. It carried f 42,700 in cash. The PRINSES CAROLINA replaced the AMSTELLAND, wrecked in September 1751 at the island Sylt (see 3530).');
INSERT INTO "voyages" VALUES (3602, '', 2, '', 'GIESSENBURG', 'Willem Hoogland', 1150, NULL, '1749', NULL, NULL, 'A', 'A', '1753-10-23', 'Texel', '1754-01-18', '1754-02-10', true, '1754-04-21', 'Batavia', NULL, 'An earlier attempt to depart from Texel took place on 08-10, but three days later the ship had to return. The PRINSES VAN ORANJE called at S. Tiago from 10 till 24-11-1753. The ship was sold in the Indies on 21-02-1764.');
INSERT INTO "voyages" VALUES (3603, '', 1, '', 'KEUKENHOF', 'Bot+', 1150, NULL, '1753', NULL, NULL, 'A', 'A', '1753-10-23', 'Texel', '1754-01-24', '1754-02-21', true, '1754-06-14', 'Batavia', 7434, 'On 08-10 the KEUKENHOF sailed out for the first time, but three days later it had to return to Texel. Gerrit Bot died before reaching the Cape, Isaak Grindet succeeded him as master.');
INSERT INTO "voyages" VALUES (3604, '', 2, '', 'LUXEMBURG', 'Pieter Tornboom', 1150, NULL, '1750', NULL, NULL, 'A', 'A', '1753-10-23', 'Texel', '1754-01-22', '1754-03-04', true, '1754-06-14', 'Batavia', 7491, 'On 08-10 the LUXEMBURG set out for the first time, but three days later it returned to Texel.');
INSERT INTO "voyages" VALUES (3605, '', 1, '', 'MARIENBOS', 'Kornelis de Nijs', 1150, NULL, '1753', NULL, NULL, 'A', 'A', '1753-10-23', 'Texel', '1754-01-20', '1754-02-21', true, '1754-05-20', 'Batavia', 7508, NULL);
INSERT INTO "voyages" VALUES (3606, '', 2, '', 'PRINSES VAN ORANJE', 'Michiel Kruger', 250, NULL, NULL, '1747', NULL, 'E', 'A', '1753-10-23', 'Texel', '1754-02-07', '1754-02-10', true, '1754-05-17', 'Batavia', NULL, NULL);
INSERT INTO "voyages" VALUES (3607, '', 1, '', 'RUITEVELD', 'Hendrik Taal', 1150, NULL, '1752', NULL, NULL, 'A', 'A', '1753-10-23', 'Texel', '1754-01-20', '1754-02-21', true, '1754-05-20', 'Batavia', 7450, 'The RUITEVELD set out for the first time on 08-10, but three days later it returned. The ship carried among other things f 344,896 in cash.');
INSERT INTO "voyages" VALUES (3608, '', 2, '', 'ERFPRINS', 'Bartholomeus Schut', 850, NULL, '1750', NULL, NULL, 'D', 'D', '1753-10-26', 'Goeree', '1754-01-22', '1754-02-10', true, '1754-05-20', 'Batavia', 7480, NULL);
INSERT INTO "voyages" VALUES (3609, '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1753-10-26', NULL, NULL, NULL, true, NULL, NULL, NULL, NULL);
INSERT INTO "voyages" VALUES (3610, '', 4, '', 'HUIGENWAARD', 'Jochem Hendrik Dodendorp', 850, NULL, '1742', NULL, NULL, 'H', 'H', '1753-11-09', 'Texel', '1754-04-05', '1754-04-23', true, '1754-06-13', 'Batavia', NULL, 'The HUIGENWAARD called at Portsmouth from 11 till 13-11-1753, where one seafarer deserted. In 1758 the ship was sold at Batavia.');
INSERT INTO "voyages" VALUES (3611, '', 4, '', 'BEVALLIGHIEID', 'Willem Klump', 850, NULL, '1746', NULL, NULL, 'R', 'A', '1753-11-30', 'Texel', '1754-03-02', '1754-04-13', true, '1754-08-13', 'Bengal', NULL, NULL);
INSERT INTO "voyages" VALUES (3612, '', 3, '', 'JAGER', 'Daniel Blok', 850, NULL, '1745', NULL, NULL, 'H', 'E', '1753-11-30', 'Texel', '1754-03-22', '1754-04-17', true, '1754-07-10', 'Batavia', 7453, 'The JAGER called at S. Tiago from 06 till 12-01-1754, where one seafarer deserted. The two passengers who embarked at the Cape were a condemned seafarer and an ex-exile who for ten years had been banished from Batavia. During the voyage one soldier possibly became a seafarer. Since March 1755 the JAGER was called BAARZANDE (see 7453 etc.).');
INSERT INTO "voyages" VALUES (3613, '', 2, '', 'NIEUWERKERK', 'Hendrik Booms', 1150, NULL, '1749', NULL, NULL, 'Z', 'Z', '1753-11-30', 'Rammekens', '1754-03-27', '1754-04-18', true, '1754-07-10', 'Batavia', 7464, 'During the voyage one soldier probably became a seafarer.');
INSERT INTO "voyages" VALUES (3614, '', 2, '', 'OUDKARSPEL', 'Marten Wout', 1150, NULL, '1747', NULL, NULL, 'A', 'A', '1753-12-31', 'Texel', '1754-04-29', '1754-05-16', true, '1754-08-01', 'Ceylon', 7451, 'The OUDKARSPEL called at Duins three times: from 04 till 09-01, from 11 till 22-01, and from 24 till 28-01-1754.');
INSERT INTO "voyages" VALUES (3615, '', 3, '', 'NIEUWVIJVERVREUGD', 'Adriaan van den Boer', 1150, NULL, '1748', NULL, NULL, 'Z', 'Z', '1754-02-05', 'Rammekens', '1754-05-20', '1754-06-14', true, '1754-09-10', 'Batavia', 7471, 'The NIEUWVIJVERVREUGD did not call at the Cape but at False Bay from 20-05 till 14-06-1754.');
INSERT INTO "voyages" VALUES (3616, '', 3, '', 'WILDRIJK', 'Kornelis Quack', 850, NULL, '1744', NULL, NULL, 'A', 'R', '1754-03-06', 'Goeree', NULL, NULL, false, '1754-08-29', 'Batavia', 7460, NULL);
INSERT INTO "voyages" VALUES (3617, '', 1, '', 'RADERMACHER', 'Samuel Wanjon', 1150, NULL, '1753', NULL, NULL, 'Z', 'Z', '1754-03-11', 'Rammekens', '1754-07-20', '1754-08-13', true, '1754-10-28', 'Batavia', 7520, 'The RADERMACHER did not call at the Cape but at False Bay from 20-07 till 13-08-1754.');
INSERT INTO "voyages" VALUES (3618, '', 3, '', 'NAARSTIGHEID', NULL, 850, NULL, '1746', NULL, NULL, 'D', 'D', '1754-04-06', 'Goeree', '1754-07-22', '1754-08-13', true, '1754-10-17', 'Batavia', 7502, 'During the voyage one soldier turned out to be a woman; she disembarked at the Cape (see the ''passenger'' indicated in the third column). The 9 passengers who went ashore at Batavia included one female slave.');
INSERT INTO "voyages" VALUES (3619, '', 3, '', 'EENDRACHT', 'Steven Lodewijk de Lill', 1150, NULL, '1748', NULL, NULL, 'A', 'A', '1754-05-20', 'Texel', '1754-09-25', '1754-10-19', true, '1755-01-14', 'Batavia', 7487, 'included one female slave. The EENDRACHT called at Duins (27-05 till 04-06) and at S. Tiago (27-06 till 04-07-1754). 3619/7487 Is the third voyage of this ship, which during its two preceding voyages was called ELSWOUD (see 3503/7398).');
INSERT INTO "voyages" VALUES (3620, '', 5, '', 'ELSWOUD', 'Dirk Stijve', 850, NULL, '1742', NULL, NULL, 'A', 'A', '1754-05-20', 'Texel', '1754-09-29', '1754-11-07', true, '1755-01-14', 'Ceylon', 3620, 'Ceylon.');
INSERT INTO "voyages" VALUES (3621, '', 3, '', 'KIEVITSHEUVEL', 'Kornelis Eike', 1150, NULL, '1749', NULL, NULL, 'A', 'A', '1754-05-20', 'Texel', '1754-10-06', '1754-10-30', true, '1755-03-04', 'Ceylon', 7534, NULL);
INSERT INTO "voyages" VALUES (3622, '', 3, '', 'SLOTEN', 'Willem Houthuizen', 1150, NULL, '1746', NULL, NULL, 'A', 'A', '1754-05-20', 'Texel', '1754-09-04', '1754-09-24', true, '1754-12-06', 'Batavia', 7466, 'On 31-12-1753 the SLOTEN set out for the first time, but it had to return to Texel. The 9 passengers who went aboard at Texel included one female slave; she disembarked at the Cape. The SLOTEN called at Duins from 24 till 27-05-1754.');
INSERT INTO "voyages" VALUES (3623, '', 5, '', 'STANDVASTIGHEID', 'Jan Martens', 850, NULL, '1742', NULL, NULL, 'R', 'R', '1754-06-01', 'Goeree', '1754-09-27', '1754-10-19', true, '1755-01-04', 'Batavia', 7454, 'at S. Tiago, where one seafarer and two soldiers deserted. two seafarers and one soldier were taken aboard. During the voyage one seafarer probably became a soldier.');
INSERT INTO "voyages" VALUES (3624, '', 4, '', 'VOSMAAR', 'Laurens Helmstrom', 850, NULL, '1746', NULL, NULL, 'Z', 'Z', '1754-06-15', 'Rammekens', '1754-10-28', '1754-11-15', true, '1755-02-15', 'Batavia', 7538, 'The VOSMAAR called at S. Tiago from 01 till 09-08-1754, where one seafarer and three soldiers deserted, another soldier died.');
INSERT INTO "voyages" VALUES (3625, '', 3, '', 'LANGEWIJK', 'Jan Wessel', 850, NULL, '1745', NULL, NULL, 'E', 'E', '1754-07-09', 'Texel', '1754-12-15', '1755-01-22', true, '1755-04-30', 'Batavia', 7456, 'In some sources Ring 
INSERT INTO "voyages" VALUES (3626, '', 1, '', 'SCHAGEN', 'Jakob Leertouwer', 880, NULL, '1753', NULL, NULL, 'H', 'H', '1754-08-18', 'Texel', '1754-12-03', '1754-12-20', true, '1755-02-28', 'Batavia', 7493, 'The SCHAGEN called at S. Tiago from 19 till 23-09-1754.');
INSERT INTO "voyages" VALUES (3627, '', 6, '', 'KRABBENDUKE', 'Paulus van der Giessen', 850, NULL, '1738', NULL, NULL, 'Z', 'Z', '1754-08-19', 'Rammekens', '1754-12-17', '1755-01-06', true, '1755-03-26', 'Batavia', NULL, 'From 19 till 24-09-1754 the KRABBENDUKE called at S. Tiago, where 2 seafarers deserted, and 3 soldiers were taken aboard. In 1759 the ship was laid up at Batavia.');
INSERT INTO "voyages" VALUES (3628, '', 3, '', 'HUIS TEN DONK', 'Klaas Droogsteen', 875, NULL, '1745', NULL, NULL, 'R', 'R', '1754-09-16', 'Goeree', '1754-12-19', '1755-01-06', true, '1755-04-21', 'Batavia', 7501, 'where 2 soldiers deserted.');
INSERT INTO "voyages" VALUES (3629, '', 3, '', 'WAAKZAAMHEID', 'Simon de Graaf', 850, NULL, '1744', NULL, NULL, 'E', 'Z', '1754-09-17', 'Rammekens', '1754-12-23', '1755-01-06', true, '1755-04-12', 'Batavia', 7494, 'where 3 seafarers and 14 soldiers deserted or died.');
INSERT INTO "voyages" VALUES (3630, '', 2, '', 'DEUNISVELD', 'Dirk van der Schilde', 850, NULL, '1747', NULL, NULL, 'D', 'D', '1754-09-23', 'Goeree', '1755-01-27', '1755-02-22', true, '1755-05-31', 'Batavia', 7506, 'During the voyage one soldier probably became a seafarer.');
INSERT INTO "voyages" VALUES (3631, '', 1, '', 'AMELISWEERT', 'Jakob Wiebe', 1150, NULL, '1753', NULL, NULL, 'A', 'A', '1754-11-02', 'Texel', '1755-02-16', '1755-03-09', true, '1755-05-31', 'Batavia', 7467, 'died.');
INSERT INTO "voyages" VALUES (3632, '', 4, '', 'HERSTELDER', 'Jan Hover', 1150, NULL, NULL, '1741', NULL, 'A', 'A', '1754-11-02', 'Texel', '1755-02-01', '1755-02-20', true, '1755-04-30', 'Batavia', NULL, 'The HERSTELDER called at Portsmouth from 07 till 17-11-1754, where one seafarer deserted, another seafarer died. Two of the 17 seafarers who disembarked at the Cape deserted. The HERSTELDER was sold in the Indies on 06-08-1762.');
INSERT INTO "voyages" VALUES (3633, '', 1, '', 'LAPIENENBURG', 'Tobias Sielkens', 1150, NULL, '1753', NULL, NULL, 'A', 'A', '1754-11-02', 'Texel', '1755-02-14', '1755-03-09', true, '1755-05-30', 'Batavia', 7543, 'The LAPIENENBURG called at Portsmouth from 07 till 17-11-1754, where one seafarer deserted. At Bantam 95 soldiers went ashore. During the voyage 7 soldiers probably became seafarers.');
INSERT INTO "voyages" VALUES (3634, '', 2, '', 'LYCOCHTON', 'Jochem Aldertsz. Tarnike', 880, NULL, '1749', NULL, NULL, 'E', 'E', '1754-11-02', 'Texel', '1755-02-14', '1755-03-04', true, '1755-05-30', 'Batavia', 7482, 'The LYCOCHTON called at Duins from 07 till 18-11-1754.');
INSERT INTO "voyages" VALUES (3635, '', 2, '', 'OOSTHUIZEN', 'Jakob de Roeper', 850, NULL, '1749', NULL, NULL, 'H', 'H', '1754-11-02', 'Texel', '1755-03-24', '1755-04-11', true, '1755-06-27', 'Batavia', 7509, 'From 08 till 18-11-1754 the OOSTHUIZEN called at Duins.');
INSERT INTO "voyages" VALUES (3636, '', 1, '', 'STADWIJK', 'Willem Vrucht', 1150, NULL, '1753', NULL, NULL, 'A', 'A', '1754-11-02', 'Texel', '1755-03-08', '1755-04-02', true, '1755-07-14', 'Batavia', 7458, 'The STADWIJK called at Portsmouth from 06 till 17-11-1754, where two seafarers and one soldier were pressed by the English. At Bantam 103 soldiers disembarked.');
INSERT INTO "voyages" VALUES (3637, '', 2, '', 'VOORLAND', 'Paulus Rauwenhof', 1150, NULL, '1750', NULL, NULL, 'A', 'A', '1754-11-02', 'Texel', '1755-04-05', '1755-04-29', true, '1755-07-14', 'Batavia', 7552, 'The 9 passengers included 3 slaves (one male and two females). The VOORLAND called at Duins (08 till 19-11) and at Portsmouth (20-11 till 19-12-1754); at Portsmouth 3 seafarers and one soldier were pressed by the English, one seafarer deserted, one craftsmen died. During the voyage one soldier probably became a seafarer.');
INSERT INTO "voyages" VALUES (3638, '', 2, '', 'VREDESTEIN', 'Laurens Kok', 880, NULL, '1750', NULL, NULL, 'R', 'R', '1754-11-02', 'Goeree', '1755-02-06', '1755-02-20', true, '1755-05-20', 'Batavia', 7479, 'voyage 3 soldiers probably became seafarers.');
INSERT INTO "voyages" VALUES (3639, '', 1, '', 'HUIS TE BOEDE', 'Martin Haringman', 880, NULL, '1753', NULL, NULL, 'Z', 'Z', '1754-11-19', 'Rammekens', '1755-03-20', '1755-04-29', true, '1755-07-13', 'Batavia', 7489, 'The 20 persons who disembarked at the Cape included some deserters.');
INSERT INTO "voyages" VALUES (3640, '', 4, '', 'OOSTKAPELLE', 'Adriaan Bertrand', 850, NULL, '1745', NULL, NULL, 'Z', 'Z', '1754-11-19', 'Goeree', '1755-03-20', '1755-05-03', true, '1755-07-20', 'Batavia', NULL, 'In 1758 the OOSTKAPELLE was wrecked off the Coromandel Coast.');
INSERT INTO "voyages" VALUES (3641, '', 2, '', 'LUCHTENBURG', 'Hans Sierks', 880, NULL, '1750', NULL, NULL, 'H', 'H', '1754-12-22', 'Texel', '1755-03-26', '1755-04-11', true, '1755-07-26', 'Batavia', 7470, NULL);
INSERT INTO "voyages" VALUES (3642, '', 2, '', 'ROZENBURG', 'Pieter Broman', 1150, NULL, '1749', NULL, NULL, 'A', 'A', '1754-12-30', 'Texel', '1755-03-27', '1755-04-29', true, '1755-07-07', 'Ceylon', 7477, NULL);
INSERT INTO "voyages" VALUES (3643, '', 1, '', 'SCHOLTENBURG', 'Hendrik Visser', 880, NULL, '1753', NULL, NULL, 'A', 'A', '1754-12-30', 'Texel', '1755-03-29', '1755-04-29', true, '1755-08-17', 'Bengal', 7498, NULL);
INSERT INTO "voyages" VALUES (3644, '', 5, '', 'AKERENDAM', 'Kornelis van der Stam', 1150, NULL, '1743', NULL, NULL, 'A', 'A', '1754-12-31', 'Texel', '1755-03-26', '1755-04-16', true, '1755-06-23', 'Batavia', 7505, 'During the voyage 6 soldiers possibly became seafarers.');
INSERT INTO "voyages" VALUES (3645, '', 2, '', 'MIDDELBURG', 'Kornelis van Zwanenburg', 1150, NULL, '1749', NULL, NULL, 'Z', 'Z', '1754-12-31', 'Rammekens', '1755-04-03', '1755-05-19', true, '1755-07-21', 'Batavia', 7483, 'During the voyage 7 soldiers probably became seafarers.');
INSERT INTO "voyages" VALUES (3646, '', 5, '', 'OVERNES', 'Arie van der Aart', 1150, NULL, '1742', NULL, NULL, 'A', 'A', '1754-12-31', 'Texel', '1755-03-26', '1755-04-16', true, '1755-06-24', 'Batavia', 7461, 'slave.');
INSERT INTO "voyages" VALUES (3647, '', 1, '', '''S GRAVENZANDE', 'Hendrik Altman', 880, NULL, '1754', NULL, NULL, 'D', 'D', '1755-05-09', 'Texel', '1755-09-08', '1755-09-29', true, '1755-12-12', 'Batavia', 7507, 'The 3 passengers who embarked at the Cape were condemned persons; they disembarked at Batavia.');
INSERT INTO "voyages" VALUES (3648, '', 2, '', 'VRIJBURG', 'Boudewijn Immers', 1150, NULL, '1748', NULL, NULL, 'Z', 'Z', '1755-05-24', 'Rammekens', '1755-09-16', '1755-10-06', true, '1756-03-15', 'Ceylon', 7516, NULL);
INSERT INTO "voyages" VALUES (3649, '', 2, '', 'BOSSCHENHOVE', 'Klaas Andersen', 1150, NULL, '1750', NULL, NULL, 'A', 'A', '1755-06-02', 'Texel', '1755-09-25', '1755-10-26', true, '1756-01-04', 'Batavia', 7486, 'The BOSSCHENHOVE called at S. Tiago from 11 till 19-07-1755. The two passengers included one slave.');
INSERT INTO "voyages" VALUES (3650, '', 4, '', 'SLOT VAN KAPELLE', 'Paulus Engelaar', 1150, NULL, '1745', NULL, NULL, 'A', 'A', '1755-06-02', 'Texel', '1755-09-28', '1755-10-26', true, '1756-01-13', 'Batavia', 7495, 'From 11 till 19-07-1755 the SLOT VAN KAPELLE called at S. Tiago, where 7 soldiers deserted or died. During the voyage one soldier probably became a seafarer.');
INSERT INTO "voyages" VALUES (3651, '', 3, '', 'OSDORP', 'Anthonie Henemans', 850, NULL, '1746', NULL, NULL, 'A', 'A', '1755-06-02', 'Texel', '1755-09-29', '1755-10-23', true, '1756-01-18', 'Batavia', 7492, NULL);
INSERT INTO "voyages" VALUES (3652, '', 4, '', 'SPARENRUK', 'Christiaan Prehn', 850, NULL, '1745', NULL, NULL, 'A', 'A', '1755-06-02', 'Texel', '1755-10-08', '1755-10-23', true, '1756-01-17', 'Batavia', 7523, 'The SPARENDIJK called at S. Tiago (dates of arrival and departure unknown). After the departure from S. Tiago a stowaway was found; he disembarked at Batavia (registered as passenger in the sixth column).');
INSERT INTO "voyages" VALUES (3653, '', 1, '', 'WELGELEGEN', 'Hans Stoft', 880, NULL, '1753', NULL, NULL, 'E', 'E', '1755-06-02', 'Texel', '1755-09-21', '1755-10-05', true, '1756-01-14', 'Batavia', 7488, 'During the voyage two soldiers probably became seafarers.');
INSERT INTO "voyages" VALUES (3654, '', 1, '', 'BARBARA THEODORA', 'Jakob Reysik', 1150, NULL, '1753', NULL, NULL, 'Z', 'Z', '1755-08-13', 'Rammekens', '1756-01-19', '1756-02-23', true, '1756-05-29', 'Batavia', 7529, 'seafarers died, during the second call three seafarers and one craftsman died, two seafarers and two soldiers deserted. Some of the 89 persons who went ashore at the Cape were handed over to the law. At Bantam 58 soldiers disembarked.');
INSERT INTO "voyages" VALUES (3655, '', 4, '', 'LEKKERLAND', 'Dirk van Maastricht', 1150, NULL, '1744', NULL, NULL, 'A', 'A', '1755-08-13', 'Texel', '1756-01-02', '1756-01-27', true, '1756-05-07', 'Batavia', 7525, 'The two passengers who went aboard at the Cape were condemned persons; they disembarked at Batavia. At Bantam 81 soldiers went ashore.');
INSERT INTO "voyages" VALUES (3656, '', 4, '', 'HOF D''UNO', 'Laurens Houtepen', 1150, NULL, '1743', NULL, NULL, 'H', 'Z', '1755-08-13', 'Rammekens', '1756-01-02', '1756-02-23', true, '1756-06-18', 'Batavia', 7497, 'The HOF D''UNO called at Duins twice: 17 till 27-08 and 10-09 till 17-09-1755; during the first call one seafarer died, during the second call one seafarer deserted.');
INSERT INTO "voyages" VALUES (3657, '', 5, '', 'BROUWER', 'Jakob Ketel', 850, NULL, '1743', NULL, NULL, 'H', 'H', '1755-10-13', 'Texel', '1756-01-24', '1756-02-13', true, '1756-05-12', 'Batavia', 7522, 'From 17 till 18-10-1755 the BROUWER called at Duins, where one seafarer died.');
INSERT INTO "voyages" VALUES (3658, '', 2, '', 'KEUKENHOF', 'Nikolaas Oman', 1150, NULL, '1753', NULL, NULL, 'A', 'A', '1755-10-13', 'Texel', '1756-01-24', '1756-02-13', true, '1756-05-13', 'Batavia', 7524, 'The KEUKENHOF called at Duins from 17 till 18-10-1755, where two soldiers died.');
INSERT INTO "voyages" VALUES (3659, '', 2, '', 'RUITEVELD', 'Sjouke Jakobsz.', 1150, NULL, '1752', NULL, NULL, 'A', 'A', '1755-10-13', 'Texel', '1756-01-25', '1756-02-13', true, '1756-05-11', 'Batavia', 7517, 'The RUITEVELD called at Duins from 17 till 18-10-1755. Some of the 35 seafarers and soldiers who went ashore at the Cape deserted.');
INSERT INTO "voyages" VALUES (3660, '', 1, '', 'BLIJDORP', 'Jan van der Vlucht', 880, NULL, '1753', NULL, NULL, 'R', 'R', '1755-10-18', 'Goeree', '1756-01-10', '1756-01-26', true, '1756-04-12', 'Batavia', 7504, NULL);
INSERT INTO "voyages" VALUES (3661, '', 5, '', 'GERECHTIGHEID', 'Hans Coenraads', 850, NULL, '1742', NULL, NULL, 'E', 'D', '1755-10-18', 'Goeree', '1756-01-18', '1756-01-26', true, '1756-04-13', 'Batavia', 7490, NULL);
INSERT INTO "voyages" VALUES (3662, '', 2, '', 'KATTENDIJKE', 'Lieve Timmermans', 880, NULL, '1750', NULL, NULL, 'Z', 'Z', '1755-10-19', 'Rammekens', '1756-03-08', '1756-04-19', true, '1756-07-01', 'Batavia', 7515, 'The KATTENDIJKE called at Duins from 25 till 27-10-1755, where two seafarers were pressed by the English. The passenger who embarked at the Cape was a criminal; he did not survive the voyage to Batavia.');
INSERT INTO "voyages" VALUES (3663, '', 1, '', 'VLISSINGEN', 'Kornelis de Jonge', 880, NULL, '1753', NULL, NULL, 'Z', 'Z', '1755-10-19', 'Rammekens', '1756-03-11', '1756-04-19', true, '1756-06-26', 'Batavia', 7511, 'died. Between Duins and the Cape one seafarer turned out to be a woman; she disembarked at the Cape (indicated as passenger in the third column). Two of the 50 seafarers who went ashore at the Cape were handed over to the law.');
INSERT INTO "voyages" VALUES (3664, '', 1, '', 'AMERONGEN', 'Christiaan Hansen', 1150, NULL, '1754', NULL, NULL, 'A', 'A', '1756-02-02', 'Texel', '1756-06-11', '1756-07-05', true, '1756-09-07', 'Batavia', 7555, 'The AMERONGEN called at Duins (04 till 24-02) and at S. Tiago (05 till 12-04-1756), at Duins one soldier deserted, two soldiers died. During the voyage 11 soldiers probably became seafarers.');
INSERT INTO "voyages" VALUES (3665, '', 5, '', 'BEVALLIGHEID', 'Dirk Took', 850, NULL, '1746', NULL, NULL, 'R', 'A', '1756-02-02', 'Texel', '1756-06-05', '1756-06-28', true, '1756-10-08', 'Bengal', 7530, 'From 04 till 24-01-1756 the BEVALLIGHEID called at Duins.');
INSERT INTO "voyages" VALUES (3666, '', 4, '', 'IMMAGONDA', 'Jan de Zee', 850, NULL, '1746', NULL, NULL, 'E', 'E', '1756-02-02', 'Texel', '1756-06-05', '1756-06-28', true, '1756-08-15', 'Batavia', 7519, 'The IMMAGONDA called at Duins from 04 till 24-02-1756, where three seafarers deserted, another seafarer died.');
INSERT INTO "voyages" VALUES (3667, '', 2, '', 'PIJLSWAART', 'Christiaan Boomgaard', 880, NULL, '1752', NULL, NULL, 'H', 'H', '1756-02-02', 'Texel', '1756-06-13', '1756-07-07', true, '1756-09-18', 'Batavia', 7528, 'From 04 till 24-02-1756 the PIJLSWAART called at Duins, where one seafarer was pressed by the English, one soldier went missing; the crew was enforced by one seafarer. The ship did not call at the Cape but at False Bay.');
INSERT INTO "voyages" VALUES (3668, '', 1, '', 'VROUWE REBECCA JACOBA', 'Jan van Ingen', 1150, NULL, '1754', NULL, NULL, 'A', 'A', '1756-02-02', 'Texel', '1756-06-16', '1756-07-18', true, '1756-10-23', 'Batavia', 7568, 'S. Tiago two soldiers deserted, one seafarer was taken over by another ship. The VROUWE REBECCA JACOBA did not call at the Cape but at False Bay.');
INSERT INTO "voyages" VALUES (3669, '', 2, '', 'RHOON', 'Hendrik Smit', 1150, NULL, '1752', NULL, NULL, 'Z', 'Z', '1756-02-02', 'Rammekens', '1756-06-11', '1756-07-07', true, '1756-09-19', 'Batavia', 7562, 'The RHOON called at Duins (04 till 18-02) and at Spithead (22 till 25-02-1756); at Duins one seafarer deserted. At the Cape Hendrik Smit went to the SNOEK (see 3672) as a passenger; Jurriaan Molensteen, coming from the VROUWE REBECCA JA-COBA (see 3668), succeeded him as master.');
INSERT INTO "voyages" VALUES (3670, '', 3, '', 'ADMIRAAL DE RUYTER', 'Pietersz.', 1150, NULL, '1749', NULL, NULL, 'A', 'A', '1756-02-02', 'Texel', '1756-06-13', '1756-07-01', true, '1756-09-12', 'Ceylon', 7563, 'From 04 till 24-02-1756 the ADMIRAAL DE RUYTER called at Duins.');
INSERT INTO "voyages" VALUES (3671, '', 4, '', 'SLOTERDIJK', 'Hans Heide', 1150, NULL, '1747', NULL, NULL, 'A', 'A', '1756-02-02', 'Texel', '1756-06-05', '1756-07-07', true, '1756-09-14', 'Ceylon', 7536, 'The SLOTERDIJK called at Duins from 04 till 24-02-1756.');
INSERT INTO "voyages" VALUES (3672, '', 2, '', 'SNOEK', 'Jan Sluiskens', 880, NULL, '1750', NULL, NULL, 'Z', 'Z', '1756-02-02', 'Rammekens', '1756-06-11', '1756-07-07', true, '1756-09-06', 'Batavia', 7540, 'at the Cape but at False Bay, where, besides 4 seafarers, Hendrik Smit, former master of the RHOON (see 3669), embarked.');
INSERT INTO "voyages" VALUES (3673, '', 3, '', 'STRALEN', 'Daniel Nieman', 850, NULL, '1748', NULL, NULL, 'E', 'E', '1756-02-02', 'Texel', '1756-06-20', '1756-07-15', true, '1756-09-26', 'Batavia', 7537, 'The STRALEN called at Duins (04 till 24-02) and at S. Tiago (06 till 12-04-1756); at Duins 4 seafarers were pressed by the English, 2 soldiers died; 2 seafarers were taken over from other ships. During the voyage one soldier probably became a seafarer.');
INSERT INTO "voyages" VALUES (3674, '', 5, '', 'HOOP', 'Thomas Hakens', 850, NULL, '1742', NULL, NULL, 'D', 'D', '1756-05-14', 'Goeree', '1756-08-20', '1756-09-11', true, '1756-11-18', 'Batavia', 7514, NULL);
INSERT INTO "voyages" VALUES (3675, '', 3, '', 'NOORD NIEUWLAND', 'Frederik Wielard', 880, NULL, '1749', NULL, NULL, 'R', 'R', '1756-05-14', 'Goeree', '1756-08-20', '1756-09-11', true, '1756-11-17', 'Batavia', 7513, 'During the voyage one soldier probably became a seafarer.');
INSERT INTO "voyages" VALUES (3676, '', 4, '', 'AMSTELVEEN', 'Willem Everdingen van de Nieuwpoort', 1150, NULL, '1746', NULL, NULL, 'A', 'A', '1756-05-20', 'Texel', '1756-08-26', '1756-09-14', true, '1756-11-28', 'Batavia', 7565, 'From 13 till 15-06-1756 the AMSTELVEEN called at S. Tiago.');
INSERT INTO "voyages" VALUES (3677, '', 2, '', 'ORANJEZAAL', 'Albert Verzaat', 880, NULL, '1750', NULL, NULL, 'E', 'A', '1756-05-20', 'Texel', '1756-08-28', '1757-02-01', true, '1757-05-21', 'Batavia', 7598, 'The two passengers who embarked at the Cape were condemned persons.');
INSERT INTO "voyages" VALUES (3678, '', 6, '', 'SPANDERSWOUD', 'Nikolaas Pietersz.', 850, NULL, '1744', NULL, NULL, 'A', 'A', '1756-05-20', 'Texel', '1756-08-28', '1756-09-14', true, '1756-11-19', 'Batavia', 7503, NULL);
INSERT INTO "voyages" VALUES (3679, '', 2, '', 'TULPENBURG', 'Kornelis Stuurman', 1150, NULL, '1750', NULL, NULL, 'A', 'A', '1756-05-20', 'Texel', '1756-08-28', '1756-09-14', true, '1757-01-09', 'Ceylon', 7569, NULL);
INSERT INTO "voyages" VALUES (3680, '', 5, '', 'ZUIDERBURG', 'Christiaan Hagerop', 1150, NULL, '1743', NULL, NULL, 'A', 'A', '1756-05-20', 'Texel', '1756-08-19', '1756-09-11', true, '1756-11-26', 'Batavia', 7526, 'The 20 soldiers who went ashore at the Cape included one person who had turned out to be a woman. The two passengers who embarked at the Cape were condemned criminals.');
INSERT INTO "voyages" VALUES (3681, '', 4, '', 'OVERSCHIE', 'Pieter Kronenburg', 850, NULL, '1745', NULL, NULL, 'D', 'D', '1756-10-23', 'Goeree', '1757-02-13', '1757-03-01', true, '1757-06-01', 'Batavia', 7535, 'The 5 passengers who embarked at the Cape included 4 slaves. During the voyage one soldier probably became a seafarer.');
INSERT INTO "voyages" VALUES (3682, '', 3, '', 'ROTTERDAM', 'Laurens Koek', 850, NULL, '1748', NULL, NULL, 'R', 'R', '1756-10-23', 'Goeree', '1757-02-09', '1757-03-01', true, '1757-05-19', 'Batavia', 7539, 'person.');
INSERT INTO "voyages" VALUES (3683, '', 4, '', 'GUSTAAF WILLEM', 'Jan Leinders', 1150, NULL, '1744', NULL, NULL, 'Z', 'Z', '1756-10-24', 'Rammekens', '1757-02-12', '1757-03-07', true, '1757-06-10', 'Batavia', 7551, 'During the voyage 3 soldiers probably became seafarers.');
INSERT INTO "voyages" VALUES (3684, '', 3, '', 'OUDKARSPEL', 'Jakob Baars', 1150, NULL, '1747', NULL, NULL, 'A', 'Z', '1756-10-24', 'Rammekens', '1757-02-12', '1757-03-26', true, '1757-06-10', 'Batavia', 7561, 'The 61 persons who went ashore at the Cape included some deserters.');
INSERT INTO "voyages" VALUES (3685, '', 1, '', 'WALCHEREN', 'Leendert Fruit van Hertog', 1150, NULL, '1754', NULL, NULL, 'Z', 'Z', '1756-10-24', 'Rammekens', '1757-02-24', '1757-03-19', true, '1757-06-10', 'Batavia', 7512, NULL);
INSERT INTO "voyages" VALUES (3686, '', 2, '', 'AMELISWEERT', 'Pieter Huisman', 1150, NULL, '1753', NULL, NULL, 'A', 'A', '1756-12-07', 'Texel', '1757-04-05', '1757-04-28', true, '1757-07-16', 'Batavia', 7572, 'The AMELISWEERT called at Bantam on 12-07-1757, where two soldiers disembarked. During the voyage two seafarers probably became soldiers.');
INSERT INTO "voyages" VALUES (3687, '', 1, '', 'BRONSTEE', 'Willem Klump', 600, NULL, '1755', NULL, NULL, 'A', 'A', '1756-12-07', 'Texel', '1757-04-24', '1757-05-16', true, '1757-08-28', 'Bengal', 7648, NULL);
INSERT INTO "voyages" VALUES (3688, '', 1, '', 'LEKKERLUST', 'Klaas Stuiver', 880, NULL, '1755', NULL, NULL, 'H', 'H', '1756-12-07', 'Texel', '1757-04-24', '1757-05-15', true, '1757-08-03', 'Batavia', 7589, NULL);
INSERT INTO "voyages" VALUES (3689, '', 1, '', 'LEIMUIDEN', 'Hendrik Winkelman', 1150, NULL, '1755', NULL, NULL, 'A', 'A', '1756-12-07', 'Texel', '1757-05-16', '1757-06-04', true, '1757-08-13', 'Batavia', 7602, 'The 6 passengers who embarked at Texel included one female slave. The LEIMUIDEN called at S. Tiago from 12 till 19-01-1757, where 12 seafarers and one soldier died.');
INSERT INTO "voyages" VALUES (3690, '', 1, '', 'VROUWE PETRONELLA MARIA', 'Jean de la Voie', 1150, NULL, '1755', NULL, NULL, 'A', 'A', '1756-12-07', 'Texel', '1757-04-05', '1757-04-28', true, '1757-07-21', 'Batavia', 7510, NULL);
INSERT INTO "voyages" VALUES (3691, '', 2, '', 'RUYSKENSTEIN', 'Jan Frederik Schrijver', 850, NULL, '1749', NULL, NULL, 'A', 'E', '1756-12-07', 'Texel', '1757-04-24', '1757-05-15', true, '1757-08-03', 'Batavia', NULL, 'The RUYSKENSTEIN was sold at Batavia in 1761.');
INSERT INTO "voyages" VALUES (3692, '', 2, '', 'STADWIJK', 'Pieter de Rode', 1150, NULL, '1753', NULL, NULL, 'A', 'A', '1756-12-07', 'Texel', '1757-04-04', '1757-04-28', true, '1757-07-07', 'Batavia', NULL, 'The STADWIJK called at Bantam on 04-07-1757, where 6 seafarers went ashore. During the voyage 10 soldiers probably became seafarers. In 1759 the ship got lost during a voyage to Japan.');
INSERT INTO "voyages" VALUES (3693, '', 4, '', 'SLOTEN', 'Godfried Wargijn', 1150, NULL, '1746', NULL, NULL, 'A', 'A', '1756-12-08', 'Texel', '1757-03-12', '1757-03-23', true, '1757-07-31', 'China', 7521, NULL);
INSERT INTO "voyages" VALUES (3694, '', 4, '', 'BAARZANDE', 'Pieter Ruis', 850, NULL, '1745', NULL, NULL, 'H', 'Z', '1757-03-08', 'Rammekens', '1757-07-18', '1757-08-15', true, '1757-10-12', 'Batavia', 7566, 'seafarers and one soldier were pressed by the English. The ship did not call at the Cape but at Simon''s Bay, a part of False Bay. During the voyage one soldier probably became a seafarer. 3694/7566 Is the fourth voyage of this ship, which during its first two voyages and the outward part of its third voyage was called JAGER (see 3612/7453).');
INSERT INTO "voyages" VALUES (3695, '', 2, '', 'TORENVLIET', 'Johannes Nicolaij', 1150, NULL, '1750', NULL, NULL, 'Z', 'Z', '1757-03-08', 'Rammekens', '1757-07-25', '1757-08-25', true, '1757-10-26', 'Ceylon', 7549, NULL);
INSERT INTO "voyages" VALUES (3696, '', 2, '', 'DELFT', 'Pieter Hogendorp', 850, NULL, '1752', NULL, NULL, 'D', 'D', '1757-04-19', 'Goeree', '1757-08-03', '1757-08-26', true, '1757-10-24', 'Batavia', 7518, 'The DELFT did not call at the Cape but at Simon''s Bay. During the voyage two soldiers probably became seafarers.');
INSERT INTO "voyages" VALUES (3697, '', 1, '', 'VROUWE ELISABETH', 'Pieter Matthijs Joele', 850, NULL, '1755', NULL, NULL, 'R', 'R', '1757-04-19', 'Goeree', '1757-08-03', '1757-08-18', true, '1757-10-26', 'Batavia', 7556, 'From 30-05 till 04-06-1757 the VROUWE ELISABETH called at S. Tiago. The ship did not call at the Cape but at Simon''s Bay. The 3 passengers who went ashore at Simon''s Bay included one ex-soldier who had turned out to be a woman.');
INSERT INTO "voyages" VALUES (3698, '', 4, '', 'GETROUWIGHEID', 'Augustinus Heynenberg', 850, NULL, '1744', NULL, NULL, 'H', 'H', '1757-05-26', 'Texel', '1757-09-06', '1757-09-24', true, '1757-12-27', 'Batavia', 7532, 'During the voyage one soldier probably became a seafarer.');
INSERT INTO "voyages" VALUES (3699, '', 4, '', 'HUIS TE MANPAD', 'Andries Lint', 850, NULL, '1745', NULL, NULL, 'A', 'A', '1757-05-26', 'Texel', '1757-10-16', '1757-11-11', true, '1758-01-29', 'Batavia', 7527, 'The HUTS TE MANPAD called at S. Tiago from 27-06 till 09-07-1757, where 3 seafarers and 3 soldiers died. The 3 passengers who disembarked there included 2 stowaways. discovered on the ship. Between the Cape and Batavia another stowaway was found; he did not survive the voyage (registered as passenger in the fifth column). During the voyage 2 soldiers probably became seafarers.');
INSERT INTO "voyages" VALUES (3700, '', 3, '', 'OVERNES', 'Marten Wout', 1150, NULL, '1749', NULL, NULL, 'A', 'A', '1757-05-26', 'Texel', '1757-10-02', '1757-11-01', true, '1758-01-29', 'Batavia', 7544, 'The OVERNES called at S. Tiago from 27-06 till 09-07-1757, where two seafarers and one soldier died; two seafarers went to the SPAARZAAMHEID (see 3703), two soldiers deserted. The passenger who embarked at the Cape was a condemned person. 3700/7544 Is the third voyage of this ship, which during preceding voyages was called ROZENBURG (see 3642/7477); it was to make two other voyages, both under a third name: AMERONGEN (see 3796/7638 and 3901/-).');
INSERT INTO "voyages" VALUES (3701, '', 1, '', 'VROUWE PETRONELLA', 'Reinder Dijkveld', 880, NULL, '1755', NULL, NULL, 'E', 'E', '1757-05-26', 'Texel', '1757-09-19', '1757-10-10', true, '1758-01-08', 'Batavia', 7541, 'included two female slaves and a former prisoner. During the voyage two soldiers probably became seafarers.');
INSERT INTO "voyages" VALUES (3702, '', 6, '', 'ROZENBURG', 'Simon Smit', 1150, NULL, '1742', NULL, NULL, 'A', 'A', '1757-05-26', 'Texel', '1757-10-07', '1757-11-01', true, '1758-03-24', 'Ceylon', 3702, '/- Is the sixth voyage of the ROZENBURG, which during its five preceding voyages was called OVERNES (see 3646/7461). The ship was sold in the Indies on 06-08-1762.');
INSERT INTO "voyages" VALUES (3703, '', 2, '', 'SPAARZAAMHEID', 'Jan Schellinger', 1150, NULL, '1750', NULL, NULL, 'A', 'A', '1757-05-26', 'Texel', '1757-09-29', '1757-10-24', true, '1758-01-15', 'Batavia', NULL, 'seafarers and 14 soldiers died; 2 seafarers were taken over from the OVERNES (see 3700). The 4 passengers who embarked at the Cape were bandits. During the voyage two soldiers probably became seafarers. On 18-10-1763 the ship was laid up in the Indies.');
INSERT INTO "voyages" VALUES (3704, '', 4, '', 'WILDRIJK', 'Jan Spek', 850, NULL, '1744', NULL, NULL, 'A', 'A', '1757-05-26', 'Texel', '1757-10-04', '1757-11-30', true, '1758-03-18', 'Batavia', 7542, 'The WILDRIJK called at S. Tiago 27-06 till 09-07-1757, where 5 seafarers and 2 soldiers deserted or died.');
INSERT INTO "voyages" VALUES (3705, '', 4, '', 'HAARLEM', 'Isaak van den Berg', 1150, NULL, '1745', NULL, NULL, 'A', 'A', '1757-06-24', 'Texel', '1757-10-31', '1757-12-15', true, '1758-03-18', 'Batavia', NULL, 'On 08-08-1758 the HAARLEM was seized by the French off Pondichery in India; later on the ship was wrecked.');
INSERT INTO "voyages" VALUES (3706, '', 6, '', 'KASTEEL VAN TILBURG', 'George Christiaan Honsdorp', 850, NULL, '1743', NULL, NULL, 'A', 'A', '1757-06-24', 'Texel', '1757-10-31', '1757-12-29', true, '1758-04-06', 'Batavia', 3706, 'sixth voyage of this ship, which during its first four voyages was called DIEMEN (see 3513/7369). On 20-10-1764 the ship was laid up in the Indies.');
INSERT INTO "voyages" VALUES (3707, '', 5, '', 'JAGER', 'Paterson', 850, NULL, '1745', NULL, NULL, 'Z', 'Z', '1757-07-08', 'Rammekens', '1757-12-09', '1758-01-13', true, '1758-05-03', 'Batavia', NULL, 'voyage was called BAARZANDE (see 3589/7439 and 7468). In 1765 the ship was sold in the Indies.');
INSERT INTO "voyages" VALUES (3708, '', 3, '', 'NIEUW NIEUWERKERK', 'Pieter de Visser', 1150, NULL, '1749', NULL, NULL, 'Z', 'Z', '1757-07-08', 'Rammekens', '1757-12-01', '1757-12-29', true, '1758-03-18', 'Batavia', 7560, 'from 16 till 20-08-1757, where 3 soldiers deserted.');
INSERT INTO "voyages" VALUES (3709, '', 3, '', 'GOUVERNEUR-GENERAAL', 'Bartholomeus Schut', 850, NULL, '1749', NULL, NULL, 'D', 'D', '1757-10-07', 'Goeree', '1758-01-03', '1758-01-22', true, '1758-04-06', 'Batavia', 7533, 'During the voyage one soldier and one craftsmen possibly became seafarers.');
INSERT INTO "voyages" VALUES (3710, '', 2, '', 'JERUSALEM', 'Pieter Rozenburg', 880, NULL, '1753', NULL, NULL, 'R', 'R', '1757-10-07', 'Goeree', '1758-01-04', '1758-01-22', true, '1758-04-14', 'Batavia', 7546, 'The passenger was a slave.');
INSERT INTO "voyages" VALUES (3711, '', 5, '', 'HERCULES', 'Leendert Kouw', 850, NULL, '1743', NULL, NULL, 'Z', 'Z', '1757-10-18', 'Rammekens', '1758-01-19', '1758-02-23', true, '1758-05-26', 'Batavia', NULL, 'The passenger who went ashore at the Cape was an ex-soldier who had turned out to be a woman. In 1763 the HERCULES was wrecked on a voyage to Timor.');
INSERT INTO "voyages" VALUES (3712, '', 1, '', 'ZUID-BEVELAND', 'Hendrik Booms', 1100, NULL, '1755', NULL, NULL, 'Z', 'Z', '1757-10-18', 'Rammekens', '1758-01-05', '1758-02-05', true, '1758-05-05', 'Batavia', 7617, 'During the voyage one seafarer probably became a soldier.');
INSERT INTO "voyages" VALUES (3713, '', 7, '', 'BATAVIER', 'Kornelis Kuiper', 525, NULL, '1735', NULL, NULL, 'A', 'A', '1757-12-19', 'Texel', '1758-05-19', '1758-10-03', true, '1758-12-16', 'Batavia', NULL, 'The BATAVIER called at Portsmouth (from 30 till 31-12-1757) and at S. Tiago (from 08 till 15-02-1758), where one soldier deserted. During the voyage two soldiers probably became seafarers. The BATAVIER did not call at the Cape but at Simon''s Bay.');
INSERT INTO "voyages" VALUES (3714, '', 4, '', 'LANGEWIJK', 'Jakob de Vries', 850, NULL, '1745', NULL, NULL, 'E', 'E', '1757-12-19', 'Texel', '1758-05-05', '1758-05-24', true, '1758-07-18', 'Batavia', 7557, 'seafarers and 39 soldiers went ashore.');
INSERT INTO "voyages" VALUES (3715, '', 3, '', 'LYCOCHTON', 'Pieter A. Lindholm', 880, NULL, '1749', NULL, NULL, 'E', 'H', '1757-12-19', 'Texel', '1758-05-07', '1758-05-24', true, '1758-07-27', 'Batavia', 7558, 'from 01 till 07-02-1758, where one seafarer and 4 soldiers deserted or died, and one soldier came aboard. At Bantam 51 soldiers went ashore. During the voyage two soldiers probably became seafarers.');
INSERT INTO "voyages" VALUES (3716, '', 1, '', 'VELSEN', 'Markus Tetting', 1100, NULL, '1756', NULL, NULL, 'A', 'A', '1757-12-19', 'Texel', NULL, NULL, false, '1758-07-25', 'Batavia', 7545, 'The VELSEN called at S. Tiago, probably from 10 till 16-02-1758. On 25-05-1758 the ship rounded the Cape. After arrival at Batavia the VELSEN sailed on to China.');
INSERT INTO "voyages" VALUES (3717, '', 2, '', 'VLIETLUST', 'Jakob Zwart', 1150, NULL, '1752', NULL, NULL, 'A', 'A', '1757-12-19', 'Texel', '1758-05-07', '1758-05-17', true, '1758-07-23', 'Ceylon', 7547, NULL);
INSERT INTO "voyages" VALUES (3718, '', 3, '', 'BOSSCHENHOVE', 'Jan Hoyer', 1150, NULL, '1750', NULL, NULL, 'A', 'A', '1757-12-30', 'Texel', '1758-05-22', '1758-06-13', true, '1758-08-20', 'Batavia', 7531, 'seafarers, 15 soldiers and one craftsmen deserted or died. and 10 seafarers were taken aboard. The ship did not call at the Cape but at Simon''s Bay. During the voyage 7 soldiers probably became seafarers.');
INSERT INTO "voyages" VALUES (3719, '', 3, '', 'GIESSENBURG', 'Jan Willem Munts', 1150, NULL, '1749', NULL, NULL, 'A', 'A', '1757-12-30', 'Texel', '1758-05-13', '1758-05-24', true, '1758-08-16', 'Ceylon', 7590, NULL);
INSERT INTO "voyages" VALUES (3720, '', 3, '', 'MIDDELBURG', 'Adriaan van den Boer', 1150, NULL, '1749', NULL, NULL, 'Z', 'Z', '1757-12-30', 'Rammekens', '1758-04-09', '1758-05-09', true, '1758-07-16', 'Batavia', NULL, 'During the voyage two soldiers and one craftsmen possibly became seafarers. The MIDDELBURG was sold in the Indies on 20-09-1763.');
INSERT INTO "voyages" VALUES (3721, '', 4, '', 'OSDORP', 'Willem Vrucht', 850, NULL, '1746', NULL, NULL, 'A', 'A', '1757-12-30', 'Texel', '1758-04-20', '1758-05-16', true, '1758-08-30', 'Bengal', NULL, 'The OSDORP was sold in the Indies on 21-10-1766.');
INSERT INTO "voyages" VALUES (3722, '', 1, '', 'RENSWOUDE', 'Jan-Zacharias Nauwman', 1150, NULL, '1756', NULL, NULL, 'A', 'A', '1757-12-30', 'Texel', '1758-05-07', '1758-05-17', true, '1758-08-03', 'Batavia', 7550, 'During the voyage one soldier probably became seafarer. After arrival at Batavia the RENSWOUDE sailed on to China.');
INSERT INTO "voyages" VALUES (3723, '', 1, '', 'ZEELELIE', 'Jakob la Mote', 600, NULL, '1755', NULL, NULL, 'Z', 'Z', '1757-12-30', 'Rammekens', '1758-05-29', '1758-07-02', true, '1758-09-19', 'Batavia', NULL, 'The ZEELELIE did not call at the Cape but at Simon''s Bay. In 1764 the ship was wrecked during a voyage to Banda.');
INSERT INTO "voyages" VALUES (3724, '', 5, '', 'SLOT VAN KAPELLE', 'Anthonie Henemans +', 1150, NULL, '1745', NULL, NULL, 'A', 'A', '1758-01-15', 'Texel', '1758-05-19', '1758-06-13', true, '1758-08-22', 'Batavia', NULL, 'female slave. The SLOT VAN KAPELLE did not call at the Cape but at Simon''s Bay. Between Simon''s Bay and Batavia Anthonie Henemans died; Michiel Hamelo succeeded him as master. On 13-08-1758 18 soldiers went ashore at Bantam. During the voyage 3 soldiers probably became seafarers. The ship was sold in the Indies on 20-09-1763.');
INSERT INTO "voyages" VALUES (3725, '', 2, '', 'HUIS TE BOEDE', 'Huibrecht van der Kneu', 880, NULL, '1753', NULL, NULL, 'Z', 'Z', '1758-01-21', 'Rammekens', '1758-05-12', '1758-05-24', true, '1758-07-28', 'Batavia', 7573, 'During the voyage one soldier probably became seafarer.');
INSERT INTO "voyages" VALUES (3726, '', 1, '', 'BLEISWIJK', 'Hans Coenraads', 880, NULL, '1756', NULL, NULL, 'D', 'D', '1758-04-09', 'Goeree', '1758-07-19', '1758-08-12', true, '1758-10-13', 'Batavia', 7597, 'The BLEISWIJK did not call at the Cape but at False Bay.');
INSERT INTO "voyages" VALUES (3727, '', 6, '', 'STANDVASTIGHEID', 'Herman de Kool', 850, NULL, '1743', NULL, NULL, 'R', 'R', '1758-04-20', 'Goeree', '1758-07-29', '1758-08-24', true, '1758-10-31', 'Batavia', 7554, 'The STANDVASTIGHEID did not call at the Cape but at Simon''s Bay.');
INSERT INTO "voyages" VALUES (3728, '', 5, '', 'HOF D''UNO', 'Louis de Jonge', 1150, NULL, '1743', NULL, NULL, 'H', 'Z', '1758-04-24', 'Rammekens', '1758-08-19', '1758-10-02', true, '1758-12-16', 'Batavia', NULL, 'Indies on 28-12-1762.');
INSERT INTO "voyages" VALUES (3729, '', 2, '', 'BUITENZORG', 'Jurriaan Molensteen', 880, NULL, '1753', NULL, NULL, 'A', 'A', '1758-05-07', 'Texel', '1758-08-27', '1758-09-20', true, '1758-12-11', 'Batavia', 7553, NULL);
INSERT INTO "voyages" VALUES (3730, '', 5, '', 'LEIDEN', 'Thomas Middelmeer', 1150, NULL, '1744', NULL, NULL, 'A', 'A', '1758-05-07', 'Texel', '1758-09-04', '1758-10-03', true, '1758-12-11', 'Batavia', NULL, 'Indies on 24-07-1764.');
INSERT INTO "voyages" VALUES (3731, '', 3, '', 'LUXEMBURG', 'Dirk Pietersz.', 1150, NULL, '1750', NULL, NULL, 'A', 'A', '1758-05-07', 'Texel', '1758-08-25', '1758-09-20', true, '1758-12-08', 'Batavia', 7548, NULL);
INSERT INTO "voyages" VALUES (3732, '', 2, '', 'WELGELEGEN', 'Jochem Aldertsz. Tarnike', 880, NULL, '1753', NULL, NULL, 'E', 'E', '1758-05-14', 'Texel', '1758-10-13', '1758-12-02', true, '1759-03-09', 'Batavia', 7580, 'soldiers probably became seafarers.');
INSERT INTO "voyages" VALUES (3733, '', 2, '', 'VISVLIET', 'Justus Baak', 880, NULL, '1752', NULL, NULL, 'Z', 'Z', '1758-05-15', 'Rammekens', '1758-09-14', '1758-10-15', true, '1758-12-26', 'Batavia', 7571, NULL);
INSERT INTO "voyages" VALUES (3734, '', 6, '', 'GERECHTIGHEID', 'Jan Mulder', 850, NULL, '1742', NULL, NULL, 'E', 'H', '1758-05-16', 'Texel', '1758-09-15', '1758-10-15', true, '1758-12-26', 'Batavia', NULL, '19 till 23-06-1758, where one soldier died, and another one deserted. The ship was sold in the Indies on 05-07-1763.');
INSERT INTO "voyages" VALUES (3735, '', 4, '', 'EENDRACHT', 'Hendrik Hartsing', 1150, NULL, '1748', NULL, NULL, 'A', 'A', '1758-07-02', 'Texel', '1758-11-04', '1758-12-22', true, '1759-04-16', 'Batavia', 7593, 'On 12-07-1758 the EENDRACHT called at Torbay, where two seafarers died. 3735/7593 Is the fourth voyage of this ship, which during its first two voyages was called ELSWOUD (see 3503/7398).');
INSERT INTO "voyages" VALUES (3736, '', 2, '', 'DE DRIE PAPEGAAIEN', 'Coenraad Dirk Wolk', 1150, NULL, '1752', NULL, NULL, 'A', 'A', '1758-07-02', 'Texel', '1758-11-14', '1758-12-03', true, '1759-02-13', 'Batavia', 7603, 'seafarer and 3 soldiers deserted, one seafarer and one soldier were taken aboard. The 2 passengers who embarked at the Cape were condemned ex-soldiers; they were transported to the small island Edam off Batavia.');
INSERT INTO "voyages" VALUES (3737, '', 3, '', 'VRIJBURG', 'Laurens Houtepen', 1150, NULL, '1748', NULL, NULL, 'Z', 'Z', '1758-07-20', 'Rammekens', '1758-11-04', '1758-12-31', true, '1759-05-01', 'Batavia', 7576, 'The 2 passengers who went aboard the VRIJBURG at the Cape were criminals; they had been banished to Edam off Batavia for two years.');
INSERT INTO "voyages" VALUES (3738, '', 4, '', 'HUIS TEN DONK', 'Arend van der Deuren', 875, NULL, '1745', NULL, NULL, 'R', 'R', '1758-10-04', 'Goeree', '1759-01-17', '1759-02-07', true, '1759-04-29', 'Batavia', 7570, 'At the Cape one soldier became seafarer.');
INSERT INTO "voyages" VALUES (3739, '', 3, '', 'ERFPRINS', 'Jakob Welgevaren', 850, NULL, '1750', NULL, NULL, 'D', 'D', '1758-10-04', 'Goeree', NULL, NULL, true, NULL, NULL, NULL, 'It was replaced by another ERFPRINS, previously called DELFT; in April 1759 the new ERFPRINS departed from Goeree (see 3757).');
INSERT INTO "voyages" VALUES (3740, '', 3, '', 'LIEFDE', 'Simon de Graaf', 1150, NULL, '1748', NULL, NULL, 'A', 'Z', '1758-10-04', 'Rammekens', '1759-01-29', '1759-03-07', true, '1759-06-20', 'Batavia', 7575, 'The 6 passengers included one slave; he disembarked at the Cape. Before the LIEFDE arrived at Batavia 55 soldiers were taken over by the LEIDEN, which since January 1759 was on service in the inter-Asiatic trade (see 3730).');
INSERT INTO "voyages" VALUES (3741, '', 1, '', 'NOORD-BEVELAND', 'Jakob Reysik', 1150, NULL, '1756', NULL, NULL, 'Z', 'Z', '1758-10-04', 'Rammekens', '1759-02-19', '1759-03-05', true, '1759-06-20', 'Batavia', 7560, 'The passenger was a slave. One day after the departure from Rammekens the NOORD-BEVELAND returned. on 14-10 it finally set out. From 04 till 19-02-1759 the ship was at Robben Island, where one seafarer and 4 soldiers died. Before it arrived at Batavia 24 soldiers were taken over by the LEIDEN, which since January 1759 was on service in the inter-Asiatic trade (see 3730).');
INSERT INTO "voyages" VALUES (3742, '', 2, '', 'SCHAGEN', 'Klaas Ariensz.', 880, NULL, '1753', NULL, NULL, 'H', 'H', '1758-10-07', 'Texel', '1759-01-29', '1759-03-02', true, '1759-06-17', 'Batavia', 7564, NULL);
INSERT INTO "voyages" VALUES (3743, '', 2, '', 'SCHOLTENBURG', 'Steven Lodewijk de Lill', 880, NULL, '1753', NULL, NULL, 'A', 'A', '1758-10-22', 'Texel', '1759-03-11', NULL, true, '1759-03-11', 'The Cape', 7581, 'members of the crews were accused of having smuggled with goods from the NAARSTIGHEID. After a protracted judicial inquiry the SCHOLTENBURG sailed for patria again in February 1760 (see 7581).');
INSERT INTO "voyages" VALUES (3744, '', 1, '', 'VROUWE ELISABETH DOROTHEA', 'Klaas Andersen', 600, NULL, '1757', NULL, NULL, 'A', 'A', '1758-11-27', 'Texel', '1759-03-13', '1759-04-16', true, '1760-01-01', 'Bengal', 7667, NULL);
INSERT INTO "voyages" VALUES (3745, '', 2, '', 'VLISSINGEN', 'Laurens Helmstrom', 880, NULL, '1754', NULL, NULL, 'Z', 'Z', '1758-11-27', 'Rammekens', '1759-03-05', '1759-04-16', true, '1759-06-29', 'Batavia', 7592, 'The 4 passengers who embarked at the Cape included one condemned person, banished to Edam off Batavia.');
INSERT INTO "voyages" VALUES (3746, '', 4, '', 'WAAKZAAMHEID', 'Jan de Zee', 850, NULL, '1744', NULL, NULL, 'E', 'E', '1758-11-27', 'Texel', '1759-03-13', '1759-03-31', true, '1759-06-17', 'Batavia', NULL, 'WAAKZAAMHEID was sold in the Indies on 19-10-1762.');
INSERT INTO "voyages" VALUES (3747, '', 2, '', 'WALCHEREN', 'Hans Kornelisz.', 1150, NULL, '1754', NULL, NULL, 'Z', 'Z', '1758-11-27', 'Rammekens', '1759-03-05', '1759-04-16', true, '1759-06-21', 'Ceylon', 7591, NULL);
INSERT INTO "voyages" VALUES (3748, '', 1, '', 'VROUWE GEERTRUIDA', 'Christiaan Hagerop', 1100, NULL, '1757', NULL, NULL, 'A', 'A', '1758-12-01', 'Texel', '1759-03-29', '1759-04-09', true, '1759-07-06', 'Batavia', 7577, 'The VROUWE GEERTRUIDA called at S. Tiago from 07 till 14-01-1759, where one seafarer and 6 soldiers died. After arrival at Batavia the ship sailed on to China.');
INSERT INTO "voyages" VALUES (3749, '', 1, '', 'KRONENBURG', 'Willem Hoogland', 1100, NULL, '1757', NULL, NULL, 'A', 'A', '1758-12-01', 'Texel', '1759-03-28', '1759-04-04', true, '1759-06-20', 'Batavia', 7578, 'After arrival at Batavia the KRONENBURG sailed on to China.');
INSERT INTO "voyages" VALUES (3750, '', 2, '', 'VROUWE PETRONELLA MARIA', 'Reinier Jan Elsevier+', 1100, NULL, '1755', NULL, NULL, 'A', 'A', '1758-12-01', 'Texel', '1759-03-30', '1759-04-12', true, '1759-06-29', 'Batavia', 7579, 'Between the Cape and Batavia Reinier Jan Elsevier died; Simon Bot succeeded him as master. During the voyage two soldiers probably became seafarers.');
INSERT INTO "voyages" VALUES (3751, '', 6, '', 'HOOP', 'Pieter Broman', 850, NULL, '1742', NULL, NULL, 'D', 'A', '1759-02-19', 'Texel', '1759-07-12', '1759-08-12', true, '1759-10-03', 'Batavia', 7567, 'An earlier departure took place on 22-01-1759, but adverse wind forced the HOOP to return to Texel on 28-01. From 04 till 19-04-1759 the ship was at S. Tiago. where one seafarer and one soldier deserted. It did not call at the Cape but at False Bay. During the voyage 3 soldiers probably became seafarers.');
INSERT INTO "voyages" VALUES (3752, '', 3, '', 'KATTENDUKE', 'Dirk Wagtels', 880, NULL, '1750', NULL, NULL, 'Z', 'Z', '1759-02-19', 'Rammekens', '1759-05-31', '1759-07-01', true, '1759-09-06', 'Batavia', 7622, 'The KATTENDIJKE did not call at the Cape but at False Bay.');
INSERT INTO "voyages" VALUES (3753, '', 1, '', 'NEPTUNUS', 'B. van Pantegem', 180, 'hoeker', '1757', NULL, NULL, 'Z', 'Z', '1759-02-19', 'Rammekens', '1759-08-27', NULL, true, '1759-08-27', 'Cape', NULL, 'The NEPTUNUS remained on service at the Cape; in 1775 the ship was laid up (01-03) and broken up.');
INSERT INTO "voyages" VALUES (3754, '', 3, '', 'RUITEVELD', 'Paulus Engelaar', 1150, NULL, '1752', NULL, NULL, 'A', 'A', '1759-02-19', 'Texel', '1759-05-30', '1759-07-21', true, '1759-09-06', 'Ceylon', 7626, '19-02-1759 Was the final date of departure of the RUITEVELD; on 22-01 the ship sailed out for the first time, but 6 days later it had to return to Texel.');
INSERT INTO "voyages" VALUES (3755, '', 2, '', 'LEKKERLAND', 'Johan Sigismund Hoeve', 1150, NULL, '1753', NULL, NULL, 'A', 'A', '1759-03-05', 'Texel', '1759-07-11', '1759-07-30', true, '1759-10-04', 'Batavia', 7611, 'MARIENBOS (see 3605/7508).');
INSERT INTO "voyages" VALUES (3756, '', 2, '', 'RADERMACHER', 'Pieter Ruis +', 1150, NULL, '1753', NULL, NULL, 'Z', 'Z', '1759-04-02', 'Rammekens', '1759-07-19', '1759-08-26', true, '1759-11-01', 'Batavia', 7587, 'False Bay. After the departure from False Bay Pieter Ruis died; Gerard Rijnder succeeded him as master.');
INSERT INTO "voyages" VALUES (3757, '', 3, '', 'ERFPRINS', 'Simon van Dalen', 850, NULL, '1752', NULL, NULL, 'D', 'D', '1759-04-09', 'Goeree', '1759-08-03', '1759-08-26', true, '1759-10-30', 'Batavia', 7607, 'The ERFPRINS did not call at the Cape but at False Bay. 3757/7606 Is the third voyage of this ship, which during both preceding voyages was called DELFT (see 3696/7518); the new ERFPRINS replaced the previous ERFPRINS, wrecked in October 1758 near Calais (see 3739).');
INSERT INTO "voyages" VALUES (3758, '', 3, '', 'VREDESTEIN', 'Jakob Claeys', 880, NULL, '1750', NULL, NULL, 'R', 'R', '1759-04-09', 'Goeree', '1759-07-08', '1759-07-28', true, '1759-09-26', 'Batavia', 7604, 'From 07 till 09-05-1759 the VREDESTEIN was at S. Tiago. The ship did not call at the Cape but at False Bay.');
INSERT INTO "voyages" VALUES (3759, '', 1, '', 'NIJENBORG', 'Klaas Stuiver', 880, NULL, '1757', NULL, NULL, 'H', 'H', '1759-04-10', 'Texel', '1759-08-03', '1759-08-19', true, '1759-10-12', 'Batavia', 7612, '03 till 19-08-1759.');
INSERT INTO "voyages" VALUES (3760, '', 5, '', 'IMMAGONDA', 'Jan Frederik Schrijver', 850, NULL, '1746', NULL, NULL, 'E', 'E', '1759-04-30', 'Texel', '1759-08-20', '1759-09-08', true, '1759-11-13', 'Batavia', 7574, 'The 2 passengers who embarked at the Cape were condemned persons.');
INSERT INTO "voyages" VALUES (3761, '', 2, '', 'BLIJDORP', 'Kornelis Nannings', 880, NULL, '1754', NULL, NULL, 'R', 'A', '1759-05-03', 'Goeree', '1759-08-28', '1759-09-15', true, '1759-10-21', 'Batavia', 7582, 'Adverse wind forced the BLIJDORP to call at Duins (05 till 17-05-1759) where two soldiers were pressed by the English.');
INSERT INTO "voyages" VALUES (3762, '', 6, '', 'BROUWER', 'Barend Rust', 850, NULL, '1743', NULL, NULL, 'H', 'A', '1759-05-19', 'Texel', '1759-10-21', '1759-11-15', true, '1760-02-09', 'Batavia', NULL, 'The BROUWER called at S. Tiago from 24-06 till 05-07-1759, where 4 soldiers disembarked. During the voyage 3 soldiers probably became seafarers. The ship was sold in the Indies on 24-07-1764.');
INSERT INTO "voyages" VALUES (3763, '', 5, '', 'SLOTEN', 'Dirk van Maastricht', 1150, NULL, '1746', NULL, NULL, 'A', 'A', '1759-05-19', 'Texel', '1759-08-28', '1759-09-15', true, '1759-12-27', 'Batavia', 7588, NULL);
INSERT INTO "voyages" VALUES (3764, '', 6, '', 'ZUIDERBURG', 'Jan van Dalen', 1150, NULL, '1743', NULL, NULL, 'A', 'A', '1759-05-19', 'Texel', '1759-10-19', '1759-11-15', true, '1760-02-16', 'Batavia', NULL, 'who came aboard at the Cape included 5 condemned persons. During the voyage one soldier possibly became seafarer. The ZUID-ERBURG was laid up in the Indies on 20-10-1764.');
INSERT INTO "voyages" VALUES (3765, '', 2, '', '''S GRAVENZANDE', 'Pieter Hogendorp', 880, NULL, '1754', NULL, NULL, 'D', 'D', '1759-06-21', 'Goeree', '1759-10-27', '1759-11-15', true, '1760-02-10', 'Batavia', 7621, 'During the voyage one soldier probably became seafarer.');
INSERT INTO "voyages" VALUES (3766, '', 3, '', 'KEUKENHOF', 'Anthonie Leertouwer', 1150, NULL, '1753', NULL, NULL, 'A', 'Z', '1759-07-28', 'Rammekens', '1759-12-10', '1760-01-06', true, '1760-04-29', 'Batavia', 7618, 'On 19-09-1759 the KEUKENHOF called at S. Tiago for a few hours.');
INSERT INTO "voyages" VALUES (3767, '', 1, '', 'DUINENBURG', 'Christiaan de Jong', 1100, NULL, '1757', NULL, NULL, 'Z', 'Z', '1759-09-21', 'Rammekens', '1760-01-17', '1760-02-28', true, '1760-06-01', 'Batavia', 7628, 'The passenger who embarked at the Cape was a condemned seafarer, banished for one year to Edam off Batavia.');
INSERT INTO "voyages" VALUES (3768, '', 4, '', 'NIEUWLAND', 'Pieter Matthijs Joele', 880, NULL, '1749', NULL, NULL, 'R', 'R', '1759-10-02', 'Goeree', '1760-01-22', '1760-02-05', true, '1760-05-17', 'Batavia', 7583, 'probably became seafarers.');
INSERT INTO "voyages" VALUES (3769, '', 5, '', '- MARIENBOS', 'Nikolaas Pietersz.', 1150, NULL, '1744', NULL, NULL, 'A', 'A', '1759-10-29', 'Texel', '1760-03-10', '1760-04-08', true, '1760-06-16', 'Batavia', NULL, 'the ship was wrecked in a heavy storm near Ceylon.');
INSERT INTO "voyages" VALUES (3770, '', 1, '', 'OOSTERBEEK', 'Jan Schellinger', 1100, NULL, '1758', NULL, NULL, 'A', 'A', '1759-10-29', 'Texel', '1760-03-18', '1760-03-29', true, '1760-06-05', 'Batavia', 7594, 'After arrival at Batavia the OOSTER-BEEK sailed on to China.');
INSERT INTO "voyages" VALUES (3771, '', 3, '', 'OOSTHUIZEN', 'Adriaan de Graaf', 850, NULL, '1749', NULL, NULL, 'H', 'H', '1759-10-29', 'Texel', '1760-03-09', '1760-03-29', true, '1760-06-15', 'Batavia', 7600, 'The OOSTHUIZEN called at S. Tiago (19 till 26-12-1759) where 2 seafarers and one craftsmen died and 11 seafarers and 5 soldiers deserted. On 13-01-1760 the ship spoke the MARIENBOS (see 3769) and took over 2 seafarers. The 7 passengers who embarked at the Cape were 2 Chinese families, released from exile by the authorities.');
INSERT INTO "voyages" VALUES (3772, '', 1, '', 'OUDERAMSTEL', 'Jakob Wiebe', 1100, NULL, '1758', NULL, NULL, 'A', 'A', '1759-10-29', 'Texel', '1760-03-22', '1760-04-07', true, '1760-06-20', 'Batavia', 7595, 'and 2 soldiers were pressed by the English. After arrival at Batavia the ship sailed on to China.');
INSERT INTO "voyages" VALUES (3773, '', 2, '', 'VROUWE PETRONELLA', 'Pieter de Leur', 880, NULL, '1755', NULL, NULL, 'E', 'E', '1759-10-29', 'Texel', '1760-02-28', '1760-03-16', true, '1760-06-17', 'Batavia', 7586, NULL);
INSERT INTO "voyages" VALUES (3774, '', 2, '', 'LAPIENENBURG', 'Jean de la Voie', 11, NULL, '1753', NULL, NULL, 'A', 'A', '1759-11-16', 'Texel', '1760-03-18', '1760-04-08', true, '1760-07-01', 'Batavia', 7610, NULL);
INSERT INTO "voyages" VALUES (3775, '', 5, '', 'OVERSCHIE', 'P. van Kronenburg', 850, NULL, '1745', NULL, NULL, 'D', 'D', '1759-11-19', 'Goeree', '1760-03-17', '1760-04-08', true, '1760-06-17', 'Batavia', 7585, NULL);
INSERT INTO "voyages" VALUES (3776, '', 5, '', 'HUIS TE MANPAD', 'Willem Klump', 850, NULL, '1745', NULL, NULL, 'A', 'A', '1759-12-05', 'Texel', '1760-03-18', '1760-04-15', true, '1761-01-09', 'Bengal', NULL, 'In 1766 the HUIS TE MANPAD was sold in the Indies.');
INSERT INTO "voyages" VALUES (3777, '', 2, '', 'VELSEN', 'Hendrik Winkelman', 1100, NULL, '1756', NULL, NULL, 'A', 'A', '1759-12-05', 'Texel', '1760-03-05', '1760-03-16', true, '1760-06-05', 'Batavia', 7596, 'After arrival at Batavia the VELSEN sailed on to China.');
INSERT INTO "voyages" VALUES (3778, '', 5, '', 'SPARENRIJK', 'Andries Lint', 850, NULL, '1745', NULL, NULL, 'A', 'A', '1759-12-06', 'Texel', '1760-03-18', '1760-05-10', true, '1760-07-19', 'Batavia', NULL, 'On 27-03-1762 the SPARENDIJK was wrecked in a heavy storm near Ceylon.');
INSERT INTO "voyages" VALUES (3779, '', 2, '', 'BARBARA THEODORA', 'Pieter Visser', 1150, NULL, '1753', NULL, NULL, 'Z', 'Z', '1760-01-06', 'Rammekens', '1760-03-28', '1760-04-15', true, '1760-06-29', 'Batavia', 7584, NULL);
INSERT INTO "voyages" VALUES (3780, '', 3, '', 'SNOEK', 'Leendert Kouw', 880, NULL, '1750', NULL, NULL, 'Z', 'Z', '1760-01-06', 'Rammekens', '1760-03-28', '1760-04-23', true, '1760-06-25', 'Batavia', 7614, 'During the voyage one soldier probably became seafarer.');
INSERT INTO "voyages" VALUES (3781, '', 4, '', 'BOSSCHENHOVE', 'Kornelis van der Stam', 1150, NULL, '1750', NULL, NULL, 'A', 'A', '1760-03-26', 'Texel', '1760-07-05', '1760-07-22', true, '1760-10-07', 'Ceylon', 7624, NULL);
INSERT INTO "voyages" VALUES (3782, '', 2, '', 'RENSWOUDE', 'Isaak van den Berg', 1150, NULL, '1756', NULL, NULL, 'A', 'A', '1760-03-26', 'Texel', '1760-07-05', '1760-08-09', true, '1761-01-01', 'Ceylon', 7725, NULL);
INSERT INTO "voyages" VALUES (3783, '', 3, '', 'TORENVLIET', 'Huibrecht van der Kneu', 1150, NULL, '1750', NULL, NULL, 'Z', 'Z', '1760-03-30', 'Rammekens', '1760-06-28', '1760-07-22', true, '1760-09-26', 'Batavia', 7616, 'The TORENVLIET called at Bantam, where 95 soldiers went ashore (23-09-1760).');
INSERT INTO "voyages" VALUES (3784, '', 4, '', 'GOUVERNEUR-GENERAAL', 'Bartholomeus Schut', 850, NULL, '1749', NULL, NULL, 'D', 'D', '1760-04-24', 'Goeree', '1760-07-14', '1760-08-23', true, '1760-10-19', 'Batavia', 7608, NULL);
INSERT INTO "voyages" VALUES (3785, '', 3, '', 'JERUSALEM', 'Godfried Wargijn', 880, NULL, '1753', NULL, NULL, 'R', 'A', '1760-04-24', 'Texel', '1760-07-28', '1760-08-23', true, '1760-11-03', 'Batavia', 7599, NULL);
INSERT INTO "voyages" VALUES (3786, '', 3, '', 'PIJLSWAART', 'Jakob Ketel', 880, NULL, '1752', NULL, NULL, 'H', 'H', '1760-04-27', 'Texel', '1760-07-24', '1760-08-23', true, '1760-10-13', 'Batavia', 7601, 'During the voyage one soldier probably became a seafarer.');
INSERT INTO "voyages" VALUES (3787, '', 3, '', 'DEUNISVELD', 'Leendert Diikveld', 850, NULL, '1747', NULL, NULL, 'D', 'E', '1760-05-13', 'Texel', '1760-09-02', '1760-10-14', true, '1760-12-28', 'Batavia', NULL, 'DEUNISVELD called at S. Tiago (29-06 till 03-07-1760), where 2 seafarers and one soldier died and 3 seafarers and 3 soldiers went missing; 6 soldiers were taken aboard. The passengers who embarked at the Cape were criminals, banished to Edam off Batavia. In 1766 the DEUNISVELD was sold in the Indies.');
INSERT INTO "voyages" VALUES (3788, '', 4, '', 'LUXEMBURG', 'Dirk Pietersz.', 1150, NULL, '1750', NULL, NULL, 'A', 'A', '1760-05-13', 'Texel', '1760-09-25', '1760-10-14', true, '1760-12-24', 'Batavia', 7625, 'At the Cape Christiaan Kornelis Testrop succeeded Dirk 
INSERT INTO "voyages" VALUES (3789, '', 1, '', 'SCHOONZICHT', 'Jochem Hendrik Dodendorp', 880, NULL, '1758', NULL, NULL, 'R', 'R', '1760-05-24', 'Goeree', '1760-09-24', '1760-10-14', true, '1760-12-24', 'Batavia', 7629, 'seafarer and 5 soldiers deserted and 2 seafarers were taken aboard. Before arrival at S. Tiago one soldier had been pressed by an English warship.');
INSERT INTO "voyages" VALUES (3790, '', 5, '', 'WILDRIJK', 'Jan Moorland', 850, NULL, '1744', NULL, NULL, 'A', 'A', '1760-06-06', 'Texel', '1760-09-30', '1760-10-15', true, '1761-01-10', 'Batavia', 7623, '(03 till 09-07-1760), where one soldier died, another one deserted and 2 soldiers were taken aboard. During the voyage one soldier probably became seafarer.');
INSERT INTO "voyages" VALUES (3791, '', 3, '', 'VLIETLUST', 'Jakob Boekhout', 1150, NULL, '1752', NULL, NULL, 'A', 'Z', '1760-07-02', 'Rammekens', '1760-11-08', '1760-12-06', true, '1761-02-15', 'Batavia', 7627, NULL);
INSERT INTO "voyages" VALUES (3792, '', 5, '', 'GUSTAAF WILLEM', 'Michiel Godfried Lehman', 1150, NULL, '1744', NULL, NULL, 'Z', 'Z', '1760-09-05', 'Rammekens', '1761-01-23', '1761-03-16', true, '1761-06-09', 'Batavia', NULL, 'Ten of the 33 seafarers who went ashore at the Cape were handed over to the law. In 1764 the GUSTAAF WILLEM was laid up in the Indies.');
INSERT INTO "voyages" VALUES (3793, '', 1, '', 'BORSSELE', 'Abraham in `t Anker', 1150, NULL, '1758', NULL, NULL, 'Z', 'Z', '1761-01-09', 'Rammekens', '1761-04-20', '1761-05-07', true, '1761-07-07', 'Batavia', 7669, 'The 5 passengers included 2 female slaves. The 47 persons who disembarked at the Cape included 3 deserters.');
INSERT INTO "voyages" VALUES (3794, '', 2, '', 'NOORD-BEVELAND', 'Jakob Reysik', 1150, NULL, '1756', NULL, NULL, 'Z', 'Z', '1761-01-09', 'Rammekens', '1761-04-20', '1761-05-07', true, '1761-07-18', 'Batavia', 7647, 'The 4 passengers who embarked at Rammekens included one female slave. The passenger who came aboard at the Cape was a Chinese, released from exile.');
INSERT INTO "voyages" VALUES (3795, '', 4, '', 'ROTTERDAM', 'Frederik Wielard', 850, NULL, '1748', NULL, NULL, 'R', 'R', '1761-01-09', 'Goeree', '1761-04-20', '1761-05-04', true, '1761-07-06', 'Batavia', 7605, 'From 19 till 23-01-1761 the ROTTERDAM was at Duins where 5 seafarers and one soldier were pressed by the English.');
INSERT INTO "voyages" VALUES (3796, '', 4, '', 'AMERONGEN', 'Jan Spek', 1150, NULL, '1749', NULL, NULL, 'A', 'A', '1761-01-27', 'Texel', '1761-06-26', '1761-07-25', true, '1762-05-04', 'Ceylon', 7638, '3796/7638 Is the fourth voyage of this ship, which during its first two voyages was called ROZENBURG (see 3642/7477), and during its third voyage OVERNES (see 3700/7544); after return to patria in 1763 it was to make one other voyage, sailing again as AMERONGEN (see 3901/4');
INSERT INTO "voyages" VALUES (3797, '', 1, '', 'DAMZICHT', 'Kornelis Stuurman', 1150, NULL, '1759', NULL, NULL, 'A', 'A', '1761-01-27', 'Texel', '1761-04-24', '1761-05-04', true, '1761-07-07', 'Batavia', 7619, 'Eight of the 37 persons who disembarked at the Cape were deserters. After arrival at Batavia the DAMZICHT sailed on to China.');
INSERT INTO "voyages" VALUES (3798, '', 5, '', 'HUIS TEN DONK', 'Pieter Albertsz. +', 875, NULL, '1745', NULL, NULL, 'R', 'A', '1761-01-27', 'Texel', '1761-06-25', '1761-07-19', true, '1761-09-14', 'Batavia', 7, 'between patria and the Cape, Jan Beys succeeded him as master. The HUIS TEN DONK called at Torbay (01 till 03-02-1761). When it set out again 3 seafarers and 6 soldiers had deserted, 9 seafarers, 14 soldiers and the passenger had died.');
INSERT INTO "voyages" VALUES (3799, '', 5, '', 'GETROUWIGHEID', 'August Heynenberg', 850, NULL, '1744', NULL, NULL, 'H', 'H', '1761-01-27', 'Texel', '1761-04-23', '1761-05-04', true, '1761-07-03', 'Batavia', NULL, 'In 1762 the GETROUWIGHEID ran aground in the Bay of Goa and was wrecked.');
INSERT INTO "voyages" VALUES (3800, '', 4, '', 'KIEVITSHEUVEL', 'Markus Tetting', 1150, NULL, '1749', NULL, NULL, 'A', 'A', '1761-01-27', 'Texel', '1761-06-11', '1761-06-29', true, '1761-09-02', 'Batavia', 7609, 'did so: on 02-11-1761, two months after its arrival, the KIEVITSHEUVEL started the return voyage to patria, departing from Batavia.');
INSERT INTO "voyages" VALUES (3801, '', 1, '', 'JONGE LIEVE', 'Kornelis Kuiper', 1150, NULL, '1759', NULL, NULL, 'A', 'A', '1761-01-27', 'Texel', '1761-05-13', '1761-05-28', true, '1761-07-25', 'Batavia', 7620, 'After arrival at Batavia the JONGE LIEVE sailed on to China.');
INSERT INTO "voyages" VALUES (3802, '', 1, '', 'MEERMIN', 'Hendrik Worms', 450, 'hoeker', '1759', NULL, NULL, 'A', 'A', '1761-01-27', 'Texel', '1761-06-15', NULL, true, '1761-06-15', 'The Cape', NULL, 'The MEERMIN remained on service of the authorities at the Cape until 09-04-1766, when it ran aground and was wrecked.');
INSERT INTO "voyages" VALUES (3803, '', 5, '', 'VROUWE REBECCA JACOBA', 'Anthonie Vogelzang', 1150, NULL, '1747', NULL, NULL, 'A', 'A', '1761-01-27', 'Texel', '1761-05-12', '1761-06-01', true, '1761-07-16', 'Bengal', 3803, '/- Is the fifth voyage of this ship, which during its preceding four voyages was called SLOTERDIJK (number of the fourth voyage: 3761/7536); in 1768 the VROUWE REBECCA JACOBA was laid up in the Indies ?#?');
INSERT INTO "voyages" VALUES (3804, '', 4, '', 'STRALEN', 'Arie Arkebout', 850, NULL, '1748', NULL, NULL, 'E', 'E', '1761-01-27', 'Texel', '1761-06-07', '1761-06-28', true, '1761-09-13', 'Batavia', 7615, 'stowaways were discovered on the ship: they became seafarers.');
INSERT INTO "voyages" VALUES (3805, '', 7, '', 'HOOP', 'Herman de Kool', 850, NULL, '1742', NULL, NULL, 'D', 'D', '1761-01-29', 'Goeree', '1761-07-21', '1761-08-13', true, '1761-11-02', 'Batavia', 7632, '11-03-1761 the HOOP was at Duins: one seafarer and 9 soldiers went to English ships.');
INSERT INTO "voyages" VALUES (3806, '', 3, '', 'RHOON', 'Jan Bernard Schaper', 1150, NULL, '1752', NULL, NULL, 'Z', 'Z', '1761-03-09', 'Rammekens', '1761-07-02', '1761-07-25', true, '1761-09-23', 'Ceylon', NULL, 'On 27-03-1762 the RHOON was wrecked in a heavy storm near Ceylon.');
INSERT INTO "voyages" VALUES (3807, '', 5, '', 'VOSMAAR', 'Laurens Houtepen', 850, NULL, '1746', NULL, NULL, 'Z', 'Z', '1761-03-29', 'Rammekens', '1761-06-25', '1761-07-13', true, '1761-09-25', 'Batavia', 7636, 'Four of the 26 seafarers who went ashore at the Cape were deserters.');
INSERT INTO "voyages" VALUES (3808, '', 3, '', 'SCHOLTENBURG', 'Leendert van der Linden', 880, NULL, '1753', NULL, NULL, 'A', 'D', '1761-04-06', 'Goeree', '1761-07-17', '1761-08-02', true, '1761-09-29', 'Batavia', 7642, 'The SCHOLTENBURG did not call at the Cape but at False Bay. During the voyage 2 soldiers possibly became seafarers.');
INSERT INTO "voyages" VALUES (3809, '', 3, '', 'SCHAGEN', 'Klaas Ariensz.', 880, NULL, '1753', NULL, NULL, 'H', 'H', '1761-04-19', 'Texel', NULL, NULL, false, '1761-09-24', 'Batavia', 7613, NULL);
INSERT INTO "voyages" VALUES (3810, '', 2, '', 'OVERNES', 'Christoffel Blom', 1150, NULL, '1754', NULL, NULL, 'A', 'A', '1761-05-09', 'Texel', '1761-09-13', '1761-10-03', true, '1761-12-19', 'Batavia', 7658, 'AMERONGEN (see 3664/7555).');
INSERT INTO "voyages" VALUES (3811, '', 2, '', 'SLOTERDIJK', 'Jan Siewersz.', 1150, NULL, '1754', NULL, NULL, 'A', 'A', '1761-05-09', 'Texel', '1761-09-14', '1761-10-03', true, '1761-12-21', 'Batavia', 7664, 'was at Duins: 4 seafarers and 6 soldiers were pressed by an English warship. It also called at S. Tiago, 23 till 28-06-1761: 4 seafarers and 2 soldiers deserted. The 14 soldiers who went ashore at the Cape included 6 deserters. 3811/7664 Is the second voyage of this ship, which during its first voyage was called VROUWE REBECCA JACOBA (see 3668/1568).');
INSERT INTO "voyages" VALUES (3812, '', 2, '', 'VROUWE ELIZABETH', 'Arend van der Deuren', 850, NULL, '1755', NULL, NULL, 'R', 'R', '1761-05-27', 'Goeree', '1761-09-01', '1761-09-18', true, '1761-11-27', 'Batavia', 7631, 'called at Bantam: 4 seafarers and 71 soldiers disembarked.');
INSERT INTO "voyages" VALUES (3813, '', 5, '', 'LANGEWIJK', 'Daniel Nieman', 850, NULL, '1745', NULL, NULL, 'E', 'E', '1761-05-27', 'Texel', '1761-09-12', '1761-10-03', true, '1761-12-18', 'Batavia', NULL, 'The LANGEWIJK was laid up and sold at Batavia, 14-01-1768.');
INSERT INTO "voyages" VALUES (3814, '', 3, '', 'VOORLAND', 'Paulus Hansen', 1150, NULL, '1750', NULL, NULL, 'A', 'A', '1761-06-15', 'Texel', '1761-12-30', '1762-01-16', true, '1762-03-23', 'Batavia', 7646, 'at Portsmouth 3 seafarers were pressed, 11 seafarers and 6 soldiers deserted, one seafarer and 3 soldiers died, and one seafarer went to an other ship; at S. Tiago one seafarer deserted.');
INSERT INTO "voyages" VALUES (3815, '', 4, '', 'NIEUW NIEUWERKERK', 'Adriaan van den Boer', 1150, NULL, '1749', NULL, NULL, 'Z', 'Z', '1761-08-05', 'Rammekens', '1761-12-25', '1762-01-16', true, '1762-05-18', 'Batavia', 7644, 'discovered as a stowaway on the NIJENBORG, which was returning to patria in 1761/2 (see 7612).');
INSERT INTO "voyages" VALUES (3816, '', 3, '', 'VISVLIET', 'Louis de Jonge', 880, NULL, '1752', NULL, NULL, 'Z', 'Z', '1761-08-05', 'Rammekens', '1761-12-25', '1762-01-26', true, '1762-05-08', 'Batavia', 7643, 'The VISVLIET called at Duins, 09 till 10-08-1761: one seafarer died. Between the Cape and Batavia 2 soldiers were taken over by an English ship.');
INSERT INTO "voyages" VALUES (3817, '', 3, '', 'HUIS TE BOEDE', 'Simon de Graaf', 880, NULL, '1753', NULL, NULL, 'Z', 'Z', '1761-09-25', 'Rammekens', '1762-02-04', '1762-03-04', true, '1762-05-24', 'Batavia', 7678, 'The 56 persons who went ashore at the Cape included 5 seafarers and one soldier who deserted.');
INSERT INTO "voyages" VALUES (3818, '', 1, '', 'VROUWE KORNELIA HILLEGONDA', 'Simon van Dalen', 850, NULL, '1760', NULL, NULL, 'D', 'D', '1761-09-28', 'Goeree', '1762-01-17', '1762-01-30', true, '1762-04-30', 'Batavia', 7685, 'The 17 persons who went ashore at the Cape included 4 seafarers and 2 soldiers who deserted.');
INSERT INTO "voyages" VALUES (3819, '', 7, '', 'STANDVASTIGHEID', 'Klaas Vermeulen', 850, NULL, '1750', NULL, NULL, 'R', 'R', '1761-09-28', 'Goeree', '1762-01-10', '1762-01-26', true, '1762-05-20', 'Batavia', NULL, 'Between the Cape and Batavia 4 seafarers, 6 soldiers and one craftsmen were pressed by an English warship. In 1768 the STANDVASTIGHEID was sold in the Indies.');
INSERT INTO "voyages" VALUES (3820, '', 1, '', 'BURCH', 'Dirk Wagtels', 1150, NULL, '1760', NULL, NULL, 'Z', 'Z', '1761-10-02', 'Rammekens', '1762-01-21', '1762-02-16', true, '1762-05-19', 'Batavia', 7654, 'two female slaves. Between patria and the Cape one seafarer and one craftsmen went missing. The 48 persons who went ashore at the Cape included 5 seafarers, one soldier and 2 craftsmen who deserted.');
INSERT INTO "voyages" VALUES (3821, '', 2, '', 'VROUWE GEERTRUIDA W', 'illem Everdingen vim der Nieuwpoort', 1100, NULL, '1757', NULL, NULL, 'A', 'A', '1761-10-06', 'Texel', '1762-02-13', '1762-03-02', true, '1762-05-23', 'Batavia', 7651, 'one soldier deserted, one seafarer died; at S. Tiago 3 seafarers and one soldier deserted.');
INSERT INTO "voyages" VALUES (3822, '', 2, '', 'OUDERAMSTEL', 'Simon Bot', 1100, NULL, '1758', NULL, NULL, 'A', 'A', '1761-10-11', 'Texel', '1762-02-14', '1762-04-04', true, '1762-06-05', 'Ceylon', 7653, 'From 14 till 21-10-1761 the OUDERAMSTEL was at Duins.');
INSERT INTO "voyages" VALUES (3823, '', 4, '', 'OUDKARSPEL', 'Willem van Braam', 1150, NULL, '1747', NULL, NULL, 'A', 'A', '1761-10-21', 'Texel', '1762-02-12', '1762-03-25', true, '1762-06-16', 'Batavia', 7635, NULL);
INSERT INTO "voyages" VALUES (3824, '', 3, '', 'AMELISWEERT', 'Honsdorp', 1150, NULL, '1753', NULL, NULL, 'A', 'A', '1761-12-12', 'Texel', '1762-03-28', '1762-04-18', true, '1762-06-23', 'Ceylon', NULL, 'voyage to Surat');
INSERT INTO "voyages" VALUES (3825, '', 1, '', 'ASCHAT', 'Kornelis Nannings', 1150, NULL, '1760', NULL, NULL, 'A', 'A', '1761-12-12', 'Texel', NULL, NULL, false, '1762-07-21', 'Batavia', 7639, 'Spithead 23 seafarers were taken over by the OOSTERBEEK (see 3831). On 12-07-1762 the ship took over 25 seafarers from the IMMAGONDA (see 3827). After having arrived at Batavia it sailed on to China.');
INSERT INTO "voyages" VALUES (3826, '', 3, '', 'BLIJDORP', 'Pieter Broman', 880, NULL, '1754', NULL, NULL, 'R', 'A', '1761-12-12', 'Texel', '1762-03-18', '1762-04-16', true, '1762-10-10', 'Batavia', 7655, '132 Of the 151 seafarers who disembarked at the Cape went to other ships; many of the 172 embarking soldiers carne from other ships. The BLIJDORP called at Tuticorin in India (23-06 till 21-08-1762): 11 seafarers were admitted to the hospital, one seafarer died, 172 soldiers and one passenger went ashore. During the voyage at least 9 soldiers possibly became seafarers.');
INSERT INTO "voyages" VALUES (3827, '', 6, '', 'IMMAGONDA', 'Jan Frederik Schrijver', 850, NULL, '1746', NULL, NULL, 'E', 'E', '1761-12-12', 'Texel', '1762-04-12', '1762-04-26', true, '1762-07-21', 'Batavia', 7630, 'seafarers were taken over by the ASCHAT (see 3825).');
INSERT INTO "voyages" VALUES (3828, '', 2, '', 'KRONENBURG', 'Johannes van Boom', 1100, NULL, '1757', NULL, NULL, 'A', 'Z', '1761-12-12', 'Rammekens', '1762-04-05', '1762-05-12', true, '1762-07-22', 'Batavia', 7717, 'The 94 disembarking seafarers and soldiers at the Cape included 10 seafarers and 65 soldiers who went to other ships.');
INSERT INTO "voyages" VALUES (3829, '', 4, '', 'LIEFDE', 'Hendrik Andries Tieding', 1150, NULL, '1748', NULL, NULL, 'A', 'A', '1761-12-12', 'Texel', '1762-04-15', '1762-05-13', true, '1762-07-21', 'Batavia', 7633, 'Between patria and the Cape one seafarer and two soldiers were pressed by the English. The 22 seafarers who went ashore at the Cape included two deserters.');
INSERT INTO "voyages" VALUES (3830, '', 4, '', 'LYCOCHTON', 'Klaas Stuiver', 880, NULL, '1749', NULL, NULL, 'E', 'H', '1761-12-12', 'Texel', '1762-03-23', '1762-04-08', true, '1762-07-03', 'Batavia', 7634, NULL);
INSERT INTO "voyages" VALUES (3831, '', 2, '', 'OOSTERBEEK', 'Jan Zacharias Nauwman', 1100, NULL, '1758', NULL, NULL, 'A', 'A', '1761-12-12', 'Texel', '1762-05-24', '1762-06-19', true, '1762-10-11', 'Bengal', NULL, 'The OOSTERBEEK called at Duins (17 till 22-12) and at Spithead (29-12-1761 till 23-01-1762); at Spithead the ship took over 23 seafarers from the ASCHAT (see 3825). Before sailing to Bengal it first called at Ceylon. See also 3834. In 1765 the OOSTER-BEEK ran aground at East Java and was wrecked.');
INSERT INTO "voyages" VALUES (3832, '', 3, '', 'VROUWE PETRONELLA MARIA', 'Jan van Eysden', 1100, NULL, '1755', NULL, NULL, 'A', 'A', '1761-12-12', 'Texel', '1762-03-28', '1762-04-08', true, '1762-07-03', 'Batavia', 7640, 'who went ashore at the Cape included one deserter. At Sunda Straits 3 seafarers were taken over by a Dutch jacht. After having arrived at Batavia the VROUWE PETRONELLA MARIA sailed on the China.');
INSERT INTO "voyages" VALUES (3833, '', 4, '', 'ADMIRAAL DE RUYTER', 'Hendrik Hilverduin', 1150, NULL, '1749', NULL, NULL, 'A', 'A', '1761-12-12', 'Texel', '1762-04-05', '1762-04-24', true, '1762-07-21', 'Batavia', NULL, 'English; between. the Cape and Batavia two seafarers went missing. After having arrived at Batavia the ADMIRAAL DE RUYTER sailed on to China.');
INSERT INTO "voyages" VALUES (3834, '', 3, '', 'WALCHEREN', 'Hans Kornelisz.', 1150, NULL, '1754', NULL, NULL, 'Z', 'Z', '1762-03-01', 'Rammekens', '1762-06-06', '1762-06-25', true, '1762-08-29', 'Batavia', 7637, '01-03-1762 Is the final date of departure of the WALCHEREN; on 25-01-1762 the ship vainly tried to sail out for the first time. The 133 persons who disembarked at the Cape included 12 seafarers and 98 soldiers who went to the OOSTERBEEK (see 3831).');
INSERT INTO "voyages" VALUES (3835, '', 2, '', 'BLEISWIJK', 'Bartholomeus Bigom', 880, NULL, '1756', NULL, NULL, 'D', 'D', '1762-04-05', 'Goeree', '1762-07-12', '1762-07-29', true, '1762-09-26', 'Batavia', 7650, NULL);
INSERT INTO "voyages" VALUES (3836, '', 3, '', 'VELSEN', 'Laurens Helmstrom', 1100, NULL, '1756', NULL, NULL, 'A', 'Z', '1762-04-14', 'Rammekens', '1762-08-21', '1762-09-12', true, '1762-11-29', 'Batavia', 7645, 'soldiers were pressed by the English.');
INSERT INTO "voyages" VALUES (3837, '', 3, '', 'WELGELEGEN', 'Jurriaan Molensteen', 880, NULL, '1753', NULL, NULL, 'E', 'A', '1762-04-15', 'Texel', '1762-08-21', '1762-09-06', true, '1762-11-07', 'Batavia', 7657, 'The WELGELEGEN called at Duins, 20 till 21-04-1762: 3 seafarers and 2 soldiers were pressed by the English. The 17 seafarers who went ashore there included one deserter.');
INSERT INTO "voyages" VALUES (3838, '', 5, '', 'AMSTELVEEN', 'Nikolaas Pietersz.', 1150, NULL, '1746', NULL, NULL, 'A', 'A', '1762-05-05', 'Texel', '1762-09-04', '1762-09-21', true, '1762-11-28', 'Batavia', NULL, 'deserted. On 05-08-1763 the AMSTELVEEN was wrecked off the Arabian Coast.');
INSERT INTO "voyages" VALUES (3839, '', 2, '', 'LEIMUIDEN', 'Barend de Rust', 1150, NULL, '1755', NULL, NULL, 'A', 'A', '1762-05-05', 'Texel', '1762-09-17', '1762-10-14', true, '1762-12-23', 'Batavia', 7714, 'From 07 till 15-06 the LEIMUIDEN was at S. Vincente: 7 soldiers deserted. On 16-06 one seafarer and one craftsmen were pressed by an English ship. The ship also called at S. Tiago, 17 till 25-06-1762: two soldiers were taken aboard.');
INSERT INTO "voyages" VALUES (3840, '', 5, '', 'NOORD NIEUWLAND', 'Joost van den Berg', 880, NULL, '1749', NULL, NULL, 'R', 'R', '1762-05-05', 'Goeree', '1762-08-21', '1762-09-06', true, '1762-11-10', 'Batavia', 7652, NULL);
INSERT INTO "voyages" VALUES (3841, '', 4, '', 'OOSTHUIZEN', 'Jan Mulder', 850, NULL, '1749', NULL, NULL, 'H', 'H', '1762-05-19', 'Texel', '1762-09-09', '1762-10-06', true, '1762-12-17', 'Batavia', 7656, NULL);
INSERT INTO "voyages" VALUES (3842, '', 1, '', 'ENKHUIZEN', 'Jakob de Vries', 880, NULL, '1760', NULL, NULL, 'E', 'E', '1762-06-14', 'Texel', '1762-11-26', '1762-12-08', true, '1763-03-02', 'Batavia', 7716, NULL);
INSERT INTO "voyages" VALUES (3843, '', 3, '', 'VLISSINGEN', 'Pieter Visser', 880, NULL, '1753', NULL, NULL, 'Z', 'Z', '1762-08-12', 'Rammekens', '1763-01-03', '1763-02-15', true, '1763-05-16', 'Batavia', 7662, 'The VLISSINGEN called at Portsmouth (23 till 27-08) and at S. Vincente (26-09 till 04-10-1762); at Portsmouth 3 seafarers were pressed by the English, one seafarer died; at S. Vincente one seafarer and 6 soldiers deserted; one Frenchman was taken aboard as seafarer.');
INSERT INTO "voyages" VALUES (3844, '', 1, '', 'HUTS TE BIJWEG', 'Dirk van Maastricht', 1100, NULL, '1760', NULL, NULL, 'A', 'A', '1762-09-14', 'Texel', '1763-01-16', '1763-02-09', true, '1763-05-15', 'Batavia', 7659, 'From 24-09 till 02-10-1762 the HUIS TE BIJWEG was at Duins. The ship sailed on to China.');
INSERT INTO "voyages" VALUES (3845, '', 6, '', 'SLOTEN', 'Hagerop', 1150, NULL, '1746', NULL, NULL, 'A', 'A', '1762-09-14', 'Texel', '1763-01-11', '1763-01-26', true, '1763-05-15', 'Batavia', 7660, 'The SLOTEN called at Spithead, 24-09 till 02-10-1762. The ship sailed on to China.');
INSERT INTO "voyages" VALUES (3846, '', 5, '', 'KIEVITSHEUVEL', 'Frederik Kelger', 1150, NULL, '1749', NULL, NULL, 'A', 'A', '1762-10-07', 'Texel', '1763-01-11', '1763-02-26', true, '1763-06-13', 'Batavia', 7680, NULL);
INSERT INTO "voyages" VALUES (3847, '', 6, '', 'OVERSCHIE', 'Jan Hendriksz. Vogelaar', 850, NULL, '1745', NULL, NULL, 'D', 'D', '1762-10-08', 'Goeree', '1763-01-05', '1763-01-16', true, '1763-04-17', 'Batavia', NULL, 'The 16 soldiers who went ashore at the Cape included one deserter. The OVERSCHIE was laid up in the Indies, 20-10-1764.');
INSERT INTO "voyages" VALUES (3848, '', 3, '', 'TULPENBURG', 'Gerrit Reyndertsz. Vos', 1150, NULL, '1750', NULL, NULL, 'A', 'Z', '1762-10-09', 'Rammekens', '1763-01-12', '1763-02-15', true, '1763-05-16', 'Batavia', 7699, '24 seafarers who went ashore at the Cape included 5 deserters.');
INSERT INTO "voyages" VALUES (3849, '', 4, '', 'VRIJBURG', 'Jakob Wiebe', 1150, NULL, '1748', NULL, NULL, 'Z', 'A', '1762-10-31', 'Texel', '1763-03-13', '1763-04-22', true, '1763-07-08', 'Batavia', 7666, 'persons who went ashore at the Cape included 7 seafarers and 6 soldiers who deserted.');
INSERT INTO "voyages" VALUES (3850, '', 1, '', 'WESTERVELD', 'Hans Bruns', 1100, NULL, '1761', NULL, NULL, 'A', 'A', '1762-10-31', 'Texel', '1763-03-08', '1763-03-22', true, '1763-06-09', 'Batavia', 7661, 'After having arrived at Batavia the WESTERVELD sailed on to China.');
INSERT INTO "voyages" VALUES (3851, '', 5, '', 'BAARZANDE', 'Pieter de Leur', 850, NULL, '1745', NULL, NULL, 'H', 'E', '1762-12-09', 'Texel', '1763-03-15', '1763-03-31', true, '1763-06-20', 'Batavia', 7649, 'The BAARZANDE called at S. Tiago, 04 till 14-01-1763. 3851/7649 Is the fifth voyage of this ship, which during its first two voyages and its third outward-voyage was called JAGER (numbers of the third voyage: 3612/7453).');
INSERT INTO "voyages" VALUES (3852, '', 4, '', 'JERUSALEM', 'Johan Sigismund Hoeve', 880, NULL, '1753', NULL, NULL, 'R', 'A', '1762-12-09', 'Texel', '1763-03-16', '1763-04-29', true, '1763-08-11', 'Bengal', 7688, NULL);
INSERT INTO "voyages" VALUES (3853, '', 2, '', 'LEKKERLUST', 'Adriaan de Graaf', 880, NULL, '1755', NULL, NULL, 'H', 'H', '1762-12-09', 'Texel', '1763-03-15', '1763-03-31', true, '1763-06-19', 'Batavia', 7677, 'The LEKKERLUST called at S. Tiago (04 till 14-01-1763): 3 seafarers and one soldier disembarked.');
INSERT INTO "voyages" VALUES (3854, '', 3, '', 'DE DRIE PAPEGAAIEN', 'Volkert Groeneweg van Oudshoom', 1150, NULL, '1752', NULL, NULL, 'A', 'A', '1762-12-09', 'Texel', '1763-03-15', '1763-04-25', true, '1763-07-05', 'Batavia', 7665, 'From 04 till 14-01-1763 the DRIE PAPEGAAIEN was at S. Tiago: one seafarer and two soldiers went missing, one seafarer died. The ship also called at Bantam (23-06-1763): 4 seafarers went to another ship.');
INSERT INTO "voyages" VALUES (3855, '', 4, '', 'VREDESTEIN', 'Jochem Hendrik Dodendorp', 880, NULL, '1750', NULL, NULL, 'R', 'R', '1762-12-10', 'Goeree', '1763-03-15', '1763-03-31', true, '1763-05-01', 'Batavia', 7676, NULL);
INSERT INTO "voyages" VALUES (3856, '', 3, '', 'RADERMACHER', 'Jan Doensen', 1150, NULL, '1753', NULL, NULL, 'Z', 'Z', '1762-12-15', 'Rammekens', '1763-05-09', '1763-05-29', true, '1763-11-05', 'Batavia', 7663, 'The 22 seafarers who went ashore at the Cape included one deserter.');
INSERT INTO "voyages" VALUES (3857, '', 2, '', 'LIEVE', 'Karsten Zunksen', 1150, NULL, '1759', NULL, NULL, 'A', 'A', '1762-12-27', 'Texel', '1763-05-04', '1763-05-19', true, '1763-08-25', 'Ceylon', 7673, NULL);
INSERT INTO "voyages" VALUES (3858, '', 2, '', 'DAMZICHT', 'Lodewijk Thomasz.', 1150, NULL, '1759', NULL, NULL, 'A', 'Z', '1763-03-13', 'Rammekens', '1763-07-09', '1763-08-12', true, '1763-10-19', 'Ceylon', 7713, NULL);
INSERT INTO "voyages" VALUES (3859, '', 4, '', 'ERFPRINS', 'Pieter Schoneman', 850, NULL, '1752', NULL, NULL, 'D', 'D', '1763-04-10', 'Goeree', '1763-07-14', '1763-08-02', true, '1763-10-08', 'Batavia', 7675, 'The ERFPRINS did not call at the Cape but at False Bay; the 31 soldiers who went ashore there included one deserter. 3859/7675 is the fourth voyage of this ship, which during its first two voyages was called DELFT (numbers of the second voyage: 3696/7518).');
INSERT INTO "voyages" VALUES (3860, '', 5, '', 'ROTTERDAM', 'Pieter Matthijs Joele', 850, NULL, '1748', NULL, NULL, 'R', 'R', '1763-04-26', 'Goeree', '1763-08-15', '1763-09-07', true, '1763-11-01', 'Batavia', NULL, 'Tiago, 31-05 till 04-06-1763: two soldiers and one craftsmen disembarked, 8 passengers came aboard. The ship was sold in the Indies, 31-12-1768.');
INSERT INTO "voyages" VALUES (3861, '', 5, '', 'EENDRACHT', 'Jan Schellinger', 1150, NULL, '1748', NULL, NULL, 'A', 'A', '1763-05-06', 'Texel', '1763-09-13', '1763-10-29', true, '1764-02-05', 'Batavia', 7689, 'The EENDRACHT did not call at the Cape but at False Bay; the 58 persons who went ashore there included 2 seafarers and 2 soldiers who deserted. 3861/7689 Is the fifth voyage of this ship, which during its first two voyages was called ELSWOUD (numbers of the second voyage: 3503/7398).');
INSERT INTO "voyages" VALUES (3862, '', 3, '', 'ORANJEZAAL', 'Hendrik Worms', 880, NULL, '1750', NULL, NULL, 'E', 'A', '1763-05-06', 'Texel', '1763-09-18', '1763-10-07', true, '1763-12-13', 'Batavia', 7679, NULL);
INSERT INTO "voyages" VALUES (3863, '', 4, '', 'BARBARA THEODORA', 'Gillis Verte', 1150, NULL, '1750', NULL, NULL, 'Z', 'Z', '1763-05-08', 'Rammekens', '1763-08-26', '1763-09-24', true, '1763-11-13', 'Batavia', 7704, 'third voyage: 3783/7616).');
INSERT INTO "voyages" VALUES (3864, '', 2, '', 'NIJENBORG', 'Jakob Ketel+', 880, NULL, '1757', NULL, NULL, 'H', 'H', '1763-05-08', 'Texel', '1765-05-03', '1765-06-24', true, '1765-08-30', 'Batavia', 7715, 'supplemented crew. Jakob Ketel died and was succeeded by George Christiaansz. Hartsz. All mutineers were caught and sent to Holland by the Portuguese. The French sent some of them to Surinam. During the trials at Den Helder and Paramaribo 24 men were sentenced to death.');
INSERT INTO "voyages" VALUES (3865, '', 3, '', 'VROUWE PETRONELLA', 'Arie Arkebout', 880, NULL, '1755', NULL, NULL, 'E', 'E', '1763-05-19', 'Texel', '1763-09-15', '1763-10-07', true, '1763-12-12', 'Batavia', 7668, NULL);
INSERT INTO "voyages" VALUES (3866, '', 4, '', 'GIESSENBURG', 'Thijs Fierman', 1150, NULL, '1749', NULL, NULL, 'A', 'A', '1763-06-03', 'Texel', '1763-09-21', '1763-10-19', true, '1764-01-04', 'Ceylon', NULL, 'In 1766 the GIESSENBURG, sailing to Banda. was wrecked.');
INSERT INTO "voyages" VALUES (3867, '', 3, '', 'LEKKERLAND', 'Christiaan Blom', 1150, NULL, '1753', NULL, NULL, 'A', 'A', '1763-06-03', 'Texel', '1763-09-23', '1763-10-31', true, '1764-02-03', 'Ceylon', 3867, '/- Is the third voyage of this ship, which during its first voyage was called MARIENBOS (see 3605/7508). The ship was sold in the Indies, 12-01-1770.');
INSERT INTO "voyages" VALUES (3868, '', 6, '', 'HUIS TEN DONK', 'Frederik Wielard', 875, NULL, '1745', NULL, NULL, 'R', 'R', '1763-06-15', 'Goeree', '1763-09-19', '1763-10-12', true, '1763-12-11', 'Batavia', 7670, 'One of the two seafarers who went ashore at the Cape was a deserter, 110 of the 119 disembarking soldiers were destined for Ceylon,');
INSERT INTO "voyages" VALUES (3869, '', 3, '', '''S GRAVENZANDE', 'Jan Moorland', 880, NULL, '1754', NULL, NULL, 'D', 'A', '1763-06-15', 'Texel', '1763-10-20', '1763-11-12', true, '1764-02-19', 'Batavia', 7695, NULL);
INSERT INTO "voyages" VALUES (3870, '', 3, '', 'LAPIENENBURG', 'Markus Tetting', 1150, NULL, '1753', NULL, NULL, 'A', 'A', '1763-06-15', 'Texel', '1763-10-07', '1763-11-04', true, '1764-02-05', 'Batavia', NULL, 'At the Cape two seafarers deserted.');
INSERT INTO "voyages" VALUES (3871, '', 2, '', 'DUINENBURG', 'Michiel Godfried Lehman', 1100, NULL, '1757', NULL, NULL, 'Z', 'Z', '1763-06-20', 'Rammekens', '1763-11-18', '1763-12-13', true, '1764-04-09', 'Ceylon', 7671, NULL);
INSERT INTO "voyages" VALUES (3872, '', 5, '', 'GOUVERNEUR-GENERAAL', 'Gerrit Harmeyer', 850, NULL, '1749', NULL, NULL, 'D', 'D', '1763-07-23', 'Goeree', '1763-12-25', '1764-01-16', true, '1764-09-11', 'Batavia', 7672, 'The GOUVERNEUR-GENERAAL called at S. Tiago (15 till 22-09-1763) and at Tuticorin (08-05 till 24-07-1764); at S. Tiago 3 seafarers and one soldier died, 3 soldiers deserted, one seafarer and one soldier were taken aboard. At Tuticorin 24 seafarers, 148 soldiers and 9 passengers went ashore, 11 seafarers and 11 soldiers died; 2 seafarers came aboard.');
INSERT INTO "voyages" VALUES (3873, '', 2, '', 'ZUID-BEVELAND', 'Huibrecht van der Kneu', 1100, NULL, '1755', NULL, NULL, 'Z', 'Z', '1763-08-17', 'Rammekens', '1763-12-27', '1764-02-14', true, '1764-05-15', 'Batavia', 7700, 'and 05 till 23-09-1763 respectively): at Ponsmouth one seafarer deserted; at Falmouth 7 seafarers, one soldier and one craftsmen were pressed by the English, one seafarer died.');
INSERT INTO "voyages" VALUES (3874, '', 4, '', 'SCHAGEN', 'Klaas Ariensz.', 880, NULL, '1753', NULL, NULL, 'H', 'H', '1763-09-01', 'Texel', '1763-12-30', '1764-01-23', true, '1764-09-22', 'Batavia', 7712, 'The 51 persons who went ashore at the Cape included 5 seafarers and 5 soldiers who deserted. From 22-05 till 07-08-1764 the SCHAGEN was at Tuticorin in India: 15 seafarers and 102 soldiers disembarked, 8 seafarers and 27 soldiers died.');
INSERT INTO "voyages" VALUES (3875, '', 5, '', 'STRALEN', 'Thomas van Wagtendonk', 850, NULL, '1748', NULL, NULL, 'E', 'E', '1763-09-06', 'Texel', '1764-01-12', '1764-02-10', true, '1764-05-20', 'Batavia', 7686, 'The 60 persons who went ashore at the Cape included 6 seafarers and 3 soldiers who deserted.');
INSERT INTO "voyages" VALUES (3876, '', 2, '', 'ASCHAT', 'Kornelis Kuiper', 1150, NULL, '1760', NULL, NULL, 'A', 'A', '1763-09-27', 'Texel', '1764-01-11', '1764-02-08', true, '1764-05-16', 'Batavia', 7681, 'From 05 till 15-10-1763 the ASCHAT was at Duins: 7 seafarers and one soldier were pressed by the English, After having arrived at Batavia the ship sailed on to China.');
INSERT INTO "voyages" VALUES (3877, '', 3, '', 'VROUWE ELIZABETH', 'Pieter Breugel', 850, NULL, '1755', NULL, NULL, 'R', 'R', '1763-09-27', 'Goeree', '1763-12-31', '1764-01-16', true, '1764-03-28', 'Batavia', 7694, NULL);
INSERT INTO "voyages" VALUES (3878, '', 1, '', 'HUIS OM', 'Kornelis Pietersen', 1150, NULL, '1761', NULL, NULL, 'Z', 'Z', '1763-09-27', 'Rammekens', '1764-01-01', '1764-02-14', true, '1764-05-17', 'Batavia', 7682, 'The 6 passengers included 2 female slaves. After having arrived at Batavia the HUIS OM sailed on to China.');
INSERT INTO "voyages" VALUES (3879, '', 1, '', '''S LANDS WELVAREN', 'Pieter Fruit', 880, NULL, '1762', NULL, NULL, 'A', 'A', '1763-09-27', 'Texel', '1764-01-12', '1764-02-07', true, '1764-05-16', 'Batavia', 7684, '''S LANDS WELVAREN called at Duins, 05 till 15-10-1763. After having arrived at Batavia the ship sailed on to China.');
INSERT INTO "voyages" VALUES (3880, '', 8, '', 'HOOP', 'Herman de Kool', 850, NULL, '1742', NULL, NULL, 'D', 'D', '1763-10-10', 'Goeree', '1764-01-13', '1764-02-02', true, '1764-05-18', 'Batavia', NULL, 'ashore at the Cape included 7 seafarers and 3 soldiers who deserted. The HOOP was sold in the Indies, 31-03-1767.');
INSERT INTO "voyages" VALUES (3881, '', 4, '', 'KEUKENHOF', 'Jan van Dalen', 1150, NULL, '1753', NULL, NULL, 'A', 'A', '1763-10-15', 'Texel', '1764-01-11', '1764-02-22', true, '1764-05-17', 'Batavia', 7696, NULL);
INSERT INTO "voyages" VALUES (3882, '', 4, '', 'RUITEVELD', 'Isaak van den Berg', 1150, NULL, '1752', NULL, NULL, 'A', 'A', '1763-10-16', 'Texel', '1764-02-09', '1764-03-03', true, '1764-05-16', 'Batavia', 7683, '16-10-1763 Is the final date of departure of the RUITEVELD; on 28-09-1763 the ship set out for the first time, but 16 days later it returned to Texel (14-10); adverse wind caused this delay. After having arrived at Batavia the ship sailed on to China.');
INSERT INTO "voyages" VALUES (3883, '', 6, '', 'WILDRIJK', 'Pieter Clement', 850, NULL, '1744', NULL, NULL, 'A', 'A', '1763-10-28', 'Texel', '1764-02-08', '1764-03-19', true, '1764-05-31', 'Batavia', NULL, 'From 07 till 10-11-1763 the WILDRIJK was at Duins. In 1766 the ship was sold in the Indies.');
INSERT INTO "voyages" VALUES (3884, '', 7, '', 'IMMAGONDA', 'Pieter Boot', 850, NULL, '1746', NULL, NULL, 'E', 'E', '1763-11-07', 'Texel', '1764-02-09', '1764-03-03', true, '1764-05-13', 'Batavia', NULL, 'In 1766 the IMMAGONDA was laid up in the Indies.');
INSERT INTO "voyages" VALUES (3885, '', 5, '', 'LUXEMBURG', 'Jan Beys', 1150, NULL, '1750', NULL, NULL, 'A', 'A', '1763-11-14', 'Texel', '1764-03-06', '1764-03-27', true, '1764-05-30', 'Batavia', 7690, 'deserted.');
INSERT INTO "voyages" VALUES (3886, '', 5, '', 'BOSSCHENHOVE', 'Pieter Sijbrandz. Flout', 1150, NULL, '1750', NULL, NULL, 'A', 'A', '1763-12-14', 'Texel', '1764-04-09', '1764-04-25', true, '1764-07-11', 'Batavia', NULL, 'From 29-01 till 03-02-1764 the ship was at S. Tiago: one seafarer deserted. On 12-01-1770 the BOSSCHENHOVE was laid up and sold in the Indies.');
INSERT INTO "voyages" VALUES (3887, '', 3, '', 'SCHOONZICHT', 'Kornelis van der Stam', 880, NULL, '1758', NULL, NULL, 'R', 'A', '1763-12-14', 'Texel', '1764-05-15', '1764-06-08', true, '1764-08-23', 'Bengal', 7706, NULL);
INSERT INTO "voyages" VALUES (3888, '', 4, '', 'VELSEN', 'Hendrik Andries Tieding', 1100, NULL, '1756', NULL, NULL, 'A', 'A', '1763-12-14', 'Texel', '1764-05-15', '1764-06-26', true, '1764-09-05', 'Batavia', 7720, 'The VELSEN called at S. Tiago (02 till 14-02-1764): 23 seafarers and 9 soldiers deserted or died.');
INSERT INTO "voyages" VALUES (3889, '', 1, '', 'WESTFRIESLAND', 'Bernard Hulleman', 880, NULL, '1761', NULL, NULL, 'H', 'H', '1763-12-14', 'Texel', '1764-05-15', '1764-06-26', true, '1764-08-29', 'Batavia', 7691, 'The WESTFRIESLAND called at S. Tiago (probably from 29-01 till 03-02-1764): 2 seafarers and 6 soldiers deserted, one soldier died. The 2 passengers who embarked at the Cape were condemned persons.');
INSERT INTO "voyages" VALUES (3890, '', 5, '', 'LIEFDE', 'Gerrit de Mul', 1150, NULL, '1748', NULL, NULL, 'A', 'A', '1763-12-17', 'Texel', '1764-05-24', '1764-06-12', true, '1764-08-05', 'Ceylon', NULL, 'The LIEFDE called at Torbay (30-12-1763 till 16-01-1764) and at Portsmouth (20 till 29-01-1764). In 1768 the ship was laid up in the Indies.');
INSERT INTO "voyages" VALUES (3891, '', 4, '', 'SNOEK', 'J. H. Westkapelle', 880, NULL, '1750', NULL, NULL, 'Z', 'Z', '1764-02-21', 'Rammekens', '1764-06-01', '1764-07-06', true, '1764-09-13', 'Batavia', 7674, 'The 27 seafarers who went ashore at the Cape included one deserter.');
INSERT INTO "voyages" VALUES (3892, '', 3, '', 'TORENVLIET', 'Christiaan Adriaanse', 1150, NULL, '1753', NULL, NULL, 'Z', 'Z', '1764-02-21', 'Rammekens', '1764-06-01', '1764-07-06', true, '1764-09-05', 'Batavia', NULL, 'The passenger was a female slave. 3892/- Is the third voyage of this ship, which during its two preceding voyages was called BARBARA THEODORA (numbers of the second voyage: 3779/7584).');
INSERT INTO "voyages" VALUES (3893, '', 4, '', 'WALCHEREN', 'Hans Kornelisz.', 1150, NULL, '1754', NULL, NULL, 'Z', 'Z', '1764-02-21', 'Rammekens', '1764-05-24', '1764-06-26', true, '1764-08-28', 'Batavia', 7722, NULL);
INSERT INTO "voyages" VALUES (3894, '', 5, '', 'OUDKARSPEL', 'Aldert Aalders', 1150, NULL, '1747', NULL, NULL, 'A', 'A', '1764-02-25', 'Texel', '1764-05-24', '1764-07-06', true, '1764-09-01', 'Batavia', NULL, 'On 11-01-1764 the OUDKARSPEL tried to sail out for the first time, but it returned to Texel the following day. In 1768 the ship was sold in the Indies.');
INSERT INTO "voyages" VALUES (3895, '', 6, '', 'VOSMAAR', 'Anthonie Leertouwer', 850, NULL, '1746', NULL, NULL, 'Z', 'Z', '1764-03-01', 'Rammekens', '1764-06-06', '1764-07-13', true, '1764-10-04', 'Batavia', 7687, 'From 23 till 28-03-1764 the VOSMAAR was at S. Tiago.');
INSERT INTO "voyages" VALUES (3896, '', 4, '', 'KATTENDIJKE', 'Leendert van der Linden', 880, NULL, '1750', NULL, NULL, 'Z', 'D', '1764-05-08', 'Goeree', '1764-09-23', '1764-10-17', true, '1764-12-31', 'Batavia', 7701, NULL);
INSERT INTO "voyages" VALUES (3897, '', 1, '', 'USSELMONDE', 'Arend van der Deuren', 880, NULL, '1762', NULL, NULL, 'R', 'R', '1764-05-08', 'Goeree', '1764-09-28', '1764-10-17', true, '1764-12-31', 'Batavia', 7787, NULL);
INSERT INTO "voyages" VALUES (3898, '', 5, '', 'ADMIRAAL DE RUYTER', 'Johan Nikolaas Herault', 1150, NULL, '1749', NULL, NULL, 'A', 'Z', '1764-05-10', 'Rammekens', '1764-10-10', '1764-11-22', true, '1765-02-20', 'Batavia', 7698, NULL);
INSERT INTO "voyages" VALUES (3899, '', 3, '', 'SCHOLTENBURG', 'George Jakob Meyer', 880, NULL, '1753', NULL, NULL, 'A', 'A', '1764-05-10', 'Texel', '1764-11-29', '1765-01-06', true, '1765-03-26', 'Batavia', 7702, 'called at the northern coast of Brazil, 05 till 19-08-1764.');
INSERT INTO "voyages" VALUES (3900, '', 4, '', 'VROUWE PETRONELLA MARIA', 'Jan van Eysden', 1100, NULL, '1755', NULL, NULL, 'A', 'A', '1764-05-17', 'Texel', '1764-10-04', '1764-11-04', true, '1765-01-16', 'Batavia', 7760, 'The VROUWE PETRONELLA MARIA called at Duins, 21 till 26-05-1764; one soldier was pressed by the English.');
INSERT INTO "voyages" VALUES (3901, '', 5, '', 'AMERONGEN', 'Jakob Pieter van Braam', 1150, NULL, '1749', NULL, NULL, 'A', 'A', '1764-05-18', 'Texel', '1764-09-25', '1764-10-23', true, '1764-12-29', 'Batavia', 3901, '/- Is the fifth voyage of this ship, which during its first two voyages was called ROZENBURG (numbers of the second voyage: 3642/7477), during its third voyage OVERNES (see 3700/7544), and during its last two voyages AMERONGEN (numbers of the fourth voyage: 3796/7638). In 1768 the ship was laid up in the Indies.');
INSERT INTO "voyages" VALUES (3902, '', 4, '', 'VOORLAND', 'Josua Hartman', 1150, NULL, '1750', NULL, NULL, 'A', 'A', '1764-05-26', 'Texel', '1764-12-29', '1765-02-22', true, '1765-06-06', 'Batavia', NULL, 'VOORLAND was laid up and sold in the Indies, 12-01-1770.');
INSERT INTO "voyages" VALUES (3903, '', 5, '', 'LYCOCHTON', 'Klaas Stuiver', 880, NULL, '1749', NULL, NULL, 'E', 'H', '1764-06-19', 'Texel', '1764-10-08', '1764-11-04', true, '1765-01-16', 'Batavia', 7692, 'LYCOCHTON took over one seafarer from the PIJLSWAART (see 3904).');
INSERT INTO "voyages" VALUES (3904, '', 4, '', 'PIJLSWAART', 'Hans Eggers', 880, NULL, '1752', NULL, NULL, 'H', 'E', '1764-06-19', 'Texel', '1764-10-15', '1764-11-28', true, NULL, NULL, NULL, 'On 24-02-1765 the PIJLSWAART, sailing near Batavia, caught fire in a thunderstorm and exploded. See also 3903.');
INSERT INTO "voyages" VALUES (3905, '', 1, '', 'DE JONGE SAMUEL', 'Johannes van Boom', 880, NULL, '1761', NULL, NULL, 'Z', 'Z', '1764-06-19', 'Rammekens', '1764-11-04', '1764-12-19', true, '1765-04-06', 'Batavia', 7726, 'Some of the persons who went ashore at the Cape were handed over to the law.');
INSERT INTO "voyages" VALUES (3906, '', 2, '', 'BURCH', 'Anthonie de Jong', 1150, NULL, '1760', NULL, NULL, 'Z', 'Z', '1764-08-10', 'Rammekens', '1764-12-22', '1765-01-27', true, '1765-04-06', 'Batavia', 7758, 'at Duins, 18 till 22-08-1764; one seafarer deserted.');
INSERT INTO "voyages" VALUES (3907, '', 1, '', 'SNELHEID', 'Elkel Juel', 120, 'hoeker', '1763', NULL, NULL, 'A', 'A', '1764-09-12', 'Texel', '1764-12-27', NULL, true, '1764-12-27', 'The Cape', NULL, 'The SNELHEID remained on service at the Cape.');
INSERT INTO "voyages" VALUES (3908, '', 3, '', 'BLEISWIJK', 'Bartholomeus Bigom', 880, NULL, '1756', NULL, NULL, 'D', 'D', '1764-10-07', 'Goeree', '1765-01-13', '1765-01-29', true, '1765-04-02', 'Batavia', 7711, NULL);
INSERT INTO "voyages" VALUES (3909, '', 3, '', 'NOORD-BEVELAND', 'Simon Rot', 1150, NULL, '1756', NULL, NULL, 'Z', 'A', '1764-10-08', 'Texel', '1765-01-15', '1765-01-29', true, '1765-05-02', 'Batavia', 7707, 'After having arrived at Batavia the NOORD-BEVELAND sailed on to China.');
INSERT INTO "voyages" VALUES (3910, '', 6, '', 'BAARZANDE', 'Gerrit Bartels', 850, NULL, '1745', NULL, NULL, 'H', 'E', '1764-11-15', 'Texel', '1765-02-12', '1765-02-28', true, '1765-05-23', 'Batavia', 7693, 'voyage was called JAGER (numbers of the third voyage: 3612/7453).');
INSERT INTO "voyages" VALUES (3911, '', 3, '', 'VROUWE GEERTRUIDA', 'Michiel Hendrik Kerke', 1100, NULL, '1757', NULL, NULL, 'A', 'A', '1764-11-15', 'Texel', '1765-02-24', '1765-04-14', true, '1765-06-19', 'Batavia', 7749, '08-10-1764 the VROUWE GEERTRUIDA sailed out for the first time, but it was forced by adverse wind to return to Texel two days later. One soldier died before the final date of departure.');
INSERT INTO "voyages" VALUES (3912, '', 3, '', 'OUDERAMSTEL', 'Jan Stuiver', 1100, NULL, '1758', NULL, NULL, 'A', 'A', '1764-11-15', 'Texel', '1765-02-19', '1765-03-25', true, '1765-06-16', 'Batavia', 7756, 'After the arrival of the ship at Batavia, its name was altered into AZIE (see 7756).');
INSERT INTO "voyages" VALUES (3913, '', 1, '', 'VREDENHOF', 'Willem van Braam', 1150, NULL, '1763', NULL, NULL, 'A', 'A', '1764-11-15', 'Texel', '1765-02-20', '1765-03-07', true, '1765-06-16', 'Batavia', 7708, '15-11-1764 Is the final date of departure of the VREDENHOF; on 08-10-1764 it sailed out for the first time, but it was forced by adverse wind to return to Texel two days later. After having arrived at Batavia the ship sailed on the China.');
INSERT INTO "voyages" VALUES (3914, '', 4, '', 'WELGELEGEN', 'Jurriaan Molensteen', 880, NULL, '1753', NULL, NULL, 'E', 'A', '1764-11-15', 'Texel', '1765-02-12', '1765-04-14', true, '1765-07-28', 'Bengal', 7745, NULL);
INSERT INTO "voyages" VALUES (3915, '', 1, '', 'COMPAGNIES WELVAREN', 'Arend Willemse', 1150, NULL, '1764', NULL, NULL, 'A', 'A', '1764-11-15', 'Texel', '1765-02-12', '1765-02-28', true, '1765-05-28', 'Batavia', 7746, NULL);
INSERT INTO "voyages" VALUES (3916, '', 1, '', 'WALENBURG', 'Erasmus de Vries', 880, NULL, '1764', NULL, NULL, 'R', 'R', '1764-11-16', 'Goeree', '1765-02-21', '1765-03-07', true, '1765-06-23', 'Batavia', 7710, 'After having arrived at Batavia the WALENBURG sailed on to China (arrival there in October).');
INSERT INTO "voyages" VALUES (3917, '', 1, '', 'PALLAS', 'Jakob Boekhout', 1150, NULL, '1762', NULL, NULL, 'Z', 'Z', '1764-11-20', 'Rammekens', '1765-03-02', '1765-03-19', true, '1765-06-24', 'Batavia', 7709, 'arrived at Batavia the ship sailed on to China (arrival there in October).');
INSERT INTO "voyages" VALUES (3918, '', 2, '', 'WESTERVELD', 'Lieve van Rentergem', 1100, NULL, '1761', NULL, NULL, 'A', 'Z', '1764-11-20', 'Rammekens', '1765-03-01', '1765-04-14', true, '1765-06-19', 'Ceylon', 7737, NULL);
INSERT INTO "voyages" VALUES (3919, '', 5, '', 'OOSTHUIZEN', 'Pieter Klinkert', 850, NULL, '1749', NULL, NULL, 'H', 'H', '1764-11-23', 'Texel', '1765-04-13', '1765-04-27', true, '1765-07-17', 'Batavia', NULL, 'The OOSTHUIZEN called at S. Tiago, 02 till 09-01-1765: 3 seafarers deserted, one seafarer, 3 soldiers and 2 craftsmen died. The ship was laid up in the Indies, 09-01-1772.');
INSERT INTO "voyages" VALUES (3920, '', 4, '', 'DE DRIE PAPEGAAIEN', 'Frederik Visser', 1150, NULL, '1752', NULL, NULL, 'A', 'A', '1764-12-17', 'Texel', '1765-04-13', '1765-04-27', true, '1765-07-02', 'Ceylon', NULL, 'The DRIE PAPEGAAIEN was laid up in the Indies, 27-12-1768.');
INSERT INTO "voyages" VALUES (3921, '', 1, '', 'LANDSKROON', 'Volkert Groeneweg van Oudshoom', 1150, NULL, '1764', NULL, NULL, 'A', 'A', '1764-12-18', 'Texel', '1765-05-05', '1765-05-17', true, '1765-08-13', 'Batavia', 7770, 'From 26-01 till 05-02-1765 the LANDSKROON was at S. Tiago: 2 seafarers and 5 soldiers went missing, one seafarer was taken over from another ship. At Bantam 26 soldiers went ashore (30-07).');
INSERT INTO "voyages" VALUES (3922, '', 3, '', 'OVERNES', 'Pietersen', 1150, NULL, '1754', NULL, NULL, 'A', 'A', '1764-12-18', 'Texel', '1765-05-03', '1765-05-17', true, '1765-07-04', 'Ceylon', 7703, '3922/7703 Is the third voyage of this ship, which during its first voyage was called AMERONGEN (see 3664/7555).');
INSERT INTO "voyages" VALUES (3923, '', 4, '', 'VLIETLUST', 'Laurens Houtepen', 1150, NULL, '1752', NULL, NULL, 'A', 'Z', '1765-02-01', 'Rammekens', '1765-05-08', '1765-05-17', true, '1765-07-04', 'Ceylon', 7736, 'soldiers,');
INSERT INTO "voyages" VALUES (3924, '', 1, '', 'VREEBURG', 'Frans van Ewijk', 850, NULL, '1764', NULL, NULL, 'D', 'D', '1765-04-17', 'Goeree', '1765-08-17', '1765-09-08', true, '1765-11-16', 'Batavia', 7721, 'The VREEBURG called at Duins, 18 till 20-04-1765.');
INSERT INTO "voyages" VALUES (3925, '', 6, '', 'NOORD NIEUWLAND', 'Jakob Hart', 880, NULL, '1749', NULL, NULL, 'R', 'Z', '1765-04-20', 'Rammekens', '1765-08-12', '1765-09-02', true, '1765-11-16', 'Batavia', 7719, 'The NOORDNIEUWLAND did not call at the Cape but at False Bay.');
INSERT INTO "voyages" VALUES (3926, '', 2, '', 'HUIS TE BIJWEG', 'Johan Sigismund Hoeve', 1100, NULL, '1760', NULL, NULL, 'A', 'A', '1765-05-01', 'Texel', '1765-08-25', '1765-09-23', true, '1765-12-21', 'Batavia', 7740, 'S, Tiago: one seafarer and one soldier died, 9 seafarers and 2 soldiers deserted, At the Cape one seafarer and one soldier died.');
INSERT INTO "voyages" VALUES (3927, '', 7, '', 'SLOTEN', 'Andries Lint', 1150, NULL, '1746', NULL, NULL, 'A', 'A', '1765-05-01', 'Texel', '1765-08-26', '1765-09-23', true, '1765-12-18', 'Batavia', NULL, 'The SLOTEN called at S. Tiago, 28-05 till 10-06-1765; 2 seafarers and 2 soldiers died, one soldier deserted. At the Cape 2 seafarers and 2 soldiers died, one soldier deserted, The SLOTEN was laid up in the Indies, 31-12-1768.');
INSERT INTO "voyages" VALUES (3928, '', 5, '', 'BLIJDORP', 'Marten Hakker', 880, NULL, '1753', NULL, NULL, 'R', 'R', '1765-05-02', 'Goeree', '1765-08-04', '1765-08-19', true, '1765-10-18', 'Batavia', 7705, 'The 3 passengers were former (female) slaves, The BLIJDORP did not call at the Cape but at False Bay. The ship also called at Bantam (14-10-1765), where 24 soldiers disembarked.');
INSERT INTO "voyages" VALUES (3929, '', 1, '', 'LINDENHOF', 'Hans Bruns', 1150, NULL, '1764', NULL, NULL, 'A', 'A', '1765-06-18', 'Texel', '1765-11-03', '1765-12-05', true, '1766-02-26', 'Batavia', NULL, 'the Cape Pieter Anthonie van der Burg succeeded Hans Bruns as master of the LINDENHOF. At the Cape 2 seafarers and 3 soldiers died. After having arrived at Batavia the ship sailed on to China, Sailing to China the LINDENHOF was struck by lightning and exploded, 1766.');
INSERT INTO "voyages" VALUES (3930, '', 5, '', 'NIEUW NIEUWERKERK', 'Dirk Klinkert', 1150, NULL, '1749', NULL, NULL, 'Z', 'A', '1765-06-18', 'Texel', '1765-10-13', '1765-11-04', true, '1766-01-31', 'Batavia', NULL, 'The 22 seafarers who went ashore at the Cape included one deserter; one soldier died at the Cape. The NIEUW NIEUWERKERK was laid up and sold in the Indies, 14-04-1772.');
INSERT INTO "voyages" VALUES (3931, '', 1, '', 'JONKVROUWE KORNELIA JAKOBA', 'Pieter de Leur', 880, NULL, '1763', NULL, NULL, 'H', 'E', '1765-07-14', 'Texel', '1765-11-22', '1765-12-12', true, '1766-03-27', 'Batavia', 7732, 'KORNELIA JAKOBA called at S. Tiago, 19 till 26-08-1765; 4 seafarers and 4 soldiers deserted; one passenger embarked (he went ashore at the Cape), At the Cape one soldier died.');
INSERT INTO "voyages" VALUES (3932, '', 5, '', 'VRIJBURG', 'Karel Sluiter', 1150, NULL, '1748', NULL, NULL, 'Z', 'Z', '1765-08-04', 'Rammekens', '1765-12-25', '1766-02-04', true, '1766-05-10', 'Batavia', NULL, 'The VRIJBURG called at Duins, 06 till 16-08-1765, At the Cape 6 seafarers, 10 soldiers and 3 craftsmen died. The VRIJBURG was laid up in the Indies, 16-10-1771.');
INSERT INTO "voyages" VALUES (3933, '', 1, '', 'BARTHA PETRONELLA', 'Leendert van Koopstad', 880, NULL, '1764', NULL, NULL, 'H', 'H', '1765-08-19', 'Texel', '1766-01-13', '1766-02-03', true, '1766-05-10', 'Batavia', 7729, 'English seafarers came aboard. After having arrived at Batavia the BARTHA PETRONELLA sailed on to China.');
INSERT INTO "voyages" VALUES (3934, '', 1, '', 'POPKENSBURG', 'Jakob Reysik', 880, NULL, '1763', NULL, NULL, 'Z', 'Z', '1765-09-10', 'Rammekens', '1766-02-24', '1766-04-07', true, '1766-07-03', 'Batavia', 7794, 'At the Cape Jakob Reysik went ashore; his successor as master of the POPKENSBURG, Jan Canvas, embarked there, During the call at the Cape 8 seafarers, 10 soldiers and one craftsmen died, one seafarer and one craftsmen deserted.');
INSERT INTO "voyages" VALUES (3935, '', 1, '', 'JONGE THOMAS', 'Jakob Wiebe', 1150, NULL, '1764', NULL, NULL, 'A', 'A', '1765-10-25', 'Texel', '1766-03-12', '1766-03-28', true, '1766-06-25', 'Batavia', 7728, 'soldier died at the Cape. After having arrived at Batavia the JONGE THOMAS sailed on to China,');
INSERT INTO "voyages" VALUES (3936, '', 3, '', 'VROUWE ELISABETH DOROTHEA', 'Willem Groeve', 600, NULL, '1757', NULL, NULL, 'A', 'A', '1765-11-15', 'Texel', '1766-03-04', '1766-03-20', true, '1766-06-24', 'Batavia', 7738, 'was back at Texel (12-10); on 25-10 the ship sailed out for the second time, adverse wind, however, again forced it to return to Texel (31-10); 15-11 is the third and final date of departure. The VROUWE ELISABETH DOROTHEA replaced the BRONSTEE, missing in 1763 between Batavia and the Cape, see 7648,');
INSERT INTO "voyages" VALUES (3937, '', 6, '', 'KIEVITSHEUVEL', 'Frans Overzee', 1150, NULL, '1749', NULL, NULL, 'A', 'A', '1765-11-15', 'Texel', '1766-03-03', '1766-04-11', true, '1766-06-24', 'Batavia', NULL, 'KIEVITSHEUVEL was laid up in the Indies, 22-12-1768.');
INSERT INTO "voyages" VALUES (3938, '', 1, '', 'ZILVEREN LEEUW', 'Gerrit Harmeyer', 880, NULL, '1765', NULL, NULL, 'D', 'D', '1765-11-15', 'Goeree', '1766-02-22', '1766-03-14', true, '1766-06-07', 'Batavia', 7718, NULL);
INSERT INTO "voyages" VALUES (3939, '', 3, '', 'JONGE LIEVE', 'Hendrik de Haard', 1150, NULL, '1759', NULL, NULL, 'A', 'A', '1765-11-15', 'Texel', '1766-03-14', '1766-04-22', true, '1766-07-02', 'Batavia', 7730, 'From 03 till 12-01-1766 the JONGE LIEVE was at S. Tiago: 3 seafarers and one passenger died, 3 seafarers and 2 soldiers deserted. At the Cape one soldier died,');
INSERT INTO "voyages" VALUES (3940, '', 1, '', 'NIEUW RHOON', 'Abraham in ''t Anker', 1150, NULL, '1764', NULL, NULL, 'Z', 'Z', '1765-11-15', 'Rammekens', '1766-03-19', '1766-04-03', true, '1766-06-12', 'Batavia', 7727, 'At the Cape 5 seafarers and 3 soldiers died. After having arrived at Batavia the NIEUW RHOON sailed on to China,');
INSERT INTO "voyages" VALUES (3941, '', 5, '', 'SNOEK', 'Johan Hendriksz.', 880, NULL, '1750', NULL, NULL, 'Z', 'Z', '1765-11-15', 'Rammekens', '1766-03-26', '1766-04-07', true, '1766-06-26', 'Batavia', 7735, NULL);
INSERT INTO "voyages" VALUES (3942, '', 1, '', 'VREDELUST', 'Martin Meytens', 1150, NULL, '1765', NULL, NULL, 'A', 'A', '1765-11-15', 'Texel', '1766-03-26', '1766-04-16', true, '1766-07-07', 'Batavia', 7809, 'seafarer, 2 soldiers and one craftsmen died.');
INSERT INTO "voyages" VALUES (3943, '', 5, '', 'VREDESTEIN', 'Jochem Hendrik Dodendorp', 880, NULL, '1750', NULL, NULL, 'R', 'R', '1765-11-15', 'Goeree', '1766-03-13', '1766-03-28', true, '1766-06-24', 'Batavia', 7733, 'The ''passenger'' was a slave. At the Cape one soldier died.');
INSERT INTO "voyages" VALUES (3944, '', 4, '', 'ORANJEZAAL', 'Frederik Kelger', 880, NULL, '1750', NULL, NULL, 'E', 'A', '1765-12-01', 'Texel', '1766-03-05', '1766-04-16', true, '1766-08-04', 'Bengal', 7724, NULL);
INSERT INTO "voyages" VALUES (3945, '', 4, '', 'VROUWE PETRONELLA', 'Steven Booms', 880, NULL, '1755', NULL, NULL, 'E', 'E', '1765-12-01', 'Texel', '1766-03-15', '1766-04-03', true, '1766-06-21', 'Batavia', NULL, 'Ganges, 11-01-1768.');
INSERT INTO "voyages" VALUES (3946, '', 2, '', 'BORSSELE', 'Pieter Fruit', 1150, NULL, '1758', NULL, NULL, 'Z', 'A', '1765-12-29', 'Texel', '1766-04-08', '1766-04-27', true, '1766-07-03', 'Batavia', 7766, NULL);
INSERT INTO "voyages" VALUES (3947, '', 6, '', 'GOUVERNEUR-GENERAAL', 'Pieter Andriesz.', 850, NULL, '1749', NULL, NULL, 'D', 'A', '1765-12-29', 'Texel', '1766-04-07', '1766-04-22', true, '1766-06-20', 'Ceylon', 7734, NULL);
INSERT INTO "voyages" VALUES (3948, '', 2, '', 'HUIS OM', 'Elkel Juel', 1150, NULL, '1761', NULL, NULL, 'Z', 'A', '1765-12-29', 'Texel', '1766-04-15', '1766-05-04', true, '1766-06-24', 'Ceylon', 7723, NULL);
INSERT INTO "voyages" VALUES (3949, '', 1, '', 'ZONNESTEIN', 'Jakob Barendsz.', 1150, NULL, '1765', NULL, NULL, 'A', 'A', '1765-12-29', 'Texel', '1766-04-21', '1766-05-04', true, '1766-07-12', 'Batavia', NULL, 'remained on service in the interasiatic trade, carrying rice between Batavia and the Cape. During one of such voyages, sailing from the Cape to Batavia, the transport-ship was wrecked, January 1768.');
INSERT INTO "voyages" VALUES (3950, '', 3, '', 'DUINENBURG', 'Helmstrom', 1100, NULL, '1757', NULL, NULL, 'Z', 'Z', '1766-02-08', 'Rammekens', '1766-05-14', '1766-07-15', true, '1766-09-20', 'Batavia', 7741, 'The DUINENBURG did not call at the Cape but at False Bay. Between patria and False Bay a mutiny broke out, which was suppressed. The 74 persons who disembarked at False Bay included a number of mutineers; they were handed over to the law.');
INSERT INTO "voyages" VALUES (3951, '', 4, '', 'VLISSINGEN', 'Dirk Wagtels', 880, NULL, '1753', NULL, NULL, 'Z', 'Z', '1766-03-12', 'Rammekens', '1766-06-28', '1766-07-21', true, '1766-09-23', 'Batavia', 7778, 'The VLISSINGEN did not call at the Cape but at False Bay.');
INSERT INTO "voyages" VALUES (3952, '', 5, '', 'ERFPRINS', 'Simon van Dalen', 850, NULL, '1752', NULL, NULL, 'D', 'D', '1766-04-06', 'Goeree', NULL, NULL, true, NULL, NULL, NULL, 'voyage: 3696/7518). See also 3985.');
INSERT INTO "voyages" VALUES (3953, '', 3, '', 'ASCHAT', 'Willem Silvester', 1150, NULL, '1760', NULL, NULL, 'A', 'A', '1766-04-25', 'Texel', '1766-11-01', '1766-11-26', true, '1767-01-30', 'Batavia', 7792, 'craftsmen went ashore at the Cape; 41 seafarers, 38 soldiers, and 7 craftsmen died during the voyage.');
INSERT INTO "voyages" VALUES (3954, '', 2, '', 'VROUWE KORNELIA HILLEGONDA', 'Christiaan Wijsbaard', 850, NULL, '1760', NULL, NULL, 'D', 'A', '1766-04-25', 'Goeree', '1766-08-15', '1766-09-17', true, '1766-12-03', 'Batavia', 7748, 'According to a Resolution of 15-10-1765 the VROUWE KORNELIA HILLEGONDA transported many soldiers to the Cape.');
INSERT INTO "voyages" VALUES (3955, '', 1, '', 'BLEIJENBURG', 'Frederik Wielard', 880, NULL, '1765', NULL, NULL, 'R', 'R', '1766-04-30', 'Goeree', '1766-08-20', '1766-09-17', true, '1766-12-03', 'Batavia', 7785, NULL);
