INSERT INTO "voyages" VALUES (4024, '', 2, '', 'KORNELIA JAKOBA', 'Gerrit Bruin', 880, NULL, '1763', NULL, NULL, 'E', 'E', '1768-08-31', 'Texel', '1769-01-09', '1769-02-13', true, '1769-06-10', 'Batavia', NULL, 'WELVAREN (4036), the BARBARA THEODORA (4041), and the GOUVERNEUR-GENERAAL (4044): one seafarer deserted at Duins; at Portsmouth 2 seaf. and 5 soldiers died, one seafarer deserted; at S. Tiago 12 seafarers, 5 soldiers, and one craftsmen died, 16 seafarers, 15 soldiers, and one craftsmen deserted; at the Cape 182 seafarers, 191 soldiers, 7 craftsmen, and 7 passengers went ashore; during the voyage 222 seafarers, 205 soldiers, and 21 craftsmen died.');
