INSERT INTO "voyages" VALUES (4031, '', 2, '', 'GANZENHOEF', 'Gerrit de Waal', 880, NULL, '1765', NULL, NULL, 'A', 'A', '1768-10-02', 'Texel', '1769-02-18', '1769-03-05', true, '1769-06-04', 'Batavia', NULL, 'See the JONKVROUW E KORNELIA JAKOBA (4024) and the VREEBURG (4030). In 1770 the GANZENHOEF was wrecked during a voyage from Japan to Batavia.');
