INSERT INTO "voyages" VALUES (4072, '', 3, '', 'WALENBURG', 'Andries Brusse', 880, NULL, '1764', NULL, NULL, 'R', 'A', '1769-12-29', 'Texel', NULL, NULL, true, NULL, NULL, NULL, 'On 12/13-01-1770 the WALENBURG ran ashore off Portsal at the coast of Bretagne (Brittany) and was wrecked, See 4090,');
INSERT INTO "voyages" VALUES (4073, '', 5, '', 'VLISSINGEN', 'Jakob Hart', 880, NULL, '1753', NULL, NULL, 'Z', 'Z', '1770-02-23', 'Rammekens', '1770-06-01', '1770-06-21', true, '1770-09-05', 'Batavia', 7825, 'See the VROUWE ANTHOINETTA KOENRARDINA (4054) and the BOT (4055).');
INSERT INTO "voyages" VALUES (4074, '', 2, '', 'WOESTDUIN', 'Michiel Godfried Lehman', 1150, NULL, '1767', NULL, NULL, 'A', 'Z', '1770-02-23', 'Rammekens', '1770-06-25', '1770-07-16', true, '1770-09-12', 'Batavia', 7826, 'Se the VROUWE ANTHOINETTA KOENRARDINA (4054) and the BOT (4055),');
INSERT INTO "voyages" VALUES (4075, '', 3, '', 'ZILVEREN LEEUW', 'Christiaan Andries Spin', 880, NULL, '1765', NULL, NULL, 'D', 'D', '1770-04-10', 'Goeree', '1770-08-01', '1770-08-19', true, '1770-10-22', 'Batavia', 7833, 'See the VROUWE ANTHOINETTA KOENRARDINA (4054) and the ERFPRINS (4058),');
INSERT INTO "voyages" VALUES (4076, '', 5, '', 'SCHOONZICHT', 'Marten Hakker', 880, NULL, '1758', NULL, NULL, 'R', 'R', '1770-04-10', 'Goeree', '1770-09-02', '1770-09-14', true, '1770-11-26', 'Batavia', 7834, 'data concerning the crew of the SCHOONZICHT: 162 seafarers, 103 soldiers, and 20 craftsmen departed from Goeree or embarked at the Cape. The following data refer to the crew of the SCHOONZICHT as well as to the crews of the WALCHEREN (see 4077), the DAMZICHT (4079), and the LANDSKROON (4080): 100 seafarers, 89 soldiers, 5 craftsmen, and 19 passengers went ashore at the Cape; during the voyage 61 seafarers, 36 soldiers, 5 craftsmen, and 4 passengers died.');
INSERT INTO "voyages" VALUES (4077, '', 5, '', 'WALCHEREN', 'Lodewijk Thomasz.', 1150, NULL, '1754', NULL, NULL, 'Z', 'Z', '1770-05-07', 'Rammekens', '1770-09-16', '1770-10-10', true, '1770-12-26', 'Batavia', NULL, 'Surat.');
INSERT INTO "voyages" VALUES (4078, '', 3, '', 'BARTHA PETRONELLA', 'Kornelis Brouwer', 880, NULL, '1764', NULL, NULL, 'H', 'H', '1770-05-12', 'Texel', '1770-09-09', '1770-10-28', true, '1771-02-10', 'Batavia', 7843, '(see 4082): 56 seafarers, 22 soldiers, and 3 craftsmen embarked at the Cape. Data concerning both the two aforesaid ships and the DUIVEN-BRUG (4081): at S. Tiago one soldier and one craftsmen died, 8 seafarers, 2 soldiers, and one craftsmen deserted (no deserters from the BARTHA PETRONELLA); 109 seafarers and 68 soldiers went ashore at the Cape; during the voyage 20 seafarers, 21 soldiers, and 4 craftsmen died.');
INSERT INTO "voyages" VALUES (4079, '', 4, '', 'DAMZICHT', 'Arend Willemse', 1150, NULL, '1759', NULL, NULL, 'A', 'A', '1770-05-20', 'Texel', '1770-09-02', '1770-09-14', true, '1770-11-24', 'Batavia', 7835, 'the LANDSKROON (see 4080): 456 seafarers, 236 soldiers, 25 craftsmen, and 26 passengers departed from the Republic or embarked at the Cape, 357 seafarers, 155 soldiers, 20 craftsmen, and 3 passengers arrived at Batavia.');
INSERT INTO "voyages" VALUES (4080, '', 2, '', 'LANDSKROON', 'Andries Lint', 1150, NULL, '1764', NULL, NULL, 'A', 'A', '1770-05-20', 'Texel', '1770-09-23', '1770-10-20', true, '1771-01-07', 'Batavia', 7851, 'At Porto Prayo, S. Tiago, one soldier deserted. See the SCHOONZICHT (4076) and the DAMZICHT (4079).');
INSERT INTO "voyages" VALUES (4081, '', 2, '', 'DUIVENBRUG', 'Steven Booms', 850, NULL, '1766', NULL, NULL, 'E', 'E', '1770-05-25', 'Texel', '1770-10-01', '1770-10-20', true, '1771-01-12', 'Batavia', 7840, 'At S. Tiago 3 members of the crew deserted. See the BARTHA PETRONELLA (4078).');
INSERT INTO "voyages" VALUES (4082, '', 7, '', 'BLUDORP', 'Abel Barber', 880, NULL, '1753', NULL, NULL, 'R', 'Z', '1770-08-01', 'Rammekens', '1770-11-27', '1770-12-19', true, '1771-03-14', 'Batavia', NULL, 'departed from Rammekens or embarked at the Cape. At S. Tiago 8 members of the crew deserted. See the BARTHA PETRONELLA (4078). The BLIJ-DORP was laid up in the Indies, 31-12-1773.');
INSERT INTO "voyages" VALUES (4083, '', 6, '', 'BARBARA THEODORA', 'Jan Canvas', 1150, NULL, '1750', NULL, NULL, 'Z', 'Z', '1770-09-02', 'Rammekens', '1771-02-04', '1771-02-28', true, '1771-06-11', 'Batavia', 4083, '/- Is the sixth voyage of this ship, which during its first three voyages was called TORENVLIET (3783/7616). The BARBARA THEODORA was laid up in the Indies. The following data refer to the crew of the BARBARA THEODORA as well as to the crews of the OOSTKAPELLE (4089) and the OU-WERKERK (4095): 69 seafarers, 31 soldiers, and 4 craftsmen embarked at the Cape.');
INSERT INTO "voyages" VALUES (4084, '', 4, '', 'HUIS OM', 'Hamelo', 1150, NULL, '1761', NULL, NULL, 'Z', 'A', '1770-10-01', 'Texel', '1771-05-19', '1771-07-23', true, '1771-09-29', 'Batavia', 7852, 'HAARLEM (4092), the''T LOO (4094), and the ASCHAT (4096): 121 seafarers, 48 soldiers, and 8 craftsmen embarked at the Cape.');
INSERT INTO "voyages" VALUES (4085, '', 4, '', 'PALLAS', 'Klaas Roem', 1150, NULL, '1762', NULL, NULL, 'Z', 'A', '1770-10-01', 'Texel', '1771-02-16', '1771-04-07', true, '1771-06-12', 'Batavia', 7844, 'crew deserted, See the HUIS OM (4084).');
INSERT INTO "voyages" VALUES (4086, '', 2, '', 'RIJNSBURG', 'Roelof Schot', 850, NULL, '1765', NULL, NULL, 'Z', 'A', '1770-10-01', 'Texel', '1771-02-05', '1771-02-24', true, '1771-05-29', 'Batavia', 7842, '(4084).');
INSERT INTO "voyages" VALUES (4087, '', 1, '', 'LAM', 'Gerrit Harmeyer', 850, NULL, '1769', NULL, NULL, 'D', 'D', '1770-10-02', 'Goeree', '1771-02-18', '1771-03-10', true, '1771-06-10', 'Batavia', 7857, 'During the voyage 5 members of the crew deserted.');
INSERT INTO "voyages" VALUES (4088, '', 2, '', 'USSELMONDE', 'Arend van der Deuren', 880, NULL, '1762', NULL, NULL, 'R', 'R', '1770-10-02', 'Goeree', '1771-03-01', '1771-03-17', true, '1771-06-10', 'Batavia', 7861, 'During the voyage one member of the crew deserted.');
INSERT INTO "voyages" VALUES (4089, '', 2, '', 'OOSTKAPELLE', 'Frederik Papegaai', 1150, NULL, '1767', NULL, NULL, 'Z', 'Z', '1770-10-03', 'Rammekens', '1771-02-19', '1771-03-10', true, '1771-06-19', 'Batavia', 7860, 'During the voyage 4 members of the crew deserted. After having arrived at Batavia the OOSTKAPELLE sailed on to China. See the BARBARA THEODORA (4083).');
INSERT INTO "voyages" VALUES (4090, '', 5, '', 'VROUWE GEERTRUIDA', 'Overstraten', 1100, NULL, '1757', NULL, NULL, 'A', 'A', '1770-11-02', 'Texel', '1771-04-20', '1771-05-06', true, '1771-08-07', 'Batavia', 7850, 'During the voyage 2 members of the crew deserted. The VROUWE GEERTRUIDA replaced the WALENBURG, which, during a voyage to the Indies, was wrecked at the coast of Bretagne (Brittany), January 1770 (4072). See the HUIS OM (4084).');
INSERT INTO "voyages" VALUES (4091, '', 3, '', 'COMPAGNIES WELVAREN', 'Hendrik Jakob Beeld', 1150, NULL, '1764', NULL, NULL, 'A', 'A', '1770-11-02', 'Texel', '1771-02-19', '1771-04-07', true, '1771-06-11', 'Batavia', 7924, 'During the voyage 2 members of the crew deserted. See the HUIS OM (4084).');
INSERT INTO "voyages" VALUES (4092, '', 2, '', 'OUD HAARLEM', 'Jan Och', 1150, NULL, '1768', NULL, NULL, 'A', 'A', '1770-11-17', 'Texel', '1771-03-01', '1771-03-13', true, '1771-06-10', 'Batavia', 7859, 'During the voyage one member of the crew deserted. After having arrived at Batavia the OUD HAARLEM sailed on to China. See the HUIS OM (4084).');
INSERT INTO "voyages" VALUES (4093, '', 1, '', 'HOOLWERF', 'Gerrit van der Gracht', 850, NULL, '1769', NULL, NULL, 'H', 'H', '1770-11-18', 'Texel', '1771-04-24', '1771-05-06', true, '1771-07-28', 'Batavia', 7845, 'PETRONELLA (4078).');
INSERT INTO "voyages" VALUES (4094, '', 2, '', '''T LOO', 'Wopke Popta', 1150, NULL, '1768', NULL, NULL, 'A', 'A', '1770-11-18', 'Texel', '1771-02-24', '1771-03-13', true, '1771-06-09', 'Batavia', 7858, 'sailed on to China. See the HUIS OM (4084).');
INSERT INTO "voyages" VALUES (4095, '', 1, '', 'OUWERKERK', 'Jakob de Frein', 1150, NULL, '1768', NULL, NULL, 'Z', 'Z', '1770-11-19', 'Rammekens', '1771-04-19', '1771-06-16', true, '1771-09-21', 'Batavia', 7853, 'THEODORA (4083).');
INSERT INTO "voyages" VALUES (4096, '', 4, '', 'ASCHAT', 'Jan Abel', 1150, NULL, '1760', NULL, NULL, 'A', 'A', '1771-01-11', 'Texel', '1771-04-26', '1771-05-24', true, '1771-09-10', 'Batavia', 7846, 'See the HUIS OM (4084).');
INSERT INTO "voyages" VALUES (4097, '', 4, '', 'HUIS TE BIJWEG', 'Hendrik Sterrenberg', 1100, NULL, '1760', NULL, NULL, 'A', 'A', '1771-01-11', 'Texel', '1771-05-01', '1771-06-01', true, '1771-08-07', 'Batavia', 7848, 'During the voyage 4 members of the crew deserted.');
INSERT INTO "voyages" VALUES (4098, '', 6, '', 'VELSEN', 'Christiaan Schreuder', 1100, NULL, '1756', NULL, NULL, 'A', 'A', '1771-01-11', 'Texel', '1771-04-15', '1771-05-01', true, '1771-06-26', 'Ceylon', NULL, 'When the VELSEN departed from the Cape, 01-05-1771, 152 seafarers and 102 soldiers were aboard. The ship was laid up in the Indies, 01-01-1780.');
INSERT INTO "voyages" VALUES (4099, '', 4, '', '''S LANDS WELVAREN', 'Pieter Clement', 880, NULL, '1762', NULL, NULL, 'A', 'A', '1771-01-11', 'Texel', '1771-04-12', '1771-05-01', true, '1771-08-08', 'Bengal', 7856, NULL);
INSERT INTO "voyages" VALUES (4100, '', 1, '', 'VREDEJAAR', 'Arie Arkebout', 850, NULL, '1769', NULL, NULL, 'E', 'E', '1771-01-12', 'Texel', NULL, NULL, true, NULL, NULL, NULL, 'The VREDEJAAR got missing between patria and the Cape; the ship was destined for China.');
INSERT INTO "voyages" VALUES (4101, '', 3, '', 'BORSSELE', 'Jan Siereveld', 1150, NULL, '1758', NULL, NULL, 'Z', 'Z', '1771-01-13', 'Rammekens', '1771-04-24', '1771-05-24', true, '1771-07-14', 'Ceylon', 7862, 'When the BORSSELE departed from the Cape, 146 seafarers and 36 soldiers were aboard.');
INSERT INTO "voyages" VALUES (4102, '', 3, '', 'VREEBURG', 'Jan Kaatman', 850, NULL, '1764', NULL, NULL, 'D', 'D', '1771-04-02', 'Goeree', '1771-07-01', '1771-08-04', true, '1771-10-26', 'Batavia', 7855, NULL);
INSERT INTO "voyages" VALUES (4103, '', 2, '', 'TEMPEL', 'Willem Koelbier', 850, NULL, '1767', NULL, NULL, 'R', 'R', '1771-05-14', 'Goeree', '1771-10-03', '1771-11-16', true, '1772-02-14', 'Batavia', 7914, NULL);
INSERT INTO "voyages" VALUES (4104, '', 1, '', 'BEEKVLIET', 'Thomas Brunei', 850, NULL, '1770', NULL, NULL, 'A', 'A', '1771-06-08', 'Texel', '1773-08-31', '1773-09-10', true, '1773-11-28', 'Batavia', 7908, 'ELISABETH (4171): 607 seafarers, 282 soldiers, 40 craftsmen, and one passenger arrived at Batavia. Data concerning both the above-mentioned four ships and the IJSSELMONDE (4172): 1102 seafarers, 530 soldiers, 89 craftsmen, and one passenger departed from the Republic or embarked at the Cape; at S. Tiago 4 seafarers and 3 soldiers died, one soldier deserted; 198 seafarers, 119 soldiers, and 23 craftsmen died during the voyage.');
INSERT INTO "voyages" VALUES (4105, '', 2, '', 'BLEIJENBURG', 'Kornelis Bos', 880, NULL, '1765', NULL, NULL, 'R', 'A', '1771-06-08', 'Texel', '1771-09-24', '1771-10-30', true, '1772-02-04', 'Batavia', 7864, NULL);
INSERT INTO "voyages" VALUES (4106, '', 2, '', 'VREDELUST', 'Willem Silvester', 1150, NULL, '1765', NULL, NULL, 'A', 'A', '1771-06-08', 'Texel', '1771-10-13', '1772-02-05', true, '1772-05-16', 'Batavia', NULL, 'The VREDELUST was laid up in the Indies, 01-01-1780.');
INSERT INTO "voyages" VALUES (4107, '', 4, '', 'ZUID-BEVELAND', 'Lambert Arnout Halfman', 1100, NULL, '1755', NULL, NULL, 'Z', 'Z', '1771-06-09', 'Rammekens', '1771-12-22', '1772-03-14', true, '1772-06-19', 'Batavia', 7875, NULL);
INSERT INTO "voyages" VALUES (4108, '', 3, '', 'VROUWE MARGARETHA MARIA', 'Jakob de Vries', 880, NULL, '1765', NULL, NULL, 'E', 'E', '1771-06-25', 'Texel', '1771-11-14', '1772-01-30', true, '1772-05-17', 'Batavia', 7889, NULL);
INSERT INTO "voyages" VALUES (4109, '', 6, '', 'SCHAGEN', 'Leendert van Koopstad', 880, NULL, '1753', NULL, NULL, 'H', 'H', '1771-06-25', 'Texel', '1771-11-16', '1772-01-30', true, '1772-05-16', 'Batavia', NULL, 'The SCHAGEN was laid up in the Indies, 31-12-1775.');
INSERT INTO "voyages" VALUES (4110, '', 2, '', 'POPKENSBURG', 'Pidter ten Droge', 880, NULL, '1763', NULL, NULL, 'Z', 'Z', '1771-06-27', 'Rammekens', '1771-11-11', '1772-01-15', true, '1772-05-07', 'Batavia', 7903, NULL);
INSERT INTO "voyages" VALUES (4111, '', 1, '', 'BOTLAND', 'Johan van Voorst', 1150, NULL, '1769', NULL, NULL, 'Z', 'Z', '1771-08-24', 'Rammekens', '1771-12-12', '1772-01-15', true, '1772-04-14', 'Batavia', 7872, NULL);
INSERT INTO "voyages" VALUES (4112, '', 7, '', 'VREDESTEIN', 'Adriaan de Keizer', 880, NULL, '1750', NULL, NULL, 'R', 'Z', '1771-09-02', 'Rammekens', '1772-01-07', '1772-02-25', true, '1772-05-16', 'Batavia', NULL, 'The VREDESTEIN was sold in the Indies, 01-01-1780.');
INSERT INTO "voyages" VALUES (4113, '', 2, '', 'PRINSES VAN ORANJE', 'Karsten Eggers', 1150, NULL, '1768', NULL, NULL, 'A', 'A', '1771-09-25', 'Texel', '1772-01-08', '1772-03-14', true, '1772-05-16', 'Batavia', 7880, NULL);
INSERT INTO "voyages" VALUES (4114, '', 4, '', 'WESTFRIESLAND', 'Gerrit Springer', 880, NULL, '1761', NULL, NULL, 'H', 'A', '1771-09-25', 'Texel', '1772-01-08', '1772-01-30', true, '1772-05-16', 'Batavia', 7885, NULL);
INSERT INTO "voyages" VALUES (4115, '', 2, '', 'BOT', 'Damiaan Hugo Staring', 1150, NULL, '1768', NULL, NULL, 'Z', 'A', '1771-09-26', 'Texel', '1772-01-08', '1772-02-19', true, '1772-05-10', 'Batavia', 7876, 'The BOT called at S. Tiago, 30-10 till 06-11-1771: 3 seafarers and 8 soldiers deserted or died.');
INSERT INTO "voyages" VALUES (4116, '', 4, '', 'VROUWE KORNELIA HILLEGONDA', 'J. Zonavond', 850, NULL, '1760', NULL, NULL, 'D', 'E', '1771-12-07', 'Texel', '1772-09-27', '1772-10-27', true, '1773-01-28', 'Batavia', 7893, 'JONGE LIEVE (4136), the RIDDERKERK(4137), the VLISSINGEN (4141), and the RENSWOUDE (4142): at S. Tiago 5 seafarers and one soldier died, 2 seafarers and one soldier deserted; 122 seafarers, 83 soldiers, and 9 craftsmen went ashore at the Cape; during the voyage 200 seafarers, 105 soldiers and 14 craftsmen died,');
INSERT INTO "voyages" VALUES (4117, '', 3, '', 'BOVENKERKER POLDER', 'Jan Moorland', 850, NULL, '1765', NULL, NULL, 'A', 'A', '1771-12-30', 'Texel', '1772-04-24', '1772-05-12', true, '1772-08-15', 'Bengal', 7882, NULL);
INSERT INTO "voyages" VALUES (4118, '', 3, '', 'GEINWENS', 'Michiel Hendrik Kerke', 1100, NULL, '1765', NULL, NULL, 'A', 'A', '1771-12-30', 'Texel', '1772-05-21', '1772-07-01', true, '1772-09-12', 'Ceylon', NULL, 'According to a letter sent from the Cape the GEINWENS departed from Texel with 350 persons aboard. At the departure from the Cape the crew consisted of 211 men. In 1776 GEINWENS was wrecked off Punto Gale.');
INSERT INTO "voyages" VALUES (4119, '', 1, '', 'LEIDERDORP', 'Albert Kikkert', 600, NULL, '1770', NULL, NULL, 'A', 'A', '1771-12-30', 'Texel', '1772-05-12', '1772-06-09', true, '1772-08-17', 'Batavia', NULL, 'On 18-11-1771 the LEIDERDORP set out for the first time; it had to return to Texel the next day. A second attempt to depart, 07-12-1771, also failed; back at Texel: 22-12. The third and final date of departure was 30-12-1771. In 1776 the LEIDERDORP was sold in the Indies.');
INSERT INTO "voyages" VALUES (4120, '', 4, '', 'NIEUW RHOON', 'Pieter van Prooien', 1150, NULL, '1764', NULL, NULL, 'Z', 'A', '1771-12-30', 'Texel', '1772-05-10', '1772-06-09', true, '1772-08-15', 'Batavia', 7878, NULL);
INSERT INTO "voyages" VALUES (4121, '', 6, '', 'SCHOONZICHT', 'Jan Rondekrans', 880, NULL, '1758', NULL, NULL, 'R', 'A', '1771-12-30', 'Texel', '1772-04-16', '1772-06-25', true, '1772-08-29', 'Batavia', NULL, 'The SCHOONZICHT was laid up in the Indies, 01-01-1780.');
INSERT INTO "voyages" VALUES (4122, '', 3, '', 'WOESTDUIN', 'Pieter Angelvorst', 1150, NULL, '1767', NULL, NULL, 'A', 'A', '1771-12-30', 'Texel', '1772-04-22', '1772-05-12', true, '1772-07-30', 'Ceylon', 7886, NULL);
INSERT INTO "voyages" VALUES (4123, '', 2, '', 'ZON', 'Andries Hansen', 450, 'hoeker', '1768', NULL, NULL, 'A', 'A', '1771-12-30', 'Texel', '1772-05-10', NULL, true, '1772-05-10', 'The Cape', 7865, 'The ZON was bound for the Cape.');
INSERT INTO "voyages" VALUES (4124, '', 1, '', 'GROENENDAAL', 'Kornelis Pietersen', 1150, NULL, '1770', NULL, NULL, 'A', 'A', '1771-12-31', 'Texel', '1772-04-16', '1772-05-01', true, '1772-07-12', 'Batavia', 7868, 'The GROENENDAAL made two earlier attempts to put out: 18-11-1771 (return to Texel the next day) and 07-12 1771 (back at Texel: 12-12); 31-12-1771 was the final date of departure. According to data recorded at the Cape the ship left from Texel with 249 persons aboard.');
INSERT INTO "voyages" VALUES (4125, '', 1, '', 'HONKOOP', 'Pieter Sijbrandsz. Flout', 1150, NULL, '1770', NULL, NULL, 'A', 'A', '1771-12-31', 'Texel', '1772-04-09', '1772-04-22', true, '1772-06-26', 'Batavia', 7870, 'The HONKOOP made two earlier attempts to put out: 18-11-1771(back at Texel the next day) and 07-12-1771 (return 19-12); 31-12-1771 was the final date of departure. According to data recorded at the Cape the ship departed from Texel with a crew consisting of 282 persons.');
INSERT INTO "voyages" VALUES (4126, '', 5, '', 'KRONENBURG', 'Jurriaan Verburg', 1100, NULL, '1757', NULL, NULL, 'A', 'A', '1771-12-31', 'Texel', '1772-04-16', '1772-05-01', true, '1772-08-25', 'Batavia', NULL, 'made two earlier attempts to set out: 18-11-1771 (return at Texel the next day) and 07-12-1771 (back at Texel: 19-12); 31-12-1771 was the final date of departure. According to data recorded at the Cape the ship left from Texel with 304 persons aboard, The KRONENBURG was laid up in the Indies, 31-12-1780.');
INSERT INTO "voyages" VALUES (4127, '', 2, '', 'HUIS TER MEIJEN', 'Simon Bot', 1150, NULL, '1767', NULL, NULL, 'A', 'A', '1771-12-31', 'Texel', '1772-05-01', '1772-07-03', true, '1772-09-05', 'Batavia', 7899, 'The HUIS TER MEIJEN made two earlier attempts to put out: 18-11-1771 (back at Texel the next day) and 07-12-1771 (return: 19-12); 31-12-1771 was the final date of departure. According to data recorded at the Cape the HUIS TER MEIJEN departed from Texel with a crew consisting of 248 persons.');
INSERT INTO "voyages" VALUES (4128, '', 2, '', 'PAUW', 'Abraham van der Weide', 850, NULL, '1767', NULL, NULL, 'D', 'D', '1771-12-31', 'Goeree', '1772-04-24', '1772-05-11', true, '1772-07-12', 'Batavia', 7869, 'attempted to set out for the first time; fifteen days later it had to return to TexeL');
INSERT INTO "voyages" VALUES (4129, '', 2, '', 'VROUWE MARIA JAKOBA', 'Marten Pietersz. Mooy', 880, NULL, '1765', NULL, NULL, 'H', 'H', '1772-01-17', 'Texel', '1772-05-11', '1772-06-09', true, '1772-08-18', 'Batavia', 7873, 'Texel with a crew consisting of 208 men.');
INSERT INTO "voyages" VALUES (4130, '', 3, '', 'RITTHEM', 'J. F. Lindeman', 880, NULL, '1764', NULL, NULL, 'Z', 'Z', '1772-01-21', 'Rammekens', '1772-05-13', '1772-06-22', true, '1772-08-29', 'Batavia', 7867, NULL);
INSERT INTO "voyages" VALUES (4131, '', 4, '', 'JONGE SAMUEL', 'Gerrit Evertsz. Popta', 880, NULL, '1761', NULL, NULL, 'Z', 'Z', '1772-01-21', 'Rammekens', '1772-05-11', '1772-06-20', true, '1772-08-25', 'Batavia', 7879, 'first time; sixteen days later it had to return to Rammekens. One source mentions G. L. Popken as master of the JONGE SAM-UEL.');
INSERT INTO "voyages" VALUES (4132, '', 3, '', 'WILLEM DE VIJFDE', 'Kornelis Klingweel', 1150, NULL, '1765', NULL, NULL, 'Z', 'Z', '1772-01-21', 'Rammekens', '1772-05-13', '1772-05-24', true, '1772-07-31', 'Batavia', 7871, 'On 05-12-1771 the WILLEM DE VIJFDE attempted to put out for the first time; sixteen days later the ship had to return to Rammekens. According to KA 3230 it finally departed from Rammekens with a crew consisting of 309 men.');
INSERT INTO "voyages" VALUES (4133, '', 1, '', 'HUIS TE KROOSWIJK', 'Frederik Wielard', 850, NULL, '1770', NULL, NULL, 'R', 'R', '1772-02-17', 'Goeree', '1772-06-03', '1772-06-26', true, '1772-08-26', 'Batavia', 7894, 'On 05-12-1771 the HUIS TE KROOSWIJK attempted to put out for the first time, two weeks later it had to return to Goeree. The ship called at Spithead, 24-02-1772.');
INSERT INTO "voyages" VALUES (4134, '', 1, '', 'MERCUUR', 'Christiaan Andries Spin', 850, NULL, '1770', NULL, NULL, 'D', 'D', '1772-04-01', 'Goeree', '1772-07-08', '1772-07-30', true, '1772-10-03', 'Batavia', 7884, NULL);
INSERT INTO "voyages" VALUES (4135, '', 5, '', 'DUINENBURG', 'Pieter Thomasz.', 1100, NULL, '1757', NULL, NULL, 'Z', 'Z', '1772-04-27', 'Rammekens', '1772-08-23', '1772-09-19', true, '1772-11-26', 'Batavia', 7883, NULL);
INSERT INTO "voyages" VALUES (4136, '', 5, '', 'JONGE LIEVE', 'Jan Frederik Raatjes', 1150, NULL, '1759', NULL, NULL, 'A', 'A', '1772-05-12', 'Texel', '1772-09-17', '1772-10-27', true, '1773-01-28', 'Batavia', 7891, 'See the VROUWE KORNELIA HILLEGONDA (4116). The following data refer to the crew of the JONGE LIEVE as well as to the crew of the RIDDERKERK (4137): 355 seafarers, 174 soldiers, and 25 craftsmen departed from the Republic or embarked at the Cape; 266 seafarers, 120 soldiers, and 18 craftsmen arrived at Batavia,');
INSERT INTO "voyages" VALUES (4137, '', 3, '', 'RIDDERKERK', 'Michiel Hendrik Wunder', 850, NULL, '1766', NULL, NULL, 'R', 'A', '1772-05-12', 'Texel', '1772-09-18', '1772-10-25', true, '1773-01-27', 'Batavia', 7888, 'See the VROUWE KORNELIA HILLEGONDA (4116) and the JONGE LIEVE (4136).');
INSERT INTO "voyages" VALUES (4138, '', 4, '', 'WESTERVELD', 'Andries Bruin', 1100, NULL, '1761', NULL, NULL, 'A', 'A', '1772-05-12', 'Texel', '1772-09-04', '1772-10-09', true, '1773-01-22', 'Batavia', 7917, NULL);
INSERT INTO "voyages" VALUES (4139, '', 2, '', 'JONGE HELLINGMAN', 'Jan Balthus Meyer', 850, NULL, '1767', NULL, NULL, 'H', 'H', '1772-05-19', 'Texel', '1772-09-19', '1772-10-25', true, '1773-01-25', 'Batavia', 7905, NULL);
INSERT INTO "voyages" VALUES (4140, '', 4, '', 'ZILVEREN LEEUW', 'Marten Hakker', 880, NULL, '1765', NULL, NULL, 'D', 'R', '1772-05-19', 'Goeree', '1772-09-11', '1772-10-25', true, '1773-01-22', 'Batavia', 7910, 'departed from Goeree with a crew consisting of 244 persons.');
INSERT INTO "voyages" VALUES (4141, '', 6, '', 'VLISSINGEN', 'J. de Fik', 880, NULL, '1753', NULL, NULL, 'Z', 'Z', '1772-05-23', 'Rammekens', '1772-11-02', '1772-12-04', true, '1773-03-09', 'Batavia', NULL, 'Cape; 282 seafarers, 122 soldiers, and 23 craftsmen arrived at Batavia,');
INSERT INTO "voyages" VALUES (4142, '', 5, '', 'RENSWOUDE', 'Stoffel Kok', 1150, NULL, '1756', NULL, NULL, 'A', 'Z', '1772-07-05', 'Rammekens', '1772-11-02', '1772-12-21', true, '1773-04-11', 'Batavia', NULL, 'The RENSWOUDE was laid up in the Indies, 01-01-1780. See the VROUWE KORNELIA HILLEGONDA (4116) and the VLISSINGEN (4141),');
INSERT INTO "voyages" VALUES (4143, '', 2, '', 'OUWERKERK', 'Josua de Wolf van Ieperen', 1150, NULL, '1768', NULL, NULL, 'Z', 'Z', '1772-08-26', 'Rammekens', '1773-01-26', NULL, true, '1773-01-26', 'The Cape', 7887, 'The OUWERKERK was bound for the Cape. The crew consisted for the greater part of soldiers, placed at the disposal of the Dutch authorities at the Cape.');
INSERT INTO "voyages" VALUES (4144, '', 1, '', 'BEEMSTER WELVAREN', 'Marten Schoning', 850, NULL, '1770', NULL, NULL, 'E', 'E', '1772-09-11', 'Texel', '1773-02-18', '1773-03-07', true, '1773-06-07', 'Batavia', 7928, 'ANTHOINETTA KOENRARDINA (4145), the JUNO (4146), and the FOREEST (4150): 19 seafarers, 13 soldiers, and 2 craftsmen died at Porto Prayo, S. Tiago; 25 men deserted; at the Cape 554 seafarers, 357 soldiers, 30 craftsmen, and 15 passengers disembarked; during the voyage 496 seafarers, 410 soldiers, 61 craftsmen, and 6 passengers died.');
INSERT INTO "voyages" VALUES (4145, '', 3, '', 'VROUWE ANTHOINETTA KOENRARDINA', 'Jan Kaatman', 880, NULL, '1765', NULL, NULL, 'D', 'D', '1772-09-29', 'Goeree', '1773-02-13', '1773-03-07', true, '1773-06-09', 'Batavia', 7918, 'Specified data concerning the crew of the VROUWE ANTHOINETTA KOENRARDINA: 203 seafarers, 73 soldiers, 22 craftsmen, and 11 passengers departed from the Republic or embarked at the Cape. See also the BEEMSTER WELVAREN (4144).');
INSERT INTO "voyages" VALUES (4146, '', 1, '', 'JUNO', 'Pieter Verkerk', 850, NULL, '1771', NULL, NULL, 'R', 'R', '1772-10-19', 'Goeree', '1773-04-11', '1773-04-24', true, '1773-07-22', 'Batavia', 7892, 'BEEMSTER WELVAREN (4144). The following data refer to the crew of the JUNO as well as to the crews of the ASCHAT (4147), the AZIE (4148), and the HOLLAND (4157): at Portsmouth 3 seafarers, 9 soldiers, and 2 craftsmen died. Data concerning both the aforesaid four ships and the FOREEST (4150), the OVERHOUT (4151), the VOORBERG (4153), and the EUROPA (4155): at Duins and Portsmouth 24 men were pressed by the English.');
INSERT INTO "voyages" VALUES (4147, '', 5, '', 'ASC H AT', 'Reindert den Uil', 1150, NULL, '1760', NULL, NULL, 'A', 'A', '1772-10-20', 'Texel', '1773-04-15', '1773-06-14', true, '1773-09-08', 'Batavia', 7902, '13 passengers arrived at Batavia.');
INSERT INTO "voyages" VALUES (4148, '', 3, '', 'AZIE', 'Christiaan Blom', 1100, NULL, '1765', NULL, NULL, 'Z', 'A', '1772-10-20', 'Texel', '1773-04-11', '1773-05-26', true, '1773-08-25', 'Batavia', 7896, 'was altered into AZIE again (7847).');
INSERT INTO "voyages" VALUES (4149, '', 4, '', 'BARTHA PETRONELLA', 'Jakob Hendrik Johansen', 880, NULL, '1764', NULL, NULL, 'H', 'A', '1772-10-20', 'Texel', '1773-05-19', NULL, true, '1773-05-19', 'The Cape', 7890, 'The BARTHA PETRONELLA called at Portsmouth (25-10 till 19-11-1772) and at Plymouth (19-11-1772 till 03-02-1773), The ship was bound for the Cape.');
INSERT INTO "voyages" VALUES (4150, '', 1, '', 'FOREEST', 'Kornelis Brouwer', 850, NULL, '1770', NULL, NULL, 'H', 'H', '1772-10-20', 'Texel', '1773-04-15', '1773-05-05', true, '1773-08-05', 'Batavia', 7897, 'VOORBERG (4153), and the EUROPA (4155)t at Duins 12 seafarers, 17 soldiers, and 2 craftsmen died.');
INSERT INTO "voyages" VALUES (4151, '', 1, '', 'OVERHOUT', 'Hendrik Willemse', 1150, NULL, '1771', NULL, NULL, 'A', 'A', '1772-10-20', 'Texel', '1773-04-14', '1773-06-14', true, '1773-09-08', 'Batavia', 7901, 'From 22-10 till 15-11-1772 the OVERHOUT called at Duins (see the FOREEST, 4150; see also the JUNO, 4146). See the BEEMSTER WELVAREN (4144) and the ASCHAT (4147).');
INSERT INTO "voyages" VALUES (4152, '', 4, '', 'JONGE THOMAS', 'Barend de la Main', 1150, NULL, '1764', NULL, NULL, 'A', 'A', '1772-10-20', 'Texel', '1773-03-29', NULL, true, NULL, NULL, NULL, 'From 22-10 till 15-11-1772 the JONGE THOMAS called at Duins. In the Table Bay at the Cape the ship was wrecked, 01-06-1773.');
INSERT INTO "voyages" VALUES (4153, '', 1, '', 'VOORBERG', 'Frederik Visser', 1150, NULL, '1770', NULL, NULL, 'A', 'A', '1772-10-20', 'Texel', '1773-04-17', '1773-04-24', true, '1773-07-07', 'Batavia', 7907, 'see the JUNO, 4146). After having called at Batavia, the ship sailed on to China. See the BEEMSTER WELVAREN (4144) and the ASCHAT (4147).');
INSERT INTO "voyages" VALUES (4154, '', 3, '', 'DUIVENBRUG', 'Willem Hartsz.', 850, NULL, '1766', NULL, NULL, 'E', 'A', '1772-10-21', 'Texel', '1773-04-11', '1773-07-01', true, '1773-10-02', 'Batavia', 7977, 'See the BEEMSTER WELVAREN (4144).');
INSERT INTO "voyages" VALUES (4155, '', 1, '', 'EUROPA', 'Jakob de Frein', 1200, NULL, '1770', NULL, NULL, 'Z', 'Z', '1772-10-23', 'Rammekens', '1773-04-09', '1773-04-24', true, '1773-07-07', 'Batavia', 7906, 'From 27-10 till 19-11-1772 the EUROPA was at Duins (see the FOREEST, 4150; see the JUNO, 4146). After having called at Batavia, the EUROPA sailed on to China. See the BEEMSTER WELVAREN (4144).');
INSERT INTO "voyages" VALUES (4156, '', 6, '', 'BLEISWIJK', 'C. de Roo', 880, NULL, '1756', NULL, NULL, 'D', 'Z', '1772-11-15', 'Rammekens', '1773-09-26', '1773-10-28', true, '1774-02-01', 'Batavia', NULL, 'The BLEISWIJK called at Rochefort, 14-12-1772 till 14-01-1773. During the voyage 46 members of the crew deserted. In 1777 the BLEISWIJK was wrecked in the Indies.');
INSERT INTO "voyages" VALUES (4157, '', 1, '', 'HOLLAND', 'Hans Hansen', 1150, NULL, '1771', NULL, NULL, 'A', 'A', '1772-11-15', 'Texel', '1773-04-09', '1773-04-24', true, '1773-07-03', 'Batavia', 7905, 'at Portsmouth (see the JUNO, 4146). After having called at Batavia, the ship sailed on to China. See the BEEMSTER WELVAREN (4144) and the ASCHAT (4147).');
INSERT INTO "voyages" VALUES (4158, '', 3, '', 'ZON', 'Andries Hansen', 450, 'hoeker', '1768', NULL, NULL, 'A', 'A', '1772-12-24', 'Texel', '1773-06-27', NULL, true, '1773-06-27', 'The Cape', NULL, 'The ZON called at St. Paulo de Luanda: departure: 03-05-1773 (see also the BEEKVLIET, 4104). The ship was bound for the Cape; it was laid up in 1782.');
INSERT INTO "voyages" VALUES (4159, '', 5, '', 'HUIS TE BIJWEG', 'Jan Paardekoper', 1100, NULL, '1760', NULL, NULL, 'A', 'A', '1772-12-25', 'Texel', '1773-04-15', '1773-05-05', true, '1773-07-07', 'Batavia', 7900, 'See the BEEMSTER WELVAREN (4144) and the ASCHAT (4147).');
