INSERT INTO "voyages" VALUES (4164, '', 5, '', '''S LANDS WELVAREN', 'Frederik Kelger', 880, NULL, '1762', NULL, NULL, 'A', 'A', '1772-12-25', 'Texel', '1773-04-07', '1773-05-26', true, '1773-08-28', 'Bengal', NULL, 'Sailing on the Ganges the ''S LANDS WELVAREN ran aground, 28-08-1773. The ship was laid up in Bengal, 12-01-1774.');
INSERT INTO "voyages" VALUES (4165, '', 3, '', 'OUD HAARLEM', 'Jan Siereveld', 1150, NULL, '1768', NULL, NULL, 'A', 'Z', '1772-12-26', 'Rammekens', '1773-04-11', '1773-05-15', true, '1773-07-16', 'Ceylon', 7912, NULL);
INSERT INTO "voyages" VALUES (4166, '', 1, '', 'ZEEDUIN', 'Kornelis Pietersen', 1150, NULL, '1771', NULL, NULL, 'Z', 'Z', '1773-02-08', 'Rammekens', '1773-05-26', '1773-07-07', true, '1773-09-10', 'Batavia', 8023, 'See the BEEMSTER WELVAREN (4144).');
INSERT INTO "voyages" VALUES (4167, '', 2, '', 'HOOLWERF', 'Willem Dona', 850, NULL, '1769', NULL, NULL, 'H', 'D', '1773-04-09', 'Goeree', '1773-08-31', '1773-09-28', true, '1773-11-28', 'Batavia', 7909, 'See the BEEKVLIET (4104). The following data refer to the crew of the HOOLWERF as well as to the crews of the VROUWE GEERTRUIDA (4169), the VROUWE ELISA-BETH (4171), and the IJSSELMONDE (4172): at the Cape 142 seafarers, 71 soldiers and 11 craftsmen disembarked.');
INSERT INTO "voyages" VALUES (4168, '', 3, '', 'BLEIJENBURG', 'Barend de Rust', 880, NULL, '1765', NULL, NULL, 'R', 'A', '1773-05-05', 'Texel', '1773-11-07', '1773-12-08', true, '1774-03-10', 'Batavia', 7968, 'During the voyage 5 members of the crew deserted.');
INSERT INTO "voyages" VALUES (4169, '', 6, '', 'VROUWE GEERTRUIDA', 'Willem Bruelle', 1100, NULL, '1757', NULL, NULL, 'A', 'A', '1773-05-05', 'Texel', '1773-08-01', '1773-08-24', true, '1773-11-28', 'Batavia', NULL, 'See the BEEKVLIET (4104) and the HOOLWERF (4167). The VROUWE GEERTRUIDA was laid up in the Indies, 01-01-1779.');
INSERT INTO "voyages" VALUES (4170, '', 5, '', 'PALLAS', 'Asmus Hendrik Sterrenberg', 1150, NULL, '1762', NULL, NULL, 'Z', 'A', '1773-05-05', 'Texel', '1773-09-05', '1773-11-02', true, '1774-02-04', 'Batavia', 7916, 'During the voyage one member of the crew deserted.');
