INSERT INTO "voyages" VALUES (4172, '', 3, '', 'IJSSELMONDE', 'Gerrit van der Gracht', 880, NULL, '1762', NULL, NULL, 'R', 'H', '1773-06-10', 'Texel', '1773-10-03', '1773-10-28', true, '1774-01-04', 'Batavia', NULL, 'the Indies, 01-01-1778.');
