INSERT INTO "voyages" VALUES (4177, '', 1, '', 'EENDRACHT', 'Thomas de Beukelaar', 850, NULL, '1771', NULL, NULL, 'D', 'D', '1773-10-07', 'Goeree', '1774-03-19', '1774-04-13', true, '1774-06-18', 'Batavia', 8015, 'one passenger departed from Goeree or embarked at the Cape. See the HUIS OM (4173).');
