INSERT INTO "voyages" VALUES (4179, '', 1, '', 'HOOGKARSPEL', 'Pieter Helmers', 850, NULL, '1771', NULL, NULL, 'E', 'E', '1773-12-07', 'Texel', '1774-05-14', '1774-06-13', true, '1774-09-08', 'Batavia', 7927, 'the crew of the HOOGKARSPEL: 221 seafarers and 27 soldiers departed from Texel or embarked at the Cape, During the voyage 3 members of the crew deserted. See the HUTS OM (4173).');
INSERT INTO "voyages" VALUES (4180, '', 2, '', 'ALKEMADE', 'Daniel Deune', 1150, NULL, '1768', NULL, NULL, 'A', 'A', '1773-12-08', 'Texel', '1774-05-01', '1774-07-12', true, '1774-09-09', 'Batavia', 7926, 'During the voyage 3 members of the crew deserted. See the HUIS OM (4173). The following data refer to the crew of the ALKEMADE as well as to the crews of the HONKOOP (see 4182), the VENUS (4184), the AMSTERDAM (4185), the GROENENDAAL (4186), the VRIJHEID (4187), the BOTLAND (4191), and the PRINSES VAN ORANJE (4193): 131 seafarers, 66 soldiers, and 6 craftsmen embarked at the Cape.');
INSERT INTO "voyages" VALUES (4181, '', 1, '', 'CERES', 'Wopke Popta', 1150, NULL, '1771', NULL, NULL, 'A', 'A', '1773-12-08', 'Texel', '1774-04-27', '1774-05-11', true, '1774-07-19', 'Batavia', 7929, 'After having called at Batavia the CERES sailed on to China. See the HUIS OM (4173).');
