INSERT INTO "voyages" VALUES (4210, '', 1, '', 'INDIAAN', 'Frederik Raatjes', 1150, NULL, '1773', NULL, NULL, 'A', 'A', '1774-09-15', 'Texel', '1775-01-24', '1775-02-08', true, '1775-06-17', 'Batavia', 7943, 'PATRIOT (4219), the EUROPA (4221), the ABBEKERK (4222), and the HOF TER LINDEN (4223): at the Cape 226 seafarers, 75 soldiers, 12 craftsmen, and 2 passengers went ashore, 77 seafarers, 49 soldiers, 4 craftsmen, and I 1 passengers embarked; during the voyage 155 seafarers, 63 soldiers, and 13 craftsmen died.');
INSERT INTO "voyages" VALUES (4211, '', 6, '', 'JONGE LIEVE', 'Willem Ferret', 1150, NULL, '1759', NULL, NULL, 'A', 'A', '1774-09-15', 'Texel', '1775-02-17', '1775-03-28', true, '1775-07-08', 'Batavia', 7954, 'The JONGE LIEVE called at Portsmouth: one seafarer died, one craftsmen deserted. During the voyage one other member of the crew deserted. See the INDIAAN (4210).');
