INSERT INTO "voyages" VALUES (4214, '', 4, '', '''T LOO', 'Gerrit Berg', 1150, NULL, '1768', NULL, NULL, 'A', 'A', '1774-09-26', 'Texel', '1775-01-24', '1775-03-02', true, '1775-06-18', 'Batavia', 7945, 'During the voyage 2 members of the crew deserted. See also the INDIAAN (4210).');
