INSERT INTO "voyages" VALUES (4216, '', 6, '', 'ASCHAT', 'Jan Paardekoper', 1150, NULL, '1760', NULL, NULL, 'A', 'A', '1774-10-27', 'Texel', '1775-03-17', '1775-05-02', true, '1775-08-01', 'Batavia', NULL, 'The ASCHAT sailed via Bantam, where 6 seafarers went ashore. During the voyage 3 members of the crew deserted. See also the INDIAAN (4210). In 1776 the ASCHAT was wrecked in the Indies.');
