INSERT INTO "voyages" VALUES (4219, '', 1, '', 'PATRIOT', 'Jan Ide', 1150, NULL, '1773', NULL, NULL, 'A', 'A', '1774-10-27', 'Texel', '1775-03-06', '1775-04-08', true, '1775-07-18', 'Batavia', 7948, 'See the INDIAAN (4210).');
