INSERT INTO "voyages" VALUES (4221, '', 2, '', 'EUROPA', 'Jakob de Frein', 1200, NULL, '1770', NULL, NULL, 'Z', 'Z', '1774-11-05', 'Rammekens', '1775-02-21', '1775-03-28', true, '1775-07-02', 'Batavia', 7956, 'During the voyage one member of the crew deserted. After having called at Batavia the EUROPA sailed on to China. See the INDIAAN (4210).');
INSERT INTO "voyages" VALUES (4222, '', 1, '', 'ABBEKERK', 'Gerrit Bruin', 850, NULL, '1772', NULL, NULL, 'H', 'H', '1774-12-05', 'Texel', '1775-04-17', '1775-05-02', true, '1775-07-24', 'Batavia', 7950, 'The ABBEKERK called at Bantam: 19 seafarers and 25 soldiers went ashore. During the voyage one member of the crew deserted, See the INDIAAN (4210).');
