INSERT INTO "voyages" VALUES (4232, '', 2, '', 'BEEKVLIET', 'Benjamin van der Spek', 850, NULL, '1770', NULL, NULL, 'A', 'A', '1775-04-29', 'Texel', '1775-09-08', '1775-10-06', true, '1776-01-23', 'Batavia', 7984, 'JUNO (4234), the VROUWE KORNELIA HILLEGONDA (4235), the TRITON (4237), the HOOLWERF (4241), and the GROENENDAAL (4243): 1333 seafarers, 625 soldiers, 84 craftsmen, and 7 passengers departed from the Republic or embarked at the Cape; 110 seafarers, 87 soldiers, and 5 craftsmen went ashore at the Cape; at Bantam 26 soldiers disembarked; during the voyage 46 seafarers, 31 soldiers, and 4 craftsmen died; 1173 seafarers, 481 soldiers, 75 craftsmen, and 6 passengers arrived at Batavia.');
