INSERT INTO "voyages" VALUES (4237, '', 1, '', 'TRITON', 'Pieter van Prooien', 1150, NULL, '1773', NULL, NULL, 'A', 'A', '1775-06-27', 'Texel', '1775-12-29', '1776-01-23', true, '1776-04-19', 'Batavia', 7981, 'The TRITON called at Duins: one seafarer died, one seafarer deserted, another seafarer was pressed by the English. After having called at Batavia, the TRITON sailed on to China. See the BEEKVLIET (4232).');
