INSERT INTO "voyages" VALUES (4390, '', 1, '', 'VROUWE KATHARINA WILHELMINA', 'Pieter van Prooien', 880, NULL, '1778', NULL, NULL, 'R', 'R', '1780-12-25', 'Goeree', NULL, NULL, true, NULL, NULL, NULL, 'January, 1781, the ship arrived at Duins.');
INSERT INTO "voyages" VALUES (4391, '', 1, '', 'ZWALUW', 'Jan Jansz. Laurits', NULL, 'logger', NULL, NULL, NULL, NULL, NULL, '1782-01-03', 'Lorient', '1782-03-23', NULL, true, '1782-03-23', 'The Cape', 8082, 'The ZWALUW was bound for the Cape.');
INSERT INTO "voyages" VALUES (4392, '', 5, '', 'BOT', 'Johan Frederik Schuts', 1150, NULL, '1768', NULL, NULL, 'Z', 'Z', '1782-07-07', 'Texel', '1782-12-02', '1783-04-11', true, '1783-07-19', 'Batavia', NULL, '(4393), the HOLLAND (4394), the JAVA (4395), the SCHOONDERLOO (4396), the VOORBERG (4397), the ZEEPAARD (4398), and the ZEEUW (4399) were accompanied by two Dutch men-of-war. Commandeur of this fleet was Jan Paardekoper aboard the GANGES.');
INSERT INTO "voyages" VALUES (4393, '', 3, '', 'GANGES', 'Jan Paardekoper', 1150, NULL, '1775', NULL, NULL, 'A', 'A', '1782-07-07', 'Texel', '1782-12-02', '1783-02-10', true, '1783-08-03', 'Ceylon', 8106, 'departed om 11-09-1781; five days later the ship returned to Texel. The GANGES sailed via Mauritius. After having arrived at Ceylon the ship continued its voyage to Batavia, where it cast anchor on 15-11-1783. The high death-rate among the crew was due to scurvy. See also the BOT (4392).');
INSERT INTO "voyages" VALUES (4394, '', 4, '', 'HOLLAND', 'Isaak de Vries', 1150, NULL, '1771', NULL, NULL, 'A', 'A', '1782-07-07', 'Texel', '1782-12-02', '1783-02-10', true, '1783-08-03', 'Ceylon', 8105, 'out on 11-09-1781; five days later, however, it returned to Texel. The ship sailed via Mauritius. After having arrived at Ceylon the HOLLAND continued its voyage to Batavia; arrival: 16-11-1783. The high death-rate among the crew was due to scurvy. See also the BOT (4392).');
INSERT INTO "voyages" VALUES (4395, '', 2, '', 'JAVA', 'Jan Tromp', 850, NULL, '1775', NULL, NULL, 'E', 'H', '1782-07-07', 'Texel', '1782-12-02', '1783-05-06', true, '1783-07-30', 'Batavia', 8096, 'Originally the JAVA departed on 11-09-1781; five days later, however, the ship returned to Texel. The high death-rate among the crew was due to scurvy. See also the BOT (4392).');
INSERT INTO "voyages" VALUES (4396, '', 1, '', 'SCHOONDERLOO', 'Jakob van den Berg', 880, NULL, '1779', NULL, NULL, 'D', 'D', '1782-07-07', 'Texel', '1782-12-02', '1783-04-11', true, '1783-07-18', 'Batavia', 8092, 'On 10-09-1781 the SCHOONDERLOO departed from Goeree; six days later it arrived at Texel. During the voyage five members of the crew deserted. The high death-rate was due to scurvy. See also the BOT (4392).');
INSERT INTO "voyages" VALUES (4397, '', 4, '', 'VOORBERG', 'Abraham Tim', 1150, NULL, '1770', NULL, NULL, 'A', 'A', '1782-07-07', 'Texel', '1782-12-02', '1783-02-10', true, '1783-08-03', 'Ceylon', 8104, 'Originally the VOORBERG departed on 11-09-1781; five days later, however, it returned to Texel. The ship sailed via Mauritius. After having arrived at Ceylon the VOORBERG continued its voyage to Batavia, where it arrived on 16-11-1783. The high death-rate among the crew was due to scurvy. See also the BOT (4392).');
INSERT INTO "voyages" VALUES (4398, '', 3, '', 'ZEEPAARD', 'Pieter Thijssen jr.', 1150, NULL, '1774', NULL, NULL, 'A', 'A', '1782-07-07', 'Texel', '1782-12-02', '1783-04-11', true, '1783-07-18', 'Batavia', 8093, 'death rate was due to scurvy. See also the BOT (4392).');
INSERT INTO "voyages" VALUES (4399, '', 2, '', 'ZEEUW', 'Willem Udemans jr.', 1150, NULL, '1774', NULL, NULL, 'Z', 'Z', '1782-07-07', 'Texel', '1782-12-02', '1783-02-10', true, '1783-08-03', 'Ceylon', NULL, 'also the BOT (4392).');
INSERT INTO "voyages" VALUES (4400, '', 1, '', 'BERLIN', 'Arie van der Giessen', 898, 'fluit', NULL, NULL, NULL, 'D', NULL, '1782-08-28', 'Riga', '1783-01-06', '1793-02-15', true, '1783-05-24', 'Batavia', 8087, 'The BERLIN flew the Prussian flag. During the voyage the ship called at Helsingor; departure: 14-09-1782.');
INSERT INTO "voyages" VALUES (4401, '', 1, '', 'L''ANGELIQUE BENECH', 'De Strale', 250, NULL, NULL, NULL, NULL, NULL, NULL, '1782-09-02', 'La Rochelle', '1783-01-22', NULL, true, '1783-01-22', 'The Cape', 8085, 'The ANGELIQUE BENECH flew the Imperial (i.e.: Austrian) flag. The ship was bound for the Cape.');
INSERT INTO "voyages" VALUES (4402, '', 1, '', 'LOUIS FRANCOIS', 'Scipion', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1782-09-02', 'La Rochelle', '1783-01-22', '1783-05-26', true, NULL, 'Ceylon', NULL, 'The LOUIS FRANCOIS flew the Imperial (i.e.: Austrian) flag. The date of arrival at Ceylon is unknown.');
INSERT INTO "voyages" VALUES (4403, '', 1, '', 'FRIEDRICH DER GROSSE', 'Simon Koter', 678, NULL, NULL, NULL, NULL, NULL, NULL, '1782-09-07', 'Texel', '2-01-01', '1783-01-28', true, '1783-05-25', 'Batavia', 8088, 'The FRIEDRICH DER GROSSE flew the Prussian flag.');
INSERT INTO "voyages" VALUES (4404, '', 1, '', 'KROONPRINS VAN PRUISEN', 'Dirk Huizing', 760, NULL, NULL, NULL, NULL, NULL, NULL, '1782-09-07', 'Texel', '1783-01-13', NULL, true, '1783-01-13', 'The Cape', 8086, 'The KROONPRINS VAN PRUISEN flew the Prussian flag. It was bound for the Cape.');
INSERT INTO "voyages" VALUES (4405, '', 1, '', 'DOLFIJN', 'Ilonore Roux', 397, NULL, NULL, NULL, NULL, NULL, 'Z', '1782-12-04', 'Texel', '1783-04-28', '1783-05-26', true, '1783-09-01', 'Ceylon', 8094, 'The DOLFIJN flew the Imperial (i.e.: Austrian) flag.');
INSERT INTO "voyages" VALUES (4406, '', 2, '', 'OOSTEREEM', 'Axel Land', 1150, NULL, NULL, NULL, '1771', 'A', 'A', '1783-01-17', 'Texel', NULL, NULL, true, NULL, NULL, NULL, 'The OOSTEREEM flew the Prussian flag. The ship was bound for China; on 21-01-1783, however, it ran aground at Goodwin''s Sand and was wrecked. 4406/- Is the second voyage of this ship, which during the preceding voyage (4184/8014) was called VENUS.');
INSERT INTO "voyages" VALUES (4407, '', 6, '', 'AURICH', 'Jan Meindertsz. Swaal', 850, NULL, NULL, NULL, '1766', 'R', 'E', '1783-02-15', 'Texel', '1783-05-26', '1783-06-17', true, '1783-09-01', 'Batavia', 8095, 'Pieter Modderman was master, when the ship arrived at the Cape. After having called at Batavia the AURICH possibly sailed on to China. 4407/8095 Is the sixth voyage of this ship, which during the preceding voyages was called RIDDERKERK (numbers of the fifth voyage: 4297/8032).');
INSERT INTO "voyages" VALUES (4408, '', 3, '', 'BRESLAU', 'Jan Kornelis Roos', 1150, NULL, NULL, NULL, '1774', 'A', 'Z', '1783-02-15', 'Rammekens', '1783-05-27', '1783-06-12', true, '1783-08-06', 'Batavia', 8101, 'having arrived at Batavia the ship sailed on to China, where it cast anchor on 11-10-1783. 4408/8101 Is the third voyage of this ship, which during its preceding voyages was called BLOK (numbers of the second voyage: 4327/8049).');
INSERT INTO "voyages" VALUES (4409, '', 1, '', 'LES DEUX SOEURS', 'Blankman', 582, NULL, NULL, '1781', NULL, 'B', 'Z', '1783-02-15', 'Lorient', '1783-06-14', NULL, true, '1783-06-14', 'The Cape', 8098, 'LES DEUX SOEURS was bound for the Cape.');
INSERT INTO "voyages" VALUES (4410, '', 1, '', 'POTSDAM', 'Bernard Christiaan Muller', 1150, NULL, NULL, NULL, '1780', 'A', 'A', '1783-02-25', 'Texel', '1783-05-27', '1783-06-12', true, '1783-08-09', 'Batavia', 8099, 'The POTSDAM flew the Prussian flag. The original date of departure was 17-01-1783, nine days later, however, the ship returned to Texel. After having arrived at Batavia the POTSDAM sailed on to China, where it cast anchor on 11-10-1783.');
INSERT INTO "voyages" VALUES (4411, '', 1, '', 'GERECHTIGHEID', 'Isaak Segon', 1150, NULL, '1779', NULL, NULL, 'A', 'A', '1783-03-04', 'Rammekens', '1783-07-19', '1783-08-22', true, '1783-11-08', 'Batavia', 8103, 'On 24-11-1782 the GERECHTIGHEID departed from Texel for Rammekens. At Texel a mutiny broke out, but was suppressed.');
INSERT INTO "voyages" VALUES (4412, '', 1, '', 'MAGDEBURG', 'Asuerus Brinkman', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1783-03-17', 'Texel', '1783-06-18', '1783-06-29', true, '1783-09-05', 'Batavia', 8089, 'Prussian flag. According to K.A. 3526 Jan Nieuwenhuis was master.');
INSERT INTO "voyages" VALUES (4413, '', 6, '', 'WILLEM DE VIJFDE', 'Pieter Kardon', 1150, NULL, '1765', NULL, NULL, 'Z', 'Z', '1783-04-04', 'Rammekens', '1783-07-19', '1783-08-10', true, '1783-11-02', 'Ceylon', 8102, NULL);
INSERT INTO "voyages" VALUES (4414, '', 1, '', 'PRINZ HEINRICH', 'Laurens Smit', 846, 'fluit', NULL, NULL, NULL, NULL, NULL, '1783-04-05', 'Texel', '1783-07-31', '1783-09-06', true, '1783-11-27', 'Batavia', 8107, 'ship was probably accompanied by a Dutch man-of-war.');
INSERT INTO "voyages" VALUES (4415, '', 1, '', 'ROTTERDAMS WELVAREN', 'Kornelis de Wit', 880, NULL, '1780', NULL, NULL, 'R', 'R', '1783-04-19', 'Goeree', '1783-08-08', '1783-09-10', true, '1783-11-17', 'Batavia', 8110, NULL);
INSERT INTO "voyages" VALUES (4416, '', 1, '', 'FACTOR', 'Jan Jochem Milfaart', 320, NULL, NULL, NULL, NULL, NULL, 'Z', '1783-05-20', 'Rammekens', '1783-08-29', NULL, true, '1783-08-29', 'The Cape', 8090, NULL);
INSERT INTO "voyages" VALUES (4417, '', 4, '', 'OUWERKERK', 'Pieter Six', 1150, NULL, '1768', NULL, NULL, 'Z', 'Z', '1783-06-01', 'Rammekens', '1783-11-14', '1784-01-14', true, '1784-04-26', 'Batavia', NULL, 'From 06 till 24-06-1783 the OUWERKERK called at Duins. The ship was laid up in the Indies, 31-12-1789.');
INSERT INTO "voyages" VALUES (4418, '', 1, '', 'L''HARMONIE', 'Joseph Bexto', 650, NULL, NULL, NULL, NULL, NULL, 'D', '1783-06-20', 'Rochefort', '1783-11-21', NULL, true, '1783-11-21', 'The Cape', 8100, 'L''HARMONIE flew the French flag. The ship was bound for the Cape.');
INSERT INTO "voyages" VALUES (4419, '', 4, '', 'HOOLWERF', 'Benjamin van der Spek', 850, NULL, '1769', NULL, NULL, 'H', 'A', '1783-06-24', 'Texel', '1783-11-14', '1783-12-17', true, '1784-04-13', 'Batavia', NULL, 'to the HOOLWERF as well as to the PRINSES VAN ORANJE (4423), the BREDERODE (4424), the DRAAK (4426), the ZEEDUIN (4428), the TRITON (4431), the DAPPERHEID (4434), and the''T LOO (4437): 1881 seafarers, 421 soldiers, 38 craftsmen, and 14 passengers departed from Texel; 1538 seafarers, 267 soldiers, 27 craftsmen, and 32 passengers arrived at Batavia.');
INSERT INTO "voyages" VALUES (4420, '', 2, '', 'HINDELOOPEN', 'Kornelis Loreim', 850, NULL, '1776', NULL, NULL, 'D', 'D', '1783-06-27', 'Goeree', '1783-11-22', '1783-12-17', true, '1784-03-13', 'Batavia', 8164, 'The following data refer to both the HINDELOOPEN and the ROZENBURG (4425): 451 seafarers, 91 soldiers, 14 craftsmen, and 6 passengers departed from Goeree; 366 seafarers, 70 soldiers, 17 craftsmen, and 4 passengers arrived at Batavia.');
INSERT INTO "voyages" VALUES (4421, '', 1, '', 'L''ESPERANCE DE LA PRIX', NULL, 600, NULL, NULL, NULL, NULL, NULL, 'A', '1783-06-01', 'La Rochelle', '1783-11-16', NULL, true, '1783-11-16', 'The Cape', 8109, 'it probably sailed via the Guinea Coast.');
INSERT INTO "voyages" VALUES (4422, '', 2, '', 'VROUWE EVERHARDINA', 'Wouter de Gelder', 850, NULL, '1776', NULL, NULL, 'D', 'Z', '1783-07-08', 'Rammekens', '1783-10-29', '1783-12-23', true, '1784-04-24', 'Batavia', NULL, 'soldiers, and 9 passengers arrived at Batavia.');
INSERT INTO "voyages" VALUES (4423, '', 5, '', 'PRINSES VAN ORANJE', 'Jan Frederik Volmer', 1150, NULL, '1768', NULL, NULL, 'A', 'A', '1783-07-24', 'Texel', '1783-10-29', '1783-12-20', true, '1784-03-11', 'Batavia', NULL, 'In 1789 the PRINSES VAN ORANJE was laid up in the Indies. See the HOOLWERF (4419).');
INSERT INTO "voyages" VALUES (4424, '', 1, '', 'BREDERODE', 'Gottlieb Mulder', 1150, NULL, '1780', NULL, NULL, 'A', 'A', '1783-07-26', 'Texel', '1783-11-30', '1784-01-09', true, '1784-04-13', 'Batavia', 8136, 'BREDERODE departed from Batavia and sailed to China, where it arrived on 24-09-1784. See the HOOLWERF (4419).');
INSERT INTO "voyages" VALUES (4425, '', 1, '', 'ROZENBURG', 'Gerrit Harmeyer', 880, NULL, '1780', NULL, NULL, 'D', 'D', '1783-09-17', 'Goeree', '1784-01-15', '1784-02-14', true, '1784-05-18', 'Batavia', 8122, 'See the HINDELOOPEN (4420).');
INSERT INTO "voyages" VALUES (4426, '', 1, '', 'DRAAK', 'Arie Kikkert', 1150, NULL, '1780', NULL, NULL, 'A', 'A', '1783-09-27', 'Texel', '1784-01-01', '1784-01-21', true, '1784-04-13', 'Batavia', 8134, 'On 15-08-1784 the DRAAK departed from Batavia and sailed to China, where it cast anchor on 30-09-1784. See the HOOLWERF (4419).');
INSERT INTO "voyages" VALUES (4427, '', 1, '', 'STRALEN', 'Willem de Wijn', 880, NULL, '1778', NULL, NULL, 'E', 'E', '1783-09-28', 'Texel', '1784-01-15', '1784-02-14', true, '1784-05-10', 'Batavia', 8135, NULL);
INSERT INTO "voyages" VALUES (4428, '', 2, '', 'ZEEDUIN', 'Jan Frederik Zegert', 1150, NULL, '1771', NULL, NULL, 'Z', 'A', '1783-09-28', 'Texel', '1784-01-01', '1784-04-16', true, '1784-07-20', 'Batavia', NULL, 'The ZEEDUIN sailed via Mauritius. In 1785, when sailing from Batavia to the Cape, the ship was wrecked. See the HOOLWERF (4419).');
INSERT INTO "voyages" VALUES (4429, '', 5, '', 'BLEIJENBURG', 'Willem Jakob Andriessen', 880, NULL, '1765', NULL, NULL, 'R', 'R', '1783-10-12', 'Goeree', '1784-01-20', '1784-04-16', true, '1784-08-18', 'Batavia', NULL, 'The BLEIJENBURG sailed via Mauritius. In 1789 the ship was laid up in the Indies.');
INSERT INTO "voyages" VALUES (4430, '', 1, '', 'GOUVERNEUR-GENERAAL DE CLERCK', 'Jochem Bank', 1150, NULL, '1779', NULL, NULL, 'Z', 'Z', '1783-10-12', 'Rammekens', '1784-01-22', '1784-02-14', true, '1784-05-06', 'Batavia', 8133, 'On 15-07-1784 the GOUVERNEUR-GENERAAL DE CLERCK depated from Batavia and sailed to China. See the VROUWE EVERHARDINA (4422).');
INSERT INTO "voyages" VALUES (4431, '', 3, '', 'TRITON', 'Hendrik Steedsel', 1150, NULL, '1773', NULL, NULL, 'A', 'A', '1783-10-26', 'Texel', '1784-03-18', '1784-04-12', true, '1784-06-29', 'Batavia', 8140, 'See the HOOLWERF (4419).');
INSERT INTO "voyages" VALUES (4432, '', 1, '', 'HARMONIE', 'Kornelis Philippus Hoek', 1150, NULL, '1778', NULL, NULL, 'Z', 'Z', '1783-11-07', 'Rammekens', '1784-03-09', '1784-04-12', true, '1784-07-02', 'Batavia', 8124, 'The 20 passengers, who embarked at the Cape, included 14 Chinese.');
INSERT INTO "voyages" VALUES (4433, '', 1, '', 'BERKHOUT', 'Herman Jakob Hulleman', 1150, NULL, '1779', NULL, NULL, 'H', 'H', '1783-12-12', 'Texel', '1784-03-30', '1784-04-26', true, '1784-08-18', 'Batavia', 8138, 'On 25-08-1784 the BERKHOUT departed from Batavia and sailed to China.');
INSERT INTO "voyages" VALUES (4434, '', 1, '', 'DAPPERHEID', 'Kornelis de Boer', 472, 'hoeker', NULL, NULL, NULL, NULL, 'A', '1783-12-23', 'Texel', '1784-04-12', '1784-05-14', true, '1784-07-19', 'Batavia', 8119, 'According to K.A. 4189 the departing crew consisted of 262 men. See the HOOLWERF (4419).');
INSERT INTO "voyages" VALUES (4435, '', 1, '', 'DOGGERSBANK', 'Swerus Vrolijk', 1150, NULL, '1782', NULL, NULL, 'A', 'A', '1783-12-23', 'Texel', '1784-04-15', '1784-05-07', true, '1784-08-21', 'Ceylon', 8139, NULL);
INSERT INTO "voyages" VALUES (4436, '', 1, '', 'JONGE FRANK', 'Jakob Veer', 592, NULL, NULL, NULL, NULL, NULL, 'A', '1783-12-23', 'Texel', '1784-04-29', '1784-05-16', true, '1784-08-01', 'Batavia', 8126, NULL);
INSERT INTO "voyages" VALUES (4437, '', 7, '', '''T LOO', 'Dirk Hulsebos', 1150, NULL, '1768', NULL, NULL, 'A', 'A', '1783-12-23', 'Texel', '1784-04-13', '1784-05-07', true, '1784-07-04', 'Batavia', 8121, 'See the HOOLWERF (4419).');
INSERT INTO "voyages" VALUES (4438, '', 1, '', 'MEERMIN', 'Francois Duminy', 500, 'fregat', '1782', NULL, NULL, 'A', 'A', '1783-12-23', 'Texel', '1784-04-03', NULL, true, '1784-04-03', 'The Cape', 8252, 'The MEERMIN was bound for the Cape.');
INSERT INTO "voyages" VALUES (4439, '', 2, '', 'ZWALUW', 'Harme Karel Visser', NULL, 'logger', NULL, NULL, NULL, NULL, NULL, '1783-12-23', 'Lorient', '1784-04-06', NULL, true, '1784-04-06', 'The Cape', NULL, NULL);
INSERT INTO "voyages" VALUES (4440, '', 1, '', 'LES QUATRES FRERES', 'Samuel Nusker', 620, 'fregat', NULL, NULL, NULL, NULL, 'A', '1783-12-27', 'Texel', '1784-08-14', '1784-09-15', true, '1784-12-16', 'Batavia', 8145, 'LES QUATRES FRERES flew the Prussian flag. During the voyage the ship called at Lorient (departure: 23-05-1784).');
INSERT INTO "voyages" VALUES (4441, '', 2, '', 'VREDE EN VRIJHEID', 'Dirk Huizing', 760, NULL, NULL, NULL, NULL, NULL, 'A', '1783-12-27', 'Texel', '1784-04-25', '1784-08-10', true, '1784-10-07', 'Batavia', 8128, 'This is the second voyage of this ship, which during its preceding voyage (4404/8086) was called KROONPRINS VAN PRUISEN.');
INSERT INTO "voyages" VALUES (4442, '', 1, '', 'VREDE', 'John Wilton', 650, NULL, NULL, '1783', NULL, 'Z', 'Z', '1784-01-06', 'Rammekens', '1784-04-25', '1784-06-02', true, '1784-08-13', 'Batavia', NULL, 'According to K.A. 4289 the departing crew consisted of 137 men. The VREDE called at Duins, 08 till 29-01-1784. See the VROUWE EVERHARDINA (4422).');
INSERT INTO "voyages" VALUES (4443, '', 1, '', 'ONZEKERE', 'Jakob Johan Staalkop', 348, NULL, NULL, NULL, NULL, NULL, 'Z', '1784-04-08', 'Rammekens', '1784-07-25', '1784-08-11', true, '1784-10-15', 'Batavia', 8130, 'The ONZEKERE called at Duins, 12 till 29-04-1784.');
INSERT INTO "voyages" VALUES (4444, '', 2, '', 'STAVENISSE', 'Kornelis van Vlaanderen', 1150, NULL, '1772', NULL, NULL, 'Z', 'Z', '1784-04-08', 'Rammekens', '1784-08-20', '1784-09-17', true, '1784-12-27', 'Ceylon', 8166, 'False Bay.');
INSERT INTO "voyages" VALUES (4445, '', 1, '', 'VROUWE WIJNANDA LUBERTA', 'Sijbrand Berk', 508, 'fregat', NULL, NULL, NULL, NULL, 'A', '1784-05-17', 'Texel', '1784-08-16', '1784-09-15', true, '1784-11-13', 'Batavia', 8137, 'According to K.A. 4390a the departing crew consisted of 245 men. On 15-09-1784 the VROUWE WIJNANDA LUBERTA set out from False Bay.');
INSERT INTO "voyages" VALUES (4446, '', 1, '', 'VRIJHEID', 'Andries Allan', 790, 'fluit', NULL, NULL, NULL, NULL, 'R', '1784-05-24', 'Goeree', '1784-09-10', '1784-09-22', true, '1784-12-15', 'Batavia', 8144, NULL);
INSERT INTO "voyages" VALUES (4447, '', 1, '', 'BATAVIER', 'Jan Jansz. Laurits', 1150, NULL, '1782', NULL, NULL, 'A', 'A', '1784-06-01', 'Texel', '1784-09-21', '1784-10-15', true, '1784-12-27', 'Batavia', 8240, NULL);
INSERT INTO "voyages" VALUES (4448, '', 1, '', 'SCHELDE', 'Pieter Harmsz.', 1150, NULL, '1780', NULL, NULL, 'Z', 'Z', '1784-07-07', 'Rammekens', '1781-11-26', '1785-01-08', true, '1785-03-19', 'Batavia', 8176, 'The SCHELDE called at Duins; departure: 02-08-1784.');
INSERT INTO "voyages" VALUES (4449, '', 1, '', 'VREDE', 'Thijs Ketel', 854, 'fluit', NULL, NULL, NULL, NULL, 'A', '1784-07-07', 'Texel', '1785-01-17', NULL, true, '1785-01-17', 'The Cape', 8143, 'The VREDE was bound for the Cape.');
INSERT INTO "voyages" VALUES (4450, '', 1, '', 'EENSGEZINDHEID', 'Peter Jansen', 884, 'fluit', NULL, NULL, NULL, NULL, 'A', '1784-07-29', 'Texel', '1784-11-29', '1785-01-22', true, '1785-03-18', 'Batavia', 8147, 'According to K.A. 4390a the departing crew consisted of 305 men.');
INSERT INTO "voyages" VALUES (4451, '', 1, '', 'EIK EN LINDE', 'Dirk Carlberg', 574, 'hoeker', NULL, NULL, NULL, NULL, 'A', '1784-08-02', 'Texel', '1784-12-18', '1785-01-16', true, '1785-05-01', 'Batavia', 8149, 'At the departure from Texel the EIK EN LINDE and the EIKENWOUD (4452) were escorted by a man-of-war.');
INSERT INTO "voyages" VALUES (4452, '', 1, '', 'EIKENWOUD', 'Klaas Ent', 892, 'fluit', NULL, NULL, NULL, NULL, 'A', '1784-08-02', 'Texel', '1784-12-26', '1785-02-07', true, '1785-06-29', 'Batavia', 8159, 'According to K.A. 4390a the departing crew consisted of 22 men. See the EIK EN LINDE (4451).');
