INSERT INTO "voyages" VALUES (4462, '', 1, '', 'JONGE JAKOB', 'Asmus Pieter Asmus', 648, 'hoeker', NULL, NULL, NULL, NULL, 'A', '1784-09-25', 'Texel', '1784-12-23', '1785-03-23', true, NULL, 'Batavia', 8155, 'Date of arrival at Batavia unknown.');
INSERT INTO "voyages" VALUES (4463, '', 1, '', 'RESOLUTIE', 'Justinus Philippus Man', 530, NULL, NULL, '1784', NULL, 'E', 'E', '1784-09-25', 'Texel', '1785-01-13', '1785-02-13', true, '1785-05-27', 'Batavia', 8268, NULL);
INSERT INTO "voyages" VALUES (4464, '', 1, '', 'CASTOR', 'Matthijs Lodewijk Heikoop', 650, NULL, NULL, '1784', NULL, 'Z', 'Z', '1784-09-29', 'Rammekens', '1784-12-28', '1785-01-29', true, '1785-05-14', 'Batavia', 8263, NULL);
INSERT INTO "voyages" VALUES (4465, '', 1, '', 'VOORSCHOTEN', 'Kornelis Kornelissen', 1150, NULL, '1783', NULL, NULL, 'A', 'A', '1784-09-29', 'Texel', '1785-01-23', '1785-02-23', true, '1785-06-20', 'Batavia', 8158, 'According to K.A. 4390a the departing crew consisted of 290 men. After having arrived at Batavia the VOORSCHOTEN sailed on to China.');
INSERT INTO "voyages" VALUES (4466, '', 1, '', 'MIDDELWIJK', 'Kornelis de Klerk', 880, NULL, '1783', NULL, NULL, 'R', 'R', '1784-09-30', 'Goeree', '1785-01-05', '1785-01-29', true, '1785-05-25', 'Batavia', NULL, 'In 1788 the MIDDELWIJK, sailing from Batavia to China, was wrecked.');
INSERT INTO "voyages" VALUES (4467, '', 1, '', 'HOOP', 'Jan Kraai', 175, NULL, NULL, '1782', NULL, 'A', 'A', '1784-10-10', 'Texel', '1784-12-27', '1785-01-16', true, '1785-04-24', 'Batavia', 8151, NULL);
INSERT INTO "voyages" VALUES (4468, '', 1, '', 'OUDENAARDE', 'Hans Klaassen', 380, NULL, NULL, NULL, NULL, NULL, 'Z', '1784-10-11', 'Rammekens', '1785-01-26', '1785-04-10', true, '1785-06-25', 'Batavia', 8172, NULL);
INSERT INTO "voyages" VALUES (4469, '', 1, '', 'POLLUX', 'Lodewijk Kappelhof', 550, NULL, NULL, '1784', NULL, 'Z', 'Z', '1784-10-30', 'Rammekens', '1785-03-03', '1785-03-30', true, '1785-06-20', 'Batavia', NULL, NULL);
INSERT INTO "voyages" VALUES (4470, '', 1, '', 'BARBESTEIN', 'Dirk Kornelis Plokker', 1150, NULL, '1783', NULL, NULL, 'A', 'A', '1784-12-12', 'Texel', '1785-03-30', '1785-04-29', true, '1785-07-10', 'Batavia', 8161, '(4471), the JAVA (4472), the SPARENRIJK (4474), and the ZEEPAARD (4475) were accompanied by a Dutch man-of-war.');
INSERT INTO "voyages" VALUES (4471, '', 1, '', 'HUISDUINEN', 'Laurens Kornelissen', 723, NULL, NULL, '1784', NULL, 'A', 'A', '1784-12-12', 'Texel', '1785-03-27', '1785-05-08', true, '1785-07-01', 'Ceylon', 8157, 'See the BARBESTEIN (4470).');
INSERT INTO "voyages" VALUES (4472, '', 3, '', 'JAVA', 'Harme Karel Visser', 850, NULL, '1775', NULL, NULL, 'E', 'A', '1784-12-12', 'Texel', '1785-04-25', '1785-05-28', true, '1785-08-11', 'Batavia', 8216, 'See the BARBESTEIN (4470).');
INSERT INTO "voyages" VALUES (4473, '', 2, '', 'PAREL', 'Kornelis in ''t Anker', 1150, NULL, '1778', NULL, NULL, 'A', 'Z', '1784-12-12', 'Rammekens', '1785-05-27', '1785-07-25', true, '1785-09-24', 'Batavia', 8193, 'During a heavy storm the PAREL lost its foremast and bowsprit. For that reason the ship was forced to call at S. Tiago, 30-01 till 30-03-1785. Two spars were supplied by the PHOENIX, a Dutch man-of-war, which called at the island from 03 till 07-02-1785.');
INSERT INTO "voyages" VALUES (4474, '', 2, '', 'SPARENRIJK', 'Christoffel Beem', 1150, NULL, '1780', NULL, NULL, 'A', 'A', '1784-12-12', 'Texel', '1785-04-04', '1785-05-28', true, '1785-09-22', 'Ceylon', 8262, 'See the BARBESTEIN (4470). 4474/8262 Is the second voyage of this ship, which during the preceding voyage (4410/8099) was called POTSDAM.');
INSERT INTO "voyages" VALUES (4475, '', 4, '', 'ZEEPAARD', 'Hendrik Zwart', 1150, NULL, '1774', NULL, NULL, 'A', 'A', '1784-12-12', 'Texel', '1785-05-23', '1785-07-28', true, '1785-09-26', 'Batavia', 8180, 'the ZEEPAARD arrived at False Bay. See the BARBESTEIN (4470).');
INSERT INTO "voyages" VALUES (4476, '', 1, '', 'NEERLANDS VRIJHEID', 'Frederik Floor', 566, NULL, NULL, NULL, NULL, NULL, 'A', '1784-12-13', 'Texel', NULL, NULL, true, NULL, NULL, NULL, 'One day after its departure from Texel the NEERLANDS VRIJHEID ran aground off the coast of England and was wrecked.');
INSERT INTO "voyages" VALUES (4477, '', 1, '', 'MEEUWTJE', 'Huibert den Breem', 400, NULL, '1783', NULL, NULL, 'A', 'E', '1784-12-22', 'Texel', '1785-04-17', '1786-01-05', true, '1786-05-02', 'Batavia', 8285, 'the NEGOTIE (4497), the TEXELSTROOM (4498), the ZAANSTROOM (4499), the ZOUTMAN (4501), the DUIFJE (4508), and the VREDENBURG (4511): 1704 seafarers, 461 soldiers. 80 craftsmen, and 51 passengers including 24 Chinese departed from Texel; 1545 seafarers, 345 soldiers, 71 craftsmen, and 39 passengers (incl. 21 Chinese) arrived at Batavia.');
INSERT INTO "voyages" VALUES (4478, '', 1, '', 'AFRIKAAN', 'Pieter Modderman', 880, NULL, '1780', NULL, NULL, 'E', 'E', '1784-12-26', 'Texel', '1785-04-21', '1785-05-11', true, '1785-07-13', 'Batavia', 8165, 'On 23-08-1785 the AFRIKAAN departed from Batavia and sailed to China.');
INSERT INTO "voyages" VALUES (4479, '', 1, '', 'AVENHORN', 'A. Arend Thobiasz.', 880, NULL, '1780', NULL, NULL, 'H', 'H', '1784-12-26', 'Texel', '1785-04-20', '1785-05-16', true, '1785-08-11', 'Batavia', 8201, 'According to K.A. 4295 the departing crew consisted of 258 men.');
INSERT INTO "voyages" VALUES (4480, '', 2, '', 'SLOT TER HOGE', 'Jan Siereveld', 1150, NULL, '1776', NULL, NULL, 'Z', 'Z', '1784-12-28', 'Rammekens', '1785-04-17', '1785-05-11', true, '1785-07-10', 'Batavia', 8167, 'Jan Siereveld became ill and disembarked at the Cape; as master he probably was succeeded by Lodewijk Elgenhuizen.');
INSERT INTO "voyages" VALUES (4481, '', 1, '', 'NOSTRA SENHORA DE L''AMPRADOZA', 'Josua Felix de Zouza', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1785-03-02', 'Lisbon', '1735-07-10', '1785-07-18', true, '1785-10-03', 'Batavia', NULL, 'The NOSTRA SENHORA DE L''AMPRADOZA flew the Portuguese flag. According to 
INSERT INTO "voyages" VALUES (4482, '', 2, '', 'GERECHTIGHEID', 'Hans Christiaan Christiaanse', 1150, NULL, '1779', NULL, NULL, 'A', 'A', '1785-05-23', 'Texel', '1785-10-19', '1785-11-14', true, '1786-02-21', 'Batavia', 8231, 'According to K.A. 4293 the departing crew consisted of 338 men. See the MEEUWTJE (4477).');
INSERT INTO "voyages" VALUES (4483, '', 1, '', 'ALBLASSERDAM', 'Aris van Valkenburg', 1150, NULL, '1782', NULL, NULL, 'Z', 'Z', '1785-06-13', 'Rammekens', '1785-10-18', '1785-11-25', true, '1786-02-21', 'Batavia', 8230, NULL);
INSERT INTO "voyages" VALUES (4484, '', 1, '', 'JAN EN KORNELIS', 'Klaas Duif', 560, NULL, NULL, NULL, NULL, NULL, 'A', '1785-06-13', 'Texel', '1785-10-29', '1785-11-25', true, '1786-03-01', 'Batavia', 8169, NULL);
INSERT INTO "voyages" VALUES (4485, '', 1, '', 'RIJNOORD', 'Laurens Smit', 846, 'fluit', NULL, NULL, NULL, NULL, 'A', '1785-06-13', 'Texel', '1785-11-04', '1785-12-27', true, '1786-06-25', 'Batavia', NULL, NULL);
INSERT INTO "voyages" VALUES (4486, '', 1, '', 'IJSTROOM', 'Dirk Roem', 898, NULL, NULL, '1785', NULL, 'A', 'A', '1785-06-13', 'Texel', '1785-10-29', '1785-11-25', true, '1786-02-21', 'Batavia', 8236, 'crew consisted of 309 men. See the MEEUWTJE (4477).');
INSERT INTO "voyages" VALUES (4487, '', 2, '', 'FACTOR', 'Jan Jochem Milfaart', 320, NULL, NULL, NULL, NULL, NULL, 'Z', '1785-06-24', 'Rammekens', '1785-10-29', '1785-11-25', true, '1786-03-08', 'Ceylon', 8168, NULL);
INSERT INTO "voyages" VALUES (4488, '', 1, '', 'GEERTRUIDA', 'Daniel Kunneman', 660, 'fluit', NULL, NULL, NULL, NULL, 'A', '1785-06-28', 'Texel', '1785-10-29', '1785-11-19', true, '1786-02-13', 'Batavia', 8170, NULL);
INSERT INTO "voyages" VALUES (4489, '', 1, '', 'JOSEPHUS DE TWEEDE', 'Christiaan Zummack', 460, NULL, NULL, NULL, NULL, NULL, 'Z', '1785-07-13', 'Rammekens', '1785-10-27', '1785-11-25', true, '1786-02-09', 'Batavia', 8171, NULL);
INSERT INTO "voyages" VALUES (4490, '', 2, '', 'ROTTERDAMS WELVAREN', 'Gijshert Matthias Weitzel', 880, NULL, '1780', NULL, NULL, 'R', 'R', '1785-07-26', 'Goeree', '1785-11-16', '1785-12-05', true, '1786-03-01', 'Batavia', 8269, 'The following data refer to both the ROTTERDAMS WELVAREN and the STANDVASTIGHEID (4504): 362 seafarers. 49 soldiers, 9 craftsmen, and 3 passengers departed from Goeree; 291 seafarers, 51 soldiers, 6 craftsmen, and 8 passengers arrived at Batavia.');
INSERT INTO "voyages" VALUES (4491, '', 1, '', 'BEVERWIJK', 'Hendrik Eduard Lodewijk van Baggen', 1150, NULL, '1784', NULL, NULL, 'A', 'A', '1785-09-15', 'Texel', '1786-02-09', '1786-03-02', true, '1786-05-26', 'Batavia', 8187, 'According to K.A. 4293 the departing crew consisted of 325 men. The BEVERWIJK called at Portsmouth, 16 till 18-10-1785. On 17-08-1786 the ship departed from Batavia and sailed to China. See the MEEUWTJE (4477).');
INSERT INTO "voyages" VALUES (4492, '', 1, '', 'MARIA LUCIA THERESIA', 'Dirk Peek', 429, 'hoeker', NULL, NULL, NULL, NULL, 'A', '1785-09-15', 'Texel', '1786-01-19', '1786-02-23', true, '1786-05-27', 'Batavia', 8173, NULL);
INSERT INTO "voyages" VALUES (4493, '', 7, '', 'RIDDERKERK', 'Imel Edan de Vries', 850, NULL, '1766', NULL, NULL, 'R', 'E', '1785-09-15', 'Texel', '1786-02-04', '1786-02-27', true, '1786-05-27', 'Batavia', NULL, '21 of them had embarked at Texel. 4493/- Is the seventh voyage of this ship, which during its sixth voyage (4407/8095) was called AURICH.');
INSERT INTO "voyages" VALUES (4494, '', 2, '', 'SCHOONDERLOO', 'Gouke Dekker van der Mieden', 880, NULL, '1779', NULL, NULL, 'D', 'D', '1785-09-15', 'Goeree', '1786-02-07', '1786-02-27', true, '1786-05-30', 'Batavia', 8183, '(4503): 408 seafarers, 93 soldiers, 16 craftsmen, and 26 passengers including 24 Chinese departed from Goeree; 339 seafarers, 59 soldiers, 10 craftsmen, and 37 passengers (incl. the 24 Chinese) arrived at Batavia.');
INSERT INTO "voyages" VALUES (4495, '', 6, '', 'OUD HAARLEM', 'Johan Bakker', 1150, NULL, '1768', NULL, NULL, 'A', 'Z', '1785-10-19', 'Texel', NULL, NULL, true, NULL, NULL, NULL, 'was taken over by the outward-bound TRITON (4517), which left the island on 04-08-1786. At Santa Cruz Johan Bakker probably changed ships, for in K.A. 4298, a source from the Cape, he is mentioned as master of the TRITON. The OUD HAARLEM sailed back to Rammekens.');
INSERT INTO "voyages" VALUES (4496, '', 1, '', 'VROUWE KATHARINA JOHANNA', 'Pieter Stokbroo', 900, NULL, NULL, '1785', NULL, 'H', 'H', '1785-10-19', 'Texel', '1786-02-11', '1786-03-06', true, '1786-05-30', 'Batavia', 8181, '185 men. Originally the VROUWE KATHARINA JOHANNA put to sea on 15-09-1785; nine days later, however, the ship returned to Texel. The following data refer to both the VROUWE KATHARINA JOHANNA and the HOLLAND (4514): 438 seafarers, 70 soldiers, 11 craftsmen, and 23 passengers including 20 Chinese departed from Texel; 353 seafarers, 63 soldiers, 17 craftsmen, and 21 passengers (incl. the 20 Chinese) arrived at Batavia.');
INSERT INTO "voyages" VALUES (4497, '', 1, '', 'NEGOTIE', 'Jonas Arend', 440, NULL, NULL, '1785', NULL, 'A', 'A', '1785-10-19', 'Texel', '1786-02-07', '1786-04-07', true, '1786-06-23', 'Batavia', 8264, 'See the MEEUWTJE (4477).');
INSERT INTO "voyages" VALUES (4498, '', 1, '', 'TEXELSTROOM', 'Paulus Kroon', 708, NULL, NULL, '1785', NULL, 'A', 'A', '1785-10-19', 'Texel', '1786-02-21', '1786-03-11', true, '1786-06-03', 'Batavia', 8182, 'See the MEEUWTJE (4477).');
INSERT INTO "voyages" VALUES (4499, '', 1, '', 'ZAANSTROOM', 'Roelof Pietersz. Hoberg', 564, NULL, NULL, '1785', NULL, 'A', 'A', '1785-10-19', 'Texel', '1786-04-27', '1786-05-19', true, '1786-07-21', 'Batavia', 8267, 'See the MEEUWTJE (4477).');
INSERT INTO "voyages" VALUES (4500, '', 1, '', 'ZEENIMF', 'Johan Noordhoek', 450, NULL, '1782', NULL, NULL, 'Z', 'Z', '1785-10-19', 'Texel', '1786-02-03', '1786-03-23', true, '1786-07-11', 'Batavia', 8286, 'On 03-10-1785 the ZEENIMF departed from Rammekens and sailed to Texel, where it cast anchor on 11-10. The ship called at S. Tiago, 26-11 till 04-12-1785.');
INSERT INTO "voyages" VALUES (4501, '', 1, '', 'ZOUTMAN', 'Bernard Christiaan Muller', 1150, NULL, '1784', NULL, NULL, 'A', 'A', '1785-10-19', 'Texel', '1786-02-09', '1786-02-27', true, '1786-05-27', 'Batavia', 8184, 'On 10-07-1786 the ZOUTMAN departed from Batavia and sailed to China. See the MEEUWTJE (4477).');
INSERT INTO "voyages" VALUES (4502, '', 2, '', 'TWEE GEZUSTERS', 'Wouter Jakobsen', 582, NULL, NULL, '1781', NULL, 'Z', 'Z', '1785-11-09', 'Rammekens', '1786-02-21', '1786-05-06', true, '1786-07-22', 'Batavia', 8175, '4502/8175 Is the second voyage of this ship, which during its preceding voyage (4409/8098) was called LES DEUX SOEURS.');
INSERT INTO "voyages" VALUES (4503, '', 1, '', 'HORSSEN', 'Jakob van den Berg', 880, NULL, '1784', NULL, NULL, 'D', 'D', '1785-11-14', 'Goeree', '1786-02-13', '1786-03-02', true, '1786-05-30', 'Batavia', 8185, 'On 10-07-1786 the HORSSEN departed from Batavia and sailed to China. See the SCHOONDERLOO (4494).');
INSERT INTO "voyages" VALUES (4504, '', 1, '', 'STANDVASTIGHEID', 'Willem Sterk', 780, 'hoeker', NULL, '1785', NULL, 'R', 'R', '1785-11-14', 'Goeree', '1786-04-04', '1786-05-06', true, '1786-07-19', 'Batavia', 8235, '(4490).');
INSERT INTO "voyages" VALUES (4505, '', 2, '', 'VREDE EN VRIJHEID', 'Dirk Huizing', 760, NULL, NULL, NULL, NULL, NULL, 'Z', '1785-12-10', 'Rammekens', '1786-05-01', '1786-06-07', true, '1786-08-28', 'Batavia', 8178, NULL);
INSERT INTO "voyages" VALUES (4506, '', 2, '', 'GOUVERNEUR-GENERAAL DE CLERCK', 'Jan Arendsz.', 1150, NULL, '1779', NULL, NULL, 'Z', 'Z', '1785-12-17', 'Rammekens', '1786-04-14', '1786-05-06', true, '1786-07-09', 'Batavia', 8188, 'China.');
INSERT INTO "voyages" VALUES (4507, '', 2, '', 'DRAAK', 'Pieter Frederik Riebe', 1150, NULL, '1780', NULL, NULL, 'A', 'A', '1785-12-18', 'Texel', NULL, NULL, false, '1786-08-22', 'Ceylon', 8192, 'At the departure from Texel the DRAAK, the DUIFJE (4508), the NEPTUNUS (4509), the STRALEN (4510), and the VREDENBURG (4511) were accompanied by a Dutch man-of-war.');
INSERT INTO "voyages" VALUES (4508, '', 1, '', 'DUIFJE', 'Gerrit Jan van der Kerkhof', 400, NULL, '1 784', NULL, NULL, 'A', 'A', '1785-12-18', 'Texel', '1786-03-24', '1786-05-06', true, '1786-07-08', 'Batavia', 8190, 'See the MEEUWTJE (4477) and the DRAAK (4507).');
INSERT INTO "voyages" VALUES (4509, '', 1, '', 'NEPTUNUS', 'Clement Bijndorp', 748, NULL, NULL, '1785', NULL, 'A', 'A', '1785-12-18', 'Texel', '1786-05-13', '1786-09-07', true, '1786-12-13', 'Batavia', NULL, 'seafarers, 33 soldiers, 12 craftsmen, and 4 passengers arrived at Batavia.');
INSERT INTO "voyages" VALUES (4510, '', 2, '', 'STRALEN', 'Jan Paardekoper', 880, NULL, '1778', NULL, NULL, 'E', 'A', '1785-12-18', 'Texel', '1786-04-30', '1786-05-19', true, '1786-09-05', 'Bengal', 8186, 'The STRALEN called at S. Tiago, 27-01 till 02-02-1786. See the DRAAK (4507).');
INSERT INTO "voyages" VALUES (4511, '', 1, '', 'VREDENBURG', 'Herman Kikken', 1150, NULL, '1784', NULL, NULL, 'A', 'A', '1785-12-18', 'Texel', '1786-04-30', '1786-05-19', true, '1786-07-23', 'Batavia', 8189, 'On 21-08-1786 the VREDENBURG departed from Batavia and sailed to China. See the MEEUWTJE (4477) and the DRAAK (4507).');
INSERT INTO "voyages" VALUES (4512, '', 5, '', 'VOORBERG', 'Thobias Post', 1150, NULL, '1770', NULL, NULL, 'A', 'E', '1785-12-25', 'Texel', NULL, NULL, true, NULL, NULL, NULL, 'The VOORBERG called at Dartmouth, 12-01-1786. On 29-06 the ship returned to Texel. Almost three months later, on 20-09, the VOORBERG put to see for the second time; on 14-10-1786, however, it sailed back to Texel again.');
INSERT INTO "voyages" VALUES (4513, '', 4, '', 'GANGES', 'Jan Frederik Schuts', 1150, NULL, '1775', NULL, NULL, 'A', 'Z', '1685-12-28', 'Rammekens', NULL, NULL, true, NULL, NULL, NULL, 'The GANGES was bound for China. On 02-02-1786 the ship ran aground at Padstow in Cornwall and was wrecked.');
INSERT INTO "voyages" VALUES (4514, '', 5, '', 'HOLLAND', 'Lars Jansen', 1150, NULL, '1771', NULL, NULL, 'A', 'H', '1786-02-24', 'Texel', '1786-05-30', '1786-07-18', true, '1786-09-21', 'Batavia', NULL, 'See the VROUWE KATHARINA JOHANNA (4496).');
INSERT INTO "voyages" VALUES (4515, '', 1, '', 'ZEELAND', 'Bank', 1150, NULL, '1783', NULL, NULL, 'Z', 'Z', '1786-04-30', 'Rammekens', '1786-08-12', '1786-09-16', true, '1786-11-20', 'Ceylon', 8270, NULL);
INSERT INTO "voyages" VALUES (4516, '', 2, '', 'JACHTRUST', 'Jan Anthonie Lubben', 450, 'fregat', NULL, '1775', NULL, 'A', 'A', '1786-05-27', 'Texel', '1786-09-10', '1786-10-10', true, '1787-01-06', 'Batavia', NULL, 'See the NEPTUNUS (4509).');
INSERT INTO "voyages" VALUES (4517, '', 4, '', 'TRITON M', 'J.m Jochem ilfaart', 1150, NULL, '1773', NULL, NULL, 'A', 'Z', '1786-05-29', 'Rammekens', '1786-10-24', '1786-11-19', true, '1787-02-06', 'Batavia', NULL, 'At the departure from the Cape the TRITON was accompanied by a Dutch man-of-war. In 1792 the ship was wrecked in the Indies. The following data refer to the TRITON as well as to the JONGE FRANK (4521), the JUF-FROUW JOHANNA (4540), the BARBESTEIN (4544), and the SURSEANCE (4557): 494 seafarers, 432 soldiers, 30 craftsmen, and 1 passenger departed from Rammekens; 495 seafarers, 248 soldiers. 19 craftsmen, and 5 passengers arrived at Batavia. and 5 passengers arrived at Batavia.');
INSERT INTO "voyages" VALUES (4518, '', 1, '', 'VEERS', 'Jan Malek', 758, 'pink', NULL, '1786', NULL, 'Z', 'Z', '1786-05-29', 'Rammekens', '1786-11-23', '1786-12-24', true, NULL, 'Ceylon', 8265, 'The VEERE called at Santa Cruz on Tenerife; departure: 04-08-1786. The date of arrival at Ceylon is unknown.');
INSERT INTO "voyages" VALUES (4519, '', 2, '', 'ROZENBURG', 'Hendrik de Lange', 880, NULL, '1780', NULL, NULL, 'D', 'D', '1786-06-03', 'Goeree', '1786-09-18', '1786-10-24', true, '1787-01-24', 'Batavia', 8261, 'According to K.A. 4298 Thomas van Tried was master. The following data refer to both the ROZENBURG and the HOUTLUST (4539): 352 seafarers, 160 soldiers, and 30 craftsmen departed from Goeree.');
INSERT INTO "voyages" VALUES (4520, '', 2, '', 'ONZEKERE', 'Klaas Zwart', 348, NULL, NULL, NULL, NULL, NULL, 'Z', '1786-06-01', 'Rammekens', '1786-11-08', '1786-12-10', true, '1787-03-01', 'Batavia', 8198, NULL);
INSERT INTO "voyages" VALUES (4521, '', 2, '', 'JONGE FRANK', 'Jakob Veer', 592, NULL, NULL, NULL, NULL, NULL, 'Z', '1786-06-12', 'Rammekens', '1786-10-23', '1786-12-02', true, '1787-02-14', 'Batavia', 8194, 'See the TRITON (4517). When arriving at the Cape. both the JONGE FRANK and the LOO (4523) were accompanied by three Dutch men-of-war. Two of them, as well as an other warship, escorted the JONGE FRANK when it departed from the Cape.');
INSERT INTO "voyages" VALUES (4522, '', 2, '', 'DOGGERSBANK', 'Abraham Tim', 1150, NULL, '1782', NULL, NULL, 'A', 'A', '1786-07-10', 'Texel', '1786-10-24', '1786-11-16', true, '1787-02-12', 'Batavia', 8205, 'The following data refer to the DOGGERSBANK as well as to the ''T LOO (4523), the VALK (4525), the AREND (4527), the HUISDUINEN (4534), the NEERLANDS WELVAREN (4536), the EENSGEZINDHEID (4537), the ADMIRAAL DE SUFFREN (4543), and the VOORSCHOTEN (4547): 1789 seafarers, 797 soldiers, 113 craftsmen, and 20 passengers departed from Texel; 1445 seafarers, 510 soldiers, 89 craftsmen, and 23 passengers arrived at Batavia.');
INSERT INTO "voyages" VALUES (4523, '', 8, '', '''T LOO', 'Johan Pleen', 1150, NULL, '1768', NULL, NULL, 'A', 'A', '1786-07-10', 'Texel', '1786-10-23', '1786-11-16', true, '1787-02-02', 'Batavia', NULL, 'In 1790 the''T LOO sank in the Indies. See the JONGE FRANK (4521).');
