INSERT INTO "voyages" VALUES (4535, '', 4, '', 'MERENBERG', 'Willem de Wijn+', 850, NULL, '1773', NULL, NULL, 'H', 'E', '1786-10-17', 'Texel', NULL, NULL, true, NULL, NULL, NULL, 'On 02-11-1786 the MERENBERG ran aground off Crookhaven in Ireland. Its cargo was taken over by the outward-bound MERENBERG (4556), previously called EIKENWOUD, which departed from Texel in March, 1787. The stranded MERENBERG was broken up in 1787.');
INSERT INTO "voyages" VALUES (4536, '', 1, '', 'NEDERLANDS WELVAREN', 'Arie Kikkert', 1150, NULL, '1785', NULL, NULL, 'A', 'A', '1786-10-17', 'Texel', '1787-02-03', '1787-02-27', true, '1787-05-12', 'Batavia', 8212, 'According to K.A. 4298 the departing crew consisted of 345 men. After having arrived at Batavia the NEDERLANDS WELVAREN sailed on to China.');
