INSERT INTO "voyages" VALUES (4540, '', 2, '', 'JUFFROUW JOHANNA', 'Simon Koter', 678, NULL, NULL, NULL, NULL, NULL, 'Z', '1786-10-24', 'Rammekens', '1787-02-22', '1787-03-19', true, '1787-06-09', 'Batavia', 8200, 'According to K.A. 4198 the departing crew consisted of 196 men. See the TRITON (4517). This is the second voyage of this ship, which during its preceding voyage (4404/8086) was called FRIEDRICH DER GROSSE.');
INSERT INTO "voyages" VALUES (4541, '', 2, '', 'VREDE', 'Thijs Ketel', 854, 'fluit', NULL, NULL, NULL, NULL, 'Z', '1786-10-24', 'Rammekens', '1787-09-09', NULL, true, '1787-09-09', 'The Cape', 8214, 'The VREDE called at Tenerife, 04-04 till 06-05-1787.');
