INSERT INTO "voyages" VALUES (4657, '', 1, '', 'SNELHEID', 'Jan Koenraad Haverkamp', 136, 'paketboot', '1788', NULL, NULL, 'H', 'H', '1790-01-06', 'Texel', '1790-04-13', '1790-04-26', true, '1790-07-11', 'Batavia', 8289, NULL);
INSERT INTO "voyages" VALUES (4658, '', 2, '', 'CANTON', 'Dirk Peek', 1150, NULL, '1785', NULL, NULL, 'R', 'R', '1790-01-18', 'Texel', '1790-04-29', '1790-05-13', true, '1790-07-16', 'Batavia', NULL, 'On 01-12-1789 the CANTON departed from Goeree; five days later it arrived at Texel. Continuing its voyage from Batavia to China the CANTON was wrecked in the South China Sea.');
INSERT INTO "voyages" VALUES (4659, '', 1, '', 'HOORNWEG', 'Simon Vaartjes', 880, NULL, '1787', NULL, NULL, 'D', 'D', '1790-01-18', 'Texel', '1790-04-29', '1790-05-13', true, '1790-07-26', 'Batavia', 8326, 'On 01-12-1789 the HOORNWEG departed from Goeree; nine days later the ship arrived at Texel.');
INSERT INTO "voyages" VALUES (4660, '', 1, '', 'MAKASSAR', 'Laurens Jansen', 1150, NULL, '1787', NULL, NULL, 'E', 'E', '1790-01-18', 'Texel', '1790-04-29', '1790-05-13', true, '1790-07-30', 'Batavia', 8342, NULL);
