INSERT INTO "voyages" VALUES (4673, '', 3, '', 'GERECHTIGIIEID', 'Wiggert Molenaar', 1150, NULL, '1779', NULL, NULL, 'A', 'R', '1790-06-16', 'Goeree', '1790-10-12', '1790-11-02', true, '1791-02-01', 'Batavia', 8364, 'The 27 passengers included 26 Chinese, 11 of them arrived at Batavia.');
INSERT INTO "voyages" VALUES (4674, '', 2, '', 'MEERMIN', 'Lodewijk Willem van Rossum', 500, 'fregat', '1782', NULL, NULL, 'A', 'A', '1790-06-27', 'Texel', '1790-10-16', NULL, true, '1790-10-16', 'The Cape', 8398, 'till 06-07-1790.');
INSERT INTO "voyages" VALUES (4675, '', 2, '', 'STANDVASTIGHEID', 'Evert Wittenberg', 780, 'hoeker', NULL, '1785', NULL, 'R', 'D', '1790-08-13', 'Goeree', '1791-01-23', '1791-02-18', true, '1791-05-22', 'Batavia', 8318, 'At Batavia, before sailing back to Texel in 1791/2, the ship''s name was altered into TEXELSTROOM (see 8318).');
INSERT INTO "voyages" VALUES (4676, '', 2, '', 'LUCHTBOL', 'Jakob Soetemans', 136, 'paketboot', '1788', NULL, NULL, 'R', 'R', '1790-09-06', 'Goeree', '1791-01-11', '1791-01-28', true, '1791-05-03', 'Batavia', 8316, '08-09 till 12-10-1790.');
INSERT INTO "voyages" VALUES (4677, '', 1, '', 'INDUS', 'Matthijs Laurens Koster', 1150, NULL, '1789', NULL, NULL, 'A', 'A', '1790-09-07', 'Texel', '1791-01-05', '1791-02-01', true, '1791-05-20', 'Batavia', NULL, 'Originally the INDUS departed on 27-08-1790; it had to return to Texel, however. From 10 till 24-09-1790 the ship was at Duins. In 1794 the INDUS was burnt down in the roads of Batavia.');
INSERT INTO "voyages" VALUES (4678, '', 1, '', 'ZWAAN', 'Marinus van Vlaanderen', 1150, NULL, '1787', NULL, NULL, 'Z', 'Z', '1790-09-08', 'Rammekens', '1791-01-26', '1791-03-09', true, '1791-05-28', 'Batavia', 8321, 'According to K.A. 4328 the departing crew consisted of 286 men.');
INSERT INTO "voyages" VALUES (4679, '', 2, '', 'USTROOM', 'Ulke Barendsz.', 898, NULL, NULL, '1785', NULL, 'A', 'Z', '1790-10-01', 'Rammekens', '1791-03-03', '1791-04-18', true, '1791-07-24', 'Batavia', NULL, 'In 1793 or 1794 the IJSTROOM was sold at Batavia.');
INSERT INTO "voyages" VALUES (4680, '', 2, '', 'BLITTERSWIJK', 'Jakob Thomsen', 1150, NULL, '1785', NULL, NULL, 'Z', 'H', '1790-10-02', 'Texel', '1791-01-25', '1791-03-09', true, '1791-06-07', 'Batavia', 8331, 'According to K.A. 4328 three passengers were aboard the BLITTERSWIJK, when it departed from Texel. The ship called at Duins, 06 till 09-10-1790, and went from Batavia to China.');
INSERT INTO "voyages" VALUES (4681, '', 1, '', 'WILLEM DE VIERDE', 'Gerrit Esman', 1150, NULL, '1789', NULL, NULL, 'A', 'A', '1790-10-02', 'Texel', '1791-02-06', '1791-03-08', true, '1791-06-19', 'Batavia', NULL, 'In 1793 the WILLEM DE VIERDE was taken by the French in Sunda Strait.');
INSERT INTO "voyages" VALUES (4682, '', 2, '', 'VALK', 'George Gottlieb Hebner', 600, NULL, NULL, '1785', NULL, 'A', 'A', '1790-10-11', 'Texel', NULL, NULL, true, NULL, NULL, NULL, 'From 17-10-1790 till 21-02-1791 the VALK was at Gluckstadt. On 27-02-1791 the ship was wrecked at the banks off Yarmouth.');
INSERT INTO "voyages" VALUES (4683, '', 1, '', 'CANDIA', 'Dirksz. Varkevisser', 1150, NULL, '1788', NULL, NULL, 'R', 'R', '1790-10-26', 'Goeree', '1791-02-13', '1791-03-23', true, '1791-06-15', 'Batavia', NULL, 'In 1796 the CANDIA was sold and broken up at Batavia.');
INSERT INTO "voyages" VALUES (4684, '', 3, '', 'SPARENRIJK', 'Johan Pleen', 1150, NULL, '1780', NULL, NULL, 'A', 'A', '1790-10-27', 'Texel', '1791-02-09', '1791-03-17', true, '1791-06-17', 'Batavia', NULL, 'According to K.A. 4328 nine passengers were aboard the SPA-RENRIJK, when it departed from Texel. In 1794 the ship was sold at Batavia. 4684.1- Is the third voyage of this ship, which during its first voyage (4410/8099) was called POTSDAM.');
INSERT INTO "voyages" VALUES (4685, '', 1, '', 'RUSTHOF', 'Simon Jakob Forster', 880, NULL, '1788', NULL, NULL, 'D', 'D', '1790-11-09', 'Goeree', '1791-02-14', '1791-03-28', true, '1791-06-19', 'Batavia', 8347, NULL);
INSERT INTO "voyages" VALUES (4686, '', 2, '', 'NEGOTIE', 'Herman Driesman', 440, NULL, NULL, '1785', NULL, 'A', 'A', '1790-11-23', 'Texel', NULL, NULL, true, NULL, NULL, NULL, 'The NEGOTIE was bound for Ceylon. On 26 and 27-11-1790, however, the ship was wrecked and went to pieces off Texel.');
INSERT INTO "voyages" VALUES (4687, '', 2, '', 'MEERWiJK', 'Willem van Groningen', 1150, NULL, '1787', NULL, NULL, 'A', 'A', '1790-11-29', 'Texel', '1791-05-28', '1791-06-20', true, '1791-09-14', 'Batavia', NULL, 'Torbay (14 till 27-02-1791). In 1795 the MEERWIJK was sold at Batavia.');
INSERT INTO "voyages" VALUES (4688, '', 2, '', 'CHRISTOFFEL COLUMBUS', 'Laurits', 1150, NULL, '1787', NULL, NULL, 'A', 'A', '1791-02-20', 'Texel', '1791-06-17', '1791-07-21', true, '1791-12-02', 'Ceylon', 8335, 'At the departure from Texel the CHRISTOFFEL COLUMBUS, the CONSTITUTIE (4689), the KRAAI (4690), the SCHAGEN (4691), and the ZAANSTROOM (4692) were accompanied by a Dutch man-of-war.');
INSERT INTO "voyages" VALUES (4689, '', 1, '', 'CONSTITUTIE', 'Zacharias van Hek', 880, NULL, '1788', NULL, NULL, 'H', 'H', '1791-02-20', 'Texel', '1791-06-01', '1791-07-05', true, '1791-09-05', 'Batavia', 8343, 'During the voyage the CONSTITUTIE lost all its topmasts. See the CHRISTOFFEL COLUMBUS (4688).');
INSERT INTO "voyages" VALUES (4690, '', 1, '', 'K R A A I', 'Swerus Magnus Cederborg', 136, 'paketboot', '1788', NULL, NULL, 'A', 'A', '1791-02-20', 'Texel', '1791-05-29', NULL, true, '1791-08-30', 'Batavia', 8324, 'Date of departure from the Cape unknown. See the CHRISTOF-FEL COLUMBUS (4688).');
INSERT INTO "voyages" VALUES (4691, '', 2, '', 'SCHAGEN', 'Justinus Philippus Man', 880, NULL, '1785', NULL, NULL, 'H', 'E', '1791-02-20', 'Texel', '1791-05-29', '1791-06-24', true, '1791-09-12', 'Batavia', NULL, 'See the CHRISTOFFEL COLUMBUS (4688).');
INSERT INTO "voyages" VALUES (4692, '', 2, '', 'ZAANSTROOM', 'Jan Jobst Droop', 564, NULL, '1785', NULL, NULL, 'A', 'A', '1791-02-20', 'Texel', NULL, NULL, true, NULL, NULL, NULL, 'The ZAANSTROOM was bound for the Cape. On 28-02-1791, however, the ship ran aground off Barfleur in France. See the CHRISTOFFEL COLUMBUS (4688).');
INSERT INTO "voyages" VALUES (4693, '', 1, '', 'ERFPRINS', 'Jan Arendsz.', 1150, NULL, '1788', NULL, NULL, 'Z', 'Z', '1791-03-31', 'Rammekens', '1791-08-03', '1791-10-08', true, '1792-01-30', 'Batavia', NULL, 'According to K.A. 4328 the departing crew consisted of 301 men. At the Cape many soldiers embarked. Eventually the ship was sold at Batavia.');
INSERT INTO "voyages" VALUES (4694, '', 2, '', 'ZEELAND', 'Albert Tjerksz.', 1150, NULL, '1783', NULL, NULL, 'Z', 'Z', '1791-03-31', 'Rammekens', '1791-07-24', '1791-10-08', true, '1792-03-20', 'Batavia', 8353, 'The ZEELAND carried many soldiers to Batavia and went on to China.');
INSERT INTO "voyages" VALUES (4695, '', 2, '', 'DRIE GEBROEDERS', 'Jan Roelofsz. de Groot', 828, 'fluit', NULL, NULL, NULL, NULL, 'A', '1791-04-27', 'Texel', '1791-08-25', '1791-09-24', true, '1791-12-14', 'Batavia', 8338, 'According to K.A. 4328 the departing crew consisted of 372 men.');
INSERT INTO "voyages" VALUES (4696, '', 2, '', 'SNELHEID', 'Roelof Jurgen Frdrop', 136, 'paketboot', '1788', NULL, NULL, 'H', 'H', '1791-05-02', 'Texel', '1791-07-09', '1791-07-27', true, '1791-09-14', 'Batavia', 8336, NULL);
INSERT INTO "voyages" VALUES (4697, '', 4, '', 'JAVA', 'Jakob van Citters de Rijke', 850, NULL, '1775', NULL, NULL, 'E', 'Z', '1791-05-25', 'Rammekens', '1791-10-22', '1791-11-17', true, '1792-02-11', 'Batavia', NULL, 'According to K.A. 4390a the departing crew consisted of 207 men. The JAVA carried many soldiers to Batavia. In 1796 the ship was laid up at Batavia.');
INSERT INTO "voyages" VALUES (4698, '', 2, '', 'VROUWE MARIA KORNELIA', 'Michiel Jurgens', 1150, NULL, '1785', NULL, NULL, 'E', 'Z', '1791-05-25', 'Rammekens', '1791-09-04', '1791-10-23', true, '1792-04-13', 'Batavia', 8351, 'VROUWE MARIA KORNELIA, when it departed from Rammekens.');
INSERT INTO "voyages" VALUES (4699, '', 2, '', 'AREND', 'Klaas Keuken', 690, NULL, NULL, '1786', NULL, 'A', 'A', '1791-06-03', 'Texel', '1791-10-19', '1791-11-09', true, '1792-01-23', 'Batavia', NULL, 'In 1795 the AREND was sold at Batavia.');
INSERT INTO "voyages" VALUES (4700, '', 2, '', 'MEEUWTJE', 'Wietse de Boer', 400, NULL, '1783', NULL, NULL, 'A', 'A', '1791-06-05', 'Texel', '1791-08-29', '1791-10-03', true, '1791-12-07', 'Ceylon', NULL, 'In 1795 the MEEUWTJE was sold at Batavia.');
INSERT INTO "voyages" VALUES (4701, '', 2, '', 'HOUTLUST', 'Kornelis van Deventer', 880, NULL, '1785', NULL, NULL, 'D', 'R', '1791-06-17', 'Goeree', '1791-10-19', '1791-11-09', true, '1792-02-10', 'Batavia', NULL, 'Chinese, 11 of them arrived at Batavia. In 1796 the HOUTLUST was sold and broken up at Batavia.');
INSERT INTO "voyages" VALUES (4702, '', 2, '', 'HAASJE', 'Jakob Zoeteman', 136, 'paketboot', '1788', NULL, NULL, 'A', 'A', '1791-07-09', 'Texel', '1791-09-16', '1791-10-30', true, '1791-12-15', 'Batavia', 8333, NULL);
INSERT INTO "voyages" VALUES (4703, '', 3, '', 'HUISDUINEN', 'Jan Kornelis Baane', 723, NULL, NULL, '1784', NULL, 'A', 'Z', '1791-08-08', 'Rammekens', '1791-11-30', '1791-12-30', true, '1792-04-01', 'Batavia', NULL, 'According to K.A. 4390a the departing crew consisted of 269 men. The 22 passengers indicated in the first and sixth column were Chinese. Eventually the HUISDUINEN was sold at Batavia.');
INSERT INTO "voyages" VALUES (4704, '', 2, '', 'TRINCONOMALE', 'Roelof Pietersz. Hoberg', 1150, NULL, '1787', NULL, NULL, 'A', 'A', '1791-08-09', 'Texel', '1792-01-15', '1792-02-16', true, '1792-06-07', 'Batavia', NULL, 'In 1796 the TRINCONOMALE was sold at Batavia.');
INSERT INTO "voyages" VALUES (4705, '', 1, '', 'JONKVROUWE SIBILLA ANTHOINETTA', 'Nikolaas Klopper', 1150, NULL, '1789', NULL, NULL, 'A', 'A', '1791-08-15', 'Texel', '1791-11-22', '1791-12-16', true, '1792-03-12', 'Batavia', 8356, 'The 34 passengers indicated in the first column included 25 Chinese, 24 of them arrived at Batavia.');
INSERT INTO "voyages" VALUES (4706, '', 2, '', 'CASTOR', 'Jan Jobst Droop', 650, NULL, NULL, '1784', NULL, 'Z', 'A', '1791-09-08', 'Texel', '1792-01-09', NULL, true, '1792-01-09', 'The Cape', 8360, NULL);
INSERT INTO "voyages" VALUES (4707, '', 2, '', 'VERWACHTING', 'Pieter van Aarson', 600, 'hoeker', NULL, '1787', NULL, 'H', 'Z', '1791-09-09', 'Rammekens', '1792-01-17', '1792-02-13', true, '1792-06-21', 'Batavia', 8357, NULL);
