INSERT INTO "voyages" VALUES (4709, '', 1, '', 'GEERTRUIDA EN PETRONELLA', 'Lodewijk Willem van Rossum', 964, 'pink', NULL, NULL, NULL, NULL, 'A', '1791-09-14', 'Texel', '1792-01-12', '1792-02-10', true, '1792-04-24', 'Batavia', 8344, NULL);
INSERT INTO "voyages" VALUES (4710, '', 3, '', 'POLLUX', 'Petrus Stephanus Buissine', 490, NULL, NULL, '1784', NULL, 'Z', 'Z', '1791-10-27', 'Rammekens', '1792-02-29', '1792-03-20', true, '1792-06-14', 'Batavia', NULL, 'In 1795 the POLLUX was sold at Batavia.');
INSERT INTO "voyages" VALUES (4711, '', 3, '', 'FAAM', 'Hidde Bok', 136, 'paketboot', NULL, NULL, NULL, 'A', 'A', '1791-12-16', 'Texel', '1792-03-13', '1792-03-25', true, '1792-05-29', 'Batavia', 8365, NULL);
INSERT INTO "voyages" VALUES (4712, '', 1, '', 'BUITENVERWACHTING', 'Arie Simonsz. Koek', 1150, NULL, '1789', NULL, NULL, 'A', 'A', '1791-12-17', 'Texel', '1792-05-31', '1792-06-21', true, '1792-08-30', 'Batavia', 8350, '(4713), the OOSTHUIZEN (4714), the UNIE (4715), and the VASCO DA GAMA (4716) were escorted by a Dutch man-of-war.');
INSERT INTO "voyages" VALUES (4713, '', 2, '', 'SLOT CAPELLE', 'Nicolaus Fischerstrom', 880, NULL, '1786', NULL, NULL, 'R', 'E', '1791-12-17', 'Texel', '1792-07-04', '1792-07-24', true, '1792-09-12', 'Batavia', NULL, 'The SLOT CAPELLE called at S. Tiago, 03 till 10-03-1792. After 1795 the ship was sold at Batavia. See the BUI-TENVERWACHTING (4712).');
INSERT INTO "voyages" VALUES (4714, '', 1, '', 'OOSTHUIZEN', 'Gerrit Scheler', 880, NULL, '1789', NULL, NULL, 'H', 'H', '1791-12-17', 'Texel', '1792-04-03', NULL, true, '1792-07-09', 'Batavia', 8352, 'Date of departure from the Cape unknown. After having arrived at Batavia the OOSTHUIZEN sailed on to China. See also BUITENVERWACHTING (4712).');
INSERT INTO "voyages" VALUES (4715, '', 2, '', 'UNIE', 'Jurriaan Pietersen', 1150, NULL, '1787', NULL, NULL, 'Z', 'A', '1791-12-17', 'Texel', '1792-05-31', '1792-06-21', true, '1792-08-30', 'Batavia', 8348, 'The 25 passengers indicated in the first column included 22 Chinese; 16 of them arrived at Batavia. See the BUITENVERWACHTING (4712).');
INSERT INTO "voyages" VALUES (4716, '', 2, '', 'VASCO DA GAMA', 'Jan van Stralen', 1150, NULL, '1788', NULL, NULL, 'A', 'A', '1791-12-17', 'Texel', '1792-06-17', '1792-07-10', true, '1792-09-21', 'Ceylon', NULL, 'The VASCO DA GAMA called at Portsmouth, 03-01 till 16-02-1792. After 1795 the ship was broken up at Batavia. See the BUITENVERWACHTING (4712).');
INSERT INTO "voyages" VALUES (4717, '', 1, '', 'WESTKAPELLE', 'Simon Laurentius', 1150, NULL, '1788', NULL, NULL, 'Z', 'Z', '1791-12-22', 'Rammekens', '1192-05-31', '1792-06-14', true, '1792-09-12', 'Batavia', 8349, 'From 25-02 till 30-03-1792 the WESTKAPELLE was at S. Tiago.');
INSERT INTO "voyages" VALUES (4718, '', 2, '', 'GOUDA', 'Anthonie Franciscus Steffers', 400, NULL, '1784', NULL, NULL, 'A', 'A', '1792-01-20', 'Texel', '1792-05-27', NULL, true, '1792-05-27', 'The Cape', 8362, 'Originally the GOUDA sailed from Texel on 21-12-1791; five days later, however, the ship returned.');
INSERT INTO "voyages" VALUES (4719, '', 2, '', 'HELENA LOUISA', 'Jan Driwes', 180, 'brik', NULL, '1787', NULL, 'B', 'A', '1792-01-20', 'Texel', '1792-05-31', NULL, true, '1792-05-31', 'The Cape', NULL, 'AFRIKAAN.');
INSERT INTO "voyages" VALUES (4720, '', 2, '', 'DORDWIJK', 'Arnold Rogge', 800, 'hoeker', NULL, '1787', NULL, 'R', 'R', '1792-01-22', 'Goeree', '1792-06-30', '1792-07-21', true, '1792-09-23', 'Batavia', 8381, 'The DORDWIJK called at Duins (arrival: 27-01-1792).');
INSERT INTO "voyages" VALUES (4721, '', 3, '', 'SCHELDE', 'Kornelis van Eps', 1150, NULL, '1780', NULL, NULL, 'Z', 'Z', '1792-02-20', 'Rammekens', '1792-06-30', '1792-07-16', true, '1792-09-16', 'Ceylon', 8377, NULL);
INSERT INTO "voyages" VALUES (4722, '', 3, '', 'VLIJT', 'Francois Moser', 136, 'paketboot', '1788', NULL, NULL, 'Z', 'Z', '1792-03-20', 'Rammekens', '1792-07-17', '1793-05-31', true, '1793-09-17', 'Batavia', 8391, 'From 25-03 till 06-04-1792 the VLIJT was at Duins.');
INSERT INTO "voyages" VALUES (4723, '', 1, '', 'HILVERSBEEK', 'Klaas Voet', 1150, NULL, '1790', NULL, NULL, 'A', 'A', '1792-05-24', 'Texel', '1792-09-06', '1792-09-27', true, '1792-12-08', 'Ceylon', NULL, 'The HILVERSBEEK called at Duins (departure: 02-06-1792). At (or before) the Cape Jan Jobst Droop succeeded Klaas Voet as master. The ship carried many soldiers to Ceylon.');
INSERT INTO "voyages" VALUES (4724, '', 3, '', 'BERKHOUT', 'Martens', 1150, NULL, '1779', NULL, NULL, 'H', 'A', '1792-06-02', 'Texel', NULL, NULL, true, NULL, NULL, NULL, 'One day after its departure from Texel the BERKHOUT had to be towed into Dover; there the ship was laid up.');
INSERT INTO "voyages" VALUES (4725, '', 3, '', 'MARIA LOUISA', 'Pieter Mosterd', 136, 'paketboot', '1788', NULL, NULL, 'A', 'D', '1792-06-16', 'Goeree', '1792-09-18', '1792-10-01', true, '1792-11-25', 'Batavia', 8367, NULL);
INSERT INTO "voyages" VALUES (4726, '', 2, '', 'TEILINGEN', 'Simon Vaartjes', 1150, NULL, '1786', NULL, NULL, 'R', 'R', '1792-07-10', 'Goeree', '1792-10-15', '1792-11-03', true, '1793-01-05', 'Batavia', NULL, 'In 1796 the TEILINGEN was sold and broken up at Batavia.');
INSERT INTO "voyages" VALUES (4727, '', 3, '', 'DUIFJE', 'Jan Olhof', 400, NULL, '1784', NULL, NULL, 'A', 'A', '1792-07-11', 'Texel', '1792-11-21', NULL, true, '1792-11-21', 'The Cape', 8361, 'at Duins (departure: 20-07-1792) and at S. Tiago (27 till 29-08-1792).');
INSERT INTO "voyages" VALUES (4728, '', 2, '', 'RECHT DOOR ZEE', 'Luur Runken', 880, NULL, '1786', NULL, NULL, 'D', 'A', '1792-07-11', 'Texel', '1792-11-23', '1792-12-09', true, '1793-02-20', 'Batavia', NULL, 'From 17 till 20-07-1792 the RECHT DOOR ZEE was at Duins. In 1795 or 1796 the ship was sold at Batavia.');
INSERT INTO "voyages" VALUES (4729, '', 2, '', 'SINT LAURENS', 'Jan David Sluiters', 1150, NULL, '1784', NULL, NULL, 'Z', 'Z', '1792-07-12', 'Rammekens', '1792-12-03', '1792-12-19', true, '1793-02-24', 'Batavia', NULL, 'The ST. LAURENS called at Duins (17 till 20-07-1792) and at S. Tiago (01 till 10-09-1792). In 1795 or 1796 the ship was broken up at Batavia.');
INSERT INTO "voyages" VALUES (4730, '', 2, '', 'RESOLUTIE', 'Daniel Hendriks', 530, NULL, NULL, '1784', NULL, 'H', 'A', '1792-07-24', 'Texel', '1793-01-17', NULL, true, '1793-01-17', 'The Cape', 8366, NULL);
INSERT INTO "voyages" VALUES (4731, '', 2, '', 'KRAAL', 'Jakob Sem', 136, 'paketboot', '1788', NULL, NULL, 'A', 'A', '1792-09-30', 'Texel', '1793-01-01', '1793-01-10', true, '1793-03-27', 'Batavia', 8369, NULL);
INSERT INTO "voyages" VALUES (4732, '', 3, '', 'AFRIKAAN', 'Thijs Ketel', 880, NULL, '1780', NULL, NULL, 'E', 'E', '1792-10-01', 'Texel', '1793-01-17', '1793-02-04', true, '1793-05-07', 'Batavia', 8371, NULL);
INSERT INTO "voyages" VALUES (4733, '', 2, '', 'DELFT', 'Johan van der Plas', 880, NULL, '1786', NULL, NULL, 'D', 'Z', '1792-10-01', 'Rammekens', '1793-01-18', '1793-03-06', true, '1793-06-13', 'Batavia', 8373, 'According to K.A. 4390a the departing crew consisted of 296 men.');
INSERT INTO "voyages" VALUES (4734, '', 2, '', 'PHOENICIER', 'Lodewijk Haak', 1150, NULL, '1786', NULL, NULL, 'A', 'A', '1792-10-01', 'Texel', '1793-01-18', '1793-02-04', true, '1793-05-08', 'Batavia', 8376, NULL);
INSERT INTO "voyages" VALUES (4735, '', 3, '', 'TEXELSTROOM', 'Jurriaan Kornelis Koertse', 780, 'hneker', NULL, '1785', NULL, 'R', 'A', '1792-10-07', 'Texel', '1793-03-31', NULL, true, '1793-03-31', 'The Cape', 8368, 'voyage was called STANDVASTIGHEID (numbers of the second voyage:4675/8318).');
INSERT INTO "voyages" VALUES (4736, '', 1, '', 'NAGELBOOM', 'Hans Barendse', 1150, NULL, '1790', NULL, NULL, 'A', 'A', '1792-10-09', 'Texel', '1793-03-25', '1793-04-11', true, '1793-07-03', 'Batavia', 8375, 'From 15 till 24-10-1792 the NAGELBOOM was at Duins. After having arrived at Batavia the ship sailed on to China.');
INSERT INTO "voyages" VALUES (4737, '', 2, '', 'ZWAAN', 'Andries Maankop', 1150, NULL, '1787', NULL, NULL, 'Z', 'Z', '1792-10-25', 'Rammekens', '1793-03-24', '1793-05-03', true, '1793-07-13', 'Batavia', 8395, 'According to K..4. 4336 the departing crew consisted of 360 men. The ZWAAN called at Duins, 28-10 till 25-11-1792.');
INSERT INTO "voyages" VALUES (4738, '', 3, '', 'BERKHOUT', 'Swerus Magnus Cederborg', 1150, NULL, '1784', NULL, NULL, 'A', 'A', '1792-11-24', 'Texel', '1793-03-21', '1793-04-10', true, '1793-07-13', 'Batavia', NULL, 'during the preceding voyages was called BEVERWIJK (numbers of the second voyage: 4594/8307).');
INSERT INTO "voyages" VALUES (4739, '', 3, '', 'BLITTERSWIJK', 'Nlarinus van Vlaanderen', 1150, NULL, '1785', NULL, NULL, 'Z', 'Z', '1792-11-25', 'Rammekens', '1793-04-04', '1793-04-21', true, '1793-06-22', 'Batavia', 8372, 'According to K.A. 4336 the departing crew consisted of 357 men.');
INSERT INTO "voyages" VALUES (4740, '', 1, '', 'IJSSELMONDE', 'Barend Sterk', 1150, NULL, '1789', NULL, NULL, 'R', 'R', '1792-11-29', 'Goeree', '1793-04-11', '1793-05-03', true, '1793-08-06', 'Batavia', NULL, 'In 1796 the IJSSELMONDE was sold and broken up at Batavia.');
INSERT INTO "voyages" VALUES (4741, '', 2, '', 'EXPEDITIE', 'Ditmar Smit', 136, 'paketboot', '1788', NULL, NULL, 'D', 'A', '1792-12-28', 'Texel', '1793-04-07', '1793-04-16', true, '1793-06-13', 'Batavia', 8370, NULL);
INSERT INTO "voyages" VALUES (4742, '', 1, '', 'CEYLON', 'Pierce Muntz', 900, 'pink', '1791', NULL, NULL, 'A', 'A', '1793-01-15', 'Texel', '1793-04-11', '1793-05-06', true, '1793-07-09', 'Ceylon', 8387, '196 men.');
INSERT INTO "voyages" VALUES (4743, '', 3, '', 'COLUMBUS', 'Daniel Kikkert', 1150, NULL, '1787', NULL, NULL, 'A', 'A', '1793-01-15', 'Texel', '1793-04-29', '1793-05-31', true, '1793-08-16', 'Batavia', NULL, 'In 1795 or 1796 the ship was broken up at Batavia.');
INSERT INTO "voyages" VALUES (4744, '', 4, '', 'DRAAK', 'Anthonie van Rijn', 1150, NULL, '1780', NULL, NULL, 'A', 'A', '1793-01-15', 'Texel', '1793-04-11', '1793-05-03', true, '1793-07-13', 'Batavia', NULL, 'Batavia, was struck by lightning and burnt down.');
INSERT INTO "voyages" VALUES (4745, '', 1, '', 'ENKHUIZER MAAGD', 'Jan Everwijn Drillinger', 1150, NULL, '1788', NULL, NULL, 'E', 'E', '1793-01-15', 'Texel', '1793-04-18', '1793-05-09', true, '1793-08-07', 'Batavia', 8374, NULL);
INSERT INTO "voyages" VALUES (4746, '', 4, '', 'MENTOR', 'Ulke Barendsz.', 560, NULL, NULL, '1789', NULL, 'Z', 'Z', '1793-04-06', 'Rammekens', '1793-07-13', '1793-07-30', true, '1793-10-04', 'Batavia', 8385, NULL);
INSERT INTO "voyages" VALUES (4747, '', 2, '', 'SURSEANCE', 'Christiaan Zummack', 768, NULL, NULL, '1786', NULL, 'Z', 'Z', '1793-04-06', 'Rammekens', '1793-07-13', '1793-07-30', true, '1793-09-25', 'Batavia', 8386, NULL);
INSERT INTO "voyages" VALUES (4748, '', 2, '', 'STAR', 'Karel Jakob Brugman', 136, 'paketboot', '1788', NULL, NULL, 'Z', 'Z', '1793-04-09', 'Rammekens', '1793-07-07', NULL, true, '1793-07-07', 'The Cape', NULL, 'On 04-08-1793 the Company''s authorities sent the ship to the Delagoa River in order to look for the homeward-bound DEMERARY (8363), which had departed from Batavia in February, 1793, and was missing since. Eventually the STAR was taken by the English.');
INSERT INTO "voyages" VALUES (4749, '', 3, '', 'LUCHTBOL', 'Willem Smal', 136, 'paketboot', '1788', NULL, NULL, 'R', 'R', '1793-07-01', 'Goeree', '1793-10-15', '1793-10-28', true, '1793-12-20', 'Batavia', NULL, 'On 15-07-1795 the LUCHTBOL was sold to the Danes at Bengal.');
INSERT INTO "voyages" VALUES (4750, '', 3, '', 'CONSTANTIA', 'Andries Laurens Kanters', 880, NULL, '1782', NULL, NULL, 'D', 'D', '1793-07-08', 'Goeree', '1793-11-12', '1793-12-08', true, '1794-02-18', 'Batavia', NULL, 'there it was taken by the English, when they captured the city.');
INSERT INTO "voyages" VALUES (4751, '', 1, '', 'KROMHOUT', 'Hendrik Holder', 880, NULL, '1790', NULL, NULL, 'H', 'H', '1793-07-08', 'Texel', '1793-11-11', '1793-12-08', true, '1794-02-16', 'Batavia', 8384, 'The 23 passengers indicated in the first column were Chinese; 20 of them arrived at Batavia.');
INSERT INTO "voyages" VALUES (4752, '', 3, '', 'HAASJE', 'Arie Smitskamp', 136, 'paketboot', '1788', NULL, NULL, 'A', 'A', '1793-09-20', 'Texel', '1794-03-06', '1794-03-16', true, '1794-06-15', 'Batavia', NULL, 'From 28-09 till 24-11-1793 the HAASJE was at Plymouth. Early in May, 1797, the HAASJE, which had been severely damaged during a storm, cast anchor off the mouth of the Delagoa River; on 27-05-1797 it was taken there by an English fishing-boat, assisted by a Portuguese ship.');
INSERT INTO "voyages" VALUES (4753, '', 3, '', 'VREDENBURG', 'Meindert Bode', 1150, NULL, '1784', NULL, NULL, 'A', 'A', '1793-09-20', 'Texel', '1794-03-29', NULL, true, '1794-07-06', 'Batavia', NULL, 'The VREDENBURG called at Plymouth, 28-09 till 24-11-1793. The date of departure from the Cape is unknown. In 1795 or 1796 the ship was sold at Batavia.');
INSERT INTO "voyages" VALUES (4754, '', 3, '', 'VROUWE AGATHA', 'Puter Murk', 900, 'fluit', NULL, NULL, NULL, NULL, 'A', '1793-11-07', 'Texel', '1794-04-11', '1794-04-20', true, '1794-07-09', 'Batavia', 8379, NULL);
INSERT INTO "voyages" VALUES (4755, '', 1, '', 'HERTOG VAN BRUNSWIJK', 'Jan Olhof', 1150, NULL, '1792', NULL, NULL, 'A', 'A', '1793-11-07', 'Texel', '1794-03-08', '1794-04-17', true, '1794-07-09', 'Batavia', NULL, 'The 44 passengers indicated in the first column included 39 Chinese; 37 of them arrived at Batavia. After having called at Batavia the HERTOG VAN BRUNSWIJK possibly sailed on to China. In 1795 or 1796 the ship was wrecked off Batavia.');
INSERT INTO "voyages" VALUES (4756, '', 5, '', 'DORDRECHT', 'Gottlieb Jager', 898, 'fluit', NULL, NULL, NULL, 'D', 'A', '1793-11-07', 'Texel', '1794-03-14', NULL, true, '1794-07-09', 'Batavia', 8380, 'According to K.A. 43936 the DORDRECHT had taken in its cargo at Riga. 4756/8380 Is the fifth voyage of this ship, which during its first voyage (4400/8087) was called BERLIN.');
INSERT INTO "voyages" VALUES (4757, '', 2, '', 'GEERTRUIDA EN PETRONELLA', 'Matthijs Hansen', 964, 'pink', NULL, NULL, NULL, NULL, 'A', '1793-11-07', 'Texel', '1794-03-14', '1794-04-20', true, '1794-07-09', 'Batavia', 8382, NULL);
INSERT INTO "voyages" VALUES (4758, '', 2, '', 'NOORD-HOLLAND', 'Hendrik Sluis', 894, 'fluit', NULL, NULL, NULL, NULL, 'A', '1793-11-07', 'Texel', '1794-09-05', NULL, true, '1794-11-05', 'Batavia', 8389, NULL);
INSERT INTO "voyages" VALUES (4759, '', 1, '', 'WASHINGTON', 'Gerard Adriaan van Velsen', 1150, NULL, '1791', NULL, NULL, 'A', 'A', '1793-11-07', 'Texel', '1794-03-08', '1794-04-17', true, '1794-07-09', 'Batavia', 8393, 'they all arrived at Batavia. After having called at Batavia the WASHINGTON sailed on to China.');
INSERT INTO "voyages" VALUES (4760, '', 1, '', 'SIAM', 'George Philip Gas', 880, NULL, '1789', NULL, NULL, 'D', 'D', '1793-11-16', 'Goeree', '1794-03-14', '1794-04-20', true, '1794-07-09', 'Batavia', 8392, 'to China.');
INSERT INTO "voyages" VALUES (4761, '', 3, '', 'STANDVASTIGHEID', 'Anton Christian von Fleischer', 708, NULL, NULL, '1785', NULL, 'A', 'R', '1793-11-16', 'Goeree', '1794-09-05', NULL, true, '1794-11-28', 'Batavia', 8390, 'Date of arrival at the Cape unknown. 4761/8390 Is the third voyage of this ship, which during its first voyage and the outward-bound part of the second voyage was called TEXELSTROOM(numbers of the second voyage: 4602/8328).');
INSERT INTO "voyages" VALUES (4762, '', 1, '', 'ZEELELIE', 'Jan Jochem Milfaart', 1150, NULL, '1789', NULL, NULL, 'Z', 'Z', '1793-11-16', 'Rammekens', '1794-03-30', '1794-04-20', true, '1794-07-09', 'Batavia', 8394, 'The 26 passengers indicated in the first column included 23 Chinese; they all arrived at Batavia. After having called at Batavia the ZEELELIE sailed on to China.');
INSERT INTO "voyages" VALUES (4763, '', 2, '', 'ZEEMEEUW', 'Albert Hillebrandsz.', 136, 'paketboot', '1788', NULL, NULL, 'E', 'A', '1793-12-26', 'Texel', NULL, NULL, false, '1794-07-15', 'Batavia', NULL, 'From Texel the ZEEMEEUW sailed to Rammekens; there it finally put to sea on 02-02-1794.');
INSERT INTO "voyages" VALUES (4764, '', 3, '', 'ALBLASSERDAM', 'Klaas Keuken', 1150, NULL, '1782', NULL, NULL, 'Z', 'A', '1793-12-27', 'Texel', '1794-08-11', '1794-09-05', true, '1795-01-01', 'Ceylon', NULL, NULL);
INSERT INTO "voyages" VALUES (4765, '', 1, '', 'EENDRACHT', 'Roelof Jurgen Erdrop', 880, NULL, '1791', NULL, NULL, 'H', 'H', '1793-12-27', 'Texel', '1794-08-08', '1194-09-05', true, '1794-11-05', 'Batavia', NULL, 'Batavia.');
INSERT INTO "voyages" VALUES (4766, '', 2, '', 'MAKASSAR', 'Frederik Markt', 1150, NULL, '1787', NULL, NULL, 'E', 'E', '1793-12-27', 'Texel', '1794-08-11', '1794-09-05', true, '1794-12-01', 'Batavia', 8388, NULL);
INSERT INTO "voyages" VALUES (4767, '', 2, '', 'WESTKAPELLE', 'Pieter .Mallet jr.', 1150, NULL, '1788', NULL, NULL, 'Z', 'Z', '1793-12-29', 'Rammekens', '1794-08-11', '1794-09-23', true, '1795-01-31', 'Batavia', NULL, 'In 1795 or 1796 the WESTKAPELLE was sold at Batavia.');
INSERT INTO "voyages" VALUES (4768, '', 4, '', 'FARM', 'Luitje Frederiksz.', 136, 'paketboot', '1788', NULL, NULL, 'A', 'A', '1794-03-21', 'Texel', NULL, NULL, true, NULL, NULL, NULL, 'On 25-03-1794 the FAAM was taken by the French and brought to Brest.');
INSERT INTO "voyages" VALUES (4769, '', 2, '', 'BUITENVERWACHTING', 'Hendrik Anthonie Stoete', 1150, NULL, '1789', NULL, NULL, 'A', 'A', '1794-05-05', 'Texel', '1794-09-20', '1194-10-12', true, '1795-01-29', 'Batavia', NULL, 'According to K.A. 4390a the departing crew consisted of 231 men. After 1795 the BUITENVERWACHTING was sold at Batavia.');
INSERT INTO "voyages" VALUES (4770, '', 1, '', 'VROUWE MARIA GEERTRUIDA', 'Roelof Tiernan', 320, NULL, NULL, NULL, NULL, NULL, 'Z', '1794-05-05', 'Texel', NULL, NULL, true, NULL, NULL, NULL, 'On 23-04-1794 the VROUWE MARIA GEERTRUIDA sailed from Rammekens to Texel. Twenty days after its final departure from Texel the ship was seized by the French; later that year it was recaptured by the English and taken to Plymouth, where it arrived on 09-06-1794.');
INSERT INTO "voyages" VALUES (4771, '', 1, '', 'ONDERNEMING', 'Karel Jakob Brugman', 570, NULL, NULL, '1793', NULL, 'Z', 'Z', '1794-05-05', 'Texel', '1794-09-01', '1794-10-12', true, '1794-12-01', 'Batavia', NULL, 'On 23-04-1794 the ONDERNEMING sailed from Rammekens to Texel.');
INSERT INTO "voyages" VALUES (4772, '', 1, '', 'ZUIDPOOL', 'J. A. van der Putten', 900, 'pink', '1791', NULL, NULL, 'Z', 'Z', '1794-05-05', 'Texel', '1794-08-22', '1794-09-05', true, '1795-01-01', 'Ceylon', 8397, 'On 23-04-1794 the ZUIDPOOL sailed from Rammekens to Texel.');
INSERT INTO "voyages" VALUES (4773, '', 1, '', 'BERLICUM', 'Frans Bremer', 846, NULL, NULL, NULL, NULL, NULL, 'Z', '1794-06-24', 'Texel', '1794-12-29', '1795-02-03', true, '1795-05-15', 'Batavia', NULL, 'On 23-06-1794 the BERLICUM sailed from Rammekens to Texel. On 15-02-1796 the ship was confiscated by the English at Ceylon.');
INSERT INTO "voyages" VALUES (4774, '', 1, '', 'JONGE BONIFACIUS', 'J. N. Kroese', 488, 'hoeker', NULL, NULL, NULL, NULL, 'Z', '1794-06-24', 'Texel', '1794-11-28', '1794-12-21', true, '1795-02-26', 'Batavia', 8399, 'On 23-06-1794 the JONGE BONIFACIUS sailed from Rammekens to Texel.');
INSERT INTO "voyages" VALUES (4775, '', 3, '', 'CASTOR', 'Gerard Ewoud Overbeek', 650, 'pink', NULL, '1784', NULL, 'Z', 'A', '1794-06-24', 'Texel', '1794-11-28', NULL, true, '1794-11-28', 'The Cape', NULL, 'The CASTOR was bound for the Cape. Eventually the ship was taken by the English.');
INSERT INTO "voyages" VALUES (4776, '', 4, '', 'EENSGEZINDHEID', 'Kornelis Michielsen', 884, 'fluit', NULL, NULL, NULL, NULL, 'Z', '1794-06-24', 'Texel', '1794-12-14', '1794-12-31', true, '1795-05-15', 'Batavia', NULL, 'On 23-06-1794 the EENSGEZINDHEID sailed from Rammekens to Texel. On 15-02-1796 the ship was seized by the English at Ceylon.');
INSERT INTO "voyages" VALUES (4777, '', 1, '', 'LOUISA ANTHONY', 'Kersje Hillebrandsz.', 640, 'fluit', NULL, NULL, NULL, NULL, 'A', '1794-06-24', 'Texel', NULL, NULL, true, '1795-04-03', 'Batavia', 8400, NULL);
INSERT INTO "voyages" VALUES (4778, '', 1, '', 'VERTROUWEN', 'Hillebrand van Uijen', 890, 'fluit', NULL, NULL, NULL, NULL, 'A', '1794-06-24', 'Texel', NULL, NULL, true, NULL, 'Batavia', 8401, NULL);
INSERT INTO "voyages" VALUES (4779, '', 4, '', 'MARIA LOUISA', 'L. Heikoop', 136, 'paketboot', '1788', NULL, NULL, 'A', 'D', '1794-07-10', 'Texel', NULL, NULL, true, '1795-01-24', 'Batavia', NULL, 'On 22-05-1794 the MARIA LOUISA sailed from Goeree to Texel. On 21-10-1795 the ship was captured by the English off the Cape and taken to the Cape.');
INSERT INTO "voyages" VALUES (4780, '', 3, '', 'KRAAL', 'J. C. Clemens', 136, 'paketboot', '1788', NULL, NULL, 'A', 'A', '1794-09-06', 'Texel', NULL, NULL, true, '1795-02-14', 'Batavia', NULL, 'wrecked.');
INSERT INTO "voyages" VALUES (4781, '', 3, '', 'RESOLUTIE', 'Daniel Hendriks', 530, NULL, NULL, '1784', NULL, 'E', 'A', '1794-09-06', 'Texel', '1795-01-15', '1795-02-18', true, '1795-05-15', 'Batavia', NULL, 'The RESOLUTIE called at Portsmouth, 09 till 11-09-1794. One source indicates, that in 1797 the ship still was in active service in the Indies.');
INSERT INTO "voyages" VALUES (4782, '', 1, '', 'NIEUWLAND', 'Johan Arkebout', 1150, NULL, '1790', NULL, NULL, 'R', 'R', '1794-12-19', 'Goeree', NULL, NULL, true, NULL, NULL, NULL, 'The NIEUWLAND was bound for China. The ship called at Duins; arrival: 19-12-1794. On 10-01-1795 the NIEUWLAND cast anchor at Plymouth; there the English put an embargo on the ship and finally confiscated it.');
INSERT INTO "voyages" VALUES (4783, '', 3, '', 'GEERTRUIDA', 'Marten de Vries', 660, 'fluit', NULL, NULL, NULL, NULL, 'A', '1794-12-22', 'Texel', '1795-05-09', NULL, true, NULL, NULL, NULL, 'In August 1795, the GEERTRUIDA was captured by the English at the Cape.');
INSERT INTO "voyages" VALUES (4784, '', 2, '', 'OOSTHUIZEN', 'Gerrit Scheler', 880, NULL, '1789', NULL, NULL, 'H', 'A', '1794-12-22', 'Texel', NULL, NULL, true, NULL, NULL, NULL, 'The OOSTHUIZEN was bound for China Six days after its departure from Texel the ship called at the Scilly Islands In December 1795, the OOSTIIUIZEN was confiscated by the English.');
INSERT INTO "voyages" VALUES (4785, '', 2, '', 'VOORLAND', 'Jan Arendsz.', 1150, NULL, '1788', NULL, NULL, 'A', 'Z', '1794-12-22', 'Texel', '1795-04-12', '1795-04-28', true, '1795-07-13', 'Batavia', NULL, NULL);
INSERT INTO "voyages" VALUES (4786, '', 1, '', 'WESTERMEER', 'Kornelis Jakobsz. Schots', 656, 'fluit', NULL, NULL, NULL, NULL, 'A', '1794-12-22', 'Texel', NULL, NULL, true, NULL, NULL, NULL, 'The WESTERMEER was bound for Batavia. Four days after the departure from Texel, however, the ship was seized by the French.');
