INSERT INTO "voyages" VALUES (5514, '', 1, '', 'KENNEMERLAND', 'Idese de Vink', 950, NULL, NULL, '1662', NULL, 'A', 'A', '1663-12-21', 'Batavia', '1664-03-13', '1664-04-16', true, '1664-08-25', 'Vlie', 968, NULL);
INSERT INTO "voyages" VALUES (5515, '', 2, '', 'MAARSSEVEEN', 'Jan Hermansz.', 1210, NULL, '1660', NULL, NULL, 'A', 'A', '1663-12-21', 'Batavia', '1664-03-13', '1664-04-16', true, '1664-08-25', 'Vlie', 977, 'Aboard the MAARSSEVEEN was Adriaan van der Meide, vice-commandeur of the return fleet. The ship was wrecked in the battle of Lowestoft against the English, 13-06-1665.');
INSERT INTO "voyages" VALUES (5516, '', 2, '', 'NAGELBOOM', 'Jan Andriesz.', 600, NULL, NULL, NULL, NULL, 'H', 'E', '1663-12-21', 'Batavia', '1664-03-31', '1664-04-16', true, '1664-08-25', 'Vlie', 960, 'The NAGELBOOM was hired by the Admiralties to fight the English; it was taken by the English on 13-06-1665.');
INSERT INTO "voyages" VALUES (5517, '', 9, '', 'ORANJE', 'Reinier Reiniersz.', 700, NULL, '1643', NULL, NULL, 'Z', 'Z', '1663-12-21', 'Batavia', '1664-03-31', '1664-04-16', true, '1664-08-30', 'Wielingen', 972, 'Aboard the ORANJE was Dirk Steur, commandeur of the return fleet. The ship was hired by the Admiralties to fight the English; it was burnt in the battle of Lowestoft, 13-06-1665.');
INSERT INTO "voyages" VALUES (5518, '', 1, '', 'RIJNLAND', NULL, 795, NULL, '1662', NULL, NULL, 'A', 'A', '1663-12-21', 'Batavia', '1664-03-31', '1664-04-16', true, '1664-08-28', 'Vlie', 969, NULL);
