INSERT INTO "voyages" VALUES (5521, '', 1, '', 'BEURS VAN AMSTERDAM', NULL, 472, 'jacht', NULL, '1660/1', NULL, 'A', 'A', '1664-01-27', 'Batavia', '1664-03-31', '1664-04-16', true, '1664-08-25', 'Vlie', 943, 'Cape.');
INSERT INTO "voyages" VALUES (5522, '', 1, '', 'LOOSDUINEN', 'Karsten Krijnsz. Rechter', 340, NULL, NULL, NULL, NULL, NULL, 'A', '1664-01-27', 'Batavia', '1664-04-09', '1664-04-16', true, '1664-08-25', 'Vlie', 926, NULL);
INSERT INTO "voyages" VALUES (5523, '', 1, '', 'AMSTELLAND', 'Theunis Gijsbertsz.', 700, 'fluit', '1660', NULL, NULL, 'A', 'A', '1664-12-23', 'Batavia', '1665-03-11', '1665-04-22', true, NULL, NULL, 957, 'KOGGE and the NIEU-WENHOVE (5534 and 5535) joined the fleet. The combined fleet sailed via Bergen (Norway) because of the war; 12-08-1665: battle in the Bay of Bergen against an English fleet (25 men killed and 70 wounded). After the departure from Bergen two ships were taken by the English (see below). The AMSTELLAND returned to Bergen on 16-09-1665; departure: in October. On 25-10-1665 the ship was wrecked east of Terschelling; its cargo was mainly saved.');
INSERT INTO "voyages" VALUES (5524, '', 1, '', 'BREDERODE', 'Pieter Veldmuis de Voogd', 666, 'fluit? jacht?', '1663', NULL, NULL, 'A', 'A', '1664-12-23', 'Batavia', '1665-03-11', '1665-04-22', true, '1665-09-17', 'Vlie', 1002, 'Via Bergen (08-08 till 02-09-1665).');
INSERT INTO "voyages" VALUES (5525, '', 1, '', 'DIEMERMEER', NULL, 505, 'fluit', '1659', NULL, NULL, 'A', 'Z', '1664-12-23', 'Batavia', '1665-03-11', '1665-04-22', true, '1665-11-28', 'Wielingen', 916, 'Via Bergen, departure on 02-09-1665.');
INSERT INTO "voyages" VALUES (5526, '', 4, '', 'SLOT VAN HONINGEN', 'Herman de Ruiter', 1124, NULL, '1654', NULL, NULL, 'R', 'R', '1664-12-23', 'Batavia', '1665-03-11', '1665-04-22', true, NULL, NULL, 1011, 'Via Bergen (08-08 till 02-09-1665). Taken on 13-09-1665 by the English at Dogger Bank.');
INSERT INTO "voyages" VALUES (5527, '', 1, '', 'WAPEN VAN HOORN', NULL, 756, 'fluit? jacht?', '1662', NULL, NULL, 'H', 'A', '1664-12-23', 'Batavia', '1665-03-12', '1665-04-22', true, '1666-05-13', 'Vlie', 1000, 'Via Bergen (08-08 till 02-09-1665) and Gluckstadt on the Elbe.');
