INSERT INTO "voyages" VALUES (5532, '', 2, '', 'WALCHEREN', 'Frans van Heist', 840, NULL, '1661', NULL, NULL, 'Z', 'Z', '1664-12-23', 'Batavia', '1665-03-11', '1665-04-22', true, '1665-09-17', 'Vlie', 1012, 'till 02-09-16651.');
INSERT INTO "voyages" VALUES (5533, '', 1, '', 'RIJZENDE ZON', NULL, 600, 'jacht', NULL, '1660/1', NULL, 'A', 'A', '1664-12-23', 'Batavia', '1665-03-11', '1665-04-22', true, '1665-10-08', 'Vlie', 946, 'Via Bergen (08-08 till 02-09-1665) and Denmark (Kronborg). Returned under convoy in the fleet of schout-bij-nacht Stachouwer of the Admiralty of Friesland.');
INSERT INTO "voyages" VALUES (5534, '', 1, '', 'KOGGE', 'Luit Pietersz.', 400, 'jacht', NULL, '1662', NULL, 'H', 'A', '1665-01-31', 'Batavia', '1665-04-14', '1665-04-22', true, '1666-03-21', 'Vlie', 971, 'Second return fleet (5534-5535), joined the first return fleet (see 5523) at the Cape. According to Daghregister 1665 the KOGGE carried a cargo of 88,576. The ship called at Bergen; departure: 02-09-1665. Later on it returned to Norway (Flecker O and Kristiansand).');
INSERT INTO "voyages" VALUES (5535, '', 1, '', 'NIEUWENHOVE', 'Pieter Koker', 438, 'jacht', '1660', NULL, NULL, 'Z', 'A', '1665-01-31', 'Batavia', '1665-04-16', '1665-04-22', true, '1665-10-31', 'Vlie', 937, 'The crew included 2 passengers.');
