INSERT INTO "voyages" VALUES (5537, '', 2, '', 'VENENBURG', 'Adriaan Bastiaansz.', 703, 'fluit', '1656', NULL, NULL, 'A', 'A', '1665-11-18', 'Bengal', '1666-03-06', '1666-05-24', true, '1666-07-01', NULL, 962, 'Original cargo from Bengal: 364,044. The VENENBURG was taken by the English.');
INSERT INTO "voyages" VALUES (5538, '', 1, '', 'BUIENSKERKE', 'Daniel de Loper', 510, 'fluit', '1659', NULL, NULL, 'Z', 'Z', '1666-01-30', 'Batavia', '1666-04-23', '1666-05-24', true, '1666-10-05', 'Vlie', 925, 'with 356 men and 11 passengers. At the Cape the KALF and the VENENBURG (5536 and 5537) joined the fleet.');
INSERT INTO "voyages" VALUES (5539, '', 1, '', 'ELBURG', 'Jakob le Bleu', 360, 'fluit', '1657', NULL, NULL, 'A', 'E', '1666-01-30', 'Batavia', '1666-04-23', '1666-05-24', true, '1666-11-16', 'Vlie', 882, NULL);
