INSERT INTO "voyages" VALUES (5650, '', 1, '', 'BAARS', NULL, 90, 'hoeker', '1668', NULL, NULL, 'R', 'R', '1674-02-04', 'Batavia', '1674-05-02', '1674-06-03', true, '1674-09-25', 'Texel', 1129, 'Return fleet (5650-5658) under command of Nikolaas de Rooi aboard the BURCHT VAN LEIDEN (5654), Jan Blauwmeulen aboard the MIDDELBURG (5655), and Jan Lambertsz. Radder aboard the BUREN (5653). At the Cape the ZWEMMER (5659) joined the fleet. The BAARS carried rice to the Cape and sailed on to patria.');
INSERT INTO "voyages" VALUES (5651, '', 2, '', 'BEEMSTER', 'Adriaan Bastiaansz. Schepers', 514, 'fluit', '1667', NULL, NULL, 'A', 'R', '1674-02-04', 'Batavia', '1674-04-25', '1674-06-03', true, '1674-10-01', NULL, 1197, 'Acc. to Daghregister 1674 the ship arrived at the Cape on 02 or 04-05-1674.');
INSERT INTO "voyages" VALUES (5652, '', 2, '', 'HOF VAN BREDA', 'Jakob Klok', 670, 'jacht', '1667', NULL, NULL, 'A', 'E', '1674-02-04', 'Batavia', '1674-05-02', '1674-06-03', true, '1674-08-01', NULL, 1207, NULL);
INSERT INTO "voyages" VALUES (5653, '', 1, '', 'BUREN', 'Kornelis de Gilde', 468, 'fluit', '1670', NULL, NULL, 'A', 'D', '1674-02-04', 'Batavia', '1674-05-02', '1674-06-03', true, '1674-08-01', NULL, 1169, 'Aboard the BUREN was Jan Lambertsz. Radder, schout-bij-nacht of the return fleet.');
