INSERT INTO "voyages" VALUES (5655, '', 4, '', 'MIDDELBURG', NULL, 846, NULL, '1664', NULL, NULL, 'Z', 'Z', '1674-02-04', 'Batavia', '1674-11-13', '1675-02-12', true, '1675-04-01', NULL, 1220, 'The MIDDELBURG sailed via Anjouan (09-06-1674) and the Mayotte Islands (12-08 till 03-10-1674), meeting with many difficulties and loosing about 60 men, The ship joined the fleet of 18-11-1674 at the Cape. Aboard the MIDDELBURG was Jan Blauwmeulen, vice-commandeur of the return fleet.');
INSERT INTO "voyages" VALUES (5656, '', 2, '', 'SPANBROEK', 'Jan Hendriksz. Boon', 448, 'fluit', '1669', NULL, NULL, 'A', 'H', '1674-02-04', 'Batavia', '1674-05-02', '1674-06-03', true, '1674-10-05', NULL, 1203, NULL);
