INSERT INTO "voyages" VALUES (5664, '', 3, '', 'STICHT VAN UTRECHT', 'Jan Kraan', 990, NULL, '1667', NULL, NULL, 'A', 'A', '1674-11-18', 'Batavia', '1675-01-19', '1675-02-12', true, '1675-04-01', NULL, 1205, NULL);
INSERT INTO "voyages" VALUES (5665, '', 3, '', 'VRIJHEID', 'Klaas de Rood', 1210, NULL, '1666', NULL, NULL, 'A', 'E', '1674-11-18', 'Batavia', '1675-01-19', '1675-02-12', true, '1675-04-01', NULL, 1229, NULL);
INSERT INTO "voyages" VALUES (5666, '', 3, '', 'VRIJE ZEE', NULL, 846, 'pinas', '1667', NULL, NULL, 'D', 'D', '1674-11-18', 'Batavia', NULL, NULL, false, '1675-06-07', 'Goeree', 1215, 'through Sunda Strait the ship lost sight of the fleet. Due to a French attack it did not call at the Cape, and sailed via Pernambuco (Brazil). Aboard the VRIJE ZEE was Jakob Ganswijk, schout-bij-nacht of the return fleet.');
INSERT INTO "voyages" VALUES (5667, '', 1, '', 'KWARTEL', NULL, 96, 'hoeker', '1672', NULL, NULL, 'A', 'A', '1675-01-07', 'Ceylon', NULL, NULL, true, '1675-05-12', 'Texel', 1248, NULL);
INSERT INTO "voyages" VALUES (5668, '', 3, '', 'WAPEN VAN GOES', NULL, 671, NULL, '1668', NULL, NULL, 'Z', 'Z', '1675-01-12', 'Ceylon', '1675-03-24', '1675-05-01', true, '1675-07-01', NULL, 1238, 'joined the fleet of 28-01-1675 at the Cape. According to Valentijn the Ceylon-fleet departed on 07-01-1675.');
