INSERT INTO "voyages" VALUES (5671, '', 1, '', 'AZIE', 'Willem Hagedoorn', 1140, NULL, '1671', NULL, NULL, 'A', 'A', '1675-01-28', 'Batavia', '1675-04-18', '1675-05-01', true, '1675-07-01', NULL, 1236, 'Aboard the AZIE was Ludder Brummer, commandeur of the return fleet.');
