INSERT INTO "voyages" VALUES (5715, '', 1, '', 'BLOEMENDAAL', 'Heye Arendsz. de Wilde', 588, NULL, NULL, NULL, '1677', 'A', 'E', '1678-02-15', 'Batavia', '1678-05-01', '1678-05-16', true, '1678-09-06', 'Texel', 1349, 'Second return fleet (5715-5717) under command of Jan Hendriksz. Boon, master of the POULERON (5717). Aboard the BLOEMENDAAL there were probably also seafarers privately recruited by the master.');
