INSERT INTO "voyages" VALUES (5717, '', 1, '', 'POULERON', 'Jan Hendriksz. Boon', 638, 'jacht', '1669', NULL, NULL, 'Z', 'Z', '1678-02-15', 'Batavia', '1678-05-01', '1678-05-16', true, '1678-07-01', NULL, 1143, 'Jan Hendriksz. Boon was commandeur of the return fleet.');
INSERT INTO "voyages" VALUES (5718, '', 2, '', 'SNOEPER', 'Barend Fokkesz.', NULL, 'galjoot', NULL, NULL, '1677', 'A', 'A', '1678-12-21', 'Batavia', '1679-02-15', '1679-02-21', true, '1679-05-10', 'Amsterdam', 1356, 'Acc. to Valentijn: cargo 4,157.');
