INSERT INTO "voyages" VALUES (5720, '', 2, '', 'CEYLON', '... Verdonk', 776, NULL, '1673', NULL, NULL, 'A', 'A', '1679-01-10', 'Ceylon', '1679-03-03', '1679-04-19', true, '1679-08-08', 'Texel', 1335, NULL);
INSERT INTO "voyages" VALUES (5721, '', 2, '', 'AFRIKA', NULL, 1100, NULL, '1673', NULL, NULL, 'R', 'A', '1679-02-04', 'Batavia', '1679-05-14', '1679-06-01', true, '1679-10-17', 'Texel', 1345, '(5721-5729) under command of Jakob van der Waayen aboard the AFRIKA, Bartholomeus Nouters aboard the HENDRIK MAURITS (5724), and Johannes Brakes aboard the HUIS TE ZILVERSTEIN (5729).  Acc. to K.A. 3992 the first seven ships departed on 15-03-1679, and acc. to Coolhaas IV on 13-03-1679.');
INSERT INTO "voyages" VALUES (5722, '', 2, '', 'AMERIKA', NULL, 1002, 'pinas', '1674', NULL, NULL, 'H', 'A', '1679-02-04', 'Batavia', '1679-05-16', '1679-06-01', true, '1679-10-17', 'Texel', 1332, 'Acc. to Hudde 20 132 seafarers and 40 soldiers on board.');
INSERT INTO "voyages" VALUES (5723, '', 2, '', 'HELLEVOETSLUIS', NULL, 714, 'pinas', '1671', NULL, NULL, 'R', 'R', '1679-02-04', 'Batavia', '1679-05-23', '1679-06-01', true, '1679-10-17', NULL, 1367, NULL);
INSERT INTO "voyages" VALUES (5724, '', 2, '', 'HENDRIK MAURITS', NULL, 1194, NULL, '1673', NULL, NULL, 'Z', 'Z', '1679-02-04', 'Batavia', '1679-05-14', '1679-06-01', true, '1679-10-17', NULL, 1341, 'Aboard the HENDRIK MAURITS was Bartholomeus Nouters, vice-commandeur of the return fleet.');
INSERT INTO "voyages" VALUES (5725, '', 1, '', 'JONAS', NULL, NULL, 'fluit', NULL, NULL, '1677', 'A', 'A', '1679-02-04', 'Batavia', '1679-05-14', '1679-06-01', true, '1679-10-17', 'Texel', 1358, NULL);
INSERT INTO "voyages" VALUES (5726, '', 2, '', 'MAKASSAR', NULL, 1014, 'pinas', '1671', NULL, NULL, 'A', 'Z', '1679-02-04', 'Batavia', '1679-05-15', '1679-06-01', true, '1679-08-01', NULL, 1314, NULL);
INSERT INTO "voyages" VALUES (5727, '', 2, '', 'JUFFROUW MARIA', NULL, 440, 'fluit', NULL, NULL, '1677', 'A', 'H', '1679-02-04', 'Batavia', '1679-05-14', '1679-06-01', true, '1679-10-17', NULL, 1363, '36 Seafarers had been privately recruited by the master of the ship.');
INSERT INTO "voyages" VALUES (5728, '', 2, '', 'KWARTEL', NULL, 96, 'hoeker', '1672', NULL, NULL, 'A', 'A', '1679-02-13', 'Batavia', '1679-04-28', '1679-06-01', true, '1679-08-01', NULL, 1323, 'Sailed ahead of the fleet and joined it at the Cape.');
INSERT INTO "voyages" VALUES (5729, '', 1, '', 'HUIS TE ZILVERSTEIN', 'Jan Verschuur?', 1017, NULL, '1674', NULL, NULL, 'A', 'D', '1679-02-15', 'Batavia', '1679-05-14', '1679-06-01', true, '1679-10-17', NULL, 1305, 'Joined the return fleet during the voyage; according to Hudde 20, 135 seafarers on board. Aboard the HUIS TE ZILVER-STEIN was Johannes Brakel, schout-bij-nacht of the return fleet.');
INSERT INTO "voyages" VALUES (5730, '', 1, '', 'ROMEIN', NULL, 450, 'fluit? hekboot?', NULL, NULL, '1677', 'A', 'A', '1679-10-13', 'Batavia', '1679-12-13', '1679-12-25', true, '1680-04-18', 'Texel', 1374, 'Sailed alone.');
INSERT INTO "voyages" VALUES (5731, '', 1, '', 'JUFFROUW KORNELIA', NULL, 316, 'fluit', NULL, NULL, '1677', NULL, 'A', '1679-11-06', 'Ceylon', '1680-02-02', '1680-02-13', true, '1680-06-20', NULL, 1373, 'Sailed alone. According to K.A.1231, fol. 1618. cargo 54,065.');
INSERT INTO "voyages" VALUES (5732, '', 1, '', 'SINT ANDRIES', NULL, 604, 'fluit? jacht?', NULL, NULL, '1677', 'A', 'A', '1679-11-24', 'Batavia', '1680-02-20', '1680-03-28', true, '1680-07-12', 'Texel', 1348, 'First return fleet (5732-5737) under command of Sybrand Abbema aboard the LAND VAN SCHOUWEN (5736), Andries Bogaard aboard the EUROPA (5734), and Dirk Timonsz. de Jonge aboard the SCHIELAND (5735). At the Cape the fleet of 09-01-1680 from Ceylon joined this fleet. In addition to the crew, 36 sick seafarers were aboard the fleet. The 60 seafarers aboard the SINT ANDRIES had been privately recruited by the master. According to Hudde 20 departure from Batavia on 11-12-1679.');
INSERT INTO "voyages" VALUES (5733, '', 3, '', 'AZIE', NULL, 1140, NULL, '1671', NULL, NULL, 'A', 'H', '1679-11-24', 'Batavia', '1680-02-20', '1680-03-28', true, '1680-07-11', NULL, 1376, 'The 18 impotenten were soldiers.');
INSERT INTO "voyages" VALUES (5734, '', 2, '', 'EUROPA', NULL, 1140, NULL, '1671', NULL, NULL, 'A', 'A', '1679-11-24', 'Batavia', '1680-02-20', '1680-03-28', true, '1680-07-11', 'Texel', 1357, 'The 19 impotenten were soldiers. Aboard the EUROPA was Andries Bogaard, vice-commandeur of the return fleet.');
INSERT INTO "voyages" VALUES (5735, '', 1, '', 'SCHIELAND', NULL, 710, NULL, '1674', NULL, NULL, 'D', 'R', '1679-11-24', 'Batavia', '1680-02-20', '1680-03-28', true, '1680-05-01', NULL, 1299, 'The 18 impotenten were soldiers.');
INSERT INTO "voyages" VALUES (5736, '', 1, '', 'LAND VAN SCHOUWEN', NULL, 1140, NULL, '1676', NULL, NULL, 'Z', 'Z', '1679-11-24', 'Batavia', '1680-02-20', '1680-03-28', true, '1680-04-01', NULL, 1355, 'The 20 impotenten were soldiers. Aboard the LAND VAN SCHOUWEN was Sybrand Abbema, commandeur of the return fleet.');
INSERT INTO "voyages" VALUES (5737, '', 4, '', 'TIDORE', NULL, 1094, NULL, '1668', NULL, NULL, 'Z', 'Z', '1679-11-24', 'Batavia', '1680-02-20', '1680-03-28', true, '1680-07-11', NULL, 1364, 'The 20 impotenten were soldiers.');
INSERT INTO "voyages" VALUES (5738, '', 2, '', 'SUMATRA', NULL, 738, 'pinas', '1673', NULL, NULL, 'A', 'A', '1680-01-09', 'Ceylon', '1680-03-08', '1680-03-28', true, '1680-07-11', NULL, 1331, 'The fleet (5738-5739) from Ceylon joined the return fleet of 24-11-1679 at the Cape.');
INSERT INTO "voyages" VALUES (5739, '', 1, '', 'WAPEN VAN THOLEN', NULL, 698, 'pinas', '1672', NULL, NULL, 'Z', 'Z', '1680-01-09', 'Ceylon', '1680-03-08', '1680-03-28', true, '1680-07-11', NULL, 1255, NULL);
INSERT INTO "voyages" VALUES (5740, '', 1, '', 'HUIS TE MERWEDE', NULL, 882, 'pinas', '1674', NULL, NULL, 'R', 'Z', '1680-03-15', 'Batavia', NULL, NULL, false, '1680-08-01', NULL, 1293, 'van Goens aboard the HUIS TE MERWEDE. The Cape was passed by on 23-05-1680.');
INSERT INTO "voyages" VALUES (5741, '', 4, '', 'TERNATE', 'Willem Kemp', 1014, 'pinas', '1668', NULL, NULL, 'A', 'A', '1680-03-15', 'Batavia', NULL, NULL, false, '1680-09-23', 'Texel', 1352, NULL);
INSERT INTO "voyages" VALUES (5742, '', 3, '', 'WAPEN VAN ALKMAAR', 'Marten Pit?', 892, 'pinas', '1671', NULL, NULL, 'E', 'A', '1680-11-29', 'Batavia', '1681-02-14', '1681-03-28', true, '1681-07-24', 'Texel', 1368, 'First return fleet (5742-5745) under command of Rijklof van Goens Junior aboard the BURCHT VAN LEIDEN (5744) and Jakob Geus aboard the CHINA (5743). They were ordered to wait at the Cape until 30-03-1681 for the second return fleet (see below); only the HUIS TE ZILVERSTEIN (5748) succeeded in joining the fleet in time.');
INSERT INTO "voyages" VALUES (5743, '', 1, '', 'CHINA', NULL, 1124, NULL, '1676', NULL, NULL, 'A', 'A', '1680-11-29', 'Batavia', '1681-02-14', '1681-03-28', true, '1681-07-24', 'Texel', 1345, 'Aboard the CHINA was Jakob Geus, vice-commandeur of the return fleet.');
INSERT INTO "voyages" VALUES (5744, '', 4, '', 'BURCHT VAN LEIDEN', NULL, 1040, NULL, '1667', NULL, NULL, 'A', 'Z', '1680-11-29', 'Batavia', '1681-02-14', '1681-03-28', true, '1681-07-24', NULL, 1370, 'Aboard the BURCHT VAN LEIDEN was Rijklof van Goens Junior, commandeur of the return fleet.');
INSERT INTO "voyages" VALUES (5745, '', 4, '', 'PRINS WILLEM HENDRIK', 'Kornelis de Keizer or Kornelis Mol', 1094, NULL, '1668', NULL, NULL, 'Z', 'Z', '1680-11-29', 'Batavia', '1681-02-14', '1681-03-28', true, '1681-05-01', NULL, 1365, NULL);
INSERT INTO "voyages" VALUES (5746, '', 2, '', 'BLAUWE HULK', 'Jan Jansz. Laman', 744, 'pinas', '1673', NULL, NULL, 'E', 'H', '1680-12-23', 'Batavia', '1681-04-04', '1681-04-30', true, '1681-06-01', NULL, 1336, 'Second return fleet (5746-5748) under command of Huibert Barendsz. Gruit aboard the EILAND MAURITIUS (5747). The 15 passengers aboard the BLAUWE HULK included 11 imprisoned criminals.');
INSERT INTO "voyages" VALUES (5747, '', 2, '', 'EILAND MAURITIUS', 'Huibert Barendsz. Gruit', 756, 'pinas', '1672', NULL, NULL, 'D', 'R', '1680-12-23', 'Batavia', '1681-04-04', '1681-04-30', true, '1681-06-01', NULL, 1346, 'The 12 passengers included 8 imprisoned criminals. Aboard the EILAND MAURITIUS was Huibert Barendsz. Gruit, commandeur of the return fleet.');
INSERT INTO "voyages" VALUES (5748, '', 2, '', 'HUIS TE ZILVERSTEIN', 'Karsten de Gilde', 1017, NULL, '1674', NULL, NULL, 'A', 'A', '1680-12-23', 'Batavia', '1681-03-21', '1681-03-28', true, '1681-07-24', 'Texel', 1393, 'The 12 passengers included 11 imprisoned criminals. The HUIS TE ZILVERSTEIN joined the return fleet of 29-11-1680 at the Cape.');
INSERT INTO "voyages" VALUES (5749, '', 3, '', 'HENDRIK MAURITS', NULL, 1194, NULL, '1673', NULL, NULL, 'Z', 'Z', '1681-01-15', 'Ceylon', '1681-03-29', '1681-04-30', true, '1681-08-25', NULL, 1386, NULL);
INSERT INTO "voyages" VALUES (5750, '', 4, '', 'OOSTENBURG', 'Kornelis van Rooien', 840, 'pinas? fluit?', '1667', NULL, NULL, 'A', 'A', '1681-01-15', 'Ceylon', '1681-04-05', '1681-04-30', true, '1681-08-25', 'Texel', 1351, NULL);
INSERT INTO "voyages" VALUES (5751, '', 1, '', 'JAVA', 'Jan Wagemant', 762, 'pinas', '1678', NULL, NULL, 'A', 'A', '1681-02-13', 'Batavia', '1681-05-15', '1681-05-28', true, '1681-09-27', NULL, 1396, 'Third return fleet (5751-5752). The master died at the Cape.');
INSERT INTO "voyages" VALUES (5752, '', 5, '', 'VRIJE ZEE', 'Kornelis Klaasz. Sman', 846, 'pinas', '1667', NULL, NULL, 'D', 'A', '1681-02-13', 'Batavia', '1681-05-08', '1681-05-28', true, '1681-09-27', 'Texel', 1381, 'Acc. to Daghregister 168011: cargo of 605,705.');
INSERT INTO "voyages" VALUES (5753, '', 2, '', 'GELE BEER', 'Gerrit van Leeuwen', 412, 'fluit', NULL, '1677', NULL, 'A', 'Z', '1681-04-30', 'Batavia', NULL, NULL, true, '1681-11-07', NULL, 1360, 'Fourth return fleet (5753-5754). 
INSERT INTO "voyages" VALUES (5754, '', 1, '', 'SPAARNWOUDE', 'Bruin Jansz.', 480, 'fluit', '1676', NULL, NULL, 'A', 'A', '1681-04-30', 'Batavia', NULL, NULL, true, '1681-11-07', 'Texel', 1339, 'Jan Wittebol is also mentioned as master.');
INSERT INTO "voyages" VALUES (5755, '', 3, '', 'AFRIKA', 'Maurits Jakobsz. van Eik', 1100, NULL, '1673', NULL, NULL, 'R', 'A', '1681-11-26', 'Batavia', '1682-02-16', '1682-04-28', true, '1682-08-30', 'Goeree', 1397, 'First return fleet (5755-5757) under command of Rijklof van Goens Senior aboard the LAND VAN SCHOUWEN(5757). At the Cape the second return fleet of 20-12-1681, the ships of 20-01-1682 from Ceylon, and the BURCHT VAN LEIDEN (5763) joined this fleet; Leendert Maas, master of the LAND VAN SCHOUWEN, became vice-commandeur and embarked on the HOLLANDSE TUIN (5758).');
INSERT INTO "voyages" VALUES (5756, '', 3, '', 'POSTHOORN', 'Dominikus van Geine', 60, 'bootje', NULL, '1671', NULL, 'Z', 'A', '1681-11-26', 'Batavia', '1682-02-15', '1682-04-28', true, '1682-08-29', NULL, 1338, NULL);
INSERT INTO "voyages" VALUES (5757, '', 2, '', 'LAND VAN SCHOUWEN', 'Leendert Maas', 1140, NULL, '1676', NULL, NULL, 'Z', 'A', '1681-11-26', 'Batavia', '1682-02-16', '1682-04-28', true, '1682-08-29', 'Texel', 1404, 'aboard the HOLLANDSE TUIN.');
INSERT INTO "voyages" VALUES (5758, '', 5, '', 'HOLLANDSE TUIN', 'Adriaan Sleutel', 1210, NULL, '1665', NULL, NULL, 'A', 'Z', '1681-12-20', 'Batavia', '1682-04-04', '1682-04-28', true, '1682-06-01', NULL, 1378, 'storm off Cape Agulhas. It joined the return fleet of 26-11-1681 at the Cape. At the Cape vice-commandeur Leendert Maas embarked on the HOLLANDSE TUIN (See also 5757).');
INSERT INTO "voyages" VALUES (5759, '', 5, '', 'VRIJHEID', 'Jakob Valk', 1210, NULL, '1666', NULL, NULL, 'A', 'Z', '1681-12-20', 'Batavia', '1682-03-25', '1682-04-28', true, '1682-08-30', NULL, 1385, NULL);
INSERT INTO "voyages" VALUES (5760, '', 1, '', 'COEVORDEN', NULL, 820, NULL, '1674', NULL, NULL, 'A', 'A', '1682-01-20', 'Ceylon', '1682-04-02', '1682-04-28', true, '1682-08-29', NULL, 1301, 'Via Malabar.');
INSERT INTO "voyages" VALUES (5761, '', 2, '', 'KORTGENE', NULL, 1139, NULL, '1675', NULL, NULL, 'Z', 'A', '1682-01-20', 'Ceylon', '1682-04-05', '1682-04-28', true, '1682-08-31', NULL, 1375, NULL);
INSERT INTO "voyages" VALUES (5762, '', 1, '', 'WESTERAMSTEL', NULL, 480, 'fluit', '1676', NULL, NULL, 'A', 'A', '1682-01-20', 'Ceylon', '1682-04-05', '1682-04-28', true, '1682-08-30', NULL, 1330, 'The ship from Ceylon (5760-5762) joined the return fleet of 26-11-1681 at the Cape.Acc. to Daghregister 1681 the WESTERAMSTEL arrived on 15-04-1682 at the Cape.');
INSERT INTO "voyages" VALUES (5763, '', 5, '', 'BURCHT VAN LEIDEN', NULL, 1040, NULL, '1667', NULL, NULL, 'A', NULL, '1682-04-28', 'The Cape', '1682-04-28', NULL, true, '1682-06-01', NULL, 1421, 'Departed from the Cape with the return fleet of 26-11-1681. According to K.A. 1143, fol. 808 the ship left the Cape on 28-08-1682 with a cargo of 425,315.');
INSERT INTO "voyages" VALUES (5764, '', 2, '', 'CHINA', 'Pieter van den Berg', 1124, NULL, '1676', NULL, NULL, 'A', 'A', '1683-01-22', 'Ceylon', '1683-04-13', '1683-06-01', true, '1683-09-26', 'Texel', 1423, 'According to Hudde 10 the crew of the CHINA consisted of 110 seafarers and 37 soldiers. 
INSERT INTO "voyages" VALUES (5765, '', 4, '', 'HENDRIK MAURITS', 'Evert van Bruggen', 1194, NULL, '1673', NULL, NULL, 'Z', 'Z', '1683-01-22', 'Ceylon', '1683-04-08', '1683-06-01', true, '1683-08-01', NULL, 1431, NULL);
INSERT INTO "voyages" VALUES (5766, '', 1, '', 'HUIS TE KRONENBURG', 'Leendert Laurensz.', 700, 'fluit', '1674', NULL, NULL, 'A', 'A', '1683-01-22', 'Ceylon', '1683-04-08', '1683-06-01', true, '1683-09-25', 'Texel', 1304, 'According to Coolhaas IV the ship departed on 06-06-1683 from the Cape. Acc. to Hudde 10 the crew consisted of 86 seafarers and 18 soldiers.');
INSERT INTO "voyages" VALUES (5767, '', 1, '', 'STRIJEN', 'Adriaan van der Werf', 634, 'fluit', '1676', NULL, NULL, 'R', 'E', '1683-02-25', 'Batavia', '1683-06-11', '1683-07-06', true, '1683-09-01', NULL, 1347, 'Return fleet (5767-5774) under command of Hendrik van Oudshoom aboard the TIDORE (5774). The STRIJEN waited for the fleet of 27-02-1683 in Sunda Strait. Originally the WEST-BROEK (5779) and the HUIS TE SPIJK (5777) also belonged to this fleet, but they had to return to Batavia because of leakage.');
INSERT INTO "voyages" VALUES (5768, '', 4, '', 'AZIE', 'Jakob Dirksz. Jaarsma', 1140, NULL, '1671', NULL, NULL, 'A', 'A', '1683-02-27', 'Batavia', '1683-06-11', '1683-07-06', true, NULL, NULL, 1420, 'The AZIE was wrecked on 17''N.');
INSERT INTO "voyages" VALUES (5769, '', 3, '', 'EUROPA', 'Michiel van der Buis or Gijsbert Kraaienstein', 1140, NULL, '1671', NULL, NULL, 'A', 'A', '1683-02-27', 'Batavia', '1683-11-25', '1684-05-01', true, '1684-08-24', NULL, 1415, 'damaged by storms the EUROPA had to call at Mauritius (08-05 till 29-09-1683) and for more than five months at the Cape, where it was repaired. It waited for the return fleet of 26-12-1683.');
INSERT INTO "voyages" VALUES (5770, '', 1, '', 'GOUDESTEIN V', 'Beier is', 843, 'pinas', '1679', NULL, NULL, 'A', 'A', '1683-02-27', 'Batavia', '1683-06-07', '1683-07-06', true, '1683-10-26', 'Texel', 1418, NULL);
INSERT INTO "voyages" VALUES (5771, '', 2, '', 'JAVA', 'Sieuwert Roos', 762, 'pinas', '1678', NULL, NULL, 'A', 'H', '1683-02-27', 'Batavia', NULL, NULL, false, '1683-10-01', NULL, 1427, NULL);
INSERT INTO "voyages" VALUES (5772, '', 1, '', 'SCHIEBROEK', 'Kornelis Valkens', 250, 'jachtje', '1681', NULL, NULL, 'Z', 'Z', '1683-02-27', 'Batavia', '1683-06-13', '1683-07-06', true, '1683-10-26', NULL, 1432, NULL);
INSERT INTO "voyages" VALUES (5773, '', 2, '', 'SCHIELAND', 'Pieter Lakens', 710, NULL, '1674', NULL, NULL, 'D', 'Z', '1683-02-27', 'Batavia', '1683-06-07', '1683-07-06', true, '1683-10-26', NULL, 1413, NULL);
INSERT INTO "voyages" VALUES (5774, '', 5, '', 'TIDORE', 'Jakob Been', 1094, NULL, '1668', NULL, NULL, 'Z', 'Z', '1683-02-27', 'Batavia', NULL, NULL, false, NULL, NULL, 1412, 'Ameland.');
INSERT INTO "voyages" VALUES (5775, '', 2, '', 'WESTERAMSTEL', NULL, 480, 'fluit', '1676', NULL, NULL, 'A', NULL, '1683-07-06', 'The Cape', '1683-07-06', NULL, true, NULL, NULL, 1448, 'Departed from the Cape with the return fleet of 27-02-1683. Date of arrival in the Republic unknown.');
INSERT INTO "voyages" VALUES (5776, '', 1, '', 'ADRICHEM', 'Reinier Schouten', 486, 'fluit', '1680', NULL, NULL, 'A', 'A', '1683-12-26', 'Batavia', '1684-04-02', '1684-05-01', true, '1684-08-24', 'Texel', 1422, 'command of Steven Schorer aboard the ADRICHEM. Via Algoa Bay (17 till +/- 20-03) and Saldanha Bay (24-03 till 01-04-1684). At the Cape the EUROPA of the return fleet of 27-02-1683, the PURMER (5789), the EM-MENES (5790), and the ships of 16-01-1684 from Ceylon joined this fleet.');
INSERT INTO "voyages" VALUES (5777, '', 1, '', 'HUIS TE SPIJK', 'Jan van Dordrecht', 700, 'fluit', '1674', NULL, NULL, 'A', 'A', '1683-12-26', 'Batavia', '1684-04-02', '1684-05-01', true, '1684-08-23', 'Texel', 1302, 'The master was also called Jan van Dorre. Original departure of the HUIS TE SPIJK and the WESTBROEK (5779) on 25-02-1683. Both ships had to return to Batavia because of leakage, 3004-1683 (see also 5767).');
INSERT INTO "voyages" VALUES (5778, '', 1, '', 'STAVENISSE', 'Marinus Willemsz. Stoop', 544, 'fluit', '1681', NULL, NULL, 'Z', 'Z', '1683-12-26', 'Batavia', '1684-04-02', '1684-05-01', true, '1684-08-24', NULL, 1440, NULL);
INSERT INTO "voyages" VALUES (5779, '', 1, '', 'WESTBROEK', 'Jan Gelein', 253, 'fluit? kat?', '1681', NULL, NULL, 'A', 'R', '1683-12-26', 'Batavia', '1684-04-02', '1684-05-01', true, '1684-08-24', NULL, 1429, 'See 5767 and 5777.');
INSERT INTO "voyages" VALUES (5780, '', 3, '', 'LAND VAN SCHOUWEN', 'Jan van Velzen', 1140, NULL, '1676', NULL, NULL, 'Z', 'A', '1684-01-16', 'Ceylon', '1684-03-15', '1684-05-01', true, '1684-08-23', NULL, 1447, 'toK.A. 1271 the crew consisted of 134 men.');
