INSERT INTO "voyages" VALUES (5894, '', 3, '', 'EENHOORN', 'Pieter van Ede', 749, NULL, '1683', NULL, NULL, 'Z', 'Z', '1692-01-30', 'Batavia', '1692-05-27', '1692-06-26', true, '1692-10-30', 'Rammekens', 1596, 'WATERLAND (5899). At the Cape the fleet of 28-02-1692 from Ceylon and the MOERKAPEL (5905) joined this fleet. The EENHOORN sailed via Saldanha Bay (21 till 27-05-1692). According to K.A. 4007 its crew consisted of 146 men.');
INSERT INTO "voyages" VALUES (5895, '', 4, '', 'RIDDERSCHAP VAN HOLLAND', 'Jan Ammansz.', 1138, NULL, '1681', NULL, NULL, 'A', 'E', '1692-01-30', 'Batavia', '1692-05-27', '1692-06-26', true, '1692-10-14', 'Vlissingen', 1587, 'Acc. to K.A. 4007 the crew consisted of 184 men. Via Saldanha Bay (01 till 27-05-1692).');
INSERT INTO "voyages" VALUES (5896, '', 1, '', 'SCHOONDIJK', 'Lambert Klein', 759, NULL, '1688', NULL, NULL, 'Z', 'D', '1692-01-30', 'Batavia', '1692-05-27', '1692-06-26', true, '1692-10-15', 'Veere', 1585, 'Acc. to K.A. 4007 the crew consisted of 146 men. Via Saldanha Bay (21 till 27-05-1692).');
