INSERT INTO "voyages" VALUES (5898, '', 2, '', 'WAALSTROOM', 'Klaas Koman', 648, 'pinas', '1684', NULL, NULL, 'A', 'H', '1692-01-30', 'Batavia', NULL, NULL, true, '1692-10-01', 'Texel', 1582, 'Acc. to K.A. 4390a the master was Pieter Pietersz. The ship probably did not call at the Cape.');
INSERT INTO "voyages" VALUES (5899, '', 3, '', 'WATERLAND', 'Willem Kemp', 1138, NULL, '1683', NULL, NULL, 'A', 'A', '1692-01-30', 'Batavia', '1692-05-27', '1692-06-26', true, NULL, NULL, 1601, 'consisted of 184 men. The WATERLAND sailed via Saldanha Bay (01 till 21-05-1692). On 12-09-1692 the ship was attacked by the French and sunk with all hands at 45''N.');
INSERT INTO "voyages" VALUES (5900, '', 1, '', 'GOEDE HOOP', 'Anthonie Pronk', 1177, 'pinas', '1688', NULL, NULL, 'A', 'A', '1692-02-28', 'Ceylon', '1692-05-07', NULL, true, NULL, NULL, 1591, 'fleet of 30-01-1692 at the Cape. The GOEDE HOOP was wrecked at the Cape, 05-06-1692; from the cargo 562,488 was saved and carried to patria aboard the EMMENES (5911).');
