INSERT INTO "voyages" VALUES (5909, '', 1, '', 'REIGERSDAAL', 'Adriaansz.', 818, 'pinas', '1691', NULL, NULL, 'A', 'Z', '1692-12-11', 'Batavia', '1693-03-20', '1693-04-17', true, '1693-08-07', 'Rammekens', 1631, 'Acc. to K.A. 4007 the crew consisted of 120 men.');
