INSERT INTO "voyages" VALUES (5911, '', 3, '', 'EMMENES', NULL, 297, 'fluit? kat?', '1682', NULL, NULL, 'A', 'A', '1693-01-07', 'Batavia', '1693-03-31', '1693-06-12', true, '1693-10-02', 'Veere', 1608, 'was only bound for the Cape, but it had to carry the cargo saved from the GOEDE HOOP (5900) to patria. At the Cape the ship joined the second return fleet of 0802-1693.');
