INSERT INTO "voyages" VALUES (8044, '', 2, '', 'MERENBERG', 'Herman Jakob Hulleman', 850, NULL, '1773', NULL, NULL, 'H', 'E', '1779-10-27', 'Batavia', '1780-01-12', '1780-01-25', true, '1780-04-17', 'Texel', 4339, 'The 6 passengers included one female slave.');
INSERT INTO "voyages" VALUES (8045, '', 2, '', 'MENTOR', 'Johan de Korte', 1150, NULL, '1774', NULL, NULL, 'A', NULL, '1779-10-27', 'Batavia', NULL, NULL, true, NULL, NULL, 4303, 'On 05-01-1780 the MENTOR ran on the reef off Cape Agulhas in a heavy storm and was wrecked.');
INSERT INTO "voyages" VALUES (8046, '', 1, '', 'STAVENISSE', 'Pieter Kardon', 1150, NULL, '1772', NULL, NULL, 'Z', 'Z', '1779-10-27', 'Batavia', '1780-01-12', '1780-02-17', true, '1780-06-06', 'Rammekens', 4208, NULL);
