INSERT INTO "voyages" VALUES (8049, '', 2, '', 'BLOK', 'Jakob de Lange', 1150, NULL, '1774', NULL, NULL, 'A', 'Z', '1779-12-17', 'China', '1780-03-20', '1170-04-08', true, '1780-07-25', 'Rammekens', 4327, 'the VOC (see 4408/8101).');
INSERT INTO "voyages" VALUES (8050, '', 1, '', 'ZEEPLOEG', 'Jan Stil', 1150, NULL, '1777', NULL, NULL, 'A', 'A', '1779-12-17', 'China', NULL, NULL, true, NULL, NULL, 4338, 'Sailing between China and the Cape the ZEEPLOEG was wrecked.');
