INSERT INTO "voyages" VALUES (8053, '', 3, '', 'VOORBERG', 'Johan van Voorst', 1150, NULL, '1770', NULL, NULL, 'A', 'A', '1780-01-18', 'China', '1780-03-24', '1780-04-08', true, '1780-07-25', 'Texel', 4336, NULL);
INSERT INTO "voyages" VALUES (8054, '', 3, '', 'LAM', 'Jan Everwijk Drillinger', 850, NULL, '1769', NULL, NULL, 'D', 'Z', '1780-01-21', 'Bengal', '1780-04-08', '1780-04-30', true, '1780-09-02', 'Rammekens', 4325, NULL);
INSERT INTO "voyages" VALUES (8055, '', 1, '', 'VROUWE EVERHARDINA', 'Segon', 850, NULL, '1776', NULL, NULL, 'D', 'Z', '1780-01-26', 'Batavia', '1780-04-21', '1780-06-09', true, '1780-10-02', 'Rammekens', 4313, '09-06-1780 was the second and final date of departure from the Cape; an earlier attempt to set out had failed.');
INSERT INTO "voyages" VALUES (8056, '', 2, '', 'ZEEPAARD', 'Jan Willem Nieder', 1150, NULL, '1774', NULL, NULL, 'A', 'A', '1780-01-26', 'Batavia', '1780-04-09', '1780-04-30', true, '1780-08-31', 'Texel', 4337, NULL);
INSERT INTO "voyages" VALUES (8057, '', 6, '', 'HUIS OM', 'Willem Udemans jr.', 1150, NULL, '1761', NULL, NULL, 'Z', 'Z', '1780-02-09', 'Ceylon', '1780-04-05', '1780-04-30', true, '1780-09-11', 'Rammekens', 4342, NULL);
INSERT INTO "voyages" VALUES (8058, '', 2, '', 'GANGES', 'Hillert Volkers', 1150, NULL, '1775', NULL, NULL, 'A', 'A', '1780-02-23', 'Ceylon', '1780-05-19', '1780-06-09', true, '1780-10-06', 'Texel', 4341, NULL);
INSERT INTO "voyages" VALUES (8059, '', 3, '', 'HERSTELDER', 'Frederik Godert Wever', 600, 'fregat', NULL, '1772', NULL, 'C', 'A', '1780-03-12', 'The Cape', '1780-03-12', NULL, true, '1780-06-29', 'Texel', 4354, 'According to K.A. 4390a Abraham Tim was master of the HERSTELDER.');
INSERT INTO "voyages" VALUES (8060, '', 4, '', 'KATWIJK AAN DEN RIJN', 'Jan Jansz. Laurits', 750, 'hoeker', NULL, '1774', NULL, 'A', 'A', '1780-04-08', 'The Cape', '1780-04-08', NULL, true, '1780-07-24', 'Texel', 4355, NULL);
INSERT INTO "voyages" VALUES (8061, '', 2, '', 'TRITON', 'Gottlieb Mulder', 1150, NULL, '1773', NULL, NULL, 'A', 'A', '1780-10-09', 'Coromandel', '1781-01-08', '1781-02-22', true, '1782-11-11', 'Texel', 4311, 'The TRITON called at Trondheim; arrival on 04-07-1781.');
INSERT INTO "voyages" VALUES (8062, '', 5, '', 'ANTHOINETTA KOENRARDINA', 'Kornelis Philippus Hoek', 880, NULL, '1765', NULL, NULL, 'D', 'H', '1780-11-01', 'Batavia', '1781-01-17', '1781-01-31', true, '1781-04-27', 'Cadiz', 4348, 'In April, 1781 the VROUWE ANTHOINETTA KOEN-RARDINA was sold to S. Berard at Marseille. Commandeur of the return fleet was Kornelis Kornelissen, master of the BEHEMOTH (8063).');
INSERT INTO "voyages" VALUES (8063, '', 2, '', 'BEHEMOTH', 'Kornelis Kornelissen', 1150, NULL, '1775', NULL, NULL, 'A', 'A', '1780-11-01', 'Batavia', '1781-02-17', '1781-03-03', true, '1781-06-08', 'Cadiz', 4357, 'The master of the BEHEMOTH, Kornelis Kornelissen, was Commandeur of the return fleet. At Marseille the ship was sold to S. Berard.');
INSERT INTO "voyages" VALUES (8064, '', 1, '', 'CONCORDIA', 'Evert Wesseling', 1150, NULL, '1773', NULL, NULL, 'Z', 'A', '1780-11-01', 'Batavia', '1781-02-10', '1781-03-03', true, NULL, NULL, 4269, 'The 13 passengers included 4 slaves. On 24-05-1781 the CONCORDIA was sunk by an English privateer off the Azores.');
INSERT INTO "voyages" VALUES (8065, '', 5, '', 'OUD HAARLEM', 'Arie Kikkert', 1150, NULL, '1768', NULL, NULL, 'A', 'Z', '1780-11-01', 'Batavia', '1781-01-17', '1781-02-22', true, '1782-11-14', 'Rammekens', 4351, 'passengers included one slave. The OUD HAARLEM called at Trondheim; arrival on 04-07-1781.');
INSERT INTO "voyages" VALUES (8066, '', 6, '', 'VREEBURG', 'Adriaan van Katersveld', 850, NULL, '1764', NULL, NULL, 'D', 'D', '1780-11-01', 'Batavia', '1781-02-19', '1781-03-03', true, '1781-06-08', 'Cadiz', 4319, 'was sold to S. Berard.');
INSERT INTO "voyages" VALUES (8067, '', 3, '', 'BEEKVLIET', 'N.Ketel Jakobsz.', 850, NULL, '1770', NULL, NULL, 'A', 'Z', '1780-11-12', 'Batavia', '1781-02-06', '1781-03-03', true, '1781-06-08', 'Cadiz', 4362, 'The 9 passengers included one slave. At Marseille the BEEKVLIET was sold to S. Berard.');
INSERT INTO "voyages" VALUES (8068, '', 6, '', '''T LOO', 'Jan van der Sloot', 1150, NULL, '1768', NULL, NULL, 'A', 'A', '1780-11-20', 'Ceylon', '1781-01-17', '1781-02-22', true, '1782-11-14', 'Texel', 4353, 'The ''T LOO called at Trondheim; arrival on 04-07-1781. At the arrival at Texel, Jan Frederik Zegert probably was master.');
INSERT INTO "voyages" VALUES (8069, '', 2, '', 'DIANA', 'Pierre Frederik Riebe', 850, NULL, '1774', NULL, NULL, 'R', 'A', '1780-12-01', 'Bengal', '1781-02-14', '1781-03-03', true, '1781-06-08', 'Cadiz', 4343, 'At Marseille the DIANA was sold to S. Berard.');
INSERT INTO "voyages" VALUES (8070, '', 4, '', 'POPKENSBURG', 'Jochem Bank', 880, NULL, '1763', NULL, NULL, 'Z', 'H', '1780-12-01', 'Bengal', '1781-02-10', '1781-03-03', true, '1781-06-08', 'Cadiz', 4361, 'At Marseille the POPKENSBURG was sold to S. Berard.');
INSERT INTO "voyages" VALUES (8071, '', 4, '', 'HONKOOP', NULL, 1150, NULL, '1770', NULL, NULL, 'A', 'Z', '1781-01-15', 'China', '1781-03-31', '1781-06-13', true, NULL, NULL, 4321, 'the HONKOOP was taken by the English in Saldanha Bay. See also the SENHOR DE BONFIM E SANCTA MARIA (8083).');
INSERT INTO "voyages" VALUES (8072, '', 3, '', 'HOOGKARSPEL', NULL, 850, NULL, '1771', NULL, NULL, 'E', 'D', '1781-01-15', 'China', '1781-03-31', '1781-05-13', true, NULL, NULL, 4352, 'On 21-07-1781 the HOOGKARSPEL was captured by the English in Saldanha Bay. See also the SENHOR DE BONFIM E SANCTA MARIA (8083).');
INSERT INTO "voyages" VALUES (8073, '', 1, '', 'MIDDELBURG', 'Justus van Gennep', 1150, NULL, '1775', NULL, NULL, 'Z', 'A', '1781-01-15', 'China', '1781-03-31', '1781-05-13', true, NULL, NULL, 4360, 'On 21-07-1781 the MIDDELBURG was burnt down in Saldanha Bay. See also the SENHOR DE BONFIM E SANCTA MARIA (8083).');
INSERT INTO "voyages" VALUES (8074, '', 1, '', 'PAREL', NULL, 1150, NULL, '1778', NULL, NULL, 'A', 'A', '1781-01-15', 'China', '1781-04-01', '1781-05-13', true, NULL, NULL, 4359, 'by the English in Saldanha Bay. See also the SENHOR DE BONFIM E SANCTA MARIA (8083).');
INSERT INTO "voyages" VALUES (8075, '', 2, '', 'DANKBAARHEID', 'Hendrik Steedsel', 850, NULL, '1772', NULL, NULL, 'R', 'R', '1781-01-20', 'Bengal', '1781-04-25', '1781-05-13', true, NULL, NULL, 4265, 'On 21-07-1781 the DANKBAARHEID was taken by the English in Saldanha Bay.');
INSERT INTO "voyages" VALUES (8076, '', 3, '', 'AMSTERDAM', 'Jan Willem Mekau', 1150, NULL, '1772', NULL, NULL, 'A', 'Z', '1781-02-13', 'Ceylon', '1781-05-03', '1781-05-17', true, NULL, NULL, 4366, 'On 17-05-1781 the Company''s authorities at the Cape sent the AMSTERDAM to Mauritius to assist the French; three and a half weeks later the ship returned to the Cape, 10-08-1781. Early in 1784 the AMSTERDAM was laid up at the Cape.');
INSERT INTO "voyages" VALUES (8077, '', 2, '', 'BATAVIA', 'Bartholomeus Veau', 850, NULL, '1773', NULL, NULL, 'E', 'R', '1781-02-15', 'Batavia', '1781-05-04', '1781-05-17', true, NULL, NULL, 4368, 'On 17-05-1781 the BATAVIA departed from the Cape to sail to Mauritius. The ship was severely damaged during a storm, and had to return to the Cape, 10-08-1781. Early in 1783 the BATAVIA was sold to the French.');
INSERT INTO "voyages" VALUES (8078, '', 3, '', 'INDIAAN', 'Gerrit Opdal', 1150, NULL, '1773', NULL, NULL, 'A', 'A', '1781-02-15', 'Batavia', '1781-05-28', '1781-06-01', true, NULL, NULL, 4358, 'In June, 1781, the INDIAAN sailed to the Hout Bay. Later on the ship departed from the Cape to sail to Mauritius, but it was missing since.');
INSERT INTO "voyages" VALUES (8079, '', 3, '', 'NOORDBEEK', NULL, 850, 'fluit', NULL, '1773', NULL, 'Z', 'Z', '1781-02-22', 'The Cape', '1781-02-22', NULL, true, NULL, NULL, 4322, 'On 26-06-1781 the NOORDBEEK was captured by the English and taken to Plymouth.');
INSERT INTO "voyages" VALUES (8080, '', 4, '', 'GROENENDAAL', NULL, 1150, NULL, '1770', NULL, NULL, 'A', NULL, '1781-05-01', 'Batavia', NULL, NULL, true, NULL, NULL, 4372, 'Sailing to patria the GROENENDAAL was seized by the English, probably in 1782.');
INSERT INTO "voyages" VALUES (8081, '', 2, '', 'HUTS TE SPIJK', 'Christiaan van Veerden', 1150, NULL, '1773', NULL, NULL, 'A', 'A', '1782-03-14', 'Ceylon', '1782-07-14', NULL, true, NULL, NULL, 4292, '03-09-1782; arrival at the Cape on 06-09-1782. The ship never returned to patria. In 1784 it made at least one voyage to Mauritius and back to the Cape. Eventually the HUIS TE SPIJK was laid up there, in 1786.');
INSERT INTO "voyages" VALUES (8082, '', 1, '', 'ZWALUW', 'Jan Jansz. Laurits', NULL, 'logger', NULL, NULL, NULL, NULL, NULL, '1782-04-20', 'The Cape', '1782-04-20', NULL, true, '1782-06-01', 'Lorient', 4391, NULL);
INSERT INTO "voyages" VALUES (8083, '', 1, '', 'SENHOR DE BONFIM E SANCTA MARIA', 'Philippo Nery da Silva', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1782-05-28', 'The Cape', '1782-05-28', NULL, true, NULL, NULL, NULL, 'flew the Portuguese flag. The ship had arrived at the Cape on 12-04-1782. There it was contracted by the V.O.C. According to K.A. 4276, fol. 373 the ship had to sail to Lisbon or to Amsterdam. Its cargo consisted of China tea, carried to the Cape by the HONKOOP (8071), the HOOGKARSPEL (8072), the MIDDELBURG (8073), and the PAREL (8074); in July, 1781, these ships had been captured or burnt down by the English in Saldanha Bay.');
INSERT INTO "voyages" VALUES (8084, '', 1, '', 'L''ACTIVE', NULL, 250, NULL, NULL, NULL, NULL, NULL, 'A', '1783-01-01', 'The Cape', '1783-01-01', NULL, true, '1783-08-03', 'Texel', NULL, NULL);
INSERT INTO "voyages" VALUES (8085, '', 1, '', 'L''ANGELIQUE BENECH', 'De Strale', 250, NULL, NULL, NULL, NULL, NULL, 'A', '1783-03-30', 'The Cape', '1783-03-30', NULL, true, '1783-08-03', 'Texel', 4401, 'The ANGELIQUE BENECH flew the Imperial (i.e. Austrian) flag. According to K.A. 4287 the ship was bound for Lorient.');
INSERT INTO "voyages" VALUES (8086, '', 1, '', 'KROONPRINS VAN PRUISEN', 'Dirk Huizing', 760, NULL, NULL, NULL, NULL, NULL, 'A', '1783-04-12', 'The Cape', '1783-04-12', NULL, true, '1783-08-03', 'Texel', 4404, 'The KROONPRINS VAN PRUISEN flew the Prussian flag.');
INSERT INTO "voyages" VALUES (8087, '', 1, '', 'BERLIN', 'Arie van der Giessen', 898, 'fluit', NULL, NULL, NULL, 'D', 'A', '1783-08-27', 'Batavia', '1783-11-11', '1783-12-23', true, '1784-04-11', 'Texel', 4400, 'The BERLIN flew the Prussian flag. After the return of the ship to patria its name was altered into DORDRECHT (4458/8148).');
INSERT INTO "voyages" VALUES (8088, '', 1, '', 'FRIEDRICH DER GROSSE', 'Simon Koter', 678, NULL, NULL, NULL, NULL, NULL, 'A', '1783-08-27', 'Batavia', '1783-10-29', '1783-12-23', true, '1784-04-08', 'Texel', 4403, 'The FRIEDRICH DER GROSSE flew the Prussian flag.');
INSERT INTO "voyages" VALUES (8089, '', 1, '', 'MAGDEBURG', 'Jan Nieuwenhuis', NULL, NULL, NULL, NULL, NULL, NULL, 'A', '1783-10-16', 'Batavia', '1783-12-17', '1783-12-28', true, '1784-04-25', 'Texel', 4412, 'The MAGDEBURG flew the Prussian flag.');
INSERT INTO "voyages" VALUES (8090, '', 1, '', 'FACTOR', 'Jan Jochem Milfaart', 320, NULL, NULL, NULL, NULL, NULL, 'Z', '1783-10-28', 'The Cape', '1783-10-28', NULL, true, '1784-01-18', 'Rammekens', 4416, NULL);
INSERT INTO "voyages" VALUES (8091, '', 1, '', 'SLOT TER HOGE', 'Lambert Arnout Hallman', 1150, NULL, '1776', NULL, NULL, 'Z', 'Z', '1783-11-06', 'Batavia', '1784-02-02', '1784-03-20', true, '1784-06-16', 'Rammekens', 4381, 'The 144 men, who departed from Batavia, included one passenger. A mutiny was suppressed between Batavia and the Cape.');
INSERT INTO "voyages" VALUES (8092, '', 1, '', 'SCHOONDERLOO', 'Jakob van den Berg', 880, NULL, '1779', NULL, NULL, 'D', 'D', '1783-11-06', 'Batavia', '1784-01-30', '1784-02-20', true, '1784-06-17', 'Goeree', 4396, NULL);
INSERT INTO "voyages" VALUES (8093, '', 3, '', 'ZEEPAARD', 'Pieter Thijssen jr.', 1150, NULL, '1774', NULL, NULL, 'A', 'A', '1783-11-06', 'Batavia', '1784-02-03', '1784-03-20', true, '1784-06-16', 'Texel', 4398, NULL);
INSERT INTO "voyages" VALUES (8094, '', 1, '', 'DOLFIJN', 'Honore Roux', 397, NULL, NULL, NULL, NULL, NULL, 'A', '1783-11-11', 'Ceylon', '1784-02-04', '1784-03-09', true, '1784-05-31', 'Texel', 4405, 'The DOLFIJN flew the Imperial (i.e. Austrian) flag.');
INSERT INTO "voyages" VALUES (8095, '', 6, '', 'AURICH', 'Pieter Modderman', 850, NULL, NULL, NULL, '1766', 'R', 'E', '1783-11-17', 'Batavia', '1784-02-02', '1784-03-20', true, '1784-06-16', 'Texel', 4407, 'The AURICH flew the Prussian flag. 4407/8095 was the sixth voyage of this ship, which during its preceding voyages was called RIDDERKERK (4297/8032). After the return to patria the ship was renamed RIDDERKERK (4493/-).');
INSERT INTO "voyages" VALUES (8096, '', 2, '', 'JAVA', 'Jan Tromp', 850, NULL, '1775', NULL, NULL, 'E', 'A', '1783-11-17', 'Batavia', '1784-02-17', '1784-03-20', true, '1784-06-16', 'Texel', 4395, 'A mutiny was suppressed between Batavia and the Cape.');
INSERT INTO "voyages" VALUES (8097, '', 4, '', 'HOOP', 'Sijbrand Sax', 800, 'fluit', NULL, NULL, NULL, 'A', 'A', '1783-12-15', 'Batavia', '1784-06-01', NULL, true, NULL, NULL, 4379, 'On 30-06-1784 the HOOP went to pieces off the Cape.');
INSERT INTO "voyages" VALUES (8098, '', 1, '', 'LES DEUX SOEURS', 'Oyer', 582, NULL, NULL, '1781', NULL, 'B', 'Z', '1784-01-15', 'Mauritius', '1784-02-17', '1784-03-20', true, '1784-05-20', 'Rammekens', 4409, 'After the return of the ship to patria its name was altered into TWEE GEZUSTERS (4502/8175).');
INSERT INTO "voyages" VALUES (8099, '', 1, '', 'POTSDAM', 'Bernard Christiaan Muller', 1150, NULL, NULL, NULL, '1780', 'A', 'A', '1784-01-20', 'China', '1784-04-07', '1784-04-26', true, '1784-07-18', 'Texel', 4410, 'The POTSDAM flew the Prussian flag. After the return of the ship to patria its name was altered into SPARENRIJK (4474/8262).');
INSERT INTO "voyages" VALUES (8100, '', 1, '', 'UHARMONIE', NULL, 650, NULL, NULL, NULL, NULL, NULL, 'D', '1784-01-31', 'The Cape', '1784-01-31', NULL, true, '1784-05-06', 'Goeree', 4418, 'L''HARMONIE flew the French flag.');
INSERT INTO "voyages" VALUES (8101, '', 3, '', 'BRESLAU', 'Jan Kornelis Roos', 1150, NULL, NULL, NULL, '1774', 'A', 'Z', '1784-02-02', 'China', '1784-06-02', '1784-07-14', true, NULL, NULL, 4408, '(4327/8049). See also the GANGES (8106).');
INSERT INTO "voyages" VALUES (8102, '', 6, '', 'WILLEM DE VIJFDE', 'Pieter Kardon', 1150, NULL, '1765', NULL, NULL, 'Z', 'Z', '1784-02-08', 'Ceylon', '1784-04-08', '1784-04-26', true, '1784-08-16', 'Rammekens', 4413, NULL);
INSERT INTO "voyages" VALUES (8103, '', 1, '', 'GERECHTIGHEID', 'Johan Frederik Schuts', 1150, NULL, '1779', NULL, NULL, 'A', 'A', '1784-02-09', 'Batavia', '1784-04-15', NULL, true, '1784-08-16', 'Texel', 4411, 'The date of departure from the Cape is unknown.');
INSERT INTO "voyages" VALUES (8104, '', 4, '', 'VOORBERG', 'Abraham Tim', 1150, NULL, '1770', NULL, NULL, 'A', 'E', '1784-02-17', 'Batavia', '1784-05-28', '1784-07-14', true, '1784-11-17', 'Texel', 4397, 'The 119 man, who departed from Batavia, included one passenger. See also the GANGES (8106).');
INSERT INTO "voyages" VALUES (8105, '', 4, '', 'HOLLAND', 'Isaak de Vries', 1150, NULL, '1771', NULL, NULL, 'A', 'H', '1784-02-22', 'Batavia', '1784-05-27', '1784-07-14', true, '1784-11-16', 'Texel', 4394, 'See also the GANGES (8106).');
INSERT INTO "voyages" VALUES (8106, '', 3, '', 'GANGES', 'Jan Paardekoper', 1150, NULL, '1775', NULL, NULL, 'A', 'Z', '1784-02-26', 'Batavia', '1784-06-02', '1784-07-14', true, '1784-11-18', 'Rammekens', 4393, 'The 105 men, who departed from Batavia, included three passengers. Jan Paardekoper, the master of the GANGES, was commandeur of the ships. which sailed from the Cape on 14-07-1784.');
INSERT INTO "voyages" VALUES (8107, '', 1, '', 'PRINZ HEINRICH', 'Laurens Smit', 846, 'fluit', NULL, NULL, NULL, NULL, 'A', '1784-03-07', 'Batavia', '1784-06-09', '1784-08-01', true, '1784-11-27', 'Texel', 4414, 'call at the Cape, but at False Bay. From there it originally departed on 25-07-1784, the next day it returned, however.');
INSERT INTO "voyages" VALUES (8108, '', 3, '', 'MORGENSTER', 'Gerrit Berg', 1150, NULL, '1772', NULL, NULL, 'A', 'A', '1784-03-10', 'Ceylon', '1784-06-02', '1784-07-14', true, '1784-11-17', 'Texel', 4371, 'See also the GANGES (8106). On 29-10-1785 the Heren XV11 decided to lay the MORGENSTER up.');
INSERT INTO "voyages" VALUES (8109, '', 1, '', 'L''ESPERANCE DE LA PAIX', 'Joseph le Naux', 600, NULL, NULL, NULL, NULL, NULL, 'A', '1784-03-23', 'The Cape', '1784-03-23', NULL, true, '1784-06-22', 'Texel', 4421, 'L''ESPERANCE DE LA PAIX flew the French flag.');
INSERT INTO "voyages" VALUES (8110, '', 1, '', 'ROTTERDAMS WELVAREN', 'Kornelis de Wit', 880, NULL, '1780', NULL, NULL, 'R', 'R', '1784-03-30', 'Batavia', '1784-06-02', '1784-07-14', true, '1784-11-15', 'Goeree', 4415, 'See also the GANGES (8106).');
INSERT INTO "voyages" VALUES (8111, '', 1, '', 'LA DAME JEANNE', 'Karel Alm', 400, NULL, NULL, NULL, NULL, NULL, 'Z', '1784-07-23', 'Batavia', '1784-10-30', '1784-12-22', true, '1785-05-05', 'Rammekens', NULL, 'LA DAME JEANNE flew the Swedish flag. In accordance with the conditions of the contract, signed in patria in March, 1783, by the owners of the ship and representatives of the V.O.C., the DAME JEANNE had sailed on its own account from Lorient in France (departure: 18-05-1783) via the Cape (08-10 till 02-11-1783) to Mauritius. There it had officially entered the Company''s service. On 19-05-1784 the ship arrived at Batavia.');
INSERT INTO "voyages" VALUES (8112, '', 1, '', 'LE CONCORDE', 'Klaas Breitholz', 400, NULL, NULL, NULL, NULL, NULL, 'A', '1784-07-25', 'Batavia', '1784-10-23', '1784-12-22', true, '1785-05-04', 'Texel', NULL, 'The CONCORDE flew the Swedish flag, see LA DAME JEANNE (8111). The CONCORDE had sailed on its own account from Lorient in France (departure: 13-04-1783) via the Cape (28-10 till 16-12-1783) to Mauritius. There it had officially entered the Company''s service. On 27-04-1784 the ship arrived at Batavia.');
INSERT INTO "voyages" VALUES (8113, '', 1, '', 'NOIR', 'Gottfried Dahl', 650, NULL, NULL, NULL, NULL, NULL, 'H', '1784-08-12', 'Batavia', '1784-10-23', '1784-12-22', true, '1785-05-02', 'Texel', NULL, 'L''AIGLE NOIR flew the Swedish flag, see LA DAME JEANNE (8111). The AIGLE NOIR had sailed on its own account from Lorient in France (departure: 19-05-1783) via the Cape (31-08 till 03-10-1783) to Mauritius. There it had officially entered the Company''s service. On 10-05-1784 the ship arrived at Batavia.');
INSERT INTO "voyages" VALUES (8114, '', 1, '', 'LA SAINTE THERESE', 'La Fayde de Branchere', NULL, NULL, NULL, NULL, NULL, NULL, 'E', '1784-09-03', 'Batavia', NULL, NULL, true, '1785-04-01', 'Texel', NULL, 'The SAINTE THERESE flew the French flag. The ship probably did not call at the Cape. See LA DAME JEANNE (8111). The SAINTE THERESE had sailed on its own account from Lorient in France (departure: 04-11-1783) via the Cape (arrival: 01-03-1784) to Mauritius. There it had officially entered the Company''s service. On 01-07-1784 the ship arrived at Batavia.');
INSERT INTO "voyages" VALUES (8115, '', 1, '', 'L''EMPEREUR ET ROI', 'Franc Odievre', 760, NULL, NULL, NULL, NULL, NULL, 'R', '1784-09-04', 'Batavia', '1784-10-29', '1784-12-22', true, '1785-04-19', 'Goeree', NULL, '(departure: 17-07-1783), probably without calling at the Cape, to Mauritius. There it had officially entered the Company''s service. On 29-06-1784 the ship arrived at Batavia.');
INSERT INTO "voyages" VALUES (8116, '', 1, '', 'L''ORION', 'Johan George Kinborg', 500, NULL, NULL, NULL, NULL, NULL, 'H', '1784-09-05', 'Batavia', '1785-01-13', '1785-02-09', true, '1785-06-07', 'Texel', NULL, 'till 02-11-1783) to Mauritius. There it had officially entered the Company''s service. On 30-06-1784 the ship arrived at Batavia.');
INSERT INTO "voyages" VALUES (8117, '', 1, '', 'LA COMPTESSE DU NORD', 'Le Vasnier', 840, NULL, NULL, NULL, NULL, NULL, 'D', '1784-09-16', 'Batavia', '1784-11-20', '1785-01-20', true, '1785-05-19', 'Goeree', NULL, 'it had officially entered the Company''s service. On 11-7-1784 the ship arrived at Batavia.');
INSERT INTO "voyages" VALUES (8118, '', 1, '', 'LE JEUNE STANISLAUS', 'Pieter Menard', 550, NULL, NULL, NULL, NULL, NULL, 'R', '1784-10-06', 'Batavia', '1785-02-22', '1785-04-12', true, '1785-07-11', 'Goeree', NULL, 'entered the Company''s service. On 02-07-1784 the ship arrived at Batavia.');
INSERT INTO "voyages" VALUES (8119, '', 1, '', 'DAPPERHEID', 'Kornelis de Boer', 472, 'hoeker', NULL, NULL, NULL, NULL, 'E', '1784-10-19', 'Batavia', '1785-01-13', '1785-02-13', true, '1785-05-25', 'Texel', 4434, NULL);
INSERT INTO "voyages" VALUES (8120, '', 3, '', 'MERENBERG', 'Jan Montagne', 850, NULL, '1773', NULL, NULL, 'H', 'E', '1784-10-28', 'Batavia', '1785-01-30', '1785-04-10', true, '1785-07-17', 'Texel', 4384, 'MERENBERG, the L00 (8121), the ROZENBURG (8122), the ONZEKERE (8130), the GOUVERNEUR-GENERAAL DE CLERCK (8133), the DRAAK (8134), and the JACHTRUST (8142) were escorted by a Dutch man of war.');
INSERT INTO "voyages" VALUES (8121, '', 7, '', 'LOO', 'Dirk Hulsebos', 1150, NULL, '1768', NULL, NULL, 'A', 'A', '1784-10-30', 'Batavia', '1785-01-10', '1785-04-10', true, '1785-07-17', 'Texel', 4437, 'See also the MERENBERG (8120).');
INSERT INTO "voyages" VALUES (8122, '', 1, '', 'ROZENBURG', 'Gerrit Bruin', 880, NULL, NULL, NULL, '1780', 'D', 'D', '1784-10-30', 'Batavia', '1785-01-22', '1785-04-10', true, '1785-07-22', 'Goeree', 4425, 'See also the MERENBERG (8120).');
INSERT INTO "voyages" VALUES (8123, '', 1, '', 'LE FABIUS', 'Pieter Kolom', NULL, NULL, NULL, NULL, NULL, NULL, 'D', '1784-11-04', 'Batavia', '1785-01-20', '1785-02-09', true, '1785-05-21', 'Goeree', NULL, 'Mauritius. There it had officially entered the Company''s service. On 05-08-1784 the ship arrived at Batavia.');
INSERT INTO "voyages" VALUES (8124, '', 1, '', 'HARMONIE', 'Kornelis Philippus Hoek', 1150, NULL, '1778', NULL, NULL, 'Z', 'A', '1784-11-06', 'Batavia', NULL, NULL, true, NULL, NULL, 4432, 'Sailing to the Cape the HARMONIE was wrecked. See also the MEEUWTJE (4477).');
INSERT INTO "voyages" VALUES (8125, '', 1, '', 'LA CONJUNCTURE', 'Pieter Arwidson', NULL, NULL, NULL, NULL, NULL, NULL, 'Z', '1784-11-10', 'Batavia', '1785-02-17', '1785-03-09', true, '1785-06-01', 'Rammekens', NULL, 'Swedish flag. See LA DAME JEANNE (8111). The CONJUNCTURE had sailed on its own account from Martinique (departure: 10-10-1783) via the Cape (arrival: 18-03-1784) to Mauritius. There it had officially entered the Company''s service. On 04-10-1784 the ship arrived at Batavia.');
INSERT INTO "voyages" VALUES (8126, '', 1, '', 'JONGE FRANK', 'Jakob Veer', 592, NULL, NULL, NULL, NULL, NULL, 'A', '1784-11-13', 'Batavia', '1785-01-11', '1785-02-14', true, '1785-05-21', 'Texel', 4436, NULL);
INSERT INTO "voyages" VALUES (8127, '', 2, '', 'OVERDUIN', 'Jan Jurgen Christiaan Meyer', 1150, NULL, '1774', NULL, NULL, 'Z', 'Z', '1784-11-18', 'Batavia', NULL, NULL, true, NULL, NULL, 4344, 'Sailing from Batavia to the Cape the OVERDUIN was wrecked. See also the MEEUWTJE (4477).');
INSERT INTO "voyages" VALUES (8128, '', 2, '', 'VREDE EN VRIJHEID', 'Dirk Huizing', 760, NULL, NULL, NULL, NULL, NULL, 'H', '1784-11-24', 'Batavia', '1785-01-29', '1785-02-12', true, '1785-06-03', 'Texel', 4441, NULL);
INSERT INTO "voyages" VALUES (8129, '', 1, '', 'LES SIX FRERES', 'Saulnier', NULL, NULL, NULL, NULL, NULL, NULL, 'A', '1784-11-29', 'Batavia', '1785-01-20', '1785-01-29', true, '1785-04-26', 'Texel', NULL, 'LES SIX FRERES new the French flag. See LA DAME JEANNE (8111). The SIX FRERES had sailed on its own account from Bordeaux (departure: 07-09-1783) via the Cape (arrival: 02-03-1784) to Mauritius. There the ship had officially entered the Company''s service. On 04-10-1784 the SIX FRERES arrived at Batavia.');
INSERT INTO "voyages" VALUES (8130, '', 1, '', 'ONZEKERE', 'Johan Staalkop', 348, NULL, NULL, NULL, NULL, NULL, 'Z', '1784-12-03', 'Batavia', '1785-03-12', '1785-04-10', true, '1785-07-22', 'Rammekens', 4430, 'See also the MERENBERG (8120).');
INSERT INTO "voyages" VALUES (8131, '', 1, '', 'HOORN', 'Isaak Thierens', 850, NULL, '1774', NULL, NULL, 'H', 'H', '1784-12-04', 'Batavia', '1785-04-04', '1785-05-16', true, '1785-09-23', 'Texel', 4283, 'Soon after the departure from Batavia the HOORN sprang a leak. The ship possibly had to return. According to K.A. 4289, fol. 464 the master was called Jan Thierens.');
INSERT INTO "voyages" VALUES (8132, '', 3, '', 'BREDENHOF', 'Pieter van der Weert', 850, NULL, '1771', NULL, NULL, 'H', 'R', '1784-12-08', 'Batavia', NULL, NULL, true, NULL, NULL, 4363, 'Sailing from Batavia to the Cape the BREDENHOF was wrecked.');
INSERT INTO "voyages" VALUES (8133, '', 1, '', 'GOUVERNEUR-GENERAAL DE CLERCK', 'Jochem Bank', 1150, NULL, '1779', NULL, NULL, 'Z', 'Z', '1784-12-28', 'China', '1785-03-23', '1785-04-10', true, '1785-07-24', 'Rammekens', 4430, 'See also the MERENBERG (8120).');
INSERT INTO "voyages" VALUES (8134, '', 1, '', 'DRAAK', 'Arie Kikkert', 1150, NULL, '1780', NULL, NULL, 'A', 'A', '1785-01-02', 'China', '1785-03-23', '1785-04-10', true, '1785-07-17', 'Texel', 4430, 'See also the MERENBERG (8120).');
INSERT INTO "voyages" VALUES (8135, '', 1, '', 'STRALEN', 'Willem de Wijn', 880, NULL, '1778', NULL, NULL, 'E', 'A', '1785-01-23', 'Bengal', '1785-04-17', '1785-05-16', true, '1785-09-23', 'Texel', 4427, 'On 13-04-1785 the STRALEN arrived at False Bay; four days later the ship sailed to the Cape.');
INSERT INTO "voyages" VALUES (8136, '', 1, '', 'BREDERODE', 'Gottlieb Mulder', 1150, NULL, '1780', NULL, NULL, 'A', 'A', '1785-01-27', 'China', NULL, NULL, true, NULL, NULL, 4424, 'On 04-05-1785 the BREDERODE sank off Cape Agulhas; 80 men were saved.');
INSERT INTO "voyages" VALUES (8137, '', 1, '', 'VROUWE WIJNANDA LUBERTA', 'Sijbrand Berk', 508, 'fregat', NULL, NULL, NULL, NULL, 'E', '1785-02-11', 'Batavia', '1785-05-10', '1785-06-07', true, '1785-09-03', 'Texel', 4445, NULL);
INSERT INTO "voyages" VALUES (8138, '', 1, '', 'BERKHOUT', 'Herman Jakob Hulleman', 1150, NULL, '1779', NULL, NULL, 'H', 'H', '1785-02-21', 'China', '1785-05-05', '1785-05-16', true, '1785-09-23', 'Texel', 4433, NULL);
INSERT INTO "voyages" VALUES (8139, '', 1, '', 'DOGGERSBANK', 'Swerus Vrolijk', 1150, NULL, '1782', NULL, NULL, 'A', 'A', '1785-02-21', 'Ceylon', '1785-05-05', '1785-05-16', true, '1785-09-23', 'Texel', 4435, NULL);
INSERT INTO "voyages" VALUES (8140, '', 3, '', 'TRITON', 'Hendrik Steedsel', 1150, NULL, '1773', NULL, NULL, 'A', 'Z', '1785-02-21', 'Ceylon', '1785-05-02', '1785-05-16', true, '1785-09-24', 'Rammekens', 4431, NULL);
INSERT INTO "voyages" VALUES (8141, '', 1, '', 'LE CASTRIES', 'Mareches', NULL, NULL, NULL, NULL, NULL, NULL, 'R', '1785-04-06', 'Batavia', '1786-02-03', '1786-03-07', true, '1786-06-26', 'Goeree', NULL, 'The CASTRIES flew the French flag. From 27-05- till 22-12-1785 the ship called at Mauritius. See LA DAME JEANNE (8111). The CASTRIES had sailed on its own account from Bordeaux (departure: 17-05-1783) via the Cape (30-12-1783 till 15-01-1784) to Mauritius. There it had officially entered the Company''s service. On 09-11-1784 the ship arrived at Batavia.');
INSERT INTO "voyages" VALUES (8142, '', 1, '', 'JACHTRUST', 'Pieter Andriessen', 450, 'fregat', NULL, '1775', NULL, 'A', 'A', '1785-04-10', 'The Cape', '1785-04-10', NULL, true, '1785-07-17', 'Texel', 4276, 'See also the MERENBERG (8120).');
INSERT INTO "voyages" VALUES (8143, '', 1, '', 'VREDE', 'Thijs Ketel', 854, 'fluit', NULL, NULL, NULL, NULL, 'A', '1785-04-29', 'The Cape', '1785-04-29', NULL, true, '1785-08-07', 'Texel', 4449, NULL);
INSERT INTO "voyages" VALUES (8144, '', 1, '', 'VRIJHEID', 'Jan Isaac', 790, 'fluit', NULL, NULL, NULL, NULL, 'R', '1785-05-17', 'Batavia', '1785-08-18', '1785-09-10', true, '1786-03-25', 'Goeree', 4446, NULL);
INSERT INTO "voyages" VALUES (8145, '', 1, '', 'LES QUATRES FRERES', 'Samuel Nusker', 620, 'fregat', NULL, NULL, NULL, NULL, 'A', '1785-05-22', 'Batavia', '1785-08-02', '1785-09-01', true, '1786-05-04', 'Texel', 4440, 'LES QUATRES FRERES flew the Prussian flag. The 51 men, who departed from Batavia, included two passengers.');
INSERT INTO "voyages" VALUES (8146, '', 1, '', 'LA RESOLUTION', '(BONNE) Andries Lundgren', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1785-08-04', 'Batavia', '1785-10-22', '1786-01-17', true, NULL, NULL, NULL, 'LA (BONNE) RESOLUTION flew the Swedish flag. The port of destination in patria and the date of arrival there are unknown. See LA DAME JEANNE (8111). The (BONNE) RES-OLUTION had sailed on its own account from a French Atlantic port via the Cape to Mauritius. There it had officially entered the Company''s service. From Mauritius the ship sailed on to Batavia.');
INSERT INTO "voyages" VALUES (8147, '', 1, '', 'EENSGEZINDHEID', 'Peter Jansen', 884, 'fluit', NULL, NULL, NULL, NULL, 'H', '1785-08-07', 'Batavia', '1785-10-17', '1785-11-27', true, '1786-05-04', 'Texel', 4450, NULL);
INSERT INTO "voyages" VALUES (8148, '', 2, '', 'DORDRECHT', 'Arie van der Giessen', 898, 'fluit', NULL, NULL, NULL, 'D', 'H', '1785-08-17', 'Batavia', '1785-10-10', '1785-12-27', true, '1786-04-14', 'Texel', 4458, '4458/8148 was the second voyage of this ship, which during the preceding voyage (4400/8087) was called BERLIN.');
INSERT INTO "voyages" VALUES (8149, '', 1, '', 'EIK EN LINDE', 'Dirk Carlberg', 574, 'hoeker', NULL, NULL, NULL, NULL, 'H', '1785-09-06', 'Batavia', '1785-11-20', '1785-12-27', true, '1786-04-30', 'Texel', 4451, 'According to K.A. 4293 Hendrik Holder was master of the EIK EN LINDE.');
INSERT INTO "voyages" VALUES (8150, '', 1, '', 'MENTOR', 'Jan Jochem Milfaart', 560, NULL, NULL, NULL, NULL, NULL, 'Z', '1785-10-13', 'Batavia', '1785-12-06', '1786-01-04', true, '1786-03-24', 'Rammekens', 4455, NULL);
INSERT INTO "voyages" VALUES (8151, '', 1, '', 'HOOP', 'Harme Karel Visser', 175, NULL, NULL, '1782', NULL, 'A', 'A', '1785-10-23', 'Batavia', '1786-01-21', '1786-02-23', true, '1786-06-27', 'Texel', 4467, 'At the departure from the Cape the HOOP was accompanied by a Dutch man-of-war.');
INSERT INTO "voyages" VALUES (8152, '', 1, '', 'ELISABETH ET SOPHIE', 'Massaut', 525, NULL, NULL, NULL, NULL, 'R', 'D', '1785-11-05', 'Batavia', '1786-01-06', '1786-02-10', true, '1786-05-24', 'Goeree', NULL, 'The ELISABETH ET SOPHIE flew the French flag. See LA DAME JEANNE (8111). The ELISABETH ET SOPHIE had sailed on its own account from Lorient in France (departure: 04-11-1783) via the Cape (05 till 26-04-1784) to Mauritius. There it had officially entered the Company''s service. From Mauritius the ship had sailed on to Batavia.');
INSERT INTO "voyages" VALUES (8153, '', 1, '', 'LE NEPTHUNE', 'Jacques Lourde Martignac', NULL, NULL, NULL, NULL, NULL, NULL, 'R', '1785-11-05', 'Batavia', '1786-01-07', '1786-03-11', true, '1786-06-02', 'Goeree', NULL, 'The NEPTHUNE flew the French flag. See LA DAME JEANNE (8111). The NEPTHUNE had sailed on its own account from a French Atlantic port via the Cape to Mauritius, where it had officially entered the Company''s service. From Mauritius the ship had sailed on to Batavia.');
INSERT INTO "voyages" VALUES (8154, '', 1, '', 'WILLEM EN JAN', 'Tijmen de Zweed', 356, 'hoeker', NULL, NULL, NULL, NULL, 'A', '1785-11-16', 'Batavia', '1786-03-02', '1786-03-25', true, '1786-07-20', 'Texel', 4461, NULL);
