INSERT INTO "voyages" VALUES (8224, '', 1, '', 'FORTUIN (VAN', 'DORDRECHT) Jan Dale', NULL, 'fluit', NULL, NULL, NULL, NULL, 'A', '1788-10-18', 'Ceylon', '1788-12-26', '1789-04-11', true, '1789-08-25', 'Texel', 4566, 'The FORTUIN (VAN DORDRECHT) carried many Luxemburg soldiers. During the voyage it called at Lorient. Sailing from Ceylon to Texel the FORTUIN (VAN DORDRECHT) was escorted by a Dutch man-of-war. As far as the Cape the DRIE GEBROEDERS (8225), the JUFFROUW JOHANNA (8226), and the SUZANNA (8227) also formed part of the convoy; between the Cape and patria these three ships were accompanied by another Dutch man-of-war.');
