INSERT INTO "voyages" VALUES (8258, '', 1, '', 'VLIJT', 'Couvret', 136, NULL, '1788', NULL, NULL, 'Z', 'Z', '1789-10-13', 'Batavia', '1789-12-06', '1790-01-02', true, '1790-03-27', 'Rammekens', 4636, 'Lieutenant William Bligh, former commanding officer of the English man-of-war BOUNTY. In April, 1789, the larger part of his crew had risen in mutiny; Bligh and 18 others had been turned adrift in a small open boat off Tofua, one of the Tonga Islands. All but one had survived the desperate voyage from Tofua all the way to Timor, where they arrived on 12-06-1789. See also the HOUTLUST (8260), the ROZENBURG (8261), the SPARENDIJK (8262), the CASTOR(8263), and the VREDENBURG (8329).');
INSERT INTO "voyages" VALUES (8259, '', 1, '', 'VALK', 'Matthijs Laurens Koster', 600, NULL, NULL, '1785', NULL, 'A', 'A', '1789-10-20', 'Batavia', '1789-12-28', '1790-01-18', true, '1790-05-01', 'Texel', 4525, 'One of the passengers was a condemned person.');
INSERT INTO "voyages" VALUES (8260, '', 1, '', 'HOUTLUST', 'Pieter Hol', 880, NULL, '1785', NULL, NULL, 'D', 'R', '1789-10-26', 'Batavia', '1790-01-11', '1790-02-17', true, '1790-05-24', 'Goeree', 4539, 'The 101 seafarers included 26 Chinese. Among the 11 passengers were one female and 4 male slaves, and a survivor of the English man-of war BOUNTY (see the VLIJT, 8258); during the voyage he died.');
INSERT INTO "voyages" VALUES (8261, '', 2, '', 'ROZENBURG', 'Dirk Dirksz. Varkevisser', 880, NULL, '1780', NULL, NULL, 'D', 'D', '1789-10-26', 'Batavia', '1790-01-08', '1790-02-26', true, '1790-06-23', 'Goeree', 4519, 'The 101 seaferers included 26 Chinese. Among the 12 passengers were 5 female slaves, and 2 survivors of the English man-of-war BOUNTY (see the VLIJT, 8258); both died very soon after having embarked on the ROZENBURG. On 29-12-1789, during a haevy storm, the crew threw 7 of the 9 guns overboard; part of the cargo, consisting of sugar, was affected by salt water. salt water.');
INSERT INTO "voyages" VALUES (8262, '', 2, '', 'SPARENRUK', 'Dirk Sem', 1150, NULL, '1780', NULL, NULL, 'A', 'A', '1789-10-26', 'Batavia', '1790-01-07', '1790-02-17', true, '1790-05-23', 'Texel', 4474, 'the SPARENDIJK was severely damaged off Cape Aghulhas. 4474/8262 was the second voyage of this ship, which during the preceding voyage (4410/8099) was called POTSDAM.');
INSERT INTO "voyages" VALUES (8263, '', 1, '', 'CASTOR', 'Michiel Jurgens', 650, NULL, NULL, '1784', NULL, 'Z', 'A', '1789-11-12', 'Batavia', '1790-02-02', '1790-02-26', true, '1790-06-22', 'Texel', 4464, 'passengers were 2 survivors of the English man-of-war BOUNTY (see the VLIJT, 8258).');
