INSERT INTO "voyages" VALUES (8281, '', 1, '', 'POLLUX', 'Johan van Stralen', 490, NULL, NULL, '1784', NULL, 'Z', 'Z', '1790-02-01', 'Batavia', '1790-07-16', NULL, true, '1790-11-12', 'Rammekens', 4546, 'Sailing to the Cape the POLLUX was overtaken by a heavy storm. Masts, rigging, and rudder were damaged, the hull got leaky. Part of the gunpowder was affected by water.');
INSERT INTO "voyages" VALUES (8282, '', 1, '', 'VERWACHTING', 'August Willem Hass+', 600, 'hoeker', NULL, '1787', NULL, 'H', 'Z', '1790-02-01', 'Batavia', '1790-05-21', NULL, true, '1790-10-15', 'Rammekens', 4570, 'Between Batavia and the Cape August Willem Hass died; Pieter van Lirtson succeeded him as master of the VERWACHTING. The passenger was a condemned person.');
