INSERT INTO "voyages" VALUES (8285, '', 1, '', 'MEEUWTJE', 'Hendrik Blok', 400, NULL, '1783', NULL, NULL, 'A', 'A', '1790-02-27', 'Batavia', NULL, NULL, true, '1790-11-05', 'Texel', 4477, 'The MEEUWTJE probably did not call at the Cape.');
INSERT INTO "voyages" VALUES (8286, '', 1, '', 'ZEENIMF', 'Theodorus Toussaint', 450, NULL, '1782', NULL, NULL, 'Z', 'A', '1790-02-27', 'Batavia', '1790-06-01', NULL, true, NULL, NULL, 4500, 'The passenger was a condemned person. On 06-07-1790 the ZEENIMF ran aground at the Cape and was severely damaged; one month later it got afloat again (07-08-1790). Then the ship was presumably repaired; the ZEENIMF never returned to patria, however.');
INSERT INTO "voyages" VALUES (8287, '', 3, '', 'SLOT TER HOGE', 'David Hartig', 1150, NULL, '1776', NULL, NULL, 'Z', 'Z', '1790-03-06', 'Batavia', NULL, NULL, true, NULL, NULL, 4601, 'Sailing from Batavia to the Cape the SLOT TER HOGE was wrecked.');
INSERT INTO "voyages" VALUES (8288, '', 1, '', 'HAASJE', 'Jan Andries Rugee+', 136, 'paketboot', '1788', NULL, NULL, 'A', 'A', '1790-05-18', 'Batavia', '1790-07-28', '1790-08-23', true, '1790-12-01', 'Texel', 4654, 'killed. The rest of the crew managed to suppress the insurrection by shooting the main instigators. Jan Wilting took Rugee''s place as master. At the Cape Francois Johan van den Broek was appointed master of the HAASJE.');
