INSERT INTO "voyages" VALUES (8312, '', 2, '', 'DUIFJE', 'Lodewijk Willem van Rossum', 400, NULL, '1784', NULL, NULL, 'A', 'A', '1791-03-26', 'The Cape', '1791-03-26', NULL, true, '1791-07-06', 'Texel', 4604, 'The DUIFJE carried part of the cargo of the homeward-bound MARIA, wrecked at the Cape in August, 1788 (see 8207).');
