INSERT INTO "voyages" VALUES (8326, '', 1, '', 'HOORNWEG', 'Dinant Visser', 880, NULL, '1787', NULL, NULL, 'D', 'R', '1791-12-21', 'Batavia', '1792-03-31', NULL, true, '1792-08-14', 'Goeree', 4659, NULL);
INSERT INTO "voyages" VALUES (8327, '', 2, '', 'HORSSEN', 'George Philip Gas', 880, NULL, '1784', NULL, NULL, 'D', 'D', '1791-12-21', 'Batavia', '1792-03-19', '1792-04-11', true, '1792-07-12', 'Goeree', 4609, 'The 12 passengers included one female and two male slaves.');
INSERT INTO "voyages" VALUES (8328, '', 2, '', 'STANDVASTIGHEID', 'Joost Masson', 708, NULL, NULL, '1785', NULL, 'A', 'R', '1791-12-21', 'Batavia', '1792-03-30', NULL, true, '1792-08-16', 'Goeree', 4602, 'voyage of this ship, which during the preceding voyage (4498/8182) and the outward-bound part of this voyage was called TEXELSTROOM. On 26-04-1791 the ship, then still called TEXELSTROOM, started its second homeward-bound voyage. Because of leakage, however, it had to return to Batavia 08-06-1791. Before sailing out for the second time, in December, 1791, the ship''s name was altered into STANDVASTIGHEID.');
INSERT INTO "voyages" VALUES (8329, '', 2, '', 'VREDENBURG', 'Hans Christiaan Christiaanse', 1150, NULL, '1784', NULL, NULL, 'A', 'A', '1791-12-21', 'Batavia', '1792-03-18', '1792-04-11', true, '1792-07-10', 'Texel', 4606, 'many BOUNTY-mutineers as possible (see the VLIJT, 8258). Edwards had succeeded in taking prisoner 14 of them. On 29-08-1791, however, the ship ran on a rock and was wrecked at Barrier Reef off New Holland; 31 men and 4 of the mutineers were drowned. In four small boats most of the survivors had managed to reach Timor. At Batavia Edwards, 30 other men, and the 10 remaining prisoners went aboard the VREDENBURG; at the Cape he and the prisoners boarded an English ship.');
INSERT INTO "voyages" VALUES (8330, '', 2, '', 'ALBLASSERDAM', 'Pieter Mallet jr.', 1150, NULL, '1782', NULL, NULL, 'Z', 'A', '1791-12-25', 'China', '1792-03-29', '1792-04-16', true, '1792-07-10', 'Texel', 4653, NULL);
INSERT INTO "voyages" VALUES (8331, '', 2, '', 'BLITTERSWIJK', 'Gerrit Esman', 1150, NULL, '1785', NULL, NULL, 'Z', 'Z', '1792-01-02', 'China', '1792-03-29', '1792-04-16', true, '1792-07-10', 'Rammekens', 4680, NULL);
INSERT INTO "voyages" VALUES (8332, '', 2, '', 'VROUWE AGATHA', 'Herman Petrus', 900, 'fluit', NULL, NULL, NULL, NULL, 'A', '1792-01-28', 'Batavia', '1792-04-16', NULL, true, '1792-08-31', 'Texel', 4646, 'According to K.A. 4329 Herman Pieter Murk was master.');
INSERT INTO "voyages" VALUES (8333, '', 2, '', 'HAASJE', 'Ditmar Smit', 136, 'paketboot', '1788', NULL, NULL, 'A', 'A', '1792-01-28', 'Batavia', '1792-03-29', '1792-04-11', true, '1792-06-28', 'Texel', 4702, 'According to K.A. 4390a Jakob Zoeteman was master.');
INSERT INTO "voyages" VALUES (8334, '', 3, '', 'STRALEN', 'Anton Christian von Fleischer', 880, NULL, '1778', NULL, NULL, 'E', 'R', '1792-01-31', 'Batavia', '1792-04-17', NULL, true, '1792-08-26', 'Goeree', 4597, NULL);
INSERT INTO "voyages" VALUES (8335, '', 2, '', 'CHRISTOFFEL COLUMBUS', 'Jan Jansz. Laurits', 1150, NULL, '1787', NULL, NULL, 'A', 'A', '1792-02-03', 'Ceylon', '1792-03-30', '1792-04-16', true, '1792-07-10', 'Texel', 4688, NULL);
INSERT INTO "voyages" VALUES (8336, '', 2, '', 'SNELHEID', 'Roelof Jurgen Erdrop', 136, 'paketboot', '1788', NULL, NULL, 'H', 'H', '1792-02-18', 'Bengal', '1792-05-05', '1792-05-15', true, '1792-07-30', 'Texel', 4696, NULL);
INSERT INTO "voyages" VALUES (8337, '', 2, '', 'GOUVERNEUR FALCK', 'Jan Anthonie Lubben', 1150, NULL, '1786', NULL, NULL, 'A', 'A', '1792-02-21', 'Batavia', NULL, NULL, true, NULL, NULL, 4670, 'Sailing from Batavia to the Cape the GOUVERNEUR FALCK was wrecked.');
INSERT INTO "voyages" VALUES (8338, '', 2, '', 'DRIE GEBROEDERS', 'Jan Roelofsz. de Groot', 828, 'fluit', NULL, NULL, NULL, NULL, 'A', '1792-02-22', 'Batavia', '1792-06-02', NULL, true, NULL, NULL, 4695, 'At the Cape the DRIE GEBROEDERS sprang a leak and was beached. The greater part of the cargo was saved.');
INSERT INTO "voyages" VALUES (8339, '', 3, '', 'BARBESTEIN', 'Johan Koenraad Knot', 1150, NULL, '1783', NULL, NULL, 'A', 'Z', '1792-02-28', 'Batavia', NULL, NULL, true, NULL, NULL, 4669, 'BARBESTEIN was wrecked.');
INSERT INTO "voyages" VALUES (8340, '', 1, '', 'STAR', 'Christiaan Zummack', 136, 'paketboot', '1788', NULL, NULL, '1', 'Z', '1792-03-21', 'Ceylon', '1792-05-04', '1792-05-15', true, '1792-07-23', 'Rammekens', 4665, NULL);
INSERT INTO "voyages" VALUES (8341, '', 2, '', 'VROUWE KATHARINA JOHANNA', 'Jakob Meyer', 900, NULL, NULL, '1785', NULL, 'H', 'H', '1792-03-23', 'Batavia', '1792-06-11', '1792-07-13', true, NULL, NULL, 4611, 'According to K.A. 4336 Andries Eksteen was master. On 13-07-1792 the VROUWE KATHARINA JOHANNA departed from the Cape; because of leakage, however, the ship had to return (09-08-1792). See also the CASTOR (8360) and the GOUDA (8362).');
INSERT INTO "voyages" VALUES (8342, '', 1, '', 'MAKASSAR', 'Klaas Keuken', 1150, NULL, '1787', NULL, NULL, 'E', 'E', '1792-04-10', 'Batavia', '1792-08-23', '1793-02-05', true, '1793-06-21', 'Texel', 4660, 'the voyage the ship fell astern.');
INSERT INTO "voyages" VALUES (8343, '', 1, '', 'CONSTITUTIE', 'Christiaan de Cerf', 880, NULL, '1788', NULL, NULL, 'H', 'A', '1792-05-26', 'Batavia', '1792-08-31', '1793-02-05', true, '1793-06-21', 'Texel', 4689, 'See also the MAKASSAR (8342).');
INSERT INTO "voyages" VALUES (8344, '', 1, '', 'GEERTRUIDA EN PETRONELLA', 'Lodewijk Willem van Rossum', 964, 'pink', NULL, NULL, NULL, NULL, 'A', '1792-05-26', 'Batavia', '1792-08-28', '1793-03-05', true, '1793-06-20', 'Texel', 4709, 'included 4 passengers; one of them was a female slave. See also the MAKASSAR (8342).');
INSERT INTO "voyages" VALUES (8345, '', 1, '', 'NIEUWSTAD', 'Kornelis van Deventer', 880, NULL, '1787', NULL, NULL, 'H', 'H', '1792-10-22', 'Batavia', '1792-12-28', '1793-02-05', true, '1793-06-21', 'Texel', 4662, 'See also the MAKASSAR (8342).');
INSERT INTO "voyages" VALUES (8346, '', 1, '', 'GOUVERNEUR-GENERAAL MOSSEL', 'Albert Coblijn', 1150, NULL, '1788', NULL, NULL, 'A', 'A', '1792-11-01', 'Batavia', '1793-01-07', '1793-02-05', true, '1793-06-22', 'Texel', 4661, 'See also the MAKASSAR (8342).');
INSERT INTO "voyages" VALUES (8347, '', 1, '', 'RUSTHOF', 'Petrus Stephanus Buissine', 880, NULL, '1788', NULL, NULL, 'D', 'D', '1792-11-01', 'Batavia', '1793-01-09', '1793-02-05', true, '1793-06-21', 'Texel', 4685, 'The 112 people included 10 passengers; 3 of them were slaves. See also the MAKASSAR (8342).');
INSERT INTO "voyages" VALUES (8348, '', 2, '', 'UNIE', 'Philip Hendrik de Haard', 1150, NULL, '1787', NULL, NULL, 'Z', 'A', '1792-11-01', 'Batavia', '1793-01-06', '1793-02-05', true, '1793-06-21', 'Texel', 4715, 'The master was commandeur of the homeward-bound fleet (see the MAKASSAR, 8342).');
INSERT INTO "voyages" VALUES (8349, '', 1, '', 'WESTKAPELLE', 'Simon Laurentius', 1150, NULL, '1788', NULL, NULL, 'Z', 'Z', '1792-11-01', 'Batavia', '1793-01-06', '1793-02-05', true, '1793-06-21', 'Texel', 4717, 'The 159 people included 5 passengers; among them were 3 slaves and Jan Greve, admiraal of the homeward-bound fleet (see the MAKASSAR, 8342). On 08-07-1793 the WESTKAPELLE sailed out from Texel; four days later the ship arrived at the Rammekens.');
INSERT INTO "voyages" VALUES (8350, '', 1, '', 'BUITENVERWACHTING', 'Arie Simonsz. Koek', 1150, NULL, '1789', NULL, NULL, 'A', 'A', '1792-11-15', 'Batavia', '1793-01-28', '1793-02-05', true, '1793-06-21', 'Texel', 4712, 'According to K.A. 4390a Gerard Adriaan van Velsen was master of the BUITENVERW ACHTING. The passenger was a condemned person. See also the MAKASSAR (8342).');
INSERT INTO "voyages" VALUES (8351, '', 2, '', 'VROUWE MARIA KORNELIA', 'Jan Arendsz.', 1150, NULL, '1785', NULL, NULL, 'E', 'E', '1792-11-27', 'Batavia', '1793-02-27', '1793-04-01', true, '1793-07-27', 'Texel', 4698, NULL);
INSERT INTO "voyages" VALUES (8352, '', 1, '', 'OOSTHUIZEN', 'Gerrit Scheler', 880, NULL, '1789', NULL, NULL, 'H', 'H', '1792-12-03', 'China', '1793-03-14', '1793-04-01', true, '1793-07-27', 'Texel', 4714, NULL);
INSERT INTO "voyages" VALUES (8353, '', 2, '', 'ZEELAND', 'Albert Tjerksz.', 1156, NULL, '1783', NULL, NULL, 'Z', 'Z', '1792-12-03', 'China', '1793-04-08', NULL, true, NULL, NULL, 4694, 'According to K.A. 4336 Jakob Arkebout was master. On 20-05-1793 the ZEELAND ran aground at the Cape. Later on the ship was sold.');
INSERT INTO "voyages" VALUES (8354, '', 2, '', 'LEIDEN', 'Theunis Groen', 1150, NULL, '1786', NULL, NULL, 'A', 'Z', '1792-12-20', 'Batavia', '1793-02-20', '1793-05-03', true, '1794-08-02', 'Texel', 4655, 'When the LEIDEN arrived at the Cape, it was in bad condition and needed repairs. Goods from the homeward-bound DRECHTERLAND (8359) were put on board. On 03-05-1793 the LEIDEN departed from the Cape. It got into a bad condition again, however, and had to return (08-05-1793). Part of the cargo was taken over by the RESOLUTIE (8366). The date of the LEIDEN''s second departure from the Cape is unknown.');
INSERT INTO "voyages" VALUES (8355, '', 3, '', 'ROZENBURG', 'Roelof Bengtson', 880, NULL, '1780', NULL, NULL, 'D', 'A', '1792-12-20', 'China', '1793-03-31', '1793-05-31', true, '1794-02-19', 'Texel', 4708, 'During the voyage the ROZENBURG called at Cork in Ireland. Commandeur of the homeward-bound fleet (8355-8358, 8364 and 8368), which on 31-05-1793 departed from the Cape, was J.C. Clemens on board the VERWACHTING (8357); Wiggert Molenaar, aboard the GERECHTIGHEID (8364), was schout-bij-nacht.');
INSERT INTO "voyages" VALUES (8356, '', 1, '', 'JONKVROUWE SIBILLA ANTHOINETTA', 'A. H. Christiaansz.', 1150, NULL, '1789', NULL, NULL, 'A', 'A', '1793-01-12', 'Ceylon', '1793-04-07', '1793-05-31', true, '1794-02-10', 'Texel', 4705, 'According to K.A. 4336 Nikolaas Klopper was master. During the voyage the JONKVROUWE SIBILLA ANTHOINETTA called at Cork in Ireland. See also the ROZENBURG (8355).');
INSERT INTO "voyages" VALUES (8357, '', 2, '', 'VERWACHTING', 'Pieter van Aarson', 600, 'hoeker', NULL, '1787', NULL, 'H', 'A', '1793-01-16', 'Batavia', '1793-04-05', '1793-05-31', true, '1794-02-10', 'Texel', 4707, 'On board the VERWACHTING was J. C. Clemens, commandeur of the fleet, which on 31-05-1793 departed from the Cape (see the ROZENBURG, 8355). During the voyage the VERWACHTING called at Cork in Ireland.');
INSERT INTO "voyages" VALUES (8358, '', 1, '', 'VOORLAND', 'Daniel Correch', 1150, NULL, '1788', NULL, NULL, 'A', 'Z', '1793-01-30', 'Batavia', '1793-05-06', '1793-05-31', true, '1794-02-09', 'Goeree', 4668, 'and at Duins, from where it departed on 30-01-1794. Because of bad weather the ship had to sail to Goeree; later on it went to Rammekens. See also the ROZENBURG (8355).');
INSERT INTO "voyages" VALUES (8359, '', 1, '', 'DRECHTERLAND', 'Eps', 1150, NULL, '1784', NULL, NULL, 'H', 'A', '1793-02-03', 'Ceylon', '1793-04-15', NULL, true, '1794-08-02', 'Texel', 4588, 'According to K.A. 3805 Jochem Westvaal was master of the DRECHTERLAND. See also the LEIDEN (8354).');
INSERT INTO "voyages" VALUES (8360, '', 2, '', 'CASTOR', 'Arie Smitskamp', 650, NULL, NULL, '1784', NULL, 'Z', 'A', '1793-02-05', 'The Cape', '1793-02-05', NULL, true, '1793-07-21', 'Texel', 4706, 'The CASTOR carried part of the cargo of the VROUWE KATHARINA JOHANNA (see 8341). See also the MAKASSAR (8342).');
INSERT INTO "voyages" VALUES (8361, '', 3, '', 'DUIFJE', 'Jan Olhof', 400, NULL, '1784', NULL, NULL, 'A', 'A', '1793-02-05', 'The Cape', '1793-02-05', NULL, true, '1793-06-20', 'Texel', 4727, 'See also the MAKASSAR (8342).');
INSERT INTO "voyages" VALUES (8362, '', 2, '', 'GOUDA', 'Anthonie Franciscus Steffers', 400, NULL, '1784', NULL, NULL, 'A', 'A', '1793-02-05', 'The Cape', '1793-02-05', NULL, true, '1793-06-20', 'Texel', 4718, 'Originally the GOUDA departed from the Cape on 16-08-1792; four days later the ship returned. The GOUDA carried part of the cargo of the VROUWE KATHARINA JOHANNA (see 8341). See also the MAKASSAR (8342).');
INSERT INTO "voyages" VALUES (8363, '', 1, '', 'DEMERARY', 'Erland Nicolaus Abo', 1150, NULL, '1787', NULL, NULL, 'A', 'R', '1793-02-07', 'Batavia', NULL, NULL, true, NULL, NULL, 4616, 'Between Batavia and the Cape the DEMERARY was wrecked. At the Cape the master of an American ship informed the Company''s authorities. that during the voyage he had spoken the DEMERARY and had found it in a very bad condition. See also the STAR (4748).');
INSERT INTO "voyages" VALUES (8364, '', 3, '', 'GERECHTIGHEID', 'Jan Jobst Droop', 1150, NULL, '1779', NULL, NULL, 'A', 'A', '1793-02-23', 'Ceylon', '1793-04-11', '1793-05-31', true, '1794-02-10', 'Texel', 4673, 'GERECHTIGHEID called at Cork in Ireland. On board the ship was Wiggert Molenaar, schout-bij-nacht of the homeward-bound fleet, which departed from the Cape on 31-05-1793 (see the ROZENBURG, 8355).');
INSERT INTO "voyages" VALUES (8365, '', 3, '', 'FAAM', 'Hidde Bok', 136, 'paketboot', '1788', NULL, NULL, 'A', 'A', '1793-02-27', 'Bengal', '1793-05-14', '1793-08-01', true, '1793-12-21', 'Texel', 4711, NULL);
INSERT INTO "voyages" VALUES (8366, '', 2, '', 'RESOLUTIE', 'Daniel Hendriks', 530, NULL, NULL, '1784', NULL, 'H', 'R', '1793-04-01', 'The Cape', '1793-04-01', NULL, true, '1793-07-27', 'Texel', 4730, 'cargo from the LEIDEN (see 8354).');
INSERT INTO "voyages" VALUES (8367, '', 3, '', 'MARIA LOUISA', 'Jakob Zoeteman', 136, 'paketboot', '1788', NULL, NULL, 'A', 'D', '1793-04-20', 'Batavia', '1793-07-30', NULL, true, '1793-12-08', 'Goeree', 4725, 'According to K.A. 4390a Pieter Mosterd was master of the MARIA LOUISA.');
INSERT INTO "voyages" VALUES (8368, '', 3, '', 'TEXELSTROOM', 'Jurriaan Kornelis Koertse', 780, 'hoeker', NULL, '1785', NULL, 'R', 'A', '1793-05-31', 'The Cape', '1793-05-31', NULL, true, '1794-01-01', 'Gluckstadt', 4735, 'Ireland. At Gluckstadt the ship was sold. See also the ROZENBURG (8355). 4735/8368 was the third voyage of this ship, which during its first voyage and the outward-bound part of the second voyage (4675/8318) was called STANDVASTIGHEID.');
INSERT INTO "voyages" VALUES (8369, '', 2, '', 'KRAAI', 'Jakob Sem', 136, 'paketboot', '1788', NULL, NULL, 'A', 'A', '1793-08-01', 'Batavia', '1793-09-29', '1793-10-17', true, '1794-04-17', 'Texel', 4731, 'In January, 1794, the KRAAI called at Plymouth, early in February at a Norwegian port.');
INSERT INTO "voyages" VALUES (8370, '', 2, '', 'EXPEDITIE', NULL, 136, 'paketboot', '1788', NULL, NULL, 'D', 'A', '1793-12-15', 'Batavia', NULL, NULL, true, NULL, NULL, 4741, 'On 04-01-1794 the EXPEDITIE was captured by a French privateer and taken to Mauritius.');
INSERT INTO "voyages" VALUES (8371, '', 3, '', 'AFRIKAAN', 'Wiggert Molenaar', 880, NULL, '1780', NULL, NULL, 'E', 'H', '1794-02-27', 'Batavia', NULL, NULL, true, '1794-10-22', 'Plymouth', 4732, 'AFRIKAAN was confiscated by the English at Plymouth.');
INSERT INTO "voyages" VALUES (8383, '', 1, '', 'HOUGLY', 'Arnold Rogge', 1150, NULL, '1788', NULL, NULL, 'A', 'A', '1794-11-22', 'Batavia', '1795-03-11', '1795-05-21', true, NULL, NULL, 4650, 'On 18-05-1795 the HOUGLY originally departed from the Cape, two days later the ship had to return because of adverse wind. In June, 1795, the HOUGLY was captured by the English off St. Helena; while sailing to Cork in Ireland they set the ship on fire and sank it (01-09-1795).');
INSERT INTO "voyages" VALUES (8384, '', 1, '', 'KROMHOUT', 'Gottlieb Havenstein', 880, NULL, '1790', NULL, NULL, 'H', 'H', '1794-11-22', 'Batavia', '1795-03-11', '1795-05-18', true, NULL, NULL, 4751, 'In August, 1795, the KROMHOUT was taken by the English off the Shetlands.');
INSERT INTO "voyages" VALUES (8385, '', 4, '', 'MENTOR', 'Ulke Barendsz.', 560, NULL, NULL, '1789', NULL, 'Z', 'Z', '1794-11-22', 'Batavia', '1795-03-11', '1795-05-21', true, NULL, NULL, 4746, 'two days later the ship had to return because of adverse wind. In June, 1795, the MENTOR was seized by the English off St. Helena and taken to Shannon in Ireland.');
INSERT INTO "voyages" VALUES (8386, '', 2, '', 'SURSEANCE', 'Diedrich Wiese', 768, NULL, NULL, '1786', NULL, 'Z', 'Z', '1794-11-22', 'Batavia', '1795-03-11', '1795-05-21', true, NULL, NULL, 4747, 'Helena. On 05-09-1795 the ship was wrecked.');
INSERT INTO "voyages" VALUES (8387, '', 1, '', 'CEYLON', 'Willem Kol', 900, 'pink', '1791', NULL, NULL, 'A', 'A', '1795-01-23', 'Batavia', '1795-05-16', '1795-06-07', true, '1795-10-31', 'Setubal', 4742, 'Date of departure from the Cape unknown (see also the PHOENICIER, 8376). On board the CEYLON was J.C. Oldenburg, commandeur of the homeward-bound ships in 1795.');
INSERT INTO "voyages" VALUES (8388, '', 2, '', 'MAKASSAR', 'Frederik Markt', 1150, NULL, '1787', NULL, NULL, 'E', 'E', '1795-01-23', 'Batavia', '1795-05-16', NULL, true, NULL, NULL, 4766, 'Date of departure from the Cape unknown (see also the PHOENICIER, 8376). The MAKASSAR was taken by the English off St. Helena and brought to the Thames.');
INSERT INTO "voyages" VALUES (8389, '', 2, '', 'NOORD-HOLLAND', 'Wijs', 894, 'fluit', NULL, NULL, NULL, NULL, 'A', '1795-01-23', 'Batavia', '1795-05-16', NULL, true, '1795-10-03', 'Setubal', 4758, 'unknown (see also the PHOENICIER, (8376).');
INSERT INTO "voyages" VALUES (8390, '', 3, '', 'STANDVASTIGHEID', 'Karel Jakob Brugman', 708, NULL, NULL, '1785', NULL, 'A', 'Z', '1795-01-23', 'Batavia', '1795-05-16', '1795-06-07', true, '1795-10-03', 'Setubal', 4761, 'The passenger was a condemned person. The date of departure from the Cape is unknown. see also the PHOENICIER (8376). 4761/8390 was the third voyage and the outward-bound part of the second voyage (4602/8328) was called TEXELSTROOM.');
INSERT INTO "voyages" VALUES (8391, '', 3, '', 'VLIJT', 'Francois Moser', 136, 'paketboot', '1788', NULL, NULL, 'Z', 'Z', '1795-01-23', 'Batavia', '1795-05-06', '1795-05-18', true, '1795-09-18', 'Bergen', 4722, NULL);
INSERT INTO "voyages" VALUES (8392, '', 1, '', 'SIAM', 'George Philip Gas', 880, NULL, '1789', NULL, NULL, 'D', 'D', '1795-01-24', 'China', '1795-05-03', '1795-05-18', true, '1795-09-01', 'Trondheim', 4760, NULL);
INSERT INTO "voyages" VALUES (8393, '', 1, '', 'WASHINGTON', 'Gerard Adriaan van Velsen', 1150, NULL, '1791', NULL, NULL, 'A', 'A', '1795-01-24', 'China', '1795-05-02', '1795-05-18', true, '1795-09-01', 'Bergen', 4759, NULL);
INSERT INTO "voyages" VALUES (8394, '', 1, '', 'ZEELELIE', 'Kornelis Adriaansz', 1150, NULL, '1789', NULL, NULL, 'Z', 'Z', '1795-01-24', 'China', '1795-05-03', '1795-05-21', true, NULL, NULL, 4762, 'off St. Helena and taken to Shannon in Ireland. The ship was wrecked off the Scilly Islands later that year.');
INSERT INTO "voyages" VALUES (8395, '', 2, '', 'ZWAAN', 'Jan Olhof', 1150, NULL, '1787', NULL, NULL, 'Z', 'A', '1795-01-24', 'China', '1795-05-03', '1795-05-18', true, '1795-09-18', 'Trondheim', 4737, NULL);
INSERT INTO "voyages" VALUES (8396, '', 3, '', 'ALBLASSERDAM', 'Klaas Keuken', 1150, NULL, '1782', NULL, NULL, 'Z', 'A', '1795-01-01', 'Ceylon', '1795-05-06', '1795-05-21', true, NULL, NULL, 4764, 'was a condemned person.');
INSERT INTO "voyages" VALUES (8397, '', 1, '', 'ZUIDPOOL', 'J. A. van der Putten', 900, 'pink', '1791', NULL, NULL, 'Z', 'Z', '1795-01-01', 'Ceylon', '1795-04-25', '1795-05-18', true, '1795-09-18', 'Trondheim', 4772, NULL);
INSERT INTO "voyages" VALUES (8398, '', 2, '', 'MEERMIN', 'Gerard Ewoud Overbeek', 500, 'fregat', '1782', NULL, NULL, 'A', 'A', '1795-01-01', 'Batavia', '1795-05-21', NULL, true, NULL, NULL, 4674, 'to return because of adverse wind. In June, 1795, the MEERMIN was captured by the English off St. Helena and taken to Shannon in Ireland.');
INSERT INTO "voyages" VALUES (8399, '', 1, '', 'JONGE BONIFACIUS', 'Jan Nikolaas Kroese', 488, NULL, NULL, NULL, NULL, 'Z', 'Z', '1795-01-01', NULL, '1795-06-24', NULL, true, NULL, NULL, 4774, 'Almost all data concerning this homeward-bound voyage are missing. In August, 1795, the JONGE BONIFACIUS was captured by the English at the Cape.');
INSERT INTO "voyages" VALUES (8400, '', 1, '', 'LOUISA ANTHONY', 'Kersje Hillebrandsz.', 640, 'fluit', NULL, NULL, NULL, 'A', 'A', '1795-01-01', NULL, '1795-08-15', NULL, true, NULL, NULL, 4777, 'Almost all data concerning this homeward-bound voyage are missing. In August, 1795, the LOUISA ANTHONY was taken by the English at the Cape.');
INSERT INTO "voyages" VALUES (8401, '', 1, '', 'VERTROUWEN', 'Hillebrand van Uijen', 890, 'fluit', NULL, NULL, NULL, 'A', 'A', '1795-01-01', NULL, '1795-08-14', NULL, true, NULL, NULL, 4778, 'the English at the Cape.');
INSERT INTO "craftsmen" VALUES (1376, '', 3, '', 19, NULL, NULL, NULL, NULL, 19);
